(5107, '体验长腿x价比高的兼职,身材不错态度很好!', 25, 30, '500', 530000, 530100, NULL, NULL, NULL, '水中箫,陪浴,胸推,口活,指滑漫游,丝足,接吻,69,做爱', '前两天真是很无聊，想找个妹妹玩玩找群里的朋友要了个qq号我就加上了 向她打了一个招呼， 问了一下mm的价格 服务 。以及价钱还有照片，mm把情况说明了一下，刚开始觉得价钱好像有些贵的，不过看照片 这价钱也值了， 搞的我心血来潮 忍不住了，按照妹妹要求预约全套服务， 乘着有性趣就跑出去在旁边的酒店里开了个钟点房， 告诉妹妹我的房间号，我在房间等啊等 。过了20分钟那mm终于来了，妹妹在外面敲门了，我在想这要不是本人那会是个什么感觉，反正先不管了 开了门在说，一开门嘿还真别说是个小美人，身材高高的，哪个皮肤白白的，尤其是头发又黑又长的，感觉特别有气质，我叫妹妹进来了休息一会 咱俩去洗个澡，妹妹说好呀 ，过了一会我跟mm俩都去洗澡去了在浴室里看见妹妹赤裸裸的身材我的小弟弟 真想马上就插进去，跟妹妹洗完澡了就跟着把妹妹抱上了床，拉掉了妹妹的浴巾 哇塞 那可真是极品呀，没想到网上还能找着这么好的妹妹。接着我们就嘿嘿 进入了主题，妹妹叫的真是好听 让我的激情一阵一阵的来袭，啊\"\"\"\"\"\"\"\" 我们做了将近一个小时，我累坏了 妹妹也快吃不消了，两人又去一起洗了个澡 出来休息了一下 然后我和妹妹就把衣服都穿好了 给了妹妹服务费 让妹妹回去了 事后想想 这妹妹真是可惜了 要是真是我女朋友那该多好啊，这么个好妹子怎么要做兼职呢 呵呵， 不过我觉得我运气还算不错 ，误打误撞的找了那么一个漂亮的妹妹 觉得也值了。想体验的要抓紧机会，现在正是资源丰盛的时候哦！', 1, 9, 1, 0, 2, '3', '2020-07-21 13:51:29', '2020-07-21 13:51:29', '[\"/upload/article/a9e3742ca07991dd2972965f363f1ea5.png\"]', 0, ''),
(5113, '验证上门小妹', 25, 30, '500', 620000, 620100, '1051486210', NULL, NULL, 'k,做爱', '微信搜索不出来，又来码字了。附上了q。这个女孩子是第一次约的上门。接上后为了防止dbj要求全程关机。跟照片出入不是很大，就是胸太小了。服务基本没有。性价比不是很高。具体过程不表了。', 1, 2, 22, 3, 2, '3', '2020-07-21 13:51:29', '2020-07-21 13:51:29', '[\"/upload/article/491115e6593e65d31ae116053ba736a3.png\"]', 0, ''),
(5119, '验证雪中花', 27, 30, '500', 620000, 620100, '2149139727', '15193131297', '15193131297', 'qt', '小狼去验证了雪中花，颜值身材中等，服务全套，感觉单纯适合泻火，感兴趣的狼友可以试试。总体来说性价比还可以，毕竟兰州资源少。', 1, 1, 10, 1, 2, '3', '2020-07-21 13:51:29', '2020-07-21 13:51:29', '[\"/upload/article/043c87be591031ed77b99e21b42621e9.png\"]', 0, ''),
(5120, '验证兼职瑶瑶', 29, 30, '500', 120000, 120100, NULL, NULL, NULL, 'PY,HS,K,做爱', '最近天气太热，倒霉雨下的还不痛快，越下越难受，想找个地方发泄一下，翻看手机发现此MM 聊天得知在南开，本人昨天正好在南开，于是约好时间前往，到地点敲门进屋，观察MM，身材不错，长相一般，能看出岁月的痕迹，脱衣洗澡，完毕上床…后面省略几百字，总体感觉比较一般，MM身材还可以，做活还算细致，骚气十足.', 1, 4, 0, 0, 2, '3', '2020-07-21 13:51:29', '2020-07-21 13:51:29', '[\"/upload/article/ac6bf61f23c336c143dbb82bacb78a2c.jpg\"]', 0, ''),
(5122, '会所出来的小活儿妹子', 27, 30, '300/p ～600/p', 110000, 110100, 'qq2270954952', NULL, NULL, '鸳鸯浴,毒龙,按摩', '妹子聊天说是以前一直在会所上班，一个钟基本上都是1299、1599的那种，服务真的还可以，尺度也不错，基本要求都能满足。', 1, 3, 2, 1, 2, '3', '2020-07-21 13:51:28', '2020-07-21 13:51:28', '[\"/upload/article/d4323063952a48a5eb4c3ea38d318e66.jpg\"]', 0, ''),
(5132, '重庆妹子皮肤白，还可以大战', 25, 30, '500/800pp', 530000, 530100, NULL, NULL, '13529201900', '做爱口活', '这几天闲的无聊，在扣扣上寻找了几个妹子，看了以后，觉得这个妹子不错，但是不是熟人介绍不给加好友，只能忽悠，最后第二天才约到，去到妹子住的地方，觉得还行，干净，但是感觉妹子和照片还是有点差距，没有照片上嫩点，进去就问要不要洗澡，没有一起洗，冲了一下，妹子穿着丝袜来的，先抚摸了一会，接着舔了全身，按摩，给你撸了一下，接着口了一会，忍不住起来休息了一会，然后妹子接着挑逗，又接着口，熊摸了也不算大，但是手感很好，实际还是屁股好摸点，接着妹子趴着干了一会，又让她爬起来，观音坐莲了一会，接着还是老汉推车射了，休息了一会，妹子问要不要再来一次，感觉来不动了，洗洗澡就走了，老哥些要去的就说介绍，问谁的话就说群里的，图片不知道有没有上传成功，需要的可以找我要，或者相册里看，密码6', 1, 1, 25, 4, 2, '3', '2020-07-21 13:51:29', '2020-07-21 13:51:29', '[\"/upload/article/6ddc197b1191518a80d8b977e08fce93.png\"]', 0, ''),
(5134, '诱惑长腿丝足美女', 25, 30, '298、318、398', 530000, 530100, NULL, 'qjqcsz', NULL, '丝足,半套', '到了之后，果然是包臀裙+黑丝美女，瞬间心动。\r\n之后虽然没有彻底的全套FW,可是她们的技术简直让你欲罢不能，黑丝裹着细长鲜嫩地腿，在你的身体上一点点摩擦，又在你耳边轻轻喘息，感觉浑身颤抖不已……\r\n体验真的很好，技术太好了，特会玩。\r\n	价格是298、318、398', 1, 2, 43, 3, 2, '3', '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/d67fbf9e6b6f4dba105bbea90a749bae.png\"]', 0, '');
