(5369, '色抢色+尖锐湿疣，绝对去不得', 30, 30, '200 400', 510000, 510100, NULL, NULL, NULL, '做爱', '本狼20多血气方钢小伙子，只和女友做过，前年和几个朋友酒喝多了，精虫上脑，路边一女子叫去爽一下，就跟着去了小出租屋，脱了衣服，没摸几下，女人说她朋友出事了，不能做了，无奈只好出去，打算再找一个，出去后就觉得不对，看了下钱包，还有钱，喝多了酒也没在意。又在路边找了一个大奶女，说好三十，进去给了钱，脱了裤子就叫干，连奶都不给摸一下，由于第一次招妓，胆小，加上女人服务不好，鸡鸡都没硬，可恶的妓女还嘲笑无鸡鸡小，没办法，干不爽，想叫她帮我吹一下，臭鸡居然说要加钱，掏出钱一看，傻眼了，原来钱包有300块钱，现在只有100，居然他妈的还是加钱，好好想想原来是第一个鸡给老子掉了包，此时想想他妈的不管了，不要花几百块；额，连鸡都没得搞，自己撸了几下硬了，爬上去搞了十来分钟就结束了，回到家想想害怕，虽然带着套搞的，还是怕得病，可不幸的是我还是得了尖锐湿疣，之后就是治病了，用激光烧，那叫一个疼，花了好几百，过了一个月，又长了一些，只好到大医院，激光烧加吃药大概花了1500，从此以后就发誓，再也不去外面搞了，这次是尖锐湿疣，治好了，要是下次是艾滋病，那就只得等死了。', 1, 1, 0, 0, 2, '1', '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/f4a9e28b30c11ac0e6d492e3a6513aab.png\"]', 0, ''),
