(6346, '验证吴中娇小魔鬼身材的东北大姐', 28, 30, '不同价位 自询', 320000, 320500, '2090770060', '无', '无', '鸳鸯浴,漫游,胸推,69式,冰火,口活,爱爱,', '周末上脑QQ群里找了两个LF，第一个到地方遥控上楼，一开门吓我一跳，以为遇到仙人跳了呢，妹子光光的躲在门后开门，但是因为人照差距太大，果断离开，奔第二个，也是遥控上楼，见到真人，人照差距小，半个咪咪喽出来慢大的，就是因为照片是大白脸看不出年纪，实际见人感觉应该能有34-5了，但身材很好，留下，洗澡，上床，一套服务，强烈推荐深喉，是真杵到嗓子眼啊~！姐姐东北人，比较实在，聊得也挺好，还给我介绍妹妹呢~！脸很白净，很瘦小。', 0, 0, 0, 0, 2, NULL, '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/5dad2aae05d46.jpg\", \"/upload/article/5dad2aae38b7f.jpg\", \"/upload/article/5dad2aae910b2.jpg\"]', 0, ''),
