(6359, '会所   江宁区家庭Spa', 26, 30, '600/次或1150双飞等', 320000, 320100, NULL, 'QCspa666', NULL, '鸳鸯浴,漫游,胸推,69', '在江宁区胜太路地铁站附近，出去玩的多了决定换个口味，这个主打服务，没有大活，唇枪舌剑，加上好友之后会给你调妹妹，挑好了会安排房间，2个公寓楼中选择，可以放松放松', 1, 4, 26, 7, 2, '3', '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/5dad766cbae20.jpg\"]', 0, ''),
(6365, '小贵，但是觉得很值得，体验小高端', 26, 30, '1k/次，一小时', 320000, 320100, '陌陌号707311068', NULL, NULL, '鸳鸯浴,漫游,胸推,69式,口活,爱爱', '陌陌联系的，看到照片挺漂亮的，价格小贵，里我住的挺近的，觉得先见见面，可以就约，不值得就找个理由撤，晚上约了就去了，见了觉得挺漂亮的，身材挺好的，娇小型，挺喜欢的，给钱，上面服务都做了一遍，过程很顺利，最后释放。', 3, 6, 5, 8, 2, '姐能干', '2020-07-21 13:51:30', '2020-08-10 00:31:32', '[\"/upload/article/5dad7d062653b.jpg\", \"/upload/article/5dad7d062df70.jpg\", \"/upload/article/5dad7d062e5d6.jpg\"]', 0, ''),
(6366, '南京重庆骚女兼职', 27, 30, '400P', 320000, 320100, NULL, 'skx1505269', NULL, '鸳鸯浴,漫游,胸推,69式,冰火,口活,爱爱', '出地铁口不远，遥控进门，妹子迎接，进门很热情，洗澡。真人不高，但是骚，口活很好。小高跟深得我心，小BB水很多，眼神销魂。性价比很不错，推荐去试试。照片是我自己偷拍的，可以参考下', 3, 7, 45, 7, 2, '3', '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/5dad7dcaea208.jpg\", \"/upload/article/5dad7dcb2da1e.jpg\", \"/upload/article/5dad7dcb77e57.jpg\"]', 0, ''),
(6367, '臻儿，服务态度好，不催人，毛刮过的', 30, 30, '臻儿，服务态度好，不催人，毛刮过的', 320000, 320100, '1523546926  暗号   知了', NULL, NULL, '鸳鸯浴,漫游,胸推,69式,口活,爱爱', '在QQ上找到的妹子，是个兼职妹子，不常在南京，先在QQ上聊天，妹子年龄稍大，三十多，先到酒店，发图，然后遥控到房间，开门后，妹子一身薄纱，咪咪不是很大，妹子瞬间先抱过来，弟弟瞬间硬起，妹妹帮忙宽衣，到浴室洗了个澡，顺便先摸一阵，妹妹很配合，口活不错，就是胸稍小，妹妹很配合在卫生间镜子前一顿爆操，妹子很多姿势都配合，之后床上一番云雨，几百下交货，妹子帮忙清理，又在浴室一顿扣摸，聊了会天，提裤子走人', 1, 6, 21, 2, 2, '3', '2020-07-21 13:51:28', '2020-07-21 13:51:28', '[\"/upload/article/5dad7e9116800.JPG\"]', 0, ''),
