(6377, '扬州瑜伽妹子，身材好', 27, 30, '600/次或1800/天等', 320000, 321000, NULL, NULL, '15767515534', '口活,爱爱', '出差回家，平时常约的那个学生妹来亲戚，遂问朋友还有别的资源么，发来个扬州的妹子，微信申请通过，简单聊了几句，驱车前往，本狼泰州的，驱车扬州，为了日个小BB，开车一个多小时，也是蛮拼的，哈哈。到了遥控上楼，妹子颜值一般，不算好看也不算难看，但是身材还行。我简单洗了下，就来口，差不多了提枪上阵，不亏是练瑜伽的小腰妞的可以，哈哈。最终后入，交货。', 2, 2, 9, 3, 2, '3', '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/5dad8947a0903.jpg\", \"/upload/article/5dad8948f404f.jpg\"]', 0, ''),
(6378, '上门美女', 26, 30, '1000/次', 320000, 321000, '1409363334', NULL, NULL, '鸳鸯浴,漫游,胸推,69式,冰火,口活,爱爱', '朋友介绍的，加了微信，妹子回复速度真的叫一个慢啊，终于约上了，自己开房，妹子上门，长相很好，口活，啪啪', 3, 7, 6, 1, 2, '3', '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/5dad89ffa9227.jpg\", \"/upload/article/5dad89ffb0c37.jpg\", \"/upload/article/5dad89ffb700e.jpg\"]', 0, ''),
(6381, '杭州城西寻欢', 28, 30, '500/次', 330000, 330100, NULL, 'luu4625', NULL, '漫游,胸推,口活,爱爱,莞式全套', '进门一看，略有失望，和照片还是有挺大差距，但是很健谈，聊了聊帮本狼洗了下。趴下开始按摩，漫游，过水，一些套路，本狼不喜欢DL，老师就简单做了下。翻过身正面漫游，口，口活还是很到位的，差一点就缴枪。之后AIAI不详述。总体来讲性价比还可以，服务热情，不机车，不催时，套路到位。', 3, 5, 10, 1, 2, '3', '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/5dad8db820057.jpg\", \"/upload/article/5dad8db84259d.jpg\", \"/upload/article/5dad8db897527.jpg\"]', 0, ''),
(6385, '约了一个下城区妹子 身材又好 屁股大 活好值得试试', 29, 30, '500/次/夜1500', 330000, 330100, '363171518', NULL, NULL, '鸳鸯浴,漫游,胸推,69式,冰火,口活,爱爱,SM', '找朋友介绍的MM  无意中找了一个结果非常满意，价格也非常实惠 ，一到宾馆还穿着老狼最喜欢的黑丝袜，笑语晏晏，看上去很性感可爱，老狼很是喜欢，就冲洗下，中间过程可想而知了 主要是价格便宜服务好，身材棒 MM 长的还不错 有兴趣的大家可以去试一试。', 1, 8, 14, 6, 2, '3', '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/5dad90138c974.jpg\"]', 0, ''),
(6387, '身材好的妹妹，竟然遇到节日价，舒心', 25, 30, '不同价位 自询', 330000, 330100, '2738554790', NULL, NULL, '鸳鸯浴,漫游,胸推,69式,口活,爱爱', '照片和本人略有差距，不过在杭州遇到真照的也算是运气好了。最主要的是妹妹这里中秋减了一米，只收6米，让人很舒心。服务基本也没得说吹啦弹唱一条龙下来，穿雨衣开始   小穴有点紧导致我提前交枪。。。。总体来说还是不错的，妹妹的身材可以', 1, 6, 29, 2, 1, '3', '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/5dad938e520e5.png\"]', 0, NULL),
(6389, '滨江区大战小仙女', 25, 30, '600/p 2000夜', 330000, 330100, '2738554790', NULL, NULL, '鸳鸯浴,漫游,胸推,69式,无套口活,爱爱全套', '具体的过程就不一一描述了，妹妹下面很紧，水也多，手摸了摸全是水，整个流程还是挺满意的，不敷衍了事，姿势你不提是不行的，必须要提出来玩什么姿势，基本都能配合，还可以的一次，推荐给狼友们，不用谢，哈哈', 1, 6, 10, 3, 2, '3', '2020-07-21 13:51:28', '2020-07-21 13:51:28', '[\"/upload/article/5dad993a5ff99.png\"]', 0, ''),
(6390, '下城服务型少妇程程', 27, 30, '400/P，700/2P.', 330000, 330100, '', '', '', '口交,洗澡,69,按摩,乳交,胸推,爱爱,特色肛交', '之前就去过，觉得服务可以，精虫上脑，就又约了，过程基本相似，洗澡、服务、口、做，做完了就直接走人，最喜欢就是可以肛', 2, 8, 2, 0, 2, '姐能干', '2020-07-21 13:51:30', '2020-08-07 04:07:23', '[\"/upload/article/5dad9aae5ad8c.jpg\", \"/upload/article/5dad9ab16938f.jpg\"]', 0, ''),
(6393, '杭州必去的标准莞式小蜜蜂-超高性价比', 28, 30, '500/次或700/2次', 330000, 330100, NULL, 'xmf52xmf', '18867145253', '胸推,69,毒龙,制服,口活,漫游,爱爱,口爆,深喉,刮痧', '朋友推荐去的，加微信之后记得一定要跟她预约时间，不要直接就说过去。老规矩，遥控上门，照片跟人差距不大，进门脱衣服洗个澡，她会进来帮你把身子擦干，到床上把脚擦擦，先是精油按摩了一会，手法还是比较地道的，然后第一遍漫游从耳朵到脚后跟，来来回回，第二遍过水再游一圈，然后小狗爬着给你做毒龙（相当给力啊！）接着是正面漫游-口活-蛋蛋什么的我就不一一赘述了，总之这个价格去了不会后悔。小姐姐还是很温柔健谈的。记得回来给我点个赞。', 3, 10, 26, 1, 2, '3', '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/5dad9d871eff7.jpg\", \"/upload/article/5dad9d871f8c8.jpg\", \"/upload/article/5dad9d87790bc.jpg\"]', 0, ''),
(6395, '体验高性价比宝藏级熟女，可以菊花', 33, 30, '300/次带服务，400/次带毒龙+肛交', 330000, 330100, NULL, 'qsbw66666', '15381197060', '漫游,胸推,69式,口活,爱爱,肛交,毒龙,舌吻', '狼友推荐，长相过得去，照片打八折这样吧，年纪也不小了，估计得有33左右了，身材不错，是有肉感的那种，房间有好多丝袜和制服，貌似可以叫她穿上搞，小狼不好意思叫，过程吧，毒龙不错，口活很耐心，不机车最主要的是能干屁眼，感觉和操逼不一样，加了润滑油还是很紧，如果不够硬可插不进去哦。这个还能舌吻，约的人也挺多，她做活时候不看手机，所以信息可能不会秒回，想去的话直接打个电话去，约时间，在新天地那一块大多女的都是鸡头代聊，这个不是', 2, 8, 31, 3, 2, '3', '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/5dada05c79e8c.jpg\", \"/upload/article/5dada05cd8232.jpg\"]', 0, ''),
(6396, '杭州可约，服务至上', 28, 30, '400p', 330000, 330100, '496452081', NULL, NULL, '鸳鸯浴,漫游,胸推,69式,冰火,口活,爱爱,SM', '美女的身材还是很不错的了，喜欢的可以去关注一下了', 1, 8, 9, 6, 2, '3', '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/5dada1f6af8e9.png\"]', 0, ''),
(6397, '验证兼职学妹婷妹儿 风骚性感', 26, 30, '全套1000包夜2000', 330000, 330100, '1709057613', NULL, NULL, '陪浴,胸推,臀推,指滑漫游,丝足接吻,69,做爱,丝袜,sm', '二十分钟后，门铃响了，我打开门一看，妹妹长的还不错，化了淡妆看起来很纯，说话也很温柔，我让妹妹休息一会 儿，我们便双双洗鸳鸯浴，妹妹脱光衣服后，全身皮肤很白很白，一对波波不算大，但是挺得尖尖的，中间的乳沟很深，摸起来手感很好，奶头可还是粉红色的呢！这时候，我的弟弟翘的很高了，欲火在不断的燃烧', 0, 0, 0, 0, 2, NULL, '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/5dada39a1d3a7.jpg\"]', 0, ''),
(6399, '杭州名凤茜茜，重新开业', 28, 30, '700P', 330000, 330100, NULL, 'qianqian2721640133du', NULL, '深喉口交,毒龙', '茜茜这个妹子是之前有朋友推荐过的，，本人验证过身材好服务好，第一次去直接给我秒了。后来有一段时间不做了，前几个月又换了个新的微信号和地址重新开了。所以我自己是去浩瀚的捧场一下的', 1, 2, 36, 1, 1, '3', '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/5dae84d1943df.jpg\"]', 0, ''),
(6400, '刚验证到心意的妹子分享一下', 25, 30, '1000/次', 330000, 330100, '3453542253', NULL, NULL, '鸳鸯浴,漫游,69式,丝袜,口活,爱爱', '早就对杭州本地兼职QM有所耳闻，只是限于地理原因一直没有机会去验证。前些天刚好公司发了一笔奖金，刚好安排小狼出差，到了办完正事，和兄弟一起庆祝，酒过三旬，DD按赖不住，朋友看出来了，于是就推荐一个本地美女，拿了美女的qq号，急不可耐的回到酒店，刚好妹妹在线，于是就聊了起来，感觉小妹聊天态度较好，看了照片确实很漂亮，于是按照美女要求然约个全套，然后告诉妹妹我酒店地址和房间号，美女说20分钟内到..', 1, 6, 7, 4, 2, '3', '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/5dae8616499d9.png\"]', 0, ''),
(6402, '下沙学生妹', 22, 30, '400/次或XX/天等', 330000, 330100, '577484485', NULL, '17090795105', '胸推,冰火,口活,爱爱', '黄文不写了，有2个公寓隔的开车5分钟。换了几个不满意的才换到学生妹。学生妹不是经常在。所以去的时候要联系好。', 2, 4, 76, 8, 2, '3', '2020-07-21 13:51:28', '2020-07-21 13:51:28', '[\"/upload/article/5dae87a91e64a.jpg\", \"/upload/article/5dae87a94909d.jpg\"]', 0, ''),
