(6423, '哈尔滨人妖TS，喜欢换换口味的可以尝试一下', 26, 30, '500/P  其他没聊，需要定金', 230000, 230100, '3108802741', 'haerbin1818', '13946060973', '口活,爱爱,情趣,SM（因为是人妖,所以还有其他的项目）', '对于人妖一直有好奇心，所以在一个QQ里，发现该特殊“美女”，长期在哈尔滨，身材算是稍微大骨架，有女性声音，容貌还可以，虽然比不上那种外国美女，但感觉在哈尔滨应该是不错了，先要了200定金，提前40分钟准备，到和兴路附近，指挥找到地方。因为不同于正常的女人，所以玩法，肯定会有很多种，不过对于SM，被干这样的，我是不太能接受，所以也没问，不过应该是各种服务都有，提前沟通好就好', 3, 5, 11, 3, 2, '3', '2020-07-21 13:51:28', '2020-07-21 13:51:28', '[\"/upload/article/5daeb0a3799e2.jpg\", \"/upload/article/5daeb0a37ce62.jpg\", \"/upload/article/5daeb0a37e5b5.jpg\"]', 0, ''),
(6425, '大晴天体验栖霞区子宣,长相比预期的好点,面容清秀,条顺,皮肤手感好', 26, 30, '90分钟/1200，夜2500', 450000, 450100, '2916294709', NULL, NULL, '胸推,69式,口活,爱爱', '那天和哥们吃饭，完事刚好路过，已经很晚了，这个妞居然在线，于是就约上了。见面后感觉很好，个儿挺高，整体身材算不错了，胸部坚挺，小腹算是平坦，两条腿也算直。进屋聊了几句，然后洗浴，妹子给简单陪浴了一下，然后上床开始项目。KH\\MY等等反正做一个告诉你这个是什么，除了KH其它每个时间都不长。最后是啪啪，这女人自带骚气，干的时候不停的喘息，不停的浪语，而且此女算是水多的，干了一会，我用手一摸就湿乎乎一片', 3, 4, 10, 1, 2, '3', '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/5daeb23694443.jpg\", \"/upload/article/5daeb23696e62.jpg\", \"/upload/article/5daeb236bdb2e.jpg\"]', 0, ''),
