(6437, '浙江台州椒江', 34, 30, '300/次或1000/夜等', 330000, 331000, NULL, 'a1391985191', NULL, '鸳鸯浴,漫游,胸推,69式,口活,爱爱', '妹子遥控上楼，是自己租的房子，34岁，长相一般，不过服务真的好，特别是口活，各种深喉，毒龙钻更是受不了，是去火好去处，颜值控的就算了，体验服务最重要，300一次，1000一晚', 1, 6, 70, 1, 2, '3', '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"images/202009/94c5d188dc2536723a7a1955dd5e1cde.jpg\"]', 0, ''),
