(6443, '银川西夏万达', 28, 30, '400/次或1200/天等', 640000, 640100, '2025992754', NULL, '15394732098/19995174964', '鸳鸯浴,漫游,胸推,69式,冰火,口活,爱爱,SM', '闲来无事打开QQ，约到小妹一枚，原本快到西夏万达，无奈公司有事召回，错过机会。现公布小妹资源，望狼友先去验验货', 2, 8, 18, 1, 2, '3', '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/5daed08134e41.jpg\", \"/upload/article/5daed08186e1b.jpg\"]', 0, ''),
(6444, '东耀赤峰行第二季：骨感年轻的妹子', 21, 30, '300/次或500小时800两小时', 150000, 150400, '1780499040', NULL, NULL, '鸳鸯浴,漫游,69式,丝袜', '值得一提的是，妹妹年龄确实小，估计也就20左右，非常内，3点粉嫩，身段也不错，但是“体重不过百，不是平胸就是矮”，胸实在是小。xl做的快活，妹子不是很配合，兴许做大活可能会配合一点吧，但xl是第一次遇到这种妹妹，估计也是最后一次。\r\n       这妹妹给人的感觉应该是从小家里生活不幸福，有一定的性格缺陷，不是很讨喜，要是喜欢年轻的鸡、粉嫩的、长得还不错的，可以尝试一下，毕竟300买不了吃亏买不了上当。', 1, 4, 18, 5, 2, '3', '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/5daed156e7e83.JPG\"]', 0, ''),
