(6451, '株洲新天红东大酒店', 24, 30, '800/pp、1000、1100都有', 430000, 430200, NULL, '18673136022', '18673136022（可以直接电话，微信同号）', '鸳鸯浴,艳舞,丝足诱惑,漫游,胸推,口活,爱爱', '我来抛转引玉吧。和朋友喝了点小酒，突然来了兴致，于是一发不可收拾。直接电话预约，飞奔到酒店，直接进房间，预定的妹妹立马就到，1米6几，胖瘦刚好，奶子应该有D，另外自己想要什么制服都可以提要求。具体过程不表，此处省略1万字。。。。。总之，服务对的起这个价格！', 3, 7, 4, 1, 2, '3', '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/5daed74b59ef9.jpg\", \"/upload/article/5daed74b5a0da.jpg\", \"/upload/article/5daed74bb10ae.jpg\"]', 0, ''),
