(6463, '山西大同灵丘住宿洗浴项目', 35, 30, '200/次或其以上项目', 140000, 140200, NULL, NULL, NULL, '口活,爱爱', '道灵丘县出差，在宾馆住宿，送洗浴，就去洗了，其实就是澡堂子，看见后面有一个休息厅，里面有女的说话，就问能不能进去，告诉说能，就进去了，里面很大，有很多信息的位置，找一个躺下，就有人问要不要按摩，139-169说不要，过了2分钟一个女的过来说里面暖和，去里面，看在有戏，进去后就介绍项目，不过人家也明说了，没有特别年轻的，都是35岁左右到，说先不做了，她说回宾馆，让层管阿姨打电话他们就上来，结果来了一个，没看上，又来了一个，感觉还行，就是泄火，没什么好说的', 1, 2, 1, 1, 2, '3', '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/5daff99eabfa2.jpg\"]', 0, ''),
(6464, '枣庄洗浴中心', 26, 30, '不同价位 自询', 370000, 370400, '就在薛城区政府旁边的院子内，院子内有个明仁宾馆，旁边就是洗浴中心了', NULL, NULL, '漫游,胸推,69式,冰火,口活,爱爱,SM,深喉', '18年就开始严打了，能洗浴的地方已经没有了，但是这个地方一直屹立不倒说明后台还是很硬的！我去的时候找的是18号，胸大而且是真胸，给我脱衣服开始漫游A/B面，然后给我口，其中口了有5分钟，小弟实在受不了了，提枪上马，18号呻吟的声音让人受不了，没几分钟就射了，事后给你捏捏腿捶捶背，服务牛逼，人也漂亮！', 1, 8, 3, 1, 2, '3', '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/5daffa774ece9.jpg\"]', 0, ''),
(6465, '超级温柔的保健按摩，没大活但是很舒服', 30, 30, '200/次--500/次', 370000, 371000, '730018834/2700933753', NULL, NULL, '按摩,肾疗,口活,胸推,丝足,360°口活,口爆', '进去先洗澡，美女说不管做多少的服务都是先按摩的。洗完了之后趴着按了会肩颈，然后踩了踩背，就开始挑逗了。我做的是500的，她说最贵也就500的服务了，反正冰火沙漠风暴什么的都有。口活还算可以，谈不上多好，感觉有点生涩，不过看的出妹妹很用心在做。说实话我找小姐也有五六年了，但是口活做的特别好的真的没遇上过几个', 2, 7, 11, 4, 2, '3', '2020-07-21 13:51:28', '2020-07-21 13:51:28', '[\"/upload/article/5daffb99b71ba.jpg\", \"/upload/article/5daffb99e83c1.jpg\"]', 0, ''),
