(6474, '龙华水多妹 波大服务好', 25, 30, '500/次', 440000, 440300, '571210238', NULL, NULL, '鸳鸯浴,漫游,胸推,69式,冰火,口活,爱爱', '跟着妹妹的指挥到达公寓 感觉不错 妹妹比较随和温柔 没有尴尬气氛 做起来像女友一般 值得推荐体验 照片没有P的 真人照 服务态度好', 2, 7, 2, 1, 2, '3', '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/5db0112b9564e.jpg\", \"/upload/article/5db0112c5faee.jpg\"]', 0, ''),
