(6476, '郑州中原区体验比较好的年轻妹子', 25, 30, '不同价位 自询', 410000, 410100, NULL, NULL, NULL, '鸳鸯浴,漫游,胸推,69式,冰火,口活,爱爱', '最近有朋友验证说这妹子活好，身材棒，就赶紧加了微信，说是朋友介绍的，没想到通过了，毕竟现在留微信的不多，都是qq，问了问服务内容和价格，感觉态度很好，就驱车直奔地方，遥控上楼，房间很温馨，接下来的服务物有所值，大战几十个回合，败下阵来，性价比挺高的', 1, 7, 4, 1, 2, '3', '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/5db012e702f14.jpg\"]', 0, ''),
(6480, '马家堡苏婷标志可以一试', 25, 30, '600', 110000, 110100, 'QQ：2195146723', '微信：17326828719', NULL, '基本都有', '晚上过去包的夜，早就应该点评了，中间有事耽误了。\r\n妹子是一个人独住一居室，出了地铁还有点距离，不是很方便。快到小区后联系上后，妹子一路遥控，进门人照差别不大，比照片壮实一点。妹子比较谨慎，小心关上了铁门，整体感觉还比较安全。可能是我到的比较晚了，妹子都快睡着了，到了之后自己简单洗漱，有一次性毛巾和牙刷，洗完后妹子给拿了瓶水，然后进入妹子房间。互相抚摸了下对方，妹子开始口，口了会，带上雨衣开战，一开始妹子上位，动了会妹子躺下，妹子下面比较紧....完事后重新冲了下，，妹子把腿主动搭在我的身上，很有恋人的氛围，期间还帮我按摩了后背。可以说是非常细致了，时间比较晚了，妹子是兼职第二天要上班，也就没好意思提再战了。第二天醒了简单再来一发就走人了。\r\n优点，态度较好，丰满系，，总之还是挺推荐人照差别不大，安全性可以，可以吻，没什么风尘气，可以考虑', 2, 1, 4, 2, 2, '3', '2020-07-21 13:51:28', '2020-07-21 13:51:28', '[\"/upload/article/4a980f43fa35370d607ab71abb83f24a.jpg\", \"/upload/article/50067ed0cd69ec0d094ec7317e9b8c9e.jpg\"]', 0, ''),
(6481, 'kh超棒的妹子', 25, 30, '500', 320000, 320500, NULL, NULL, '188 0944 8923', '漫游,kh,口爆,爱爱', '这个妹子是外地来的，自己一个人租房子做兼职。服务很细致，很专业。尤其是kh，我敢保证，没有男人能坚持三分钟以上的。妹子家里有浴缸，可以一起洗泡泡浴，服务就跟AV里一样。妹子不催人，很有耐心。', 1, 4, 4, 2, 2, '3', '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/ef10924d2792da036a43fc76f5d17d6f.jpeg\"]', 0, ''),
(6482, '小地方有惊喜', 20, 30, '600', 620000, 620100, '3116329235', NULL, NULL, 'qt', '朋友介绍的一JT，手下一般4-5人左右，以租住公寓形式。指定地点后qq联系至地点后挑选，进行一般服务；现兰州全城YD大多转为楼凤了。', 1, 1, 15, 3, 2, '3', '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/74c95d716a6579b46fecacbe4e29f036.jpg\"]', 0, ''),
(6483, '上门服务', 25, 30, '600', 150000, 150300, NULL, '45658596', NULL, 'DP,包夜', '海勃湾区兼职上门服务 只去家里 公寓，酒店 宾馆。 酒店宾馆不需要任何订金，见到本人满意付款，家里公寓先给20路费。 全套2小时600一次 ，包夜10小时1500不限制次数。 口J胸T鸳鸯浴69式毒龙啪啪 诚意约不视频不聊骚 \r\n小弟精虫上脑，所以就在微信附近疯狂搜了搜，果然看到一妹子，拍好地址，房间号果断叫妹子来，来的不是咱叫的妹子，没办法，既来之则干之吧，疯狂泄火完算了，今年全国yd，没办法了', 2, 2, 20, 2, 1, '3', '2020-07-21 13:51:28', '2020-07-21 13:51:28', '[\"/upload/article/494335f980bf8cddb3503ef537809d42.jpg\", \"/upload/article/b7b69a65bdf564822e37e8410fbb84df.jpg\"]', 0, ''),
(6484, '你们要的极品乐乐', 27, 30, '600/P或1000/PP', 330000, 330200, '19832052421939101696', '', '', '鸳鸯浴,漫游,胸推,69式,冰火,口活,爱爱', '试过的都知道这是个极品，不光长的漂亮，服务也非常到位，不催不机车。收藏好久了，不过找的次数不多，因为之前北仑嵩山路ZJ没扫黄的时候偏爱那边的快餐，现在没地方去了，只能找这些LF了。看了下她微信，十月这几天出去旅游了还没回来，加不上的可以等几天，我会在这个帖子里公布她上课时间。然后她的闺蜜小迪，我只留了QQ，', 3, 7, 0, 0, 2, '姐能干', '2020-07-21 13:51:30', '2020-08-07 03:52:47', '[\"/upload/article/5db019aab124c.png\", \"/upload/article/5db019aab14bc.png\", \"/upload/article/5db019aab1b12.png\"]', 0, ''),
(6485, '说说最近的经历 有一个cd', 20, 30, '600', 110000, 110100, '2562739534', NULL, NULL, 'qt', '最近到处溜达    \r\n刘庄子路 去了没有人   有红蓝灯巡逻\r\n\r\n小井桥也没人了   有红蓝灯巡逻\r\n\r\n\r\n海子角去了 也是有红蓝灯巡逻\r\n\r\n一天看无意间发现这个ts甜甜看着长得挺甜的，（实际是cd）聊了聊开价600砍了价就去了\r\n身材很好挺瘦的，没有赘肉，173身高，有点高了  矮一点合适，和照片很像，就是没那么白，\r\n鸡鸡挺大和我差不多，还挺硬的，玩了一会，他会说17，应该15差不多，\r\n由于他们经常干不是特紧  包裹感还可以，不知道为什么干几下就跑出来了，我时间也长一点，\r\n干了好久才完事\r\n挺讲卫生，一次性纸浴巾，经常换套怕破了，gj得病的几率更高，还行挺好玩，\r\n有的人妖看着就不舒服，这个不会看着难受，比较女人', 1, 1, 3, 1, 2, '3', '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/d91b172a8ae30975c3c628e5023b265f.jpg\"]', 0, ''),
(6486, '桥黄岗路艾特公寓净高174美腿大高个/点点兼职妹', 28, 30, '600', 370000, 370100, NULL, NULL, NULL, '鸳鸯浴,漫游,胸推,69式,口活,丝足,爱爱,能亲能摸', '个头净高在174以上，因为我才173，一看就比我高，穿个黑丝配个高跟鞋到180了，大长腿玩着老带劲了，妹子是个人兼职那种，不是店里那种，服务比较认真，不机械，先发了50让她开房用的定金，每次去了都是先陪我洗澡，搓着我的大鸟，瞬间就先干，然后躺着妹子舔着全身漫游一遍，如果你那种不抽烟没味道的人，对眼了还能亲亲嘴，逼毛很旺盛，是那种性欲强的少妇，具体要看自己会不会玩，你要是光图自己享受就不多说，反正我很喜欢舔比比，把妹子舔舒服了，干起来也都舒服都投入，太多的不说，想搞的自己体验', 3, 8, 24, 18, 2, '姐能干', '2020-07-21 13:51:30', '2020-08-10 00:20:13', '[\"/upload/article/5db01b27151f5.JPG\", \"/upload/article/5db01b271669a.JPG\", \"/upload/article/5db01b27174db.JPG\"]', 0, ''),
(6487, '石家庄最诱人的小妖精', 26, 30, '500一次或者1200一天', 130000, 130100, '', '', '15533935949', '漫游,胸推,69式,口活,口爆,爱爱,丝足,丝袜制服', '个小妖精当年12年约的时候还有些青涩 学生般的感觉当时她应该是还没毕业 当时包夜也便宜 我这个人有个习惯 玩就包夜好好的玩 一般谈不好的也不去没有意思 这妞胸还可以 腿配上丝袜无论是肉丝（本人钟爱）还是黑丝都别特无敌 小黄文咱么就不写了 每次最让我受不了的就是在宾馆的落地镜前面给你跪舔挑逗你 最后让你射了你以为完了 嘴里喊着精液看着你 根本就受不了还有就一个就是在大镜子面前后入叫声让你根本把持不住', 1, 8, 2, 0, 2, '姐能干', '2020-07-21 13:51:30', '2020-08-07 03:51:55', '[\"/upload/article/5db01bdd1654d.png\"]', 0, ''),
(6488, '这个小女子可以拥有', 25, 30, '400次', 230000, 230100, '643160039', NULL, NULL, '鸳鸯浴,口活,爱爱', 'QQ联系，她会再给你打电话，给地址。和照片一个人，但感觉美颜了，不过整体还是不错，不催人，挺会聊天的，口活可以', 1, 3, 2, 1, 2, '姐能干', '2020-07-21 13:51:28', '2020-08-07 03:51:18', '[\"/upload/article/5db01f636a7eb.jpg\"]', 0, ''),
(6489, '南昌西湖良家少妇', 27, 30, '500', 360000, 360100, NULL, 'gsh0802', NULL, '鸳鸯浴,漫游,胸推,口活,爱爱', '进门先共浴，帮洗澡。手法高超呀，随便弄几下，就让JB受不了。洗完后，换新订单，上床趟好，MM换上黑丝，开始口，无套，技法简直超级一流，没点耐力很容易缴枪完蛋。口完后，上雨衣开干。观音坐莲搞了几分钟，妹子累的受不了，一屁股的汗。只好我来了，妹子很会叫，一会老公，一会骚JB操。。。。不多说了，自己去体验。附图是妹子朋友圈发的，微胖，带大胸器。', 1, 5, 21, 5, 2, '3', '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/5db020843fe76.jpg\"]', 0, ''),
(6490, '普陀可儿', 26, 30, '400p 600双飞', 450000, 450100, '', '', '', '口活,aiai', '本来就4张想泄泄火，结果mz说可以双飞，尝试了一下，还不错', 1, 2, 3, 0, 2, '姐能干', '2020-07-21 13:51:28', '2020-08-10 00:18:29', '[\"/upload/article/1ce575046c78b3af12e7e0d5b3955a3e.jpeg\"]', 0, ''),
(6492, '金牌丽丽', 26, 30, '400/次或600/2次', 220000, 220100, '119169029', NULL, NULL, '鸳鸯浴,漫游,胸推,69式,冰火,口活,爱爱,SM', '同样也是老兼职，安全的，我记得以前是300的，现在涨价了，胸挺大的！400了，然后她说我记错了，或许吧，以前上门，现在有地方了！奉献给狼友！', 0, 0, 0, 0, 2, NULL, '2020-07-21 13:51:28', '2020-07-21 13:51:28', '[\"/upload/article/5db024dfc39a3.jpg\", \"/upload/article/5db024e008598.jpg\"]', 0, ''),
(6493, '一个欠了挺多钱的兼职，本地人她说26岁 逼超级紧 我一进去真紧到受不了 刚做不久 还被我干高潮', 26, 30, '600一p', 320000, 320600, '1319024829', NULL, NULL, '就做和口', '通过现实认识的 主要嫩 真的爽 屁股圆润 啪啪起来响的不行 后入揪着头发 一会就射了 这是我操过最紧的兼职', 2, 1, 5, 2, 2, '3', '2020-07-21 13:51:28', '2020-07-21 13:51:28', '[\"/upload/article/6e67b4fdbdc4217f6249a9701c8ca18d.jpeg\", \"/upload/article/9b7c9995771156a1caff28fc6ca01f17.jpeg\"]', 0, ''),
(6498, '兰州新区', 40, 30, '不同价位 自询', 620000, 620100, NULL, '可人ZZL091109110911', NULL, 'dp,口活,by', '前段时间去兰州新区玩，找了半天一个妹子也没找到，就问狼友要了两个嫂子的微信，这两个嫂子不是一起的也都不认识。第一个嫂子可人，长的还可以，胸大，个子高，东北人，服务只有口和做，一次400，包夜1000，一个老嫂子了还要这么贵，坚决抵制这种婊子。\r\n第二个嫂子岁数大了，长相差点，并且自己房子还有一个嫂子，两人服务也只有口和做，做一个100双飞一次150，包夜600，价钱也有点虚高，要是对长相不太介意，不要求服务的狼友可以约。', 1, 3, 11, 1, 2, '3', '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/7f3c60960fa8f7fdace5700fdbbef322.jpg\"]', 0, ''),
(6500, '长腿高跟熟女，包夜爆艹', 27, 30, '200/次800包夜', 460000, 460100, NULL, '15120692552', '15120692552', '漫游,胸推,69式,口活,爱爱,', '海口这边信息重复的发实在是丢人，为了骗点金币真是无所不用其及，我实在看不下去了。这个熟女早就认识了，她老公在海南这做工，她没事就出来兼职，有段时间不见了，前两天晚上太热，去酒店开了房约她，正好有空，吩咐穿着尖嘴高跟鞋，皮肤特别好，叫声也特别的骚，一晚来了三次，最后直接无套内射，爽歪歪，喜欢熟女的可以联系。', 1, 6, 22, 4, 2, '3', '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/5db02b5423b53.jpg\"]', 0, ''),
