(6504, '宜昌市附近稀缺资源分享', 26, 30, '400-500次不同妹子价格不一样我只找过一个', 420000, 420500, '2165434359', NULL, NULL, '鸳鸯浴,漫游,胸推,69式,口活,爱爱,不接吻,不钢,不SM', '了几个颜值在线的前段时间正好有空就去了到地方了，妹子开门一看妈的比我以前约的那些坑货强太多了。进门和妹子聊了一下然后去洗澡，妹子帮忙洗自己不用动手，洗了几下美女直接蹲下来就开始服务我的好兄弟了\r\n口活和爱情动作片一样差点让我交代了，估计让美女开始正题要不就走火了，往床上一趟美女就开始做服务了基本和会所差不多，', 1, 9, 17, 5, 2, '3', '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/5db02d6c60f43.jpg\"]', 0, ''),
(6505, '徐汇洋洋（性价比高）', 26, 30, '400/次', 310000, 310100, '3470999766', NULL, '15821166394', '漫游,胸推,冰火,口活', '见面感觉、见面和照片一样、妹子的照片应该没有修饰过、比较真实、妹子蛮热情的、进入房间就给一瓶矿泉水、为人处事不错的、就是感觉妹子喜欢笑、有一种邻家妹妹的感觉、身材、妹子个子不高、但是很有型的、该有的都有、手感不错、皮肤嫩滑、胸B+、服务FU属于中规上的、全Luo课表里面有的、没有遗漏、都会做到', 2, 4, 10, 3, 2, '3', '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/5db14bca37645.jpg\", \"/upload/article/5db14bcb0981a.jpg\"]', 0, '');
