(6511, '厚街虎门万达的，泻火合适', 26, 30, '400Q,600QQ,800二小时不限次，1000包夜', 440000, 441900, NULL, 'Vxxm8866', '17056478697', '鸳鸯浴,漫游,胸推,69式,冰火,口活,爱爱,SM', '对于这个来说是厚街难得的资源，虽然说是也是鸡头的，但是泻火还是不错的，虽然可能比不上其他很多，但是在厚街那么少的情况下能找到这个也不错了，不要相信什么那么多项目，这个顶多是普通的洗吹做而已，照片的也不要太相信了，相差比较大，但是还是勉强能看咯', 2, 8, 19, 3, 2, '3', '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/5db15542cdce0.jpg\", \"/upload/article/5db155432e63b.jpg\"]', 0, ''),
(6512, '服务型的东北妞', 26, 30, '500/次或700/2次', 430000, 430100, '1270998884   她有个朋友  两个人在一起   她朋友的  QQ：1263799727', NULL, NULL, '鸳鸯浴,漫游,胸推,69式,冰火,毒龙,口活,爱爱,SM', '这个妹子，声音不怎么好听，她说自己是东北人，但是第一眼穿着高跟鞋还是很不错的，本人比照片要黑，是那种健康的小麦肤色，对于肤色有喜好的，不推荐，妹子的服务没得说的，她说以前是场子里面出来的，现在自己做，人也比较健谈，过程不聊了，那一次被口的很爽，没两下就交货了，这个妹子很厉害，你只要射她就感觉到了，也不催我，包着好爽的。   她的朋友，总体而言就比她要差一些，个头矮一些，不过那个B，感觉这个女孩子发育的时候有种没发育全的感觉，下面的私处很饱满，插进去里面是那种很暖和的。', 0, 0, 1, 0, 2, NULL, '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/5db155a841f79.jpg\", \"/upload/article/5db155bc603df.jpg\"]', 0, ''),
(6514, '长腿雪儿', 25, 30, '500', 440000, 440600, NULL, '13378480849', '15916199654', '鸳鸯浴,漫游,69式,口活,爱爱', '500/次40分钟，800/2次，900/2小时\r\n约了两天才约到mm，而且前面一直约满，只好等到4点。mm遥控到公寓，环境不错，BL身高170，mm穿着矮跟鞋就快跟我一样高了，而且腿是真长，苗条，适合腿控人士。进门先洗澡，mm帮洗干净全身，然后上床漫游，无T口，可以69，爱爱，本人跟照片8成相似，就是没那么白，', 1, 5, 20, 4, 2, '3', '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/5db156e66bde0.jpg\"]', 0, NULL),
