(6522, '大风大雨好PP', 25, 30, '600p1200pp', 230000, 230100, '', '', '', '全套,除了没有独龙', '台风天列车停运被强行留在济南了，酒店闷着无聊就qq加几个群，物色物色。加了几个洪楼附近的，问了价格还行就说先去看看\r\n到地方进门一看妹子长得还行，很礼貌的，抱着摸摸胸很大很舒服就她了\r\n先YYY，妹纸洗得很细心，BL只顾着揉MM的大熊了。洗完往床上一趟，B面再A面，MM一遍XT还一边舔耳呻吟非常爽。聊天中，提出能不能多抹点润滑油XT，妹子也悻然同意，非常耐心。KH很到位，差点交代在这。赶紧说进入正题，先女上再正面又hr，MM里面特暖和，像是小DD泡温泉一样爽。最后几百下冲刺出货。体验非常爽非常爽\r\n最后放个照片，妹纸本人比照片好看点，还是耐看的。服务这么专业，一问还真是在洗浴店里面做过，现在全国都在严，朋友介绍到济南投入老鸨这。\r\n对了，群里什么都是中介....直接找到老鸨这少交冤枉钱。这朋友圈里面天天发在岗人，验证这个lulu人照对上的没问题，其他应该也没问题了', 1, 2, 0, 0, 2, '姐能干', '2020-07-21 13:51:28', '2020-08-07 04:58:18', '[\"/upload/article/952b499b6ededd152074e7bf83ea0902.jpg\"]', 0, '');
