(6530, '温州， 鹿城 骚货探秘', 26, 30, '600/次', 330000, 330300, NULL, 'lsyj60708090', NULL, '鸳鸯浴,漫游,胸推,69式,口活,爱爱', '晚上寂寞难耐，在狼友推荐的微信里随便找了这个妹子聊，跟妹子谈好服务项目，价格。据说很骚，上次有个家伙直接给咬爆了。妹子帮着洗完澡，因为卫生间灯是开着的，能看清妹子相貌，画了点淡妆，还算漂亮，接着把服务项目做完一遍，几把硬起来了，女上位，开始插入干完。果然很骚，搞得不要不要的。', 1, 6, 32, 5, 2, '3', '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/5db16985b0a2a.jpg\"]', 0, ''),
(6532, '给大家介绍一个越过的妹子', 25, 30, '400', 150000, 150100, '1247441636', NULL, '13015205506', '口活,爱爱,', '呼市，现月现聊 6米两次摸摸抱抱爱爱口活戴套口， 上门或者来我附近开个钟点房， 我在牛街附近，1.67米，105斤，27岁 上门提前发路费50 【隔天勿扰，谢谢】', 1, 3, 34, 7, 2, '3', '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"images/202009/29c18bbf5e8f3296688bbded95e819e0.jpg\"]', 0, ''),
(6533, '芝罘区万达KTV公主', 25, 30, '400起', 370000, 370600, '986089427', NULL, NULL, '漫游,胸推,冰火,口活', '妹子服务不多，身材是真好，年轻苗条大长腿，颜值还不错，就是服务很少，这个KTV公主的称号算是当之无愧。目前QQ又改名车模了，还是她不过。\r\n这个妹子每天接不了几单，接单时间也不固定，早了也得下午，有时候下午五六点才开始，一天最多三四单，原因是做得少，加上紧，接多了受不了，刚来那会儿有一次一天就接了一单，说是头一天接多了，下面疼。', 1, 4, 10, 6, 2, '3', '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/5db16bd806ec0.jpg\"]', 0, ''),
