(6537, '真●英姐验证加最新联系方式', 35, 30, '150', 460000, 460100, NULL, NULL, '18389288985', '看你需要', '在论坛看到诸位ly对英姐的服务赞不绝口，小弟我就按捺不住，想去体验一番，奈何坛子里留的联系方式都是之前的，已经封号停机了，更有几个坑爹玩意儿挂羊头卖狗肉，留的号是鸡头的或者别的小姐的，真是坑你狼爹不手软啊。后来用了点特殊手段终于搞到联系方式，迫不及待去体验一番，英姐的口活真不一般，小弟生平第一次口爆（非自愿，完全是控制不住），其它啪啪细节就不多说了，服务项目该有的都有，ly去体验吧。', 1, 1, 42, 5, 1, '3', '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/1aae127195a02251dc13ebed8fb6d5e2.png\"]', 0, ''),
(6538, '海口熟女婷婷肉厚耐艹爽到飞', 30, 30, '300', 430000, 430100, NULL, NULL, '13368987116', '口活,做爱', '找过这个姐姐多次了，她现在搬到西海岸凤凰城那边去了，小弟就喜欢这种，小穴很紧，身上有肉，啪啪的时候浑身上下都是一弹一弹的，爽的起飞。这姐姐有些害羞，不怎么活泼，服务项目也只有kj,ml，这个位置又偏又远，开车去方便点。', 1, 2, 7, 4, 2, '3', '2020-07-21 13:51:28', '2020-07-21 13:51:28', '[\"/upload/article/de7bc92e43127d0db4ef528776482f4e.png\"]', 0, ''),
