(6540, '紧致的湖南妹子，很有气氛', 25, 30, '600/p', 310000, 310100, '3278763418', NULL, NULL, '鸳鸯浴,漫游,胸推,69式,口活,爱爱', '文笔不好，妹子胸不是很大但是挺软的手感好，下面十分紧致，住在公寓里不是居民区装饰很有气氛。颜值有图片的8成，身材是和照片一样的。', 3, 6, 0, 0, 2, '6', '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/5db1759a44223.jpg\", \"/upload/article/5db1759a470a4.jpg\", \"/upload/article/5db1759a474c0.jpg\"]', 0, ''),
(6541, '莘庄地铁站，柠檬，瑜伽达人', 27, 30, '500/次', 310000, 310100, '2405448501', NULL, NULL, '鸳鸯浴,漫游,胸推,69式,口活,爱爱', '一开始，朋友推荐，我加了好友，很快回复。我说是朋友介绍的，还给优惠了100.。然后打车前往，到了楼下，给妹子发消息，妹子告诉房间号，随上楼。一进门，和照片差别不大。闲话少说，一起洗了个澡，妹子重点帮忙洗小弟弟。然后就开火，服务很好，项目都会做，关键是身体的柔韧性太棒了，可能练过瑜伽的原因，身材很棒。不虚此行。可以加她QQ，里边很多的生活照，没有风尘味', 3, 6, 12, 1, 2, '3', '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/5db176640c2af.jpg\", \"/upload/article/5db176640f92e.jpg\", \"/upload/article/5db1766436135.jpg\"]', 0, ''),
(6542, '鸳鸯浴，漫游，口活，爱爱', 26, 30, '400/次或700/pp或1600/天等', 310000, 310100, '1426531589', NULL, NULL, '鸳鸯浴,漫游,口活,爱爱', '第一次小姑娘态度特别好，特别可爱，年龄也不大，身材也挺好，第二次服务差点，长得不错，第三次还是第二次那个，和她说了这次服务要好点，服务确实改变了，基本上单次都是快餐，但是妹子嫩，性价比高，能泄火，要服务的要选人了，不满意可以换的，看过别的姑娘，是真的都不错，照片来的第一次的和后面第二次的，照片第一个是本人，可能为了安全吧，不让拍也不给本人照片，这是加了微信截得图', 0, 0, 0, 0, 2, NULL, '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/5db1788ac4dc2.jpg\", \"/upload/article/5db1788ac6e92.jpg\", \"/upload/article/5db1788ad1a0d.jpg\"]', 0, ''),
(6545, '兼职美女', 22, 30, '400-600', 340000, 340200, NULL, NULL, NULL, '大活', 'QQ联系，到地方拍照确认，然后美女发地址房间号。到了之后洗澡，直接服务一遍，开始大活。', 3, 1, 2, 0, 2, '3', '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/18b527ff86d65cc10dccf3daba77c453.jpeg\", \"/upload/article/1ad874ea64b00ddc51b8db768dc50948.jpeg\", \"/upload/article/b94ae6f886c1a2e190c40c253ffe25ee.jpeg\"]', 0, ''),
(6547, '再探北二环家庭式丝足会所', 26, 30, '298', 610000, 610100, '3438943081', NULL, NULL, '飞机,丝足', '这个妹子是南方人（哪个地方的自己去玩的时候去问），可御女、可清纯、可浪荡，很是不错。洗澡还是老样子，自己洗，洗完了，缠个浴巾出来，光着上床，然后，额滴神呀，三起三伏的，爽！只要你身体好，飞机个100次都可以，人家不限次数', 2, 2, 41, 4, 2, '3', '2020-07-21 13:51:28', '2020-07-21 13:51:28', '[\"/upload/article/5db19ca7c25ff.jpg\", \"/upload/article/5db19cab4a94e.jpg\"]', 0, ''),
