(6552, '白云肤白高挑巨乳美女', 27, 30, NULL, 440000, 440100, '2773646982', '860850766', '15813316134', '前后鸳鸯浴,波推漫游,刮痧,69式深喉,激情lovelove,制服诱惑,丝袜高跟', '白云区3号线白云大道北地铁A2出口，胸是天然巨乳，奶头大，身材是高挑丰满型，颜值和自拍基本无异，保养的不错皮肤白，风骚型样貌，服务不错，声音温柔', 1, 7, 5, 3, 2, '3', '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/5db2a0688f78e.jpg\"]', 0, ''),
(6553, '成寿寺娇小素儿', 23, 30, '500600', 440000, 440300, '3496822868', '', '', '陪浴,口活,冰火', '之前就加上了素儿，距离稍远，就没去。后来又看到了心里上火了，遂约了妹子中午，地铁过去之后，遥控上楼，进门屋里有淡淡的香味，妹子特别娇小，苗条的一比，哈哈。  然后换鞋，洗澡和妹子开始快乐的运动。 小黄文没写过，但是妹子人照无差，值得一去。（ps:妹子家里养了一条狗，挺可爱的）', 3, 3, 1, 0, 2, '小肥龙', '2020-07-21 13:51:28', '2020-08-14 09:44:29', '[\"/upload/article/0ee3f5699a74f68b4b85a0b503635ccd.png\", \"/upload/article/260a3712bb599fab3d1eed4a5de6c607.png\", \"/upload/article/43760e825be35594034c7043f0be90f2.png\"]', 0, ''),
(6554, '武汉小有名气的玉儿萧王', 28, 30, '400/次或600/两次', 420000, 420100, '1711127641\\2815709037', NULL, '15972023094\\15072362103', '鸳鸯浴,漫游,胸推,69式,冰火,口活,爱爱,SM', '晚上11:00才轮到，当时心里小有不爽。想着是老乡，还是去试一试。敲门进去，满屋子情趣内衣、丝袜、情趣玩具，看到这些前期等待也值了。脱衣洗澡此次省略，选了空姐制服，肉色丝袜套装，艳舞搞起来，各种诱惑姿势，然后就是各种服务。此女非常骚，服务时淫声不断，嫂子、老师、姐姐、丈母娘。。。。。。靠，真有点抗不住。口活时，真是床上尤物，能掌握好节奏，目前是我预见最好的口活骚女，实在受不了，戴套提枪开干，BB会自动夹紧', 2, 8, 6, 1, 2, '3', '2020-07-21 13:51:28', '2020-07-21 13:51:28', '[\"/upload/article/5db2a268009fd.jpg\", \"/upload/article/5db2a268464f3.jpg\"]', 0, ''),
