(6621, '夸一夸劳模小玲子', 30, 30, '300', 110000, 110100, '2088198454', NULL, NULL, '口活,独龙', '小玲子也算京城名凤了 这么多年价格一直不涨 口碑很好 首先身材不错 虽个矮但胸大 皮肤也不错 当然毕竟年纪也不小 脸上胶原蛋白流失也可以理解 除此以外卖点就是服务特别好 只要不是特别过分的要求基本都会满足 绝对不jc 对我来说是300档首选没看过照片的可以看看下面照片 只有她空间不露脸的 本人皮肤会差一点 其他差不多', 2, 2, 14, 4, 2, '3', '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/1294ecb1bbc75355a13544214cd7a5ae.jpg\", \"/upload/article/6eaabbadce2140d883106a847f4edb3b.jpg\"]', 0, ''),
(6622, '南通兼职小姐姐，胸大活好', 27, 30, '400一P', 320000, 320600, '', '', '', '鸳鸯浴,口爆,毒龙', '通过朋友介绍，遥控上楼后人很好，不催人，能做的要求都尽量满足，咪咪特别大，下面很紧，关键人也漂亮', 1, 3, 1, 0, 2, '姐能干', '2020-07-21 13:51:30', '2020-08-07 04:55:32', '[\"/upload/article/af4e28f8fa3efdf1fe36bc10fa22e321.jpeg\"]', 0, ''),
(6623, '南京小浪蹄 喜欢颜射', 24, 30, '500/p 1000/pp 1600by', 320000, 320100, '', '', '', '鸳鸯浴,口爆,做爱', '附近人加的 妹子很直接也很爽快 到了之后遥控开门 一起洗澡 顺便口了一次 然后开始做 妹子带节奏 差点没扛住 快射的时候 妹子拿下套子 一边讲骚话一边帮打飞机和口 然后射在脸上 她说很享受射在脸上的感觉', 2, 3, 1, 0, 2, '姐能干', '2020-07-21 13:51:28', '2020-08-07 04:53:46', '[\"/upload/article/ece20fab769f0235b6c2af8f96a66198.png\", \"/upload/article/ee7cad86b0592c348646a4370cb5da08.png\"]', 0, ''),
