(6635, '年轻嫩妹，就是嫩，要哄一下', 20, 30, '500', 460000, 460100, NULL, NULL, NULL, '口活,做爱', '开好房就过来了，一开门哇，好嫩。也蛮听话的，不过就是年轻的耐心不是很够。总的来说还是挺好', 1, 2, 0, 0, 2, '姐能干', '2020-07-21 13:51:30', '2020-08-07 04:46:52', '[\"/upload/article/98e2faeb082832108616d44f173859af.png\"]', 0, ''),
(6636, '炮打李家村96年妹子', 25, 30, '5波/次 8波2次', 610000, 610100, '3438332784', NULL, NULL, '鸳鸯浴,漫游,胸推,69式,冰火,口活,爱爱,SM', '早就加上这个妹子的扣扣了，看着很漂亮，之前一直在没去，后面弟弟忍住不住了一咬牙，找了个时间就过去了。妹子住旁边的公寓楼，一进门换鞋，然后聊了会就洗澡干正事了，出来还有一次性浴巾。妹子跟照片差不多，年轻漂亮身材好，胸也还可以，坚挺粉嫩，b杯抓起来手感不错，就是服务不多，年轻妹子都这样，不过态度可以，挺配合。口的时候不让停不抬头的，看着就直接硬起来了，来了两次。这妹子挺爱玩游戏的 估计和她游戏玩熟了还能解锁其他姿势。', 2, 8, 23, 7, 2, '3', '2020-07-21 13:51:28', '2020-07-21 13:51:28', '[\"/upload/article/5db68c72eacac.png\", \"/upload/article/5db68c73561d0.png\"]', 0, ''),
(6638, '年轻的妹子珊珊，刚做不久，值得体验，你可以忘记她，但你一定会记得她的口活', 25, 30, '500/次等', 110000, 110100, NULL, NULL, NULL, '鸳鸯浴,漫游,胸推,69式,冰火,口活,爱爱,SM', '妹子皮肤非常棒，顺滑，应该是经常保养，胸不大，但玩着非常舒服，乳头粉嫩，非常好吃，一边揉奶一边啃奶，随后让妹妹给我口，跪在面前非常有征服感，全程无齿感，不叫停不会停，时不时还来几下子深喉，相当爽，穿衣服打雨伞，开干，下面也粉嫩，非常紧致，细节不表', 2, 8, 3, 1, 2, '3', '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/5db698f444c47.jpg\", \"/upload/article/5db698f54682c.jpg\"]', 0, ''),
(6639, '声甜貌美兼职-小妙妙', 26, 30, '700/一次', 440000, 440100, '1769392982', NULL, '19925690043', '鸳鸯浴,漫游,胸推,69式,冰火,口活,爱爱,SM', '过程就不说了，自己体验', 2, 8, 4, 1, 2, '3', '2020-07-21 13:51:28', '2020-07-21 13:51:28', '[\"/upload/article/5db69cf1d1d98.jpg\", \"/upload/article/5db69cf204f5e.jpg\"]', 0, ''),
