(6641, '鲁磨路居家妹子一枚', 26, 30, '260/次或700/天等', 420000, 420100, '2649356238', NULL, NULL, '鸳鸯浴,漫游,胸推,69式,冰火,口活,爱爱,SM', 'QQ发掘的，自己在鲁磨路住的房子，环境尚可，可以洗澡等，服务过程不拖沓，不催，态度很好，家里还有一只小狗，做的时候小狗在旁边', 1, 8, 17, 3, 2, '3', '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/5db69dd698c26.png\"]', 0, ''),
(6642, '郑州市东区聂庄好去处', 28, 30, '不同价位 自询', 410000, 410100, NULL, 'q18703809307', NULL, '鸳鸯浴,漫游,胸推,69式,冰火,口活,爱爱,SM', '约好以后，直接上楼，姐姐等侯，进门深深的拥抱，就像好久不见的爱人，温情一会儿，姐姐就到浴室把瑜伽垫铺好，把热水调好，我躺在垫子上姐姐开始服务，那个服务太爽了，就是日式的那种，姐姐逼逼很紧但是姐姐叫着不让插。浴室完后，直接上床，姐姐可以穿各种制服，调情，各种舔，吹，实在忍不住了就带套进入', 1, 8, 76, 4, 2, '3', '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/5db69fa1337f4.png\"]', 0, ''),
(6643, '服务很不错的兼职妹子', 27, 30, '258（按摩推油）/358（按摩、推油、KJ）/400（全套）', 340000, 340100, NULL, '15055139471  联络暗号：9527介绍', NULL, '漫游,胸推,冰火,口活,爱爱,全身按摩', '出差合肥，很早就添加了这个微信，一直没时间去体验，提前一天联系后，第二天下火车安顿好之后，直奔现场，妹子电话遥控进入小区，洗浴后等着享受。原想只做按摩和推油的，但是妹子特别热情，因妹子身体不适只能做358的了，口含热水戴套口交射嘴里感觉很舒服，之后就是全身按摩，大约持续80分钟，聊天甚欢，最后还少收我8块钱，哈哈。如此良家怎能部介绍给各位狼友。', 2, 6, 5, 1, 2, '3', '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/5db6a0272a3fd.jpg\", \"/upload/article/5db6a02759ce7.jpg\"]', 0, ''),
(6645, '颜值不错，服务一般的妹子', 25, 30, '500/次', 440000, 440600, NULL, 'ya2016218', NULL, '鸳鸯浴,口活,爱爱,', '下午约得，比起以前约得，这个更真实点，主要人好看，身材不错，不好的地方就是服务态度一般', 1, 4, 12, 1, 2, '3', '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/5db6a29989828.jpg\"]', 0, ''),
(6646, '亲自验证熟女姐姐', 35, 30, '300起', 230000, 230100, '1668545387', '17036806498', '17036806498', '全套服务', '岁数不小了，偏胖的体型，胜在服务挺好，弥补了些外表的缺陷，泄泄火还是可以的。', 1, 1, 22, 2, 2, '3', '2020-07-21 13:51:28', '2020-07-21 13:51:28', '[\"/upload/article/81352699beac31f15848779d34a73b76.jpg\"]', 0, ''),
(6647, '南开妹子～大胸', 26, 30, '500/次或1200/天等', 120000, 120100, NULL, 'geiwoliliang789', NULL, '鸳鸯浴,漫游,胸推,69式,冰火,口活,爱爱,SM', '自己有地儿，遥控上楼，长得还行服务不催活儿～故事不会编～长挺高的，胸也不小身材不错～', 1, 8, 14, 3, 2, '8', '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/5db6a3b57bd1b.jpg\"]', 0, ''),
(6648, '小钢炮宁波鄞州炮打高冷小妹妹', 26, 30, '400/P；700/PP', 610000, 610100, '3387457881', NULL, NULL, '漫游,胸推,口活,爱爱', '提前1小时预约，有空，然后联系到附近，遥控上楼，和照片还算是接近的，年龄目测20-25上下，小巧类型，没有热情互动，无制服诱惑，直接裸奔，有点冷漠，没什么情趣可言，胸小，还不怎么让人摸，但是B还是算不错的，够紧，但是不怎么会叫，让我觉得有点冷淡无趣，就转型为纯属泻火，不管三七二十一，疯狂冲击，出货走人，没什么太大的整体感受，狼友纯泻火可以去，追求服务享受的请斟酌。', 0, 0, 0, 0, 2, NULL, '2020-07-21 13:51:28', '2020-07-21 13:51:28', '[\"/upload/article/5db6a44196242.jpg\"]', 0, ''),
(6649, '凤楼值得拥有', 21, 30, '800', 460000, 460100, NULL, NULL, NULL, '全套', '如图不多说\r\n虽然有点贵但是真的爽\r\n很200块钱的不一样\r\n成功人士标配', 2, 1, 2, 0, 2, '3', '2020-07-21 13:51:28', '2020-07-21 13:51:28', '[\"/upload/article/7a85267422f84f7ae2bea157c767ed3e.png\", \"/upload/article/b6da0ab673029b3d64b6549dc07870de.png\"]', 0, ''),
(6650, '汽车站附近特别漂亮的妞', 26, 30, '700一次 1300两次', 370000, 370100, '2965907719/2420168536', NULL, NULL, '胸推,69式,口活,爱爱', '到了妹妹说的地点，给妹妹打电话，在妹妹的指导下上楼以后，简单冲洗一下，就直奔主题了。具体的服务流程都大同小异，也不必细说，妹子之间的区别就是有的会投入一些，有的会敷衍一点，这个妹妹还比较配合，有点女朋友的感觉，所以我很喜欢。', 2, 4, 66, 8, 1, '3', '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/5db6a56c80aea.jpg\", \"/upload/article/5db6a56c88db4.jpg\"]', 0, NULL),
(6651, '胸大身材超级棒的小妹', 25, 30, '400', 370000, 371300, NULL, NULL, NULL, '胸推口活打炮', '去了之后，脱了衣服就开始口活，一边口一边摸她的胸，过了一会直接翻身上马，叫声非常好听', 1, 1, 3, 0, 2, '姐能干', '2020-07-21 13:51:30', '2020-08-07 04:46:06', '[\"/upload/article/a43de3231a9b9d385962e86856a4c98d.jpg\"]', 0, ''),
(6652, '夜总会', 24, 30, '3400', 440000, 440100, NULL, NULL, NULL, '都有,做爱', '在房间里选，一排小姐会自己报年龄和地方、不满意换\r\n900-1300的坐台费，出台包坐台费\r\n\r\n图片是我找小姐要的简介图', 1, 2, 2, 1, 2, '3', '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/c42e69d6e6ba4f77aaee310e0bcbeab8.jpeg\"]', 0, ''),
(6653, '王府井附近，良心妹子', 25, 30, '400～500', 630000, 630100, '1191847783', NULL, NULL, '鸳鸯浴,漫游,胸推,69式,冰火,口活,爱爱,SM', '大概过了5分钟向我走来一个穿黑丝的女人 我就问是杨姐吗对方答知是的 因为是那种很久的楼下面没有路灯看不清脸 但是那双腿和身材是特别棒 进入楼道后 楼道没灯我就来了手机手电筒照明 她走在前面 我故意照了一下他下面 卧槽 当时就看见 只穿了黑丝和丁字裤 我立马就涨了 到家后 门刚一关上 她立马爬下来给我口 我说实话小狼从上大学开始就阅女无数 她的kh算得上是第一 一直深喉那种 小狼当场去世 大概五分钟 全射在嘴里', 1, 8, 49, 14, 2, '3', '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/5db6a8f53c5cc.jpg\"]', 0, ''),
(6654, '紧致翘臀大波妹', 26, 30, '500p 900pp', 310000, 310100, '3164228312', NULL, NULL, 'yyy,口活,69,爱爱', '妹子很主动，臀部非常紧致，干的时候hr相当爽。而且胸部挺大的，推油很爽哦。', 3, 4, 20, 5, 1, '3', '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/1a1afc9993798f2c47bd01962bf2da11.jpeg\", \"/upload/article/94d72af69334164d4bcc4838d24d95b4.jpeg\", \"/upload/article/ccf9b08c1eb5d69b2e5f1dd0c8d3ee27.jpeg\"]', 0, NULL),
(6655, '学生气质清纯少女', 25, 30, '600pp/60min', 310000, 310100, NULL, NULL, NULL, 'YYY,口活,胸推,SW,COSPLAY,爱爱', '妹子很主动，长相挺清纯的。妹子很温柔，姿势随你摆，挺配合的。', 2, 6, 1, 0, 2, '3', '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/30798d979c511ac185354c63617a5c1c.jpeg\", \"/upload/article/8ee6a3298159612d47f410f5a4449d21.jpeg\"]', 0, ''),
(6657, '发一个有地方的少妇，感觉很职业那种', 28, 30, '不同价位 自询', 220000, 220100, NULL, NULL, '15144025977，联络暗号：是不是浪女', '漫游,胸推,冰火,口活,爱爱', '简单说几句吧，妹子30来岁吧，个人感觉应该是在会馆做了很久，就是很专业的感觉，懂得很多，适合喜欢手法的狼友，但是建议去之前跟妹子先谈好价格和项目，我是400都带，有的狼友不喜欢各种乱七八糟的项目，上来直入主题的也有。可能是这样的客户太多了，所以如果不提前说好的话，可能400就剩主题了。总得来说还是不错的，躺那享受享受服务也还好', 1, 5, 4, 1, 2, '3', '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/5db6accbbd1fc.jpg\"]', 0, ''),
(6658, '南阳家庭SPA经验汇总分享贴', 26, 30, '298-1000不等', 410000, 411300, NULL, '15203808917', '15203808917', '鸳鸯浴,漫游,胸推,69式,冰火,口活,爱爱', '。我都是去个几次，熟了，然后把里面的JS玩个遍，就换地方了。这里面的好处是可以双飞，去的时候不一定有几个人，最爽的一次叫了3个人，人多了也不好，忙不过啊，一边摸奶，一边啪啪，还有一个人在后面推，场面真是不堪入目。你玩的次数多了，可以加里面的JS微信，就可以单独约炮了。然后让JS再给你介绍他的姐妹，闺蜜啥的，这行的人认的就是钱，钱都位啥都好说', 1, 7, 13, 2, 2, '3', '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/5db6ad959895b.jpg\"]', 0, ''),
(6659, '浦东甜甜', 25, 30, '手-350/次、口爆500/次、900/p等', 310000, 310100, '2823291711', NULL, NULL, '漫游,胸推,口活,耳朵调情,爱爱', '本来是约另外一个妹子，可惜当天课程已满，就推荐她的小姐妹，看了一下图片，感觉还不错，于是QQ先联系了一下，看有没有时间，妹子说有时间，于是我去了，妹子是住在酒店，到酒店后，一路遥空上楼，刚进门看见妹子还不错，虽然和照片上有一点差距，身材很溜，马上兴趣来了，妹子很热情也很骚、口技一流，过程就不描述了，自己去体验吧', 0, 0, 1, 0, 2, NULL, '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/5db6aeeac6d46.jpg\", \"/upload/article/5db6aeeb2d6f6.jpg\"]', 0, ''),
(6660, '广州天河熟女', 28, 30, '300/次或500/2次', 440000, 440100, '2586966014', NULL, '18719135504', '鸳鸯浴,漫游,胸推,69式,冰火,口活,爱爱,', '天河北这个熟女去过几次，价格比较便宜，住的地方离地铁口相对较远，需要走上几分钟。样子长的还可以，个子不高，波挺大，人骚。服务也不错。', 2, 8, 4, 2, 2, '3', '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/5db6b2855fe2a.jpg\", \"/upload/article/5db6b28593b89.jpg\"]', 0, ''),
(6661, '南联300p服务还可以', 24, 30, '300p500pp', 440000, 440300, NULL, NULL, '131 1369 2187', '洗,口,做', '网友推荐的，电话联系，微信不回，很安全，性价比可以，嫌我时间长。。。。。。最近休假，九月初回来', 1, 3, 6, 0, 2, '3', '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/e470c9acc703e7db774af4d733ac48b8.jpg\"]', 0, ''),
