(6664, '杨浦区小悦验证', 25, 30, '手-350/次或700/p等', 310000, 310100, 'xyy991099', 'xyy991099', NULL, '鸳鸯浴,漫游,胸推,69式,冰火,口活,爱爱,SM', '第一次来ml，本来还害怕是照骗，结果照片p的很严重，但是人也很漂亮，其实没必要p成那样的，服务项目是按摩然后制服ml，yy浴我没试，有朋友试了可以说一下行不行', 1, 8, 10, 1, 1, '3', '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/5db6d3662880e.jpg\"]', 0, NULL),
(6665, '广州 小彩旗 已排雷', 18, 30, '400/次', 440000, 440100, NULL, '13533437227', '13533437227', '鸳鸯浴,漫游,胸推,69式,冰火,口活,爱爱,SM', '彩旗原来是梅花园的，现转到京溪了，我之前第一次去的时候玩起来很带爽，不要约束自己。在床上想怎么玩就怎么玩跟，有点女朋友的感觉叫声也很入脑', 2, 8, 9, 2, 2, '8', '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/5db6d3ec8fad4.jpg\", \"/upload/article/5db6d3ecbbf8a.jpg\"]', 0, ''),
