(6668, '00后小可爱', 19, 30, '500-800', 510000, 510100, '2498978320', '', '', 'cx,bt,口爆,zh', '位于酒店式公寓，进门就问我喝不喝水，休息寒暄了一下，就拉着我去了浴室，温柔的宽衣解带，感觉像自己的女朋友一样，姑娘看上去年龄较小，麻利的动作中透露着一丝羞涩。洗毕，进房，开始躺尸，服务还是很全面的，没想到娇小的面容下隐藏着这么多技能，先按摩了一下，然后胸推，漫游，毒龙，口爆，舒服得一批，最后提抢上马，大战300回合。小姐姐还问我是不是吃了药，哈哈哈，肯定没撒，我毕竟忍了好久了。', 1, 4, 2, 0, 2, '小肥龙', '2020-07-21 13:51:30', '2020-08-14 04:19:43', '[\"/upload/article/47720e6ed5530a2c8f358b8b32cfe99a.jpg\"]', 0, ''),
