(6677, '佛山南海上门服务，价格合理，服务不错', 26, 30, '400/次', 440000, 440600, NULL, NULL, '18675191076', '鸳鸯浴,漫游,胸推,69式,冰火,口活,爱爱', '朋友介绍的，感觉还不错，自己一个人，不是团队，所以免了中间商赚差价啥的，服务，不错，颜值也还可以。', 1, 7, 18, 3, 2, '3', '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/5db7dee22e934.jpg\"]', 0, ''),
(6681, '沈阳寻欢分享一个高配合美女', 26, 30, '300到1000/次或1200/夜等', 210000, 210100, 'QQ:458881829     qq1735410378', NULL, NULL, '鸳鸯浴,漫游,胸推,69式,冰火,口活,爱爱,SM', '一上来就舔我得胸还摸自己，我伸手摸妹子的小b，也没躲，还给我看，蝴蝶逼特别大的阴唇，我感觉就上来了。一遍给我看一遍给我口，几下深口，差点出来妹子就给我放缓节奏，帮我舔了舔蛋蛋我知道自己有点受不了就提枪上马，妹子还换了几个姿势，配合的真好。大家可以去看一看。奔着小仙女找你就别想这么便宜了，千八百那不是很正常的。', 0, 0, 0, 0, 2, NULL, '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/5db7e44fcc234.png\"]', 0, ''),
(6683, '济南不爽记', 29, 30, '400/次', 370000, 370100, NULL, NULL, NULL, '口活,爱爱', '晚上联系上，说好4张。进门后说四张只有用腿做，我就是犒劳小弟弟的，用腿怎么泄火？就说走吧，再见！看那样子无可奈何地同意了，后来就是一个劲的催，我终于体会到了早泄的感谢，非常不爽！美女身材不错，但长得真不敢恭维。', 0, 0, 0, 0, 2, NULL, '2020-07-21 13:51:28', '2020-07-21 13:51:28', '[\"/upload/article/5db7e9c9bc1be.jpg\", \"/upload/article/5db7e9ca80d72.jpg\", \"/upload/article/5db7e9caab79e.jpg\"]', 0, ''),
(6684, '大庆爽体验', 27, 30, '400单次，包夜1000', 230000, 230600, '2481533103', NULL, '17084557725', '69式,冰火,口活,爱爱,', '在一个大庆兼职群找到的，女的挺瘦身材不错，那天问她给她打电话直接去了那里，玩的很开，可以全活，这个价钱也不贵，找她包了夜，真是很舒服', 0, 0, 0, 0, 2, NULL, '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/5db7eb1197fe2.jpg\"]', 0, ''),
