(6692, '刘家窑晴格格', 27, 30, '500/次', 110000, 110100, '783284377', NULL, NULL, '鸳鸯浴,漫游,胸推,口活,爱爱,', '昨天验证果果没尽兴。进去先送一瓶矿泉水，我说洗洗开做，她说不着急陪我在沙发上唠了一会，然后陪浴，洗得干干净净全程不用动手。躺下开始给我舔全身，最后口活开始，次次深喉差点给我整射了。赶紧让停下开始做。十来分钟交水费走人。照片P的不知道怎么说，说不像吧还有点挺像，颜值说的过去，服务也说的过去。', 1, 6, 10, 1, 2, '3', '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/5db7f2178a58e.jpg\"]', 0, ''),
