(6697, '鸳鸯浴，漫游，胸推，69式，冰火，口活，爱爱、SM', 65, 30, '500/次', 320000, 320500, '3586336951', NULL, NULL, '鸳鸯浴,漫游,胸推,69式,冰火,口活,爱爱,SM', '这个妹子加了好久。前段时间她不在苏州，害得我等了好久，没事就看妹妹空间的大胸美腿，那个眼馋啊！真想上去摸遍全身。国庆后看到状态更新，立马驱车前往。本人与照片有点差距，好在还不错。上门让穿着制服做，一边让小妞口，一边摸着奶，口的受不了提枪就上阵了。一阵爽完，付费走人。', 3, 8, 9, 3, 2, '3', '2020-07-21 13:51:28', '2020-07-21 13:51:28', '[\"/upload/article/5db939bff1f5c.jpg\", \"/upload/article/5db939c00f807.jpg\", \"/upload/article/5db939c0a6308.jpg\"]', 0, ''),
