(6700, '郑州出差舌功极好的妹子', 28, 30, '500次798特别服务两次或1500天', 410000, 410100, NULL, 'qi99668869', NULL, '鸳鸯浴,漫游,胸推,69式,冰火,口活,爱爱,S', '问了朋友要了特服联系方式.朋友果断推荐了她，联系后当天被别人预约包夜了，我说加钱让他推了，他说信誉最重要。因为听朋友说她的服务郑州没有几个的，所以只能等第二天拉，身材长相都不错，胸刚入b把不大，但是推荐798东莞式服务，一个舌头舔遍全身，毒龙很有心，整个过程都让你颤抖比射还爽。', 2, 8, 39, 4, 2, '6', '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/5db93c91effeb.png\", \"/upload/article/5db93c9226fa9.jpeg\"]', 0, ''),
(6701, '鸳鸯浴，漫游，胸推，69式，口活，爱爱（', 26, 30, '350/次 550/60分钟', 440000, 441900, '1406408226', NULL, NULL, '鸳鸯浴,漫游,胸推,69式,口活,爱爱（', '先洗澡，洗澡过程中帮你吹，好服务，然后他会帮你把屁眼洗得干干净净地，因为等下要做毒龙，不过手劲有点太大了，你可以让她温柔一点。上床就是一整套流程，我最喜欢的就是口活，她说你喜欢就多帮我口一会，BB也还可以，外观看着不错，看起来小小的，第一发很快就射了，然后再洗一下，一边聊天，一边进行第二次。一共下来做了两次，服务过程中还有客户打电话来，可能生意太好了，。胸不算大，主要是你想怎么做都是可以的，只要不过分，不会推三阻四的。', 1, 6, 47, 5, 2, '3', '2020-07-21 13:51:28', '2020-07-21 13:51:28', '[\"/upload/article/5db93e131ff73.jpg\"]', 0, ''),
