(6704, '南稍门小阿霞', 28, 30, '不同价位 自询', 610000, 610100, '2890647672  3386842246  3214969401', NULL, NULL, '鸳鸯浴,漫游,胸推,口活,爱爱', '刚开房门妹子一身制服诱惑到了我，小弟弟不由而主的躁动起来。进门换鞋直接去鸳鸯浴，因为两次中途妹子用嘴弄没弄出来。洗完后直接提枪开干。没几分钟就缴枪了。随后妹子开始做各种服务，昨晚后继续。第二次又半个小时才出来。妹子体力挺好，人长得跟图片差不多，能紧能松好像练过。妹子QQ胜任不加，但是你发消息只要她闲着就会回', 1, 5, 14, 3, 2, '姐能干', '2020-07-21 13:51:30', '2020-08-07 03:27:34', '[\"/upload/article/5db94046e9aea.jpg\"]', 0, ''),
