(6706, '武汉 mm大长腿', 18, 30, '自询', 420000, 420100, '3376151741', NULL, NULL, '全套', '朋友推荐很久了，本人又是腿空，就抽空去了一趟，一进门就被妹子的腿吸引住了，当时妹子穿的旗袍更有感觉了，下面秒硬，在妹子的帮助下洗澡，屁股真的大，口活不错，然后就去床上玩腿，差不多了提枪上阵，水多，叫声浪，很值！', 1, 1, 3, 2, 2, '3', '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/5b0e4982a9d10f24b05bb03e182de290.png\"]', 0, ''),
