(6743, '火车东站极品瑜伽教练', 22, 30, '1200', 620000, 620100, '571672788', NULL, NULL, '洗吹做', '妹子是枚小极品，职业是瑜伽教练所以身材你们懂得，胸大概是b+，形状饱满圆润，练过的胸就是不一样，屁股翘，整体偏瘦一点，b很紧应该出来没做多久，长相大概在90分，有点网红的感觉，妹子有个小要求就是只上门，而且只上火车东站的全季酒店，价格稍贵，一次700，两次1200，总之还是物超所值，这样的极品兰州已经不多了。', 3, 1, 42, 8, 2, '3', '2020-07-21 13:51:28', '2020-07-21 13:51:28', '[\"/upload/article/545595710fa0daa2d4aa910c32923c57.jpg\", \"/upload/article/71d8b154f8f60c93c1380c715eb4a6ac.jpg\", \"/upload/article/d4334c27a682904f653d66c68e3a842b.jpg\"]', 0, NULL),
