(6803, '武汉街道口大胸姐', 27, 30, '500', 420000, 420100, '1802771160', 'ppk249', '13986017815', 'bt,口活,做爱', '妹妹今年23岁。身高1 66,96斤。胸C罩杯。我在酒店开的长期房，500全套服务(包含房费)。\r\n\r\n妹妹不包夜，不出台。不要定金见面满意了付钱。服务项目:鸳鸯浴、口活、胸推、漫游、乳交、69、丝袜诱惑、做爱等,保证让您满意。全套服务70分钟，做1次。.                上班时间: 中午12点到晚上11点。  地址:洪山区街道口地铁站B出口，未来城C座  我在这里一年多了，不换地方，不换电话哦。', 4, 3, 22, 6, 2, '3', '2020-07-21 13:51:28', '2020-07-21 13:51:28', '[\"images/202009/fa907ba98aee29cea1e10a8ef32304c0.jpg\", \"images/202009/ed216822f239ff2ee1500ccb3a905a0b.jpg\", \"images/202009/d08d8604f072075a5503d8b416d102dc.jpg\", \"images/202009/9cd217b480560862a08b1a7dd339c888.jpg\"]', 0, ''),
