(6981, '胸大，活好，', 24, 30, '300500', 220000, 220100, NULL, 'meilulu123', '13244414286', '口,莞式,大活', '不上门，有地址，我第一次也没敢怕被跳，但是看了看，决定去试试，硬头皮去了，那大奶子得劲，本人喜欢胸大的，长得也还行吧，洗完澡上来先口，无齿感，后来忍不住直接冲锋了', 1, 3, 18, 7, 2, '3', '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/18d1492a6e6c23958f8879637ceb08e5.PNG\"]', 0, ''),
