(6993, '北京望京地区兼职，东北妹子，170长腿，皮肤挺白，c罩杯', 25, 30, '500p', 110000, 110100, NULL, NULL, '18941553655', '全套', '望京地铁站，到了给她打电话，妹子御姐型，皮肤比较白，不催活，很爽', 1, 1, 6, 2, 2, '3', '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/86a5b3eb2c310662af4bc8ed776fb9a2.jpeg\"]', 0, ''),
(6995, '普陀-初凉', 25, 30, '500P900PP1600BY', 310000, 310100, '3106000538', NULL, NULL, 'AM,SW,XP,GS,漫游,SEIWEN,69,TT,做爱,口爆', '一进门沙发上坐了一个大长腿，初凉把我拉进房间，我问幽幽沙发上坐的谁，说是杨老师，心里暗喜，居然可以看到传说中的杨老师，进了房间b面按摩摸初凉大腿丝滑，手法娴熟，a面的时候脱了紧身连衣裙，胸又圆又挺，胸推软软的，接着KH，最后戴套干，爽完之后温存一会交钱走人。强烈推荐', 2, 10, 3, 2, 2, '3', '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/0194c90e58112e45fdf68be9b70e75b8.jpg\", \"/upload/article/42e059fa23a1747e5bacbbdb0889e53d.jpg\"]', 0, ''),
(7011, '服务型温柔短发妹妹，力荐，爽的很', 22, 30, '600p', 330000, 330100, '2106632952', '没留', '没留', '莞式全套,该有的都有', '从进门就开始服务，可乐矿泉水供应，陪浴，擦身，擦脚，铺一次性床单，莞式服务全套一个不落，小舌头舔得极其认真舒服，接下来啪啪，十来分钟交货，意犹未尽，整体感觉亲切舒服，下次还要来宠幸她。\n非常满意，宾至如归的感觉', 0, 0, 56, 1, 1, NULL, '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/1e1852818d063909756eaa31e9bb2025.jpg\"]', 0, ''),
(7018, '分享个高端妹子', 25, 30, '500', 120000, 120100, '46176081', NULL, NULL, '鸳鸯浴,漫游,胸推,口活,爱爱', '这妹子是其他地方得到的，空间有照片，虽然年纪不大，应该也是这行老人了，现在到处跑，在天津就能约，有财力的狼友自己聊。', 1, 5, 17, 3, 1, '3', '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/5dda67e68242e.jpg\"]', 0, NULL),
(7028, '亲测嫩妹，身材价格安全极佳', 25, 30, '500-800', 510000, 510100, NULL, NULL, NULL, '胸推,漫游,口交,口爆,69,丝袜,制服诱惑,啪啪', '感觉邻家小妹，态度好，因为对毒龙，波推之类没多大兴趣，不清楚具体情况。蜀都惠园的环境如何各位上网一搜便知。虽然不算是极品，但是让我很开心，心情好了就行。跟她合住的另一个mm没仔细看，年纪差不多，可以双飞的', 3, 8, 0, 0, 2, '3', '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/374f88b0ab79ea3a574d7d9931b274ba.jpeg\", \"/upload/article/d15cc758cb4795059cacd96f5099777c.jpeg\", \"/upload/article/f9ec0bf6dbafb40d888df1f3cd6b4b44.jpeg\"]', 0, ''),
(7050, '体验大奶小穴，浴室调情口活胸推大活', 25, 30, '1500', 130000, 130100, '2870387885', NULL, NULL, '鸳鸯浴,漫游,胸推,口活,爱爱', '小狼着急释放，从炮击中选出以前约过的妹子，马上让妹妹来我家，到楼下有门禁小狼出去接的，回到我家，两人脱掉衣服洗洗澡，大大的胸脯揉捏的非常爽，jj雄起让妹妹在浴室里口活，感觉棒棒哒！口活结束后就是胸推了，这个大胸看着都眼晕推一次只有试过了才知道妙处！爽点在哪，夹着我的jj上下抖动左右摩擦，怎能一个爽字了得？', 1, 5, 3, 1, 2, '3', '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/5ddce02616830.jpg\"]', 0, ''),
(7052, '花果园一日游', 30, 30, '500/p  700/pp  包夜1600有点贵', 520000, 520100, '3469014148', NULL, NULL, 'yyy口活做爱69', '联系好以后，打车过去，进房间，先跟xl聊了会天，倒了杯水，然后去洗澡，虽然长得跟照片有差距，但是是真的大，也很挺，一手根本无法掌握，喜欢胸大的可以去体验。很注意卫生，给xl洗的明明白白的，过程十分香艳。洗完澡开始服务，穿着黑丝，透明内衣给xl口，差点没控制住，然后翻身上马，可以感觉到很紧，而且练过瑜伽，可以摆出很销魂的姿势。一顿翻云覆雨最后射出万千子孙，坐在客厅吃了点水果，冲了一下，留下炮资走人', 1, 1, 8, 1, 2, '3', '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/6aa19c0f52d62ea4353c1ceac12c86b6.jpeg\"]', 0, '');
