(7073, '偶尔兼职的嫩妹，乳头敏感一舔下面就泛滥', 25, 30, '1180', 120000, 120100, '745545987', NULL, NULL, '鸳鸯浴,漫游,胸推,口活,爱爱', '知道这个妹子是在一个约炮群里，当时加上妹妹，看空间很干净，也没有照片，就直接问妹妹要照片，妹妹给发了两张，虽然脸被遮住了，但是还是能看出来是个美女，身材很纤细那种，心里满意，就和妹子约好，我下班赶过去晚了半小时，搞的妹妹以为我口嗨了。。。。', 0, 0, 12, 1, 1, NULL, '2020-07-21 13:51:28', '2020-07-21 13:51:28', '[\"/upload/article/5dde3e5dd93c4.jpg\"]', 0, ''),
(7074, '成渝立交400不限次的风骚熟女', 30, 30, '400', 510000, 510100, '1985162504', NULL, '15682056759', '鸳鸯浴,漫游,胸推,口活,爱爱', '都老凤了 以前是会所JS 服务态度极好 一个半小时400不限次 普通人应该也就两次吧哈哈哈哈 进门简单洗洗按住头先往嘴里弄一发 抽根烟休息一下享受服务 DL不得不说很专业口活也是一绝 按摩放松一会儿来感觉了提枪上马 推荐背枪发射 可惜姐姐不给肛 最后在姐姐的bi里长长的射了', 2, 5, 41, 11, 2, '3', '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/5dde3fd21dedf.jpg\", \"/upload/article/5dde3fd24caa5.jpg\"]', 0, ''),
(7076, '大奶美女特别淫荡600双飞', 25, 30, '400一次，600双飞', 110000, 110100, NULL, NULL, '13073530292', '胸滑,口活,啪啪', '妹子两个人合租公寓，起初只要了一个人，不过后面听闻加200双飞果断答应，两个妹子一个胸D，一个E，都是巨乳爽的不行。服务很好，口活无齿感，两个妹子都喜欢啪啪，很淫荡。', 1, 3, 19, 3, 2, '3', '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/e43036da72f7c7f2a6ee14bc6bcf69c2.jpeg\"]', 0, ''),
