(7082, '东北一米七高个子熟女蓝色玫瑰', 31, 30, '东北一米七高个子熟女蓝色玫瑰', 110000, 110100, '3209552241', NULL, NULL, '鸳鸯浴,漫游,胸推,口活,爱爱', '以前南苑西路有一个东北熟女叫妞妞，体验过几次，现在上岸了。有一天看见妞妞的说说上介绍有一个闺蜜，然后我就加上了，就是蓝色玫瑰。蓝色玫瑰自我介绍写净身高1米7，看照片身材确实高挑，鉴于是妞妞推荐的，决定去试试。到了后发现身材果然高挑，还穿的高跟鞋', 1, 5, 4, 1, 2, '3', '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/5dde489b50fab.jpg\"]', 0, ''),
(7083, '逗逼小美', 25, 30, '500', 110000, 110100, NULL, 'zx1989078246', NULL, '鸳鸯浴,漫游,胸推,口活,爱爱', '美美这个妹子实在是一个逗逼，经常在抖音上分享她的逗逼视频，我们俩的加上微信之后，这妹子就给我发一些黄色的动图，给你的感觉就是她特骚特饥渴的那种，这种反应是我需要的（爷最烦那种高冷的妞，男盗女娼的核心就是：男人花了钱就要找乐子', 2, 5, 2, 1, 2, '3', '2020-07-21 13:51:28', '2020-07-21 13:51:28', '[\"/upload/article/5dde49b97d6c5.jpg\", \"/upload/article/5dde49b9b0745.jpg\"]', 0, ''),
(7101, '龙归半套', 24, 30, '200左右', 440000, 440100, '598520114', NULL, '13987452016', 'BT,ZJ,SC,口活', '按导航走  龙归派出所对面，一进去妈妈很热情，看到丝袜鸡儿棒棒硬，直接问服务多少钱就行了，谈好了 可以带出去', 1, 4, 3, 1, 2, '3', '2020-07-21 13:51:28', '2020-07-21 13:51:28', '[\"/upload/article/484a2822e73b951aef8f040816790df6.png\"]', 0, ''),
(7113, '双井地铁站附近服务系', 28, 30, '300', 110000, 110100, '2447985433', NULL, NULL, '鸳鸯浴,漫游,胸推,口活,爱爱', '姐姐还是很礼貌的询问力度如何，按了一会儿，问姐姐能不能穿着丝袜坐上了按照，照做，那种感觉真的是太刺激了，背面按完之后，翻身，按正面，我这人怕痒，没按几下肚子呢就痒的受不了，让后就让姐姐按下面三角区，还各种挑逗，感觉太刺激了，', 1, 5, 2, 1, 2, '3', '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/5de0df65b0611.jpg\"]', 0, ''),
