(7161, '燕郊99年的妹子', 20, 30, '400', 130000, 131000, '3091014308', NULL, NULL, '鸳鸯浴,漫游,胸推,口活,爱爱', '本人在燕郊兼职，99年身\r\n高165体重92\r\n服务:四张带T口+pp(别的服\r\n务面谈哦)\r\n可包时，\r\n上门\r\n喝酒闲聊勿扰!\r\n中午十二点到晚上一点欢迎\r\n哥哥前来上课', 2, 5, 102, 11, 1, '3', '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"images/202009/7feec49f65d5ea1a35c863220ce552be.jpg\", \"images/202009/43fc3a27da47f979bd5e0663ecf96dc6.jpg\"]', 0, NULL),
(7170, '东门夏婉荷', 26, 30, '400p', 510000, 510100, NULL, NULL, NULL, '口+做', '妹妹在东门双桥路那边，日常出入健身房，所以身材可以，屁股翘，胸有C吧。去了是个老小区，不过好在热情，为了屁股去的～', 1, 1, 0, 0, 2, '3', '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/cd38d05e867e80b1acb4e6bc7281cfaa.jpeg\"]', 0, ''),
(7172, '南京秦淮大长腿兼职上班了的', 21, 30, '600', 320000, 320100, '1394836566', NULL, NULL, '鸳鸯浴,漫游,胸推,口活,爱爱', '打电话或者微信联系她，她会发送位置。洗的时候会跪下来舔。一定要要求换上制服丝袜高跟鞋，总之身材高挑特别吸精，后入爽歪歪！腿都能玩很久', 3, 5, 13, 4, 2, '3', '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/5de61f11cfaa5.jpg\", \"/upload/article/5de61f120b4a7.jpg\", \"/upload/article/5de61f120b9a7.jpg\"]', 0, ''),
(7173, '珠江路喷水妹子', 24, 30, '600', 320000, 320100, '2583543616', 'ziyi1441', NULL, '鸳鸯浴,漫游,胸推,口活,爱爱', '会喷水，很会吸，玩起来啊超爽。', 2, 5, 10, 1, 2, '3', '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/5de61f70ab7be.jpg\", \"/upload/article/5de61f70dd264.jpg\"]', 0, ''),
(7182, '13号线北苑重庆妹子体验超级好', 26, 30, '400', 110000, 110100, '1721809669暗号,牛牛', NULL, NULL, '鸳鸯浴,漫游,胸推,口活,爱爱', '最新开发的一个嫩货，清纯初恋脸，味道特别棒。先在QQ上与妹子取得联系，周末时间便杀了过去。路程不细说，妹子已经在等我了。一室一厅 很干净舒适。 话说见到真人之前，我的心情都要跳出来了。好在妹妹没有让我失望，看到小女神之后，我悬着的心也终于是放下了。是个非常青春漂亮的小嫩妹，颜值太纯了，一看就是个乖乖女，看到我脸一红，萌萌的叫了一声哥哥，搞的我心直发痒。', 2, 5, 3, 1, 2, '3', '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/5de628d1d4901.jpg\", \"/upload/article/5de628d1d71a3.jpg\"]', 0, ''),
