(7189, '休闲按摩打飞机', 27, 30, '198 298 398', 110000, 110100, NULL, NULL, NULL, '按摩,精油,目前我体验过的就这两个', '那天突然想去做个按摩，就随口问了一句，有没有那个，小姐姐说，198的欧式有，精油打飞机加按摩，就尝试了一下，手法也不错，态度也很好，完事还在那里小憩了一下，周围还有几家，还没去。', 1, 3, 0, 0, 2, '3', '2020-07-21 13:51:28', '2020-07-21 13:51:28', '[\"/upload/article/4a832bcccaa1a07d073774b3eb3925a4.png\"]', 0, ''),
(7200, '北京西土城自聊妹子', 25, 30, '一次6', 110000, 110100, '3390187274', NULL, NULL, '陪浴,丝袜,69,口活', '这个妹子是朋友给我的，我联系了下感觉还可以 服务项目多就去了 妹子很热情 服务项目多 大于颜值 喜欢服务的可以去看看', 1, 4, 6, 2, 2, '3', '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/cb5790bb9d984f7f1516ebdc857c7d2b.jpeg\"]', 0, ''),
(7204, '新翠景园SPA加一条龙', 23, 30, '600-1280', 110000, 110100, NULL, 'beikekebeibei', '17338157663', 'kh,做爱,独龙', '这家适合高端一点的玩，因为六七百只能打一个飞机，会给你洗浴搓揉下面非常贴心，如果想玩的爽玩的带劲998起步开始解锁各种，小姐颜值高技术好，指画，口活，情商都一级棒，推荐贝壳漂亮皮肤雪白又骚让你爽的飞起。', 1, 3, 3, 1, 1, '3', '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/751a7f402398d57546e58369e7d65024.jpg\"]', 0, NULL),
(7205, '宣城火车站爱尚足浴', 30, 30, '500', 340000, 341800, NULL, '13637248278', NULL, '口爆.漫游', '闲着没事就去找了一家店，才开的，没去过，进去先洗澡，洗澡完了做项目，有漫游，毒龙，吸皮，诱惑，最后吹箫口爆，服务不错，就是有点贵了', 1, 1, 5, 1, 2, '3', '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/a0a008b237851278e31559ddb0e71b78.jpg\"]', 0, ''),
(7206, '外模异域风情让你骑洋马 射洋B', 22, 30, '998', 110000, 110100, '52693458', 'wm18311350487', '18311350487', 'kh,做爱', '按照联系方式，可以到不同的地址去开炮，干过日本韩国俄罗斯印尼的，不同洋妞不同体验，日本技术好听话，印尼胸大屁股大草起来带劲，韩国善解人意，俄罗斯就是正经骑洋马新体验，都会简单英语，八九百块钱四十分钟玩到爽，进来洗澡然后开始口活做爱，提前预约，有不同外国友人在店。', 2, 2, 11, 3, 2, '3', '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/77140d633e0372ef52a2a1ec794e557f.jpg\", \"/upload/article/eee25bb2f55b04e203c30829a1cdee27.jpg\"]', 0, ''),
(7207, '一个清纯小妹', 25, 30, '6张一次', 110000, 110100, '1919082735', NULL, NULL, '全套', '前几天才去的一个妹子 ，总体感觉不错 服务到位 主要是长相清纯啊！', 1, 1, 6, 2, 2, '3', '2020-07-21 13:51:28', '2020-07-21 13:51:28', '[\"/upload/article/4b6c55822a89edf0a3a8a44c85833e70.jpeg\"]', 0, ''),
(7213, 'AV角色扮演', 26, 30, '600-1000', 510000, 510100, '3623045608', NULL, '17072848603', '想玩什么提前联系', '加了这个好久，一直没去，有个群，大家都跃跃欲试想去验证，但就是没有人真去的，看描述很刺激，各种角色扮演，想玩啥提前跟妹妹沟通，妹妹会准备台词和场景（台词好长……），昨天过去，动物园附近，把自己喜欢的小电影类型先跟妹妹沟通好，去了后妹妹配合演戏（去之前想的好好的一块演戏刺激一下，去了后就一直想着上她，憋不住，嘿嘿），总体小贵，体验一次还行。', 2, 1, 3, 2, 2, '3', '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/98ad1d12dbf4abc070bedfb2a30dc5e7.jpeg\", \"/upload/article/dee1684e7fb921fa480d047b518ac22f.jpeg\"]', 0, ''),
(7215, '温江单身少妇', 37, 30, '200', 510000, 510100, '283199007', NULL, NULL, '鸳鸯浴,漫游,胸推,口活,爱爱', '偶然听说的少妇，在温江，亲自体验一下，只快餐，很讲究卫生，自己有地方，体验就好，不要举报。嗯', 1, 5, 35, 4, 1, '3', '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/5de8fcd76c9a0.jpg\"]', 0, NULL),
(7217, '龙华mm-小羽', 27, 30, '500', 440000, 440300, '1218175778', 'hl66952025', NULL, '鸳鸯浴,漫游,胸推,口活,爱爱', '加了mm后按地址导航过去，进屋后先洗澡，洗完上床做服务，有吹箫、胸推。欲火焚身后，提枪上阵，一阵翻云覆雨后得到成佛了', 0, 0, 7, 0, 1, NULL, '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/5de8feae10297.jpg\"]', 0, ''),
(7221, '中医医院大屁股少妇', 27, 30, '500', 610000, 610100, '732746150', NULL, NULL, '鸳鸯浴,漫游,胸推,口活,爱爱', '27岁，凤翔人，皮肤白皙，身材娇小，体态匀称，染黄发，化妆有点浓，可能是她怕遇到熟人，认不出本来面目，但应该不丑，抽烟，但身上没烟味，不太热情，偏冷淡，总体来说有点应付，禁忌有点多，不让摸B，不让亲嘴，不让亲脸，甚至不喜欢被摸脸，可能是怕妆被破坏了，可以摸.奶.，奶偏小，B不是太黑，比洗浴城一天接7-8个那些要好很多', 1, 5, 9, 1, 2, '3', '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/5dea15eda8ff1.jpg\"]', 0, ''),
(7223, '170大长腿', 22, 30, '500', 510000, 510100, '1170889623', NULL, NULL, '鸳鸯浴,漫游,胸推,口活,爱爱', '上周约的一个妹子，也是朋友介绍。叫朵朵，颜值属于可爱那种，主要是腿长。喜欢腿控的可以去哦。服务很温柔。还有个闺蜜，双飞的也可以，只要你没问题～', 1, 5, 4, 0, 2, '3', '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/5dea16a3447a1.jpg\"]', 0, ''),
(7225, '一短发妹子', 25, 30, '600', 310000, 310100, '2138373960', 'k1586981445', NULL, '鸳鸯浴,漫游,胸推,口活,爱爱', '妹子胸没那么大但也有b吧，长的跟照片差不了太多还是挺耐看的，跟妹子一起洗澡了边洗边口爽死了，我跟她说你是不是还有个小姐妹也做她惊了一下，问我咋知道的（我上过我不知道哈哈）。然后就是床上热火朝天的ml，讲道理这个要更紧一点，下次有机会约他们姐妹俩双飞试试肯定爽死了！', 2, 5, 6, 1, 2, '3', '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/5dea17899d130.jpg\", \"/upload/article/5dea1789c96bd.jpg\"]', 0, ''),
(7228, '熟女爽翻天', 38, 30, '300', 110000, 110100, NULL, '18301352241', NULL, '鸳鸯浴,漫游,胸推,口活,爱爱', '口 漫游 做 200\r\n口 漫游 做 深喉 69 毒龙 口爆或做 300\r\n夜：11点到8点，3次800（口 漫游 做）\r\n39岁 身高170体重125 东北人 胸围C\r\n崇文门新世界附近', 3, 5, 22, 4, 2, '3', '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"images/202009/8907df595e883fbddd4169b50f05f3ff.jpg\", \"images/202009/8bb03790769b7003326cdf60f91d8e4a.jpg\", \"images/202009/8f394baf611551f493fda63599f78498.jpg\"]', 0, ''),
(7230, '丰南一楼凤服务很好值得一去', 40, 30, '100', 130000, 130200, NULL, 'lixiaoli36727253', NULL, '鸳鸯浴,漫游,胸推,口活,爱爱', '最开始几年前我是通过遇见添加的，后来搜不到了，现在只能加微信。我去过很多次了，主要是便宜100一次，可以做两次就是加一百。提前通过微信联系问问有没有时间，有时间了，她给你发位置，直接去她那里。进去之后聊一会，就脱衣服，然后给你口几分钟。然后开干，可以让她在上面，什么姿势都可以玩，绝对不机车。而且特别爱喷，很爽的。尤其是她在上位，最容易喷了。我去了好多次，而且三四年了。就是她老换地方，一个月基本换一个地方。直接加微信，加不上联系我，我找她。', 1, 5, 12, 2, 2, '3', '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/5dea3e56938a2.jpg\"]', 0, ''),
