(7248, '年底总结之 天河小爱', 22, 30, '500', 440000, 440100, '', '', '', '鸳鸯浴,漫游,胸推,口活,爱爱', '小米那里出来先解决中午饭，补充好体力啊，然后直接到楼下联系。说我来早了要稍等下，擦，就是生意好没办法。小爱很职业，专门的工作室应该不会住在这。还有个女孩，但一直没见过，因为另一个每次也是约得满满的，她俩总是错峰开门、洗澡。不用介绍别的了，小爱是我觉得暂时在广州最喜欢的，性价比之王', 1, 5, 0, 0, 2, '姐能干', '2020-07-21 13:51:28', '2020-08-07 04:43:44', '[\"/upload/article/5deba8c090bf7.jpg\"]', 0, ''),
(7249, '最近来一个新人妹子一个', 24, 30, '650', 120000, 120100, NULL, 'cc9978855', NULL, '鸳鸯浴,漫游,胸推,口活,爱爱', '天凉了进门先暖手，后洗澡，后面一项一项开始。身材真不错皮肤白，颜值也还可以，态度也可以不算机车，各种制服可选，秘洞算是粉嫩可以，妹子性格很温柔，不会有那种不耐烦催人的样子。', 1, 5, 10, 2, 2, '3', '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/5deba93ac55cf.jpg\"]', 0, ''),
(7252, '姑苏区漂亮妹子', 24, 30, '600', 320000, 320500, '2593537607', NULL, NULL, '鸳鸯浴,漫游,胸推,口活,爱爱', '提前预约一下，开车到公寓，上楼进门是几个妹子合租的，选了那个冰冰，摸摸屁股，付钱。\r\n\r\n洗个澡开始服务，冰冰的奶子不错，人张的也还行。剩下差不多的。', 1, 5, 55, 5, 1, '8', '2020-07-21 13:51:28', '2020-07-21 13:51:28', '[\"/upload/article/5dee59f22db9d.jpg\"]', 0, NULL),
(7253, '一个模特妹子', 23, 30, '600', 510000, 510100, '3441377706', NULL, NULL, '全套', '周末去了趟成都，找了朋友介绍的一个美女。据说是做模特的，遥控到达地方一看，我去，这身材，大概170多，这胸是真的大。上去就舔了一下，舒服～开始洗澡，妹子给用口按摩。到了床上，雨衣一带，提枪上马～', 1, 1, 5, 1, 2, '3', '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/5dee5a7938812.jpg\"]', 0, ''),
