(7259, '琳琳回归还有童颜巨乳倩倩相伴', 26, 30, '600', 110000, 110100, NULL, '2794482116', NULL, '鸳鸯浴,漫游,胸推,口活,爱爱', '琳琳大家不陌生，之前也有其他ly发帖，160/86/c 服务专业，娇小玲珑，抱着操最舒服了，性价比极高，推荐800的服务。倩倩刚下水不久，年方20，160/105胸超级大，目测在D到E之间。\n\n之前我给我哥们发去了张素颜照，早起还没洗脸的那种，哥们评价是清纯，青涩，清秀，以为是我新把的妹子', 0, 0, 14, 0, 1, NULL, '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/5df0c38fe0433.jpg\"]', 0, ''),
