(7266, '双飞切换可不换套 带SM道具和三通', 30, 30, '1000', 110000, 110100, NULL, '15045541077 暗语:涛哥介绍的', NULL, '鸳鸯浴,漫游,胸推,口活,爱爱', '这个凤楼算是我的老熟人，经常去光顾的，她们警察有2-4个MM在一起住着，都是同行都能做，看上谁都能服务。前阵子出差，接到她给我发微信，说来了两个姐妹，一对可双飞的女同，诱惑得我不行不行的了，LZ在外地呢，恨不得马上回北京。6号终于回来了，朋友约上出去吃饭，喝了点小酒，感觉实在忍不住了。告别朋友，打车前往，地址我早熟悉了。一路上策划着双飞怎么干的事。进屋后两个MZ已经穿好情趣战衣，给我放好热水，带我去洗澡。。。洗澡过程不表。', 2, 5, 2, 1, 2, '3', '2020-07-21 13:51:28', '2020-07-21 13:51:28', '[\"/upload/article/5df0c6346765b.jpg\", \"/upload/article/5df0c634a8950.jpg\"]', 0, ''),
