(7297, '江南西', 26, 30, '江南西', 440000, 440100, NULL, 'y13544564952', NULL, '鸳鸯浴,漫游,胸推,口活,爱爱', '在小区，比较安全，我刚开始过去的时候，小姐姐担心出事，叫我不要走电梯，电梯有监控。见了小姐姐，感觉还可以，先洗澡，然后口交，做的过程还会放小电影，做完之后按摩，然后洗澡，不催人，挺好的。', 0, 0, 1, 0, 1, NULL, '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/5df35bb490f2f.jpg\"]', 0, ''),
