(7367, '兼职大奶小雨', 34, 30, '300', 320000, 321100, '1033659289', '15605287788', NULL, '漫游,胸推,口活,爱爱', '本人小雨，29岁，丰满型熟女一枚(E罩杯，不喜勿扰)! 300一次，漫游，深喉，69,做(可口爆，颜射)\r\n包夜800，次数不限(晚上十点到早上八点)!下午晚上都有空，可以提前一-小时预约!\r\n可以到我租的房子，景天花园!\r\n(上门仅限镇江市区+50路费)\r\n上课时间不定时，加人等', 4, 4, 38, 5, 1, '3', '2020-07-21 13:51:28', '2020-07-21 13:51:28', '[\"images/202009/f9852dd30ff88ae26b6ea67ad1ada879.jpg\", \"images/202009/a73cc33a369cdbb7067fab68c1f6212b.jpg\", \"images/202009/455525fa21cb28064c7bb7c410a83293.jpg\", \"images/202010/8e7231359664526067736114554905df.jpg\"]', 0, NULL),
(7370, '荔湾 炮架粉果果', 23, 30, '600', 440000, 440100, NULL, 'guoguo3504809660', NULL, '鸳鸯浴,漫游,胸推,口活,爱爱', '波波大的34C，很大，很圆，很挺，皮肤中等，洗澡的时候有互动，咪咪推你，咪咪很有弹性，很少有妹子的咪咪那么圆滑的了。在房间开始服务，上床各种舔，漫游，该有的都有，有点性感又风骚。在回头含住弟弟，会带节奏，一快一慢。摸到果果下面都水汪汪了。还是这个咪咪摸起来最带感。最爽快是，给波推的感觉，肉感摩擦。这个很带感觉。咪咪的确很大，双手我都抓不完。戴帽子做的时候感觉也不错，', 0, 0, 12, 0, 1, NULL, '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/5df75adcd2020.jpg\", \"/upload/article/5df75adcd234b.jpg\"]', 0, ''),
(7372, '00年的萌妹 最近剃的白虎', 19, 30, '1000p', 310000, 310100, NULL, NULL, NULL, '很嫩,不太会', '妹子本来只是卖私房图的 不好约 买一套私房照才愿意闲聊 软磨硬泡了一个礼拜才肯出来的 很嫩 三点粉 下面剃的白虎 很紧 不是特别会 想要服务系的老哥就别去了 老哥们真心想约就好好聊 妹子不让外传她的照片 就不发了 不过的确嫩', 1, 2, 1, 0, 2, '3', '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/5f3e326869a7abebbd1d705d060c5ef0.jpeg\"]', 0, ''),
