(7407, '东营年纪不大的小太妹', 26, 30, '500', 370000, 370500, NULL, 'li0815330', NULL, '鸳鸯浴,漫游,胸推,口活,爱爱', '一直想约个年轻的妹子，要到这个妹子的联系方式，看照片比较清纯，说是个学生，见到本人却是十足的社会小太妹，估计是学生也是常年不去的那种。年纪确实比较小，很紧，就是皮肤有点黑。她租住的地方不太好，最好是带宾馆，服务整体中规中矩，啥也不会，就是个嫩的小太妹，想尝鲜的狼友可以试试。', 1, 5, 8, 1, 2, '3', '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/5df9f16fd6093.jpg\"]', 0, ''),
(7408, '王兰庄年轻高挑妹子', 26, 30, '800', 120000, 120100, NULL, 'dandan888dan666', NULL, '鸳鸯浴,漫游,胸推,口活,爱爱', '狼友介绍，加了微信许久才通过。微信有照片，看着年轻比较嫩。约好时间过去，遥控上楼，门口等着。屋内较为干净，估计平时不住。换鞋，简单洗洗。躺好，妹子脱衣，里面直接情趣内衣，看着身材较为高挑。漫游，口活非常好，差点射了。戴套换了几个姿势干，后来无套直接口爆。\r\n事了拂身去。', 1, 5, 7, 4, 2, '3', '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/5df9f21602ab0.jpg\"]', 0, ''),
(7409, '静安MZ惠惠验证小结', 26, 30, '700', 310000, 310100, '1135126207', NULL, NULL, '鸳鸯浴,漫游,胸推,口活,爱爱', '正好单位调休，来大融城陪朋友吃饭，准备顺道剪个头发，之前加了这个妹子，知道这个妹子就在附近，喝了两瓶啤酒，心痒难耐，于是打开炮Q，遂询问有没有空，妹子很快就回复了，说半小时后可以约，想想理个发也差不多，跟妹子约好时间，准备出击', 1, 5, 14, 1, 1, '3', '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/5df9f2d1c3a26.jpg\"]', 0, NULL),
(7410, '炮打福建老妹小JOJO', 27, 30, '700', 310000, 310100, '1782580661', '15000124749', '15000124749', '鸳鸯浴,漫游,胸推,口活,爱爱', '：出差上海，闲的蛋疼，想整一炮，对比几家选择JOJO，主要是照片漂亮，见着真人差别不大，胸大（隆的）、腰也细、屁股一般吧，活还行，花5分钟洗、15分钟前胸后背包括KB/DL，完了开始男上女下，干了一会侧方位、后入式，姑娘奶头敏感，弄几下脸就范红晕，嚷嚷让你使劲捅她，劲小还不行，就让你使劲用力啥的，拍你屁股掐你屁股各种来，这谁顶的住，几下就交代了，出了一身汗，射完舒服了，躺了会抽根烟，再一冲，完事！我这几天在上海这模块尽被忽悠，不是照片不对人就是太虚了，价格不对人，没法弄。行就这么吧，下回再聊。', 1, 5, 22, 3, 1, '3', '2020-07-21 13:51:28', '2020-07-21 13:51:28', '[\"/upload/article/5df9f326a8383.jpg\"]', 0, ''),
