(7482, '天津体验高端极品模特', 25, 30, '3000', 120000, 120100, '819056270', NULL, '18600775831', 'v鸳鸯浴,漫游,胸推,口活,爱爱', '，没等多久妹妹就到了，一眼就人出来了和照片基本上没什么区别穿的包臀短裙黑丝袜高跟鞋，很性感，很漂亮，身材特别完美，净身高估计有172，叫她去电梯口等，我自然就去开房间啦。上去后先把钱付了，然后迫不及待跟妹妹一起洗澡，本来没出门也不用洗澡的但是何乐而不为呢？胸大屁股大，皮肤细腻 很白，抓起来很爽。', 1, 5, 18, 2, 1, '3', '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/5dfd8ef83e3b4.jpg\"]', 0, NULL),
