(7498, '回龙观一条街', 26, 30, '600-1300', 110000, 110100, NULL, NULL, NULL, '手推,胸推,口活,大活', 'Spa店，里面有一系列服务，包括手推、胸推、口活、大活，价钱从400-1300。\r\n技师有年轻的，年纪大的，大概25-35,。\r\n一般直接到店里，前台会安排技师，你一个个挑，技师多的时候有八九个，总有一款适合你；选好技师后，选服务，也可以先做个简单的，有感觉再价钱。服务流程：一般先洗个澡，技师帮你按摩、指划、鼻息、口活、大活，过后会聊一下天，下次再去嘛。\r\n我的个人体验：我比较专一，一般过去都只找年轻的小姐姐的，同龄人有感觉好嘛！当然不排除大胸白腿大姐姐的，毕竟，有胸器不敢不上吗。到店里后，一般跟前台大姐姐打声招呼，然后找之前小姐姐，到房间后，我一般会洗个澡，舒服一点；小姐姐一般都会穿着裙子进来，大白腿、高登鞋。然后一如既往的抱一下、从后面透过小短裙顶着小妹妹的大腿根一起摇啊摇、摇到木头床。在床上，小姐姐穿着小短裙露着大白腿、跪着指划、抚摸着小弟弟、自然我也会在这个时候安慰一下她的小妹妹的，等到下面湿润后、小姐姐卷起短裙、给我戴上套套、直接做在小弟弟上，一面狂骑一面摸着自己的胸。不过这时候我都抽身起来，直接把她压倒到床头、一段操、顶着床头插她小妹妹。听着她呻吟、看着她那欠操的表情，自然这时候不能太专注，尼玛的，之前就是一口气干到底，射了。等到差不多的时候，就换动作，保持一个动作用易射，最喜欢后进了，雪白的屁股、从后面抱住胸、一段慢插、插一下停一下、再使劲插一下，感受一下小妹妹收紧的感觉，到差不多高潮的时候，使劲抓着她的肩，看着小蛮腰，狂操一波，可怜我千千万万的子孙啊。', 2, 4, 1, 1, 2, '3', '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/35797a409bc9d24a4a21770756636b8a.jpg\", \"/upload/article/fea73784928bf4bd3b39f594c9f69b33.jpg\"]', 0, ''),
