(7520, '张家港站街', 26, 30, '400', 110000, 110100, '337549026  暗号品茶', NULL, NULL, '鸳鸯浴,漫游,胸推,口活,爱爱', '第一次去是开车抵达了指定小区，遥控上楼（妹子比较谨慎，在遥控过程中，发了楼层和门号接着就撤回了，我进门提到此事，她说第一次客人还是要谨慎一些，大家都安全，这一做法值得点赞）。妹子住的是租住的住宅小区，当时去的时候有3个妹子，只有一个常驻，其他的2个都是她以前的朋友，属于串场短暂停留。当时一看3个妹子质量都比较上等，年轻而且相貌不错', 2, 5, 1, 0, 2, '姐能干', '2020-07-21 13:51:28', '2020-08-07 05:06:31', '[\"/upload/article/5e014d033f65c.jpg\", \"/upload/article/5e014d037600f.jpg\"]', 0, ''),
