(7528, '传说中的撞脸AV女优', 25, 30, '500', 320000, 320100, NULL, 'ttxiangshang16', NULL, '鸳鸯浴,漫游,胸推,口活,爱爱', '据说神似里美尤利娅，作为资深老狼从小泉彩时代就看过来的自然不能放过，好容易约上了时间，遥控上楼，真人蛮漂亮的，大灯诱人，不过说老实话跟里美也不是那么像，不过话说里美自己都是整的。鸳鸯浴后口活、女上、后入缴枪付钱不表。总的来说颜值身材服务均还不错。值得一试。', 1, 5, 10, 1, 2, '3', '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/5e0153cc83054.jpg\"]', 0, ''),
(7530, '范湖性价比极高的熟女', 40, 30, '范湖性价比极高的熟女', 420000, 420100, NULL, '15527292056', NULL, '鸳鸯浴,漫游,胸推,口活,爱爱', '年龄稍大，不是很紧。个子小，熊小。不过保养的还不错，应该是整容了。去过两次，该有的服务都有，主要是便宜', 0, 0, 34, 0, 1, NULL, '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/5e0154fc67fab.jpg\"]', 0, ''),
(7532, '烟台福山区洗浴中心', 25, 30, '300～900', 370000, 370600, NULL, NULL, NULL, '双飞,胸推', '烟台福山区有一家洗浴，楼下是澡堂，楼上是包间，经营挺多年了，每次都是洗完澡上楼上包间叫人来。以前可以过夜，现在好像只能kq，加个看服务项目，反正js是不少200～1000不等', 1, 2, 4, 2, 2, '3', '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/03b6320c474c718d42702e5a4bef5ca2.jpg\"]', 0, ''),
(7533, '这个批日得安逸', 23, 30, '600', 510000, 510100, NULL, 'dan1395613167 暗号;六六六推荐', NULL, '鸳鸯浴,漫游,胸推,口活,爱爱', '细节就不描述了写不来小黄文。声音和长相都是我喜欢的类型，热情，温软，一口四川批话让我忍不住和她对着皮，如果你不想批想埋头苦干的话，她也会配合你浪啊叫啊之类的，口的过程中也很舒服，最后戴套套开始日批批，总体还是批得挺开心的', 0, 0, 26, 2, 1, NULL, '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/5e01575e3276a.jpg\"]', 0, ''),
(7536, '绝佳体验新天地小琪', 24, 30, '800', 310000, 310100, NULL, NULL, NULL, '鸳鸯浴,漫游,胸推,口活,爱爱', '这质量在上海来说已经很良心的价格了，如放在几年前的场子，1500以上，现在外卖也属于中等偏上了，服务确实比较简单，不过我这个人只要颜值够了，服务无所谓，长的一般的才让她做服务，腿那个细啊，下面很紧，容易出水，我竟然10多分钟就出货了，叫声不做作，妹子1月10号回家，年后什么时候回来不确实，要找的抓紧了', 2, 5, 0, 0, 2, '姐能干', '2020-07-21 13:51:28', '2020-08-07 05:05:59', '[\"/upload/article/5e015d2f9a5e4.jpg\", \"/upload/article/5e015d2fd272e.jpg\"]', 0, ''),
