(7541, '高颜值气质美少女体验一日两炮调教啪啪', 23, 30, '700', 110000, 110100, '3201348710', NULL, NULL, '鸳鸯浴,漫游,胸推,口活,爱爱', '之前就有这妹妹QQ，一直没机会验证包括她在北京的时候也错过了。这几天天气不错就一脚油门约妹妹玩玩。过程顺利，第一眼见到妹子感觉还是年轻，那天她化的淡妆，不管是皮肤还是身材都挺像那么回事的，摸胸的时候发觉很挺，口活也不错，挺听话，让干啥就干啥，整得我五六秒就一柱擎天了。后面的事就大同小异啦，需要说的是本狼一直健身，这次试着站着一手抱着妞， 一手扣，玩了三四个姿势把妞给高潮了，两个脸蛋通红。', 1, 5, 4, 2, 2, '3', '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/5e02e1468013b.jpg\"]', 0, ''),
