(7543, '上海兼职学生妹', 23, 30, '不同价位 自询', 310000, 310100, NULL, NULL, NULL, '妹子比较生涩,可自己开发,只要不过分都能满足', 'QQ上认识的兼职学生妹 约好时间自己开房 看上去很nice 本人与照片差别不大 妹子很粉嫩 很紧应该做的不多 比较羞涩 但是很入戏 可自己开发各种姿势', 3, 3, 5, 2, 2, '3', '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/1b66954700fb92bc3912e7cbf5c2fc5a.jpeg\", \"/upload/article/4d60300b06f62213ece775bfdd54e791.jpeg\", \"/upload/article/76861c5c966c0cd4e334706c049c883b.jpeg\"]', 0, ''),
(7544, '不错的小姐姐胸器', 25, 30, '200~800', 370000, 370600, NULL, NULL, '15053534537', '胸推,69,冰火', '朋友介绍的，去之前先电话联系好，不一定有时间，电话里说好口加做加支付诱惑，安抚徐讲好价格，遥控上楼，有两个姐妹，原来有好几个，挑一个喜欢的，讲好价格，服务很好，可以一起洗澡澡，妹子非常温柔，躺倒穿上，妹子开始给口，才发现见到爆了，真的很舒服，没有吃干，不是的来个深喉，真是罪恶了我问妹子口暴怎么算，妹子说左爱和口暴都算一次，郑州由于妹子抬头说，快射的时候抠出来算一次，听到这话真的超级感动，直接答应，问妹子，可以请罪吗。妹子说可以 刚刷完牙。换了各种姿势，很伤。服务真的很周到 很贴心 ，给米女朋友的感觉 狼友抓紧时间 不定哪天妹子就不做了......', 1, 3, 10, 3, 2, '3', '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/d78403076ae453ac7914ec9231dfac58.jpg\"]', 0, ''),
(7546, '旷工找楼凤漫游口交日批爽记', 22, 30, '1260/P', 320000, 320500, '3057137421', NULL, '13391722862', '做爱,口活', '之前一直有在联系的，那天心血来潮就联系问了，下午有空，约好时间就去了，到楼下电梯要刷卡，妹子下来接的，看起来蛮可以的，领上去看到屋里还行，手机打字说不能说话，介意就让直接走，来都来了就说无所谓，重新又给我发了遍服务内容，我选了1个小时的，自己洗了下，躺床上做了漫游口交，口的比较久，蛮敏感的了，就让戴套做了，出了后再去洗了会，本狼说休息会妹子直接上来口，这次有一会儿才硬，后入没交货，休息了会，因为临时出了的，公司手机响不停，没什么兴趣就付钱走人了', 1, 2, 1, 1, 2, '3', '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/d2efcf5f992f367f97fc7b2a34089ba9.jpg\"]', 0, ''),
(7551, '和田 00后', 20, 30, '和田 00后', 440000, 440300, NULL, 'zlq19951220', NULL, '鸳鸯浴,漫游,胸推,口活,爱爱', '一次800两次1300包夜2500群里五和那地方论坛很多老狼去过，那公寓几个女的都认识互相一起的，嫩是嫩，就是没服务，体验过一次就行了，自称是00后，感觉像是这么回事吧，但是上过那个什么晓晓和什么美妆，', 1, 5, 3, 2, 2, '8', '2020-07-21 13:51:28', '2020-07-21 13:51:28', '[\"/upload/article/5e0328e6a7e04.jpg\"]', 0, ''),
(7552, '身材高挑美女', 20, 30, '500', 110000, 110100, NULL, '15120003204', NULL, '鸳鸯浴,漫游,胸推,口活,爱爱', '单次500两次800包夜1200约了欣雨姐姐4次，一次2Q，剩下的1Q，谈谈感觉~很棒的御姐，无整容无精修。服务特别投入，但是不能 kiss，可以唇吻。胸部大，但微微下垂。开车感真实且投入，但我建议1次性价比最高，因为下面不是那种夹人疼的紧致，所以偶尔去温存一波还是不错的。挺会', 1, 5, 7, 2, 2, '3', '2020-07-21 13:51:28', '2020-07-21 13:51:28', '[\"/upload/article/5e0329cbb8a05.jpg\"]', 0, ''),
(7554, '牛王庙寻欢', 25, 30, '500', 510000, 510100, NULL, '18628091181', NULL, '鸳鸯浴,漫游,胸推,口活,爱爱', '遥控上门，见面就被小妮子的身材容貌迷倒，直接一个小拥抱，然后解衣入浴，销指在雨中轻滑背部，小唇在地下有节奏的亲浮，销魂至极。然后入室，躺在床上，享受着至尊服务，顿有帝王之感。服务之后，穿上雨衣，纵情挥洒汗水，痛快至极。', 1, 5, 7, 1, 2, '3', '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/5e032d9da4bdd.jpg\"]', 0, ''),
(7560, '体育场附近大胸妹子', 25, 30, '500', 610000, 610100, NULL, '18740400367', NULL, '鸳鸯浴,漫游,胸推,口活,爱爱', '艺名\r\n佳佳\r\n27sui 165cm 52kg 熊伟36D\r\n授课方式:自己有地方\r\n授课内容:熊推;屯推; kou活; 6-9指化;志\r\n服思哇，高度配合。不催人，真诚对\r\n待每个同学，给你初恋般的感觉\r\n课时费:5/1节，8/两节，\r\n夜/15\r\n地址:长安大街3号小区，2号线体育场.\r\nD出口\r\n注:再三敏感字眼搔扰、- -律拉黑，\r\n嘴子勿扰，谢谢', 3, 5, 67, 10, 1, '3', '2020-07-21 13:51:28', '2020-07-21 13:51:28', '[\"images/202009/b8e45e781757005f59150dbcae6e4c76.jpg\", \"images/202009/f39b8061d17fe218c67d4e90b6593329.jpg\", \"images/202009/97b6db5485cece80c3e44e2798620f5c.jpg\"]', 0, NULL),
