(7565, '广州 体验东圃小小林', 27, 30, '400', 440000, 440100, NULL, '18926278614', NULL, '鸳鸯浴,漫游,胸推,口活,爱爱', '趁着女朋友不在，去了她这里体验一下，不过我去的时间有点不对，刚好是饭点，在楼下等了会，遥控上门（位置挺好找的），该有的服务还是有的（不会写小黄文。。。），并且妹纸也挺好聊天的，因为是在论坛上知道是哪一栋哪间房了，所以说了一下，妹纸知道后还有点不高兴，说把具体的地址都发出来了。对了，她还养了两只猫呢。我还撸了一会猫呢。最后一句话就是服务不错，就是胸有点不合心意（本人胸控）。', 0, 0, 4, 0, 1, NULL, '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/5e04777c3c892.jpg\"]', 0, ''),
(7566, '越秀亲测兼职白领小姐姐，温柔似水', 24, 30, '400', 440000, 440100, '3479924866', 'slmjslmjslmj2', NULL, '鸳鸯浴,漫游,胸推,口活,爱爱', '朋友介绍的，加了微信。QQ回复不是很快，过了一会就恢复了，约了晚上过去。按妹子指导到底门口，推开房门，看到妹子28-30出头左右，少妇类型。办公室白领的气质。立即脱衣服洗澡，虽然服务不会很多，但确实很温柔。口的很舒服，很熟练，服务态度很好。身上闻起来很香，让我心旷神怡！ 和妹子水乳交融一阵，带套上阵（过程不表，也就那样）15分钟后出水，抱着妹子温软了一下才走人。', 1, 5, 5, 0, 1, '3', '2020-07-21 13:51:30', '2020-07-21 13:51:30', '[\"/upload/article/5e0479a7cfd59.jpg\"]', 0, ''),
