(7699, '黄浦区极高颜值ty店', 22, 30, '一分价钱一分货  按牌分598  798  1098  1398', 310000, 310100, NULL, 'sssxxxccc88888', '13167113316', 'ty,除了直接插入什么都能做', '我是通过朋友推的微信知道的，后来自己，加上自己带朋友陆陆续续去了四五次。体验很不错，主要是因为技师漂亮，服务好，对于那些喜欢享受ty的人来说，绝对是个好地方。\r\n地方也比较方便，离地铁站近。\r\n场地环境也不错，比较高级。', 1, 2, 9, 1, 2, '3', '2020-07-21 13:51:28', '2020-07-21 13:51:28', '[\"/upload/article/6ec64cc32b6bb03a427f84fb99e719cc.jpeg\"]', 0, ''),
