(7709, '36D大熊OO后 魔都娜妹 非常不错', 25, 30, '600', 330000, 330200, NULL, 'xiaoxuetuzi0000备用yaya18658481972', NULL, '鸳鸯浴,漫游,胸推,口活,爱爱', '见妹子移步宁波一定要尝试一下，微信约好时间，进酒店前习惯验证酒店附近照片，给房号直接进入，房间空调比较足，妹子情趣内衣很是诱人，进门脱衣闲聊几句倾慕之词但眼和手一直没闲着，妹子熊真的很大，两个手捧下，稍刻一起洗澡，妹子洗的很认真，大胸打奶胸推全身，然后重点胸夹大炮，伴着沐浴奶香真的很有感，小弟弟充血紫红，忍耐不住冲洗移步战床，大战三百回合交钱走人，妹子非常配合，骑马摇胸很卖力，非常不错的体验', 1, 5, 5, 0, 2, '3', '2020-07-21 13:51:31', '2020-07-21 13:51:31', '[\"/upload/article/5e10a08d10d39.jpg\"]', 0, ''),
