(7714, '洛阳市涧西区175丰满熟女', 36, 30, '300一次 500包夜3次 可以议价', 410000, 410300, '783983143', '18538835810', '18538835810', '口活,dp', '熟女，身材比较健硕，喜欢的可以去尝试一下，网上聊的熟女，175的个头，120斤，咪咪很大，屁股很圆。QQ空间里有照片。一开始要价一次300包夜500.后来我砍价到包夜400射3次。包夜是从晚上11点开始，我去开了个标间，然后告诉她了房间号，在晚上10点45左右给我打电话，说过来了。进房间后感觉比照片上的皮肤要好点，身材的确比较健壮。然后一起去洗了个澡，话比较多，也不认生，洗完后出来看了会电视，看电视期间狂摸她，然后她受不了说开始吧，开干。先是KJ，技术不错，没有齿感。我喜欢找熟女就是因为这个，放得开，技术好。然后在做的时候看这个身材我放弃了女上男下式，直接老汉推车和背入式，BB不是很紧，还凑合。晚上射了两炮。早上起来后又来了一次，让她在半梦半醒中给我KJ起来开搞。技术和长相都差不多，可以尝试一下。身材比较健硕，身体不好的要慎重哦', 1, 2, 16, 4, 2, '3', '2020-07-21 13:51:28', '2020-07-21 13:51:28', '[\"/upload/article/0a1d5bf282a3e0ff417cd146a8e55958.jpg\"]', 0, ''),
