(7783, '徐州云龙万达spa特爽记！', 26, 30, NULL, 320000, 320300, NULL, NULL, '17768286977 （店里的电话）', 'spa,推油,按摩,飞机,kh,dh', '大家应该都知道最新徐州yd的厉害啊，凯撒车水马龙这些洗浴全都关门了，整个徐州都找不到能有大活的会所了，除了找兼职的了，但兼职的一般都不能随叫随到，xl晚上寂寞，找兼职的少妇，老公在家不方便，无奈只能去按摩店找找机会了，在美团上搜的，spa的店很多，随便找了一家，进了门常规介绍一下，xl小声问有大活吗？前台的老板摇了摇头，笑道，啥时候了还大活，没有了，徐州没有有大活的店了。\r\n没办法，无奈啊，来了就按摩一下吧，进了屋子里，粉色的小床很诱惑啊，一会来了个技师，穿着超短裙，很诱惑，我就让她进来了，常规介绍了一下，398按摩，498诱惑按摩，598贴身按摩，698含着果冻给全身按一下，我小声问给飞机吗？技师摇了摇头。\r\n没有飞机我干毛啊，邪火都邪不了，就选了个398的按摩。\r\n技师很老实的按摩，按了一会后，我的手和腿总是有意无意的碰她，她也没反抗，我觉得有戏啊，小声的说，我给你转200块钱，你给我看kh吧？\r\n技师有些挣扎，我说没事，我私下转给你，她犹豫了一下就同意了，转了钱，她就开始诱惑起来了，用小手伸到我的裤子，戏弄了起来，我雄起之后，她就趴下kh了。\r\n我的手自己也不老实，一手mn，一手mb，几下就给她m湿了，水挺多的，我又悄悄的说，再加一百，让我插几下过过瘾。\r\n她犹豫一下就同意了，还说就插几下，不能多插。\r\n她给我穿上雨衣，我就进去了，很紧，是真的紧，至于插几下肯定不可能的，老子都进去了还能出来。\r\n干了20分钟才交货，加了qq，以后就私下干了，哈哈。', 1, 6, 42, 14, 2, '3', '2020-07-21 13:51:31', '2020-07-21 13:51:31', '[\"/upload/article/cca401acd6f454b82173027d49236472.png\"]', 0, ''),
