(7849, '城关区极品妹子', 25, 30, '500p 800pp', 440000, 440100, '2838111334', NULL, NULL, '69,口活,丝袜', '（妹子之前的qq号被封了，这是新号）这个妹妹年龄25岁，是我之前从朋友那里搞到的，这是第三次去她那里了，妹子挺温柔的，也很有礼貌。重点是年轻，身材好，皮肤白。应该有经常健身，乳房摸上去很有弹性，这是重点，真的很有弹性。我问过妹子是不是假的，妹子说纯天然的。手感真的很好。乳头也是粉色，小穴粉色 ，很紧的那种。应该时间不长。而且口活也不错。妹子之前一直在银川，来兰州时间不长，据说过段时间就回银川了，我问他怎么不待兰州，他说兰州没人知道她，自己又不会宣传。没客户。所以想回银川。然后我说 我帮你发个帖试试吧。行的话就待在兰州，因为我觉得这妹子确实不错。兰州的朋友们可以去试试。如果觉得可以，大家帮宣传下，这么好的资源真的不多了。这个价位绝对物有所值。', 1, 3, 2, 1, 2, '3', '2020-07-21 13:51:28', '2020-07-21 13:51:28', '[\"/upload/article/9422763dc0431fa8f76f45585f2779e3.jpeg\"]', 0, ''),
