(7851, '95后楼凤媚媚口爱双绝技惊四座', 28, 30, '1020/P', 120000, 120100, 'QQ1811422846', NULL, NULL, '做爱,口活', '因为现在自己一个人住，近日精虫上脑，小狼是新手，总共出去联系过两次，这个加了好友半个多月了，天天刷朋友圈感觉没问题，头一天晚上联系了这个妹子，第二天休息，一大早8点多就出门，到了门口之后，遥控上楼，说实话，见到本人确实有点小惊喜，长相不算太出色，但身材真是棒，小狼比较嗨年轻，就喜欢漂亮身材好，进房间之后妹子帮洗澡，有一次性浴巾还是比较满意的，洗完澡躺床上，开始服务，舔身上，口暴，小狼色急，没一会忍不住直接戴套开干，妹子下面还是蛮紧的，结果一时没把持住，丢人了，最后匆匆忙忙帮忙洗澡，溜了，泄的有点快，尴尬，妹子服务很好，说话很温柔，不机车，不催人，有要求直接提，但是能不能成功就看个人本事了', 0, 0, 18, 2, 1, NULL, '2020-07-21 13:51:31', '2020-07-21 13:51:31', '[\"/upload/article/5bcbf1b0c4c91dc00b09bac78379391f.jpg\", \"/upload/article/842abe3178c60c744c4505d66c25b286.jpg\"]', 0, ''),
(7852, '少妇吸精奶子大，屁股肥白后入爽', 28, 30, '1388/P', 120000, 120100, 'QQ3593243342', NULL, NULL, '做爱,口活', '在论坛上看到这个楼凤好久了，感觉不错，正好本人也是胸控，于是就前去爽一爽，在qq上约好了时间，坐地铁出发，遥控上楼，楼凤姐姐开门，发现装修很色，就是那种暧昧的灯光，姐姐的胸确实挺大的，也很软，绝对真凶，首先去洗澡，然后开始服务，服务就是kj ml，服务态度很好，会问爽不爽，kj完后就开始戴套干了，姐姐会配合叫，虽然有点假，可能是太久没做了，出货比较快，姐姐会用嘴吸一吸，还是挺不错的', 0, 0, 6, 1, 1, NULL, '2020-07-21 13:51:31', '2020-07-21 13:51:31', '[\"/upload/article/24b49ae11c376613e2e5a517cc79601f.jpg\", \"/upload/article/66ab33cb490850acb3079ab133146dda.jpg\"]', 0, ''),
