(7877, '中秋假期连续验证小熙和唐心', 25, 30, '700', 110000, 110100, NULL, NULL, '电话：13370171419，暗号：苹果', '助浴,漫游,过水,口痧,胸推,臀推,独龙,kh,大活', '最近一个来月，把多余精力都用在了追“港剧”，每天晚上对着屏幕气愤填膺，但又无能为力，导致也没心情出鸡。好在是这部“烂剧”基本都是一个模式，追了一个来月也追烦了。打算趁着假期出出鸡改善改善生活，于是有了下面的经历。这妞以前约过，但种种原因没验证上。所以选择她作为本次出鸡的首选。过程简略。妹子山西人，目测约24、5岁，身高目测约1米63上下。胸围B+或者C。长得还不错，大眼睛，双眼皮。比较腼腆，举个例子：妹子始终不敢跟对对视，尤其是干她时不看我，问她为何如此？回答：还不熟悉等等的，挺有意思。服务项目不少，正反面，漫游，过水，胸、臀推，DL，口、做等等一样不少，服务还算认真，但技术对我来说一般，中规中矩。值得一提的是，这妞可以接吻甚至舌吻，对我个人来说，这点很重要。\r\n小熙： 妹子东北人，性格较为活泼。目测25、6岁，身高1米65上下。胸围C或C+。长相还可以，本人比照片胖一圈，但算不上胖妞，正常人吧。服务项目同样也很多，正反面，漫游，过水，胸、臀推，DL，口、做等等都有，技术还不错，比唐心高明不少，看的出来以前受过专业培训。不排斥接吻。\r\n1、服务技术：小熙更为纯属老练。比唐心高不止一个档次。\r\n2、外形上：尺有所长寸有所短，这点看个人喜好。\r\n3、态度：都不错，一个腼腆一个活泼。', 2, 9, 4, 1, 2, '3', '2020-07-21 13:51:31', '2020-07-21 13:51:31', '[\"/upload/article/34ce2c38e42407b32d142e93fc3ae972.png\", \"/upload/article/d8ba9831461cb3c1f919711a8c821e28.png\"]', 0, ''),
