(7899, '先吹硬后开干，这个小婊砸果然骚', 23, 30, '1400/p', 120000, 120100, '2507140165', NULL, NULL, '做爱,口活', '经朋友介绍，他没去过，今天闲来无事一看离我挺近看照片觉得挺瘦感觉没啥胸，于是约了从市区走过去，遥控上楼正常流程先给钱再洗澡，对着流程很不爽，也不是不给钱怕跑了估计，洗完澡后直接上下其手，哎哟很意外的是奶子还可以，一只手能抓着，并不是看照片中的那么小，过程先吹硬了带小雨衣开干，感觉一般就搞了一次，泻火的可以去', 2, 2, 4, 1, 2, '3', '2020-07-21 13:51:31', '2020-07-21 13:51:31', '[\"/upload/article/4b95e063d40d5f572d83c9f22c91ac9e.jpg\", \"/upload/article/842383d5bc5bd04b3c7ba9f198a36be8.jpg\"]', 0, ''),
