(7955, '人生中干过的第二个西安妹子', 20, 30, '500', 620000, 620100, NULL, NULL, NULL, 'kh,dp,共浴,69,独龙,aiai', '说实话真的不想码字的，贼鸡儿麻烦。但是呢，这个妹子是一个资历很老的朋友推荐给我的。我本来心想:估计也就那样吧。\r\n\r\n不过我还是抱着试一试的心态去找了这个名叫雪公主的妹子，真的，说实话，第一眼见到她的时候，我就觉得她很眼熟，和我第一次出来pc找的那个西安姐姐那样，身材娇小，然而白嫩的胸脯和诱人的双腿却让人移不开视线，一边想好好疼她又想好好去蹂躏她，让她在自己胯下娇喘。可能真的是物是人非吧，看着她总是想到本狼第一次做的时候的那个西安女孩，\r\n一样的黑色长发，\r\n差不多的身材，差不多的奶，\r\n干着差不多的活儿，面对差不多的男人，\r\n她们差不多的漂亮，追逐差不多的生活，\r\n差不多的妆， 差不多的靓……\r\n\r\n我差不多的日，差不多的zs\r\noo又xx,插着差不多的b\r\n最后上她差不多的把生命给送上\r\n\r\n而现在这位姑娘，这里我要分享\r\n\r\n最后，大家不要对她太暴力，这个妹子我做的时候真的很有第一次的感觉……请大家轻一点好不好', 2, 6, 3, 0, 2, '3', '2020-07-21 13:51:31', '2020-07-21 13:51:31', '[\"/upload/article/cd0f0282298e8f59c71b666d00ec4989.jpeg\", \"/upload/article/f9d2f249fd1178963706f4be54db8ebd.jpeg\"]', 0, ''),
(7957, '清纯可爱兼职学生', 19, 30, '300两个小时 600包夜', 340000, 341300, '714950146', '没有', '没留', '口活,吞精,全身漫游,插比', '朋友介绍的，还在上学，因为自己想买的东西家里不给，所以就出来偶尔接单，加 qq聊的，一开始还有些不好意思，见面后先收钱，不然不做。给钱后就可以抱着了，胸不算小，摸着很舒服，属于特别嫩的那种。bb水也多，应该做爱次数不多，看着蛮嫩的，插进去的时候，很紧。她不好意思叫，但是后面放开了也就显得很淫荡了。真是表面清纯，内心淫荡的妹子。哈哈 只有做了才知道', 3, 4, 18, 4, 2, '3', '2020-07-21 13:51:28', '2020-07-21 13:51:28', '[\"/upload/article/7b1177eef7f2a4e58874f3fbf780d612.jpeg\", \"/upload/article/875d7a9a68925ec18deac21b2f771266.jpeg\", \"/upload/article/a0206251552cd59d7348f99c5a8daa11.jpeg\"]', 0, ''),
