(8008, '来西安出差体验的兼职小妹', 33, 30, '400', 610000, 610100, NULL, NULL, '136 8944 4373', '过水漫游,独龙,kh,爱爱', '来西安出差，工作很累，好不容易熬到周五要放松一下，朋友给介绍了这个兼职，说是刚刚和老公离婚，带着一个孩子的少妇。于是便决定去体验。地点在昆仑小区，进院子后妹子电话里告诉楼号上楼。\r\n进去以后大概端详了一下妹子，长相还可以，穿着黑丝蕾丝情趣装，给了一次性的毛巾和香皂，进去洗澡，厕所里挂着mm刚洗完的内衣裤，小狼忍不住闻了闻。洗完以后出来，mm又帮我擦了下身体，进闺房开炮。\r\n漫游的时候，妹子从脚底一直舔到jj，再向上到耳朵，期间和小狼舌吻一番。做DL的时候差不多伸进去三四公分，就跟做前列腺保健一样。妹子kh的时候，用眼神不断挑逗，小狼实在坚持不住了，便起身开干，从床上干到地上，几番云雨之后结束。\r\n之后抱着妹子聊天，妹子说把孩子送到奶奶那去了，还抱怨说每次做完都得把避孕套之类的东西赶紧扔了，怕孩子看见了不好。\r\n随后便结账走人，妹子服务非常认真，一点不机车，推荐给大家。', 1, 4, 24, 4, 2, '3', '2020-07-21 13:51:28', '2020-07-21 13:51:28', '[\"/upload/article/7b4b75fd116ee3b629b8a4498464c231.jpeg\"]', 0, ''),
