(8102, '大学生兼职，巨爽体验', 20, 30, '700/p1200/pp1800包夜', 310000, 310100, 'q:1374540756', NULL, NULL, '妹子不喜69但会口活', '联系到妹子以后，先问了有没有吃饭，妹子说没有，于是约出来吃麻辣烫(你懂的)妹子为人很放的开，就出来一起吃饭，之后妹子带去家里，进家之后，就开始对妹子动手动脚，很子胸不大，但是很软，摸着摸着妹子说先洗澡，于是就去了浴室，妹子非常认真的帮忙洗，期间还让妹子kj了一下，出来之后妹子说不想69也就没有强求，摸了一会妹子帮忙带上雨伞就开始，妹子真的超级紧，而且叫声不做作，没多久就缴枪了，很值得一试!', 2, 1, 12, 6, 2, '3', '2020-07-21 13:51:31', '2020-07-21 13:51:31', '[\"/upload/article/084532b5d4a483c5c26c3c0c09acabcd.png\", \"/upload/article/181236e68db5634ef7523234d0b28d06.png\"]', 0, ''),
(8103, '北京四惠东约到个清纯小妹', 20, 30, '1000--1500', 500000, 500100, NULL, 'guo125m', NULL, '观音坐莲一字马爱爱口等等', '经常去她们家 属于老顾客了  那天在家闲得无聊 就跟妹妹提前预约了一下  现在妹妹们还不少 陈欣妹妹服务很不错 妹妹还很体贴 服务就一一略过了 给大家推荐一下啦', 2, 1, 4, 2, 2, '3', '2020-07-21 13:51:28', '2020-07-21 13:51:28', '[\"/upload/article/016a88d9a78b223074724598891b8bf2.png\", \"/upload/article/25c4d881ea2e47f350f37a2294d87d3a.png\"]', 0, ''),
(8104, '岱岳区区委附近兼职妹', 21, 30, '400', 520000, 520100, '3012444795', NULL, NULL, '做爱,口活各种自己谈,可以情趣内衣', '一个老哥给介绍的妹子，加了好久一直都没加上，突然有一天我qq发现有人同意加好友的提醒，回忆下才发现是这个妹子。看他空间，发现18年时候就开始做了。马上联系妹子，不过妹子好像不常在线，很少用这个qq，熬了好久终于有一天等到他在线。妹子刚开始要700，她有地方。但怕出现仙人跳，就准备开房，价格砍到400。进门看到样子还行，稍微有点肉，皮肤挺白挺滑的，妹子也比较听话，各种姿势可以跟她商量着来。', 2, 3, 18, 2, 2, '3', '2020-07-21 13:51:28', '2020-07-21 13:51:28', '[\"/upload/article/30766278480c5250791eddce30bc9ab9.jpg\", \"/upload/article/b52bfdb17a31ec4f95da377364131ba0.jpg\"]', 0, ''),
(8112, '夜约兼职小美女', 26, 30, '400', 350000, 350500, '2519863577', NULL, NULL, '鸳鸯浴,漫游,胸推,口活,爱爱', '当天有点小雨，放下雨伞，换了拖鞋，一起洗鸳鸯浴，这点记住，你不提的话，她是不帮你洗的，我是问了她要不要一起，帮我洗洗，她才一起洗的。\r\n洗完上床，然后就是亲咪咪挑逗吹JB，服务内容不多，但是挺熟练的，对于我这种喜欢吃服务的人太说服务内容太少了。舔咪咪舔蛋蛋口几下，打几下飞机就上阵了。', 1, 5, 7, 3, 2, '3', '2020-07-21 13:51:28', '2020-07-21 13:51:28', '[\"/upload/article/5e39312cb63d8.jpg\"]', 0, ''),
