(8121, '观山湖区漂亮的大波妹', 25, 30, '600', 520000, 520100, '', '', '', '鸳鸯浴,漫游,胸推,口活,爱爱', '吃完饭在家玩手机加到的，开始没在意，后来兴趣来了喊她发照片这些看了后决定过去看下，真人和照片相差不大，毕竟现在照相都用美颜了，但是真人还是漂亮的，开始蛮热情的，穿的正好是我喜欢的那种，没忍住直接抱上去了，她帮我洗的澡，在浴室就帮我口了一下，', 1, 5, 0, 0, 2, '姐能干', '2020-07-21 13:51:31', '2020-08-07 01:30:09', '[\"/upload/article/5e394ea86771b.jpg\"]', 0, ''),
(8122, '南山 清纯 新入行', 26, 30, '600', 440000, 440300, NULL, '13728813030', NULL, '基本都有,自己谈', '有单间租房，服务好，可以鸳鸯浴，胸推，调情，水中萧，还有情趣制服，丝袜，胸大肤白', 1, 2, 3, 1, 2, '3', '2020-07-21 13:51:31', '2020-07-21 13:51:31', '[\"/upload/article/5e395cd58f7de.jpg\"]', 0, ''),
(8124, '金融城F杯mm', 26, 30, '500', 510000, 510100, '248880754', NULL, NULL, '鸳鸯浴,漫游,胸推,口活,爱爱', '遥控上楼，暖气开好了，洗澡吹了一下，说话很温柔，长得也还比较乖，主要是胸真的大，F杯，看到就像一直抓到起，而且mm脸瘦，腰也很细，不像有些坦克大胸mm。。。mm也比较会挑逗情绪。fw简单主要就是胸推，但是不着急那种，很认真。过程姿势也很配合。缴枪。应该会再回锅~', 1, 5, 3, 1, 2, '3', '2020-07-21 13:51:31', '2020-07-21 13:51:31', '[\"/upload/article/5e3a81b4cdc73.jpg\"]', 0, ''),
(8125, '立水桥不错的妹纸', 26, 30, '500', 110000, 110100, '2568163343', NULL, NULL, '鸳鸯浴,漫游,胸推,口活,爱爱', '地铁站下来以后遥控上门，身材跟态度还可以 细节大家自行体验吧', 1, 5, 3, 1, 2, '3', '2020-07-21 13:51:28', '2020-07-21 13:51:28', '[\"/upload/article/5e3a8257a0b0b.jpg\"]', 0, ''),
(8126, '健德门地铁站附近京妞小姐姐慈溪', 25, 30, '800', 110000, 110100, '2483807378', NULL, NULL, '鸳鸯浴,漫游,胸推,口活,爱爱', '体验有一段时间，感觉挺好的想分享出来，但是最近挺忙。。。也就搁浅了。前几天刚联系上，听说又换地方了，现居住蒲黄榆GOGO新时代。不废话了直接进入正题吧。\r\n\r\n一进门，感觉还是比较好的，妹妹是丰满型的，不过身材均称。还是蛮可爱的，加上我进门态度，进去就请我坐下，说大老远来辛苦了，又是给我拿饮料喝，还自卑香烟拿给我抽。', 2, 5, 1, 1, 2, '3', '2020-07-21 13:51:31', '2020-07-21 13:51:31', '[\"/upload/article/5e3a82f0199ba.jpg\", \"/upload/article/5e3a82f05dc7a.jpg\"]', 0, '');
