(8129, '西城微笑姐', 28, 30, '400', 110000, 110100, NULL, 'w13466471887', NULL, '鸳鸯浴,漫游,胸推,口活,爱爱', '1月去的，妹子很谨慎上楼前在楼上确认一个人后才给的详细地址。人照90，很高，腿控不要错过。妹子有自己的工作室，应该不接上门了。服务过程不多赘述了，该有的都有，该做的都做了，不过美中不足的是没有一次性浴巾，但这个价格也不奢求多的。妹子过年回家了，想约的狼友们提前备一下。', 0, 0, 6, 0, 1, NULL, '2020-07-21 13:51:31', '2020-07-21 13:51:31', '[\"/upload/article/5e3a84f387fd6.jpg\"]', 0, ''),
(8137, '新华城附近美女', 24, 30, '800 两次', 370000, 370900, '959904795', NULL, NULL, '口活,做爱', '跟朋友交换信息得到的。不是本地人，个子不高，一米五多吧，胸很大。在新华城附近卖衣服。聊了两天才同意约的。她在新华城有房子，聊的好可以直接去她那，不过要加钱。见面直接开始，服务不错', 3, 2, 7, 2, 2, '3', '2020-07-21 13:51:31', '2020-07-21 13:51:31', '[\"/upload/article/316668af9b0419e94a06f2f5d5ae77a2.jpg\", \"/upload/article/b98f1093e7d6cebc6aaeaf94088e3ea8.jpg\", \"/upload/article/cd2fe26cefc01be523b1d033a86940c7.jpg\"]', 0, ''),
(8138, '万达公寓兼职妹', 28, 30, '200一次，500两小时', 370000, 370900, '1677828472', NULL, NULL, '做爱,口活要加钱', '别人介绍的，在万达公寓那住，平常上班。晚上可以有时间出来做。按需服务的，200块钱只能正常啪啪啪一次，想要kj或其他的都要加钱。所以之前一定各种服务跟价格都谈好，要不紧要关头她要钱，会弄的人不爽。', 3, 2, 8, 3, 2, '3', '2020-07-21 13:51:31', '2020-07-21 13:51:31', '[\"/upload/article/1e98affb8100abe5ebbc46185020309e.jpg\", \"/upload/article/891e51d539db03d87411a69a522c29c7.jpg\", \"/upload/article/b487c9902dbcc93da8660cf83e5f0566.jpg\"]', 0, ''),
(8139, '和平区不催不机车的楼凤女梦梦', 25, 30, '1069/P', 120000, 120100, 'QQ2949803084', NULL, NULL, '做爱,口活', '这个前段时间约的，关注了很久，微信上联系的，微信上联系好了之后大概半个多小时到了住的公寓，当时她住的公寓不太好找，她出来到门口接我，我看下他当时只穿个上衣，没有穿内裤，跟着她到了屋里，看她长的皮肤很白奶子很挺，就上去开始摸妹子主动摸了我下面给我吸了起来，皮肤很光滑，摸了几下先付了水费，去洗了一下，然后开始到床上，妹子还有道具可以自己发挥，之后就是一些细节，细节大家自己去脑补，完了以后跟妹子一起聊了一会儿天，也没有催，服务态度是很不错的一个', 1, 2, 4, 1, 2, '3', '2020-07-21 13:51:31', '2020-07-21 13:51:31', '[\"/upload/article/ad164c5d799cc31074e837dd01bdf662.jpg\"]', 0, ''),
(8140, '萱然居半套爽记', 23, 30, '600', 140000, 140100, '体育路高德地图可以查到萱然居', NULL, NULL, '鸳鸯浴,漫游,胸推,口活,爱爱', '适合享受 价格偏高 去了以后主要是是spa按摩，给技师200红包小费，可以摸摸，推个油。 技师都比较漂亮', 1, 5, 5, 1, 2, '3', '2020-07-21 13:51:31', '2020-07-21 13:51:31', '[\"/upload/article/5e3bdaed6a06d.jpg\"]', 0, ''),
