(8144, '拱北农村工厂妹超级诱惑', 23, 30, '400全套', 440000, 440400, NULL, 'H528587', NULL, '做爱,口活', '妹子颜值不错，400全套可议价，身高163 ，C杯 \r\n去了可以做，可以口，可以黑丝诱惑等，其他自己商量\r\n======', 1, 2, 15, 1, 2, '3', '2020-07-21 13:51:31', '2020-07-21 13:51:31', '[\"/upload/article/1b923f07aff56a6f977d146964eb1967.jpg\"]', 0, ''),
(8146, '亲贤北街附近熟女骚货', 31, 30, '400', 140000, 140100, '1160779860', NULL, NULL, '鸳鸯浴,漫游,胸推,口活,爱爱', '朋友介绍的一个熟女，说是骚的不行，加了QQ后聊了很久，才有机会约出来。过程不表，说说感受。长相不咋样，颜控的兄弟可以忽略了。但是确实骚，主动求操，而且事先说好了让台带工具过来，狼牙按摩棒，很夸张啊。朋友告诉我她有受虐倾向，试了一下，果然不反抗还很享受的样子，后来加了点润滑油走后门也没问题，玩的很尽兴。图片是本人，还有是玩工具的时候拍的。', 1, 5, 29, 19, 2, '3', '2020-07-21 13:51:28', '2020-07-21 13:51:28', '[\"/upload/article/5e3d1b5007d67.jpg\"]', 0, ''),
(8147, '太原 太榆路性感美女楼凤', 30, 30, '600', 140000, 140100, '', '', '', '鸳鸯浴,漫游,胸推,口活,爱爱', '微信和妹子联系好后我就开车过去了，然后遥控上楼，进去妹子就穿的很性感在等你，一看到我就硬了，妹子还有很多道具配合爱爱，进去和妹子一起洗澡后，就提枪直到狂龙，妹子玩得很开放身材诱人，值得一试', 1, 5, 1, 0, 2, '姐能干', '2020-07-21 13:51:31', '2020-08-07 01:27:57', '[\"/upload/article/5e3d1f0c5e054.jpg\"]', 0, ''),
(8148, '热情服务妹子让我射了满满一打', 24, 30, '1200/P', 120000, 120100, '2082650565', NULL, NULL, '做爱,口活', '妹子看着很漂亮，一进门就硬了，先戴套干一趴后在洗澡做服务，妹子比较配合，叫声比较销魂，插了一会儿阴道还会收缩，让我射了满满一打', 1, 2, 5, 1, 2, '3', '2020-07-21 13:51:28', '2020-07-21 13:51:28', '[\"/upload/article/b188dce83853e664233b2abbac091520.jpg\"]', 0, ''),
(8150, '广安门外良家兼职做按摩，其他均可商量', 25, 30, '600全套按摩，其他看个人，聊好了可大活儿', 110000, 110100, '1506983227', NULL, '13661337607', '按摩,波推,其他自行开发', '出差认识的。小姐姐在北京做红酒生意，闲暇自己无聊兼职做上门按摩。颜值不算出众但高于平均水平，关键是一对36E的纯天然大杀器实在可遇不可求。按摩手法正常，波推和乳交是重点，真的非常非常舒服，别问我怎么知道的。\r\n\r\n小姐姐人很开朗健谈，自己有地方，上门的话可以玩丝足。如果上酒店的话要自己跟她约，白天有正职工作所以不一定回得很快。因为是兼职，所以没有特别的明码标价的项目，额外的全看个人，聊好了顺理成章推倒办事，该会的都会。其余不表', 2, 3, 6, 1, 2, '3', '2020-07-21 13:51:28', '2020-07-21 13:51:28', '[\"/upload/article/70c40fc38083082350472b0c73182d21.jpeg\", \"/upload/article/f89d9a577b32136c6e7f99abd2d7d668.jpeg\"]', 0, ''),
(8153, '普陀冰冰', 24, 30, '500pp', 310000, 310100, '1296211697', NULL, NULL, '挺全的500全套一小时2次', '隔好久了，最近开工，妹子163，偏瘦，照片和本人基本没差别，长的挺清纯的，漫游这些感觉不错，口活一般，有齿感，也没太在意就没和她说。微微呻吟的声音不做作，挺带感的，第一发没忍住很快交代了。休息的时候不会像其他人那么混会给你按摩，好了之后搞第二发，地点是妹子租的房子，挺安全的环境也不错，500块这么漂亮的搞两次真的很值', 3, 1, 4, 2, 2, '3', '2020-07-21 13:51:31', '2020-07-21 13:51:31', '[\"/upload/article/4890a1184ce61526af0e48c7305541c6.jpeg\", \"/upload/article/a2dc3785f3fae5337d58dbb5cd8bed51.jpg\", \"/upload/article/a5442baf8dc7330357b4d4e44bd7e101.jpg\"]', 0, ''),
(8156, '深圳福田热情奔放的梦瑶，真服务，浪骚', 26, 30, '600', 440000, 440300, NULL, 'xinjiongain520      备用微信：cocozx168', '深圳福田下沙附近', '鸳鸯浴,漫游,胸推,口活,爱爱', '看过她的照片，确实是形象很不错，是我的菜。再加上她的鲜嫩程度，我觉得这个价格还是很值得的。就这样联系好了，然后昨天双方都有时间，我便过去了。感觉还蛮顺利的，妹子人很踏实。见到珊珊本人，果然如我所料，她正是照片上的女孩，差别不大，这点让我很满意。妹子漂亮啊，前凸后翘的，大奶大屁股，还有一双美腿，芊细。个子有163。标准身材。留下来享受，就是看服务了。珊珊没有让我失望，开始展露她的功力，', 1, 5, 5, 2, 2, '姐能干', '2020-07-21 13:51:31', '2020-07-28 06:06:59', '[\"/upload/article/5e3d38caefb56.jpg\"]', 0, ''),
(8157, '深圳居家好服务，人也很美的妍希 ', 28, 30, '300', 440000, 440300, NULL, 'yiani1314520', '13530123634', '鸳鸯浴,漫游,胸推,口活,爱爱', '是主打居家按摩，价格300，以前是叫燕子，现在叫妍希，熟客的话，妹子也可以提供开大服务，6张一次。但是，没有服务（没有口，没有DL等等）', 0, 0, 6, 0, 1, NULL, '2020-07-21 13:51:31', '2020-07-21 13:51:31', '[\"/upload/article/5e3d39598774e.jpg\"]', 0, ''),
(8163, '厦门SM', 27, 30, '600-1500', 350000, 350200, '192448773', NULL, NULL, '做爱,69,BH', '遥控上楼 妹妹和你一起洗澡 水中萧 可以制服 胸很大先KJ有BH然后上TT可以沟通服务还不错 不机车。', 1, 3, 27, 2, 1, '3', '2020-07-21 13:51:28', '2020-07-21 13:51:28', '[\"/upload/article/6236cbb1d9af7c027e60034beeb25d05.jpg\"]', 0, NULL),
