(8176, '沈阳 浑南激情泻火', 30, 30, '200', 210000, 210100, '642389539', NULL, NULL, '鸳鸯浴,漫游,胸推,口活,爱爱', '早上醒来精虫上脑，群里加上此女，驱车前往，到楼下说有客人让等20分钟，浴火转愤怒，直接离开。无奈下午饥渴难耐再次联系，有空，火速赶到。进门环境一般，简单清洗后，马上叼上雪茄，小爷很是享受。躺在床上A面亲完，控制欲上来，猛搓鲍鱼。69下无味，春水泛滥，姐姐狂舔嘴唇 。带上雨衣大战300回合，缴枪付费，走人。下次还会光顾，过程很投入，不机车。', 1, 5, 13, 3, 2, '3', '2020-07-21 13:51:28', '2020-07-21 13:51:28', '[\"/upload/article/5e3e9115efd01.jpg\"]', 0, ''),
(8177, '大连千山路美臀少妇', 30, 30, '400', 210000, 210200, NULL, NULL, '13700087448', '基本都有,自己谈', '年龄30多一点儿，身高170，长相还不错，重点是屁股又大又圆，尤其后入的时候看着蜂腰肥臀特别有感觉，而且皮肤很滑嫩，贴在她身上特别爽，200元绝对良心价。妹子可以肛交，需要加200元，喜欢美臀和肛交的小伙伴儿不要错过。妹子每天都在，建议直接电话，微信有可能被封回不了。', 1, 2, 12, 3, 2, '3', '2020-07-21 13:51:31', '2020-07-21 13:51:31', '[\"/upload/article/5e3e93b983a75.jpg\"]', 0, ''),
(8179, '青春学生妹，服务号，身材好，漂亮', 23, 30, '400-800', 370000, 370100, NULL, NULL, NULL, '口活,69,颜射', '提前联系好，找妹妹的时间，去酒店，洗澡，先口一会，直接带上雨衣上阵，妹妹皮肤白，身子软，舒服。', 1, 3, 2, 0, 2, '3', '2020-07-21 13:51:31', '2020-07-21 13:51:31', '[\"/upload/article/76a3d917c1667f383cbe9a352343d85b.jpeg\"]', 0, ''),
(8186, '分享一个胸大屁股翘水多易高潮的小姐姐', 25, 30, '1020/P', 120000, 120100, '1813364377', NULL, NULL, '做爱,口活', '最近火大想找个姐姐泄泻火，看到这该小姐姐胸大屁股翘，到地方一看是本人，就安心开始做，先洗了一下，因为急着上本人就自己冲了一下，没有人小姐姐帮忙，上床后小姐姐先给口，看得出来小姐姐是练过的，口的很爽，本人一边摸小姐姐的胸一边享受，差不多了就戴套先来一发，小姐姐姿势很配合，叫的很好听，第一次就快速出水了，休息了一会感觉差不多了，叫小姐姐来，小姐姐依然先帮口，然后带套上，第二次世界很长，换了很多姿势，小姐姐也被搞的大汗淋漓，也高潮了，最后一期冲洗一吸，走人，非常舒服的一次体验', 1, 2, 3, 1, 2, '3', '2020-07-21 13:51:31', '2020-07-21 13:51:31', '[\"/upload/article/ec31f3f630cde97bbf6eb8ee7c871e75.jpg\"]', 0, ''),
(8189, '亲自验证明华里丰满屁股活好爽记', 22, 30, '1180/P', 120000, 120100, '1273768292', NULL, NULL, '做爱,口活', '晚上闲来无事，精虫上脑，qq搜索到妹子，于是就联系，看了妹子的动态，还不错，于是就联系上了，遥控指挥上楼，妹子可能颜值不是很高，洗好澡后，先吹，那技术真的是非常好，太爽了，她是可以kb的，可能我状态不好吧，于是就提议先来一炮，后入，非常爽，妹子那丰满的屁股实在让人陶醉，奶子也是非常的的大，手感非常好，于是百来下，射出万千子孙，十分舒坦，后来可能状态不给力，没法出第二次，有能力的狼友可以去试试，服务真的非常好，也可以自己完全不动，让妹子来服务', 1, 2, 5, 1, 1, '3', '2020-07-21 13:51:31', '2020-07-21 13:51:31', '[\"/upload/article/d2a54c9cf1d98c2d422876fb9327ce8e.jpg\"]', 0, NULL),
