(8194, '再发一个偶尔约的小妹', 23, 30, '500', 620000, 620100, '3277703867', 'wd2810538261', NULL, '制服丝袜口', '妹子还可以性价比一般口还戴套屁股挺翘的，进门坐了两分钟就开始催着洗澡，洗完换上学生服丝袜，口硬开搞，大战300回合走人一般得体验', 1, 1, 9, 1, 2, '3', '2020-07-21 13:51:31', '2020-07-21 13:51:31', '[\"/upload/article/9f46b63d75b3d09bb24e3f5f98e6746f.jpg\"]', 0, ''),
(8195, '偶尔兼职女', 27, 30, '500', 120000, 120100, '3076592554', NULL, NULL, 'KH,SW,PY,DH', '这个天津真实验证兼职女是最近搞的最新资源，妹子长得还可以，自己有工作，偶尔兼职，不经常约。我说下价格服务 单次是500 时间是一个小时两次是700 时间是90分钟服务是爱爱陪浴kh丝袜调情就这些 其他的不做 我现在上图 喜欢的自己约。态度很好，不催人，做的时候有点偷情的感觉。', 1, 4, 3, 1, 2, '3', '2020-07-21 13:51:31', '2020-07-21 13:51:31', '[\"/upload/article/600de47c5a37ecf5d7468e00611625c0.png\"]', 0, ''),
(8196, '周末CJ廊坊宾馆', 24, 30, 'D150/p K+D200/p 带走小BY800/pp', 130000, 131000, '', '', '', 'K+D', '听说廊坊回暖，闲来无事打算过去转转。说动就动，驱车1个小时，太阳落山前终于到达目的地。晚上也没打算回去，先订酒店歇歇乏，缓缓劲，毕竟马上大庆，还是等天黑在出动吧。在酒店磨蹭到晚上8点多，估摸着站街的也都出来了，乘兴走起。\r\n\r\n话说，刚走到宾馆大堂，就看到角落里坐着一个姑娘，目测身高170，体重应该不到95，年龄22、23岁，面目清秀，如果……。无奈，还是规规矩矩扫街去吧（貌似跑题了）。\r\n\r\n\r\n酒足饭饱后，先从西边胡同溜达。小姐姐们总算都出现了。貌似寺庙以北都是一些30以上的老熟（实在没兴趣），寺庙往南有岁数小点的妹妹。匆匆走了一条街，总算有几个可以瞄准的对象，心里一合计，打算在走走，看看还有没有更好的目标。顺着东边这条街往回走，一边留神脚下的土路，一边借着零星的光亮打量两侧不断推销自己的姑娘，也许是太过昏暗的缘故，总感觉数量和质量明显不成正比，居然没看到一个能提起兴趣的目标。\r\n\r\n穿过寺庙南边的过道，返回西边小路，仔细打量能让我提起兴趣的姑娘，心里盘算着到底选择哪个做今晚的目标。正盘算着，迎面走来一个，眨眼一看，基本符合我的标准。直接上前问价。答150、200、800。BL基本不在炮房里ML（总感觉没有任何安全性）。交了400定金直接带走。\r\n\r\n回到宾馆仔细打量这个姑娘，有点小失望，脸上全是小包，综合评价大打折扣。休息片刻，转过尾款后，小姑娘开始跟我说BY的内容：2P，不带K；如果带K，另加钱或是2P后让她离开（估计她还想接着去挣钱）。说实话，看了这姑娘实在没心情加钱（如要是脸），直接告诉她完事让她离开。匆匆冲洗出浴，回到床上，小姑娘在玩手机，有一搭没一搭的闲聊，趁姑娘不注意，拍了几张半身照（放收费区了）。躺了五分钟，准备开战。\r\n\r\n居然带套K，不过K的还算仔细，并没有出现两三下就完事的情况。趁着姑娘给我口，我仔细摸了摸姑娘，皮肤略显粗糙（个人意见），并不像24岁（她自己说的）女孩应该有的皮肤，RF虽然不大（B吧），但却没有软哒哒的感觉，RT很小，腰很细，PG不大。K了最多10分钟，让她躺下，借着亲她RT的时间，冷却一下高涨的欲火。到这里有几点不太满意，亲RT可以但不能大力，下面只能看不能摸（软机车），更别说伸进去；我也没在意。捣鼓了两三分钟，估摸着差不多了，果断分开她的双腿，瞄准目标，一枪到底。感觉姑娘的YD不是很长，包裹感不错，至少不松。趴在他身上，两手托着她的屁股，快速OX了几十下，突然有种不妙的征兆，赶紧停止，示意她换个zs。她只说了句别频繁换太多zs（软机车），然后侧入。心里琢磨，要是一会儿把她抱起来输出，应该感觉不错；至于hr，屁股没肉（一只手能抓一半），视觉冲击没有，选择性放弃。侧入5分钟，换女上，借着起身亲RT的机会，果断把她抱起（80来斤，很轻松），姑娘稍愣神，刚想出言制止，我连机会都没给她，直接开动。感觉快到顶峰的时候，拔出换正常zs。趴在姑娘身上，由缓至急，来回100来下，在最后一刻插入最深处……结束第一次ML。\r\n\r\n各自清理了战场，为了消磨缓解体力的时间，打了两把王者农药。估摸着体力恢复的差不多了，示意姑娘开始第二次ML。第二次明显是为ML而ML。过程无非是带套K、男上、女上、侧入、男上释放。完事后留了姑娘微信，打发她离开。\r\n\r\n总结：\r\n\r\n个人感觉附近的姑娘，西侧小路比东侧小路的年轻，但机车的占多数，\r\n800BY/pp，细算不值。要不什么也没有，直接ML。要不带K，两次以后离开。这只能算是小夜。\r\n马上国庆，狼友CJ多保重，毕竟为了ML把自己搭进去太不值。', 2, 1, 1, 0, 2, '小肥龙', '2020-07-21 13:51:31', '2020-08-14 22:13:05', '[\"/upload/article/05479a7327eb4879314970d6e06bf223.jpg\", \"/upload/article/99a47599fb6d24890fbac96f18c8ad41.jpg\"]', 0, ''),
