(8248, '家庭式SPA会所', 26, 30, '400', 410000, 411000, NULL, '18838461383', '18838461383', '爱爱', '价格398揉情放松，鼻息漫游，波涛汹涌，消\r\n魂缠绵，胸推背游，全身按摩，香吻玉足，三\r\n子区推油释放60分钟。\r\n价格498全身按摩，风情理疗，臀部漫游，指\r\n滑，鼻吸,猫扑，耳语,肾部，丝袜选择，相\r\n思红豆，臀勾故事，揉情三角州，舌尖漫游，\r\n口活口技释放60分钟。\r\n价位598技师助浴，全身按摩放松，丝足诱\r\n惑，全身缠绵，指滑蛋蛋，69玩法，地钟海,\r\n毒龙钻，全裸+深喉，假试爱爱，刺激享受，\r\n胸推胸揉，舌尖漫游，相思红豆，360度旋转\r\n口技，美腿丝滑，玉足之恋，蜻蜓点水，果东\r\n漫游，反叼风情，互动随便调情，口活口爆释\r\n放(70分钟)', 1, 1, 16, 2, 2, '8', '2020-07-21 13:51:31', '2020-07-21 13:51:31', '[\"images/202009/cf1ee90c329240ee15d24ef1793f3fbe.jpg\"]', 0, ''),
(8250, '300喷潮熟女姐姐，高性价比', 40, 30, '300', 110000, 110100, NULL, 'txy80326（暗号；童话镇介绍）', NULL, '鸳鸯浴,漫游,胸推,口活,爱爱', '是在下午憋的实在难受，翘了个班联系上这个姐姐，小狼喜欢熟女 看了姐姐的照片欲罢不能，遂驱车前往 姐姐很小心 进屋嘘寒问暖，很温暖，姐姐提出陪欲，奈何不适应 自己洗了洗 坐在沙发上抽个烟，姐姐就开始不安分了，摸我的大鸟，衣服脱下两个大白兔就跳了出来，左右开工吃了一会，姐姐开始给口，技术很好无齿感，带上雨衣出击干了三十分钟，姐姐还喷潮了，非常过瘾，射出丸万子千孙 留下水费闪身走人，体验不错 价格合适 泄火专用，喜欢熟女绝对值得一试，性价比高', 1, 5, 28, 1, 1, '3', '2020-07-21 13:51:31', '2020-07-21 13:51:31', '[\"/upload/article/5e451ace541b2.jpg\"]', 0, ''),
