(8323, '给大家发一个JT的联系方式，有小萝莉哦', 20, 30, '500', 620000, 620100, NULL, NULL, '138 9301 1243（是JT的联系方式）', '鸳鸯浴,乳交,漫游,臀推,胸推,爱爱,69', '这个JT手底下有七八个妹子，年龄都不大。小狼体验的这个刚18岁。大家直接打电话联系。', 1, 7, 12, 1, 2, '3', '2020-07-21 13:51:31', '2020-07-21 13:51:31', '[\"/upload/article/6b37f80689d4bb9bafb8651400c73c0f.jpeg\"]', 0, ''),
(8330, '体验广东妹-诗诗', 26, 30, '600', 310000, 310100, '1489979062', NULL, NULL, '鸳鸯浴,漫游,胸推,口活,爱爱', '，小弟的手也往下面游去这次居然不躲也不挡了，还把两腿撒开，真的是发情了，那必须展示一下一阳指了这么搞了几分钟，妹子说不行好多的水， 又给小弟带套，这次全力输出了，没几分钟出货了，真的可以说基本什么都玩到了，期间询问妹子能不能拍照，被拒绝了不让。以上都是小弟的真实体验，不能保证每位都能玩到这些项目，但是把妹子玩发情了应该是没问题的。妹子写是写20岁，但是估计年纪应该加个5-6.最后有一点小担心，小弟的手指插了妹子的穴之后又摸了自己的吊这个有没有问题啊？', 1, 5, 2, 1, 2, '3', '2020-07-21 13:51:31', '2020-07-21 13:51:31', '[\"/upload/article/5e4baf1bacebe.jpg\"]', 0, ''),
(8335, '分享一个邯郸、石家庄北京三地跑的妹子', 25, 30, '600', 130000, 130100, '1640066018', NULL, NULL, '鸳鸯浴,漫游,胸推,口活,爱爱', '这个妹子是邯郸的，说重点，他是邯郸的jz,只不过石家庄北京也去，估计约的也不多对，没有口活 ，之前在邯郸约过一次，年前来了次石家庄就约了下，小黄文也不会写，大概描述就是有种学校女朋友那种感觉，苗条青春系那种，服务肯定没有啥了，看个人喜好吧，经常去邯郸的可以约，或者加上等他来石家庄的时候再约，看清说明，别加上说我骗子', 1, 5, 8, 3, 2, '3', '2020-07-21 13:51:28', '2020-07-21 13:51:28', '[\"/upload/article/5e4bb34ba9580.jpg\"]', 0, ''),
(8336, '江南万达嫩妹', 22, 30, '500', 450000, 450100, '2038089207', NULL, NULL, '鸳鸯浴,漫游,胸推,口活,爱爱', '妹子白天都有公寓，想要包夜的自己开房。相对来说这个价格还是比较值的，毕竟妹子很嫩。过程就不用说了，也就洗吹做，妹子态度还可以，大长腿，皮肤好。', 1, 5, 10, 5, 2, '3', '2020-07-21 13:51:31', '2020-07-21 13:51:31', '[\"/upload/article/5e4bb3ff2f13d.jpg\"]', 0, ''),
(8338, '疫情期间还在开的可三通', 32, 30, '500', 510000, 510100, NULL, NULL, NULL, '鸳鸯浴,漫游,胸推,口活,爱爱', '疫情很多楼风都关了、精虫上脑就看到这个在开、联系好要求她穿好丝袜。进门洗澡上床简单服务第一次射在嘴里、休息片刻主动去含到我的JJ 一番挑逗后又硬了，主动坐上来，一番激战后缴枪结账走人、', 1, 5, 0, 0, 2, '3', '2020-07-21 13:51:31', '2020-07-21 13:51:31', '[\"/upload/article/5e4bb955c4413.jpg\"]', 0, ''),
(8339, '天河气质较好小良家感觉的静静', 26, 30, '400', 440000, 440100, NULL, NULL, '13609064063', '鸳鸯浴,漫游,胸推,口活,爱爱', '看了看空间的照片，感觉那个静静还是蛮不错的，但是也不知道真人真假。地铁过去，一开门就见到了本人，跟照片上差不多。人是很耐看的那种，进来就抱抱，哎呀，身上真的好光滑呀。眼睛大大的特别的漂亮，人虽然不高但是胜在身材好凹凸有致，该有肉的地方有肉，特别喜欢屁股很翘。然后一起去洗了洗澡，态度特别的好，微笑服务，基本我不用动手帮我洗干净后擦了擦上床服务，皮肤特别的光滑，身上摩擦的时候更不要说了，这个妹子特别的的随和，属于刚刚好的小女人味，气质比较好的小良家感觉。五官标致。做的过程也舒服。蛮OK。性价比还OK。温柔。', 1, 5, 3, 1, 2, '3', '2020-07-21 13:51:31', '2020-07-21 13:51:31', '[\"/upload/article/5e4cf10c020b3.jpg\"]', 0, ''),
