(8379, '约操公司前台白领', 25, 30, '次3K', 110000, 110100, '3285083213', NULL, NULL, '口,啪', '妹子是公司前台，颜值在线。群里认识的，学了几次都不成，终于可以了。约在国贸香格里拉，玩的觉得尽兴。最后后入对着大裤衩射了。', 1, 2, 2, 1, 2, '3', '2020-07-21 13:51:31', '2020-07-21 13:51:31', '[\"/upload/article/baae1d3b582d3d24096eaef47c0769db.jpeg\"]', 0, ''),
(8385, '长安体验', 23, 30, '300-400', 440000, 441900, '1352610265', NULL, NULL, '口爆,打炮', '扣扣上找的，服务一般是个中介，不过价钱也还可以，小姐组的小宾馆，进门还看见在吃东西，洗了澡就开始口，口活还行，一会开干，不知道当天是不是因为状态不对，半天射不出来，妹子生意好像还挺好， qq一直在有人联系，我忘了加她个人的微信了，图片和本人有差距。', 0, 0, 5, 0, 2, NULL, '2020-07-21 13:51:31', '2020-07-21 13:51:31', '[\"/upload/article/8a3ae104b2709be22f39f6bd90085f38.jpg\"]', 0, ''),
(8390, '偶尔兼职的身材爆好的妹子', 27, 30, '800', 370000, 370100, '1470762927', NULL, NULL, '鸳鸯浴,漫游,胸推,口活,爱爱', '晚上闲来无事偷偷跑出来，约了这个关注了很久的妹子，一样的套路遥控上楼，妹子自己租的公寓，开门看见真人瞬间有点把持不住，这身材和身高跟照片上一模一样。和妹子瞎聊一会便进入正题，妹子的一双大长腿无比震撼，后面省略一百字。。文采不好，就不描述了，看照片就知道什么质量了。总之，喜欢好身材的看过来准没错，不过妹子说过两天要回家休息一段时间，你们约的时候可能凑巧不在，不过我觉得没关系，在qq群充斥着各种键盘和中介的今天，有一个极品个人兼职的资源可不容易啊，先养着吧', 1, 5, 23, 3, 2, '3', '2020-07-21 13:51:31', '2020-07-21 13:51:31', '[\"/upload/article/5e5107d0aa6ce.jpg\"]', 0, ''),
(8394, '佛山南海湘梨', 29, 30, '500', 440000, 440600, NULL, '18689320972', '18689320972', '鸳鸯浴,漫游,胸推,口活,爱爱', '该有的都有，年龄也不高是24岁，c罩杯，二话不说去到就给我脱了去洗澡，，有很多服务内容，冰火啊，丝袜，漫游等等，当然了这些你最好还是提一下，摸起来皮肤也不算很差，我果然还是很喜欢漫游这个项目，mm下面小草qiqi，水也出的很快，我就直接进去了，老实说干起来还不错，当然了，蕾丝真的太诱惑了，别的不说了吗，出图可以和我们班的同学聊一下不行', 0, 0, 22, 0, 1, NULL, '2020-07-21 13:51:31', '2020-07-21 13:51:31', '[\"/upload/article/5e5117e2e9daf.jpg\"]', 0, ''),
(8395, '一个禅城资源，排雷回来', 26, 30, '350', 440000, 440600, '2495002930', NULL, '13728564051', '鸳鸯浴,漫游,胸推,口活,爱爱', '，在qq上5个妹子里面选了个胸大颜不错的妹子之后，根据指示来到公寓，进房间里面就是跟普通的酒店双人房一样，妹子挺漂亮的，可能去的比较晚九点多了，妹子估计也有点累，没那么热情，但是态度还不错，先洗了个澡，然后出来见到妹子脱好衣服了，眼前一对胸器让我为之一震，胸比较大，而且很挺，摸上去又软又暖，下面很快就y了，然后该有的服务都有，就是服务时间比较短，5分钟左右看我弟弟很y了就给我戴t然后开干，后面就不描述。总体来说，服务一般，但是妹子的颜值和身材绝对值这个价，毕竟也不贵，身材超赞', 1, 5, 20, 3, 2, '3', '2020-07-21 13:51:28', '2020-07-21 13:51:28', '[\"/upload/article/5e511883b12fd.jpg\"]', 0, ''),
(8396, '极品学生妹', 22, 30, '2000', 110000, 110100, '179385244', NULL, '18602000226', 'K,做', '极品颜值，翘臀', 3, 2, 5, 2, 2, '3', '2020-07-21 13:51:31', '2020-07-21 13:51:31', '[\"/upload/article/2e4eb500a1028d74d69e48f61fae3b9a.jpeg\", \"/upload/article/bdedd4c6e843a115015c9a8d1533a547.jpeg\", \"/upload/article/e95e05f79e38888f08615fe6e093d45a.jpeg\"]', 0, ''),
(8397, '真正的大学生，很漂亮，做的时候可以和她男友通话', 21, 30, '一小时600不限次数，1500包夜', 120000, 120100, '2422677956', NULL, NULL, '除了不能口爆基本都有', '本人亲自去学校接的她，第一眼惊艳到了，年龄小，胸不小，皮肤非常白，说话很温柔，像朋友那种感觉，学校附近有他租的房子，房子一居室，装修不错很干净。进家先让你去挑情趣内衣，然后让你在房间等着，一会就换好衣服进来来，还来了一句哥哥我要开始服务了，过程中知道她有男朋友，从来电看到的，让我别发声，轻点顶，一边通话一边草，服了，第一次体验。第二天早上来了一炮，我说可不可以给你男朋友再打个电话，居然真打过去了，她和她男朋友亲密，我在后边顶，最后我都完事了两人还没聊完。真舍不得分享出来，大二的，大学毕业估计就没机会了，本人最近准备去北京发展，才分享出来的，包夜的话要提前约，周5周6可以包夜，周日她的回学校。', 0, 0, 1, 0, 2, NULL, '2020-07-21 13:51:31', '2020-07-21 13:51:31', '[\"/upload/article/c64aeb238d4bbb936c4f729c17d55543.jpeg\"]', 0, ''),
