(8482, '绵阳涪城区妖姬', 25, 30, '400', 510000, 510700, '1260305647', NULL, NULL, '鸳鸯浴,漫游,胸推,口活,爱爱', '今天就要正式上班了，终于在上班前搭上了末班车，刚回来上课的妹儿，颜值不错，皮肤是真好，腿光溜溜的，扛在肩上舒坦，价格还是比较实惠的，不过服务比较简单，就吹加做，这几天人不多，憋慌了可以试试，妹子是自己出来做，在绵阳这种不多', 1, 5, 14, 3, 2, '3', '2020-07-21 13:51:31', '2020-07-21 13:51:31', '[\"/upload/article/5e58f796c1acd.jpg\"]', 0, ''),
(8483, '爱穿黑丝的合肥小姐姐', 20, 30, '400', 340000, 340100, NULL, 'cctv1575192057', NULL, '鸳鸯浴,漫游,胸推,口活,爱爱', '微信联系好就去了，小姐姐穿着黑丝超短裙来开门，真人比照片更性感。外表清纯在床上就是个荡妇，叫的非常大声。不错，下次有机会包个夜', 1, 5, 8, 1, 2, '3', '2020-07-21 13:51:31', '2020-07-21 13:51:31', '[\"/upload/article/5e58ff5e8e761.jpg\"]', 0, ''),
(8484, '大望路小活', 26, 30, '400', 110000, 110100, NULL, '13146238700', NULL, '鸳鸯浴,漫游,胸推,口活,爱爱', '累了想找个小活按按，安然家没开门，在论坛找的这家，吐槽一下按摩真一般，简单按了几下，最恐怖的是踩背，也没个杆借力，生踩啊，腰不好的大哥千万别去。踩了有5分钟换前面，就简单捏了两下胳臂，然后就是一直摸下边，还是干Lu，最后给上了点油。JS长的一般，不难看也不是特惊艳，尺度有点小，基本上碰到敏感部位都给你推开，只有发射前才让碰。300是这样的60分钟没他介绍里的80分钟，我也不知道算不算足钟。400说加SZ、QS，500是半裸XT。总体感觉性价比一般。', 1, 5, 3, 1, 1, '3', '2020-07-21 13:51:31', '2020-07-21 13:51:31', '[\"/upload/article/5e5a38cc2ec46.jpg\"]', 0, ''),
(8485, '小美', 26, 30, '500', 110000, 110100, '1153794429', 'W2537790299', NULL, '鸳鸯浴,漫游,胸推,口活,爱爱', '闲来无事，便约小美。离地铁近，进屋基本还算满意，主要我是胸控，其他的一切就显得不那么重要了。服务我选的5张，洗完之后上床就是大家所熟知的一抽一插，活塞运动细节不怎么会描写，发出来是想让感兴趣的狼友去体验一下。不说超值，也算满意', 1, 5, 9, 4, 2, '8', '2020-07-21 13:51:28', '2020-07-21 13:51:28', '[\"/upload/article/5e5a395f2b656.jpg\"]', 0, NULL),
(8487, '刘家窑附近便宜白虎资源，配合耐草', 29, 30, '300', 110000, 110100, '2574362798', '15010908029', NULL, '鸳鸯浴,漫游,胸推,口活,爱爱', '，姐姐29，身高不高但是体型还可以，没有胸！胸控不要去！小狼一看这也没胸，就别xt了，直接带套上马。握住长枪往里进，第一下愣是没进去，这个白虎确实紧，进去以后的包裹度不是一般的好，遂大力打桩，姐姐也是耐草型，小狼狂干20分钟没出货，想着拔出来歇一歇，结果发现套破了，姐姐帮着换了个新套，又干了17，8分钟出货。姐姐也没催，总体来说便宜耐用，配合度高，没胸，长相也一般，但是价格真的适合泻火，300的白虎现在上哪里去找，', 1, 5, 15, 1, 2, '3', '2020-07-21 13:51:31', '2020-07-21 13:51:31', '[\"/upload/article/5e5a3bb0c5561.jpg\"]', 0, ''),
(8488, '大胸小玲子回来了', 31, 30, '300', 110000, 110100, '2088198454', 'huoguo9896', NULL, '鸳鸯浴,漫游,胸推,口活,爱爱', '果是老人，估计肯定知道小玲子这个人，之前就在刘家窑这，这么多年一直保持300不涨价，kh好，而且现在年纪大了也就三十多不算老。怎么说呢，如果是论坛上300这个价的你去，保不齐有坑的有值的，这个小玲子算是一个保底，就是性价比高，不一定特别惊艳，但绝对不坑的那种。', 1, 5, 8, 3, 2, '3', '2020-07-21 13:51:28', '2020-07-21 13:51:28', '[\"/upload/article/5e5a3c5661a85.jpg\"]', 0, ''),
