(8492, '性感活泼的美瞳妹子 ', 26, 30, '500', 110000, 110100, '3169202571', '', '', '鸳鸯浴,漫游,胸推,口活,爱爱', '妹子身高169，人瘦脸小，开始的时候，妹子是提前已经洗了澡的，她直接在床上脱衣服，我就去洗澡，回到床上看着她白白的大奶，尤其是腿很细长，我先抱着她边聊天边摸她全身边亲，大概5分钟后妹子给我口，小嘴巴十分温暖，口的时候很爽，之后就干了次。总之性价比超高，妹子也十分漂亮', 1, 5, 0, 0, 2, '姐能干', '2020-07-21 13:51:31', '2020-08-07 01:08:48', '[\"/upload/article/5e5a59c7dcf73.jpg\"]', 0, ''),
(8493, '喜欢伪娘的不要错过', 19, 30, '400-800', 370000, 370600, '3303149003', NULL, NULL, '口爆,gj', '陌陌上约的，一开始没看出来是伪娘真的太像女的了，男人骚起来没女的什么事了，爱爱期间会不停闻你的内裤，还会提出来让你射在内裤上送给他，我看他人不错送了他一条原味的，还喜欢把精液含在嘴里和你舌吻，不要感觉恶心，这样真的很刺激。', 1, 2, 5, 1, 2, '3', '2020-07-21 13:51:28', '2020-07-21 13:51:28', '[\"/upload/article/f79dd1b4328a0800c1a2395f8486b62f.jpg\"]', 0, ''),
