(8571, '海珠区超级好看妹子', 23, 30, '400', 440000, 440100, NULL, 'kh198825', '13247390936', '鸳鸯浴,漫游,胸推,口活,爱爱', '憋了好久终于忍不住去了，小妹妹很白，主要是有一副美腿，惹火的要命，妹妹刚下海，B很紧，水也很多，进门先洗澡，洗完澡开始做服务，口了几分钟，就带上套子干了10分钟交货，4张便宜实惠值得一去！', 2, 5, 9, 2, 1, '3', '2020-07-21 13:51:31', '2020-07-21 13:51:31', '[\"/upload/article/5e5f6ed119813.jpeg\", \"/upload/article/5e5f6ed897e4b.jpeg\"]', 0, ''),
(8572, '玉儿妹子服务好 态度好', 20, 30, '300', 370000, 370200, NULL, '19953236891', '19953236891', '鸳鸯浴,漫游,胸推,口活,爱爱', '妹子服务不错 腿长 特意让她穿好丝袜等我，遥控进楼以后一看到人就硬了，口活也不错，当然最爽的还是后入', 1, 5, 143, 9, 1, '小肥龙', '2020-07-21 13:51:28', '2020-08-15 02:07:37', '[\"/upload/article/5e5f70511b26a.jpeg\"]', 0, ''),
(8573, '北郊约会兼职丰满姑娘', 25, 30, '500', 610000, 610100, '505734528', NULL, NULL, '鸳鸯浴,漫游,胸推,口活,爱爱', '这个女的之前在南郊，后来搬到北郊凤城五路这边了，由于她是兼职，并且已经结婚，平时也不太好约，一般她老公出差后，比较容易约，此女长相还行，有点婴儿肥的感觉，皮肤挺白皙，身高大概160cm以上，身材挺不错的，尤其有对大奶子，看起来很诱人，服务不错也不机车，由于没有生过孩子，下面挺紧水也多，所以插起来很舒服，口活没的说，挺专业的，基本服务都有，喜欢大胸的狼友，可以一试，在房间里的过程也不多说了，基本步骤差不多。', 2, 5, 12, 3, 2, '3', '2020-07-21 13:51:31', '2020-07-21 13:51:31', '[\"/upload/article/5e5f70d81a60a.jpg\", \"/upload/article/5e5f70e0e3b3b.jpg\"]', 0, ''),
