(8575, '九街长腿大胸 小美', 26, 30, '400', 500000, 500100, NULL, 'xiaomei29069367', '13696453395', '鸳鸯浴,漫游,胸推,口活,爱爱', '进门就在沙发上先验货，一边亲一边让你摸她的一对大胸，一只手根本抓不完而且很软，之后就是洗澡那些。之后进房间里有投影仪，可以放些片子助兴。服务的话正反面都有而且我感觉还是比较细致，还有就是有个蒙到保鲜膜舔脚，挺痒有点舒服。之后做的话就是选情趣内衣然后在镜子前后入，看到大胸一晃一晃的真的特别爽。床上干的时候一定要玩美腿，又细又长。总之就是身材很极品，所以约的人很多，我约了两次才约上。', 2, 5, 4, 1, 2, '3', '2020-07-21 13:51:31', '2020-07-21 13:51:31', '[\"/upload/article/5e5f7368036df.png\", \"/upload/article/5e5f736f03ae0.png\"]', 0, ''),
