(8693, '成都99年小妹温柔体验，绝对粉嫩多汁', 21, 30, '688', 510000, 510100, '3031550487', '15528192008', '15528192008', '口爆,做爱', '周末休息，跟朋友联系，无意中朋友说验证了一个好玩的地方，非常棒的一次谈，于是赶紧要过来，打算过去看看没要留联系方式，预约了时间，驱车前往，遥控一路不表，是一个小区，环境不错，停车也很方便，很快就找到了停车位，激动地心，颤动的手，她粗来接我，第一眼看到她，高挑的身材前凸后翘，长得漂亮，小鸟已经开始要飞的感觉了，进去以后，还有几个妹子都不赖，各有千秋，我选了出来接我的那个妹妹，进房间简单聊了几句给予步入正轨了，鸳鸯浴，手法不错，口活也不错，身材胸臀真的相当不错，我的鸡巴直接棒棒硬，真是绝了，这样的妹子现在干这个的少之又少，走出浴室，口活十分钟，我直接把她按在床上狂操，b有点紧，水特别多，边操边流淫水，不过她的叫声犹如我内心的一股骚动，叫的真是绝了，我越用力她叫的越性感，很刺激，很爽。推荐给大家，有兴趣可以去看看，我反正会常去的。', 2, 2, 1, 0, 2, '小肥龙', '2020-07-21 13:51:31', '2020-08-14 20:17:42', '[\"/upload/article/637e44e62d8510a7919d8aeeb3d26e38.JPG\", \"/upload/article/bb9d841ab9528fadbf3065ff5d2acf62.JPG\"]', 0, ''),
(8694, '韵味少妇', 33, 30, '300-600', 440000, 440300, '3257090094', '15976875417', '15976875417', '鸳鸯浴,漫游,胸推,口活,爱爱', '该女需要预约，第二天根据提供的地址找到了，一进门感觉还行吧10分给7分，跟照片出入不大，保养的好，口了一会骑she了，过程不赘了，体验不错，自行体会，可以一试', 1, 5, 5, 0, 1, '3', '2020-07-21 13:51:31', '2020-07-21 13:51:31', '[\"/upload/article/5e67538773ea1.jpg\"]', 0, ''),
