(8709, '成渝立交的美女琳琳', 23, 30, '全套400 上门600包夜 1300不限次', 510000, 510100, '350265572', NULL, NULL, '鸳鸯浴,漫游,胸推,口活,爱爱', '本人与照片差不多，之前去过一次。前段时间刚开课，昨天包夜。让她穿的制服丝袜。活好，可摸。B也紧，水还不少。一晚上给她干喷水了一次。12个小时不限次。我就总共三次，走之前还让她给我口了会儿。有条件包夜的强烈推荐。颜值看图', 1, 5, 14, 9, 2, '3', '2020-07-21 13:51:31', '2020-07-21 13:51:31', '[\"/upload/article/5e68a5022d4c8.jpg\"]', 0, ''),
(8710, '东站高颜大奶嫩妹', 23, 30, ' 400p 上门也可以', 510000, 510100, '2996968449', NULL, '18743940900', '鸳鸯浴,漫游,胸推,口活,爱爱', '妹儿颜值很高。皮肤也很好。有弹性，那一对大白兔揉起来手感一级棒。洗了澡之后上床服务穿着丝袜69 直接暴力撕开小穴味道不错，有点甜甜的感觉。水还挺多。后入简直了。最后一边吃着奶子一边干。整个过程回味无穷。下次准备包夜', 0, 0, 1, 0, 2, NULL, '2020-07-21 13:51:31', '2020-07-21 13:51:31', '[\"/upload/article/5e68a6b83c7d9.jpg\"]', 0, ''),
(8711, '沙河口区妹子，屁股不错，开工了', 26, 30, '400', 210000, 210200, '', '', '', '鸳鸯浴,漫游,胸推,口活,爱爱', '疫情憋的小狼难受，索性直接找了个群，加了个妹妹，妹妹直接发照片来。一看样子不错直接就去了。进门很热情嘘寒问暖，不一会儿直接开炮', 1, 5, 0, 0, 2, '姐能干', '2020-07-21 13:51:31', '2020-08-09 23:25:51', '[\"/upload/article/5e68a90de1109.jpg\"]', 0, ''),
(8713, '南岸南坪 高颜值苗条美女 静馨', 18, 30, '400qt，600pp', 500000, 500100, '1617283841', NULL, '17090691177', '鸳鸯浴,漫游,胸推,口活,爱爱', '最近单位复工了，但是lf复工的很少，今天逛群看到了这个妹妹复工了，精虫上脑直奔南坪，地方还算好找，上楼一看，人长得比照片漂亮些还，屁股跟腰杆的比例也恰到好处', 1, 5, 13, 7, 2, '3', '2020-07-21 13:51:31', '2020-07-21 13:51:31', '[\"/upload/article/5e68aa9fe352c.jpg\"]', 0, ''),
(8714, '普陀年前轻熟爽记', 28, 30, '600', 310000, 310100, '', '', '', '鸳鸯浴,漫游,胸推,口活,爱爱', '年前取得。真人和照片稍微有点差距。不过也算顺眼。皮肤挺滑。后入起来贼爽。说是又yyy实际就是自己洗。可能时本狼不够又魅力。不过其他服务还是很用心的。说是来上海没多久。但也是个经验丰富的主。上次问，说过一周就回来了。', 2, 5, 0, 0, 2, '姐能干', '2020-07-21 13:51:32', '2020-08-09 23:25:32', '[\"/upload/article/5e68ac0fe7286.jpg\", \"/upload/article/5e68ac197a1e4.jpg\"]', 0, ''),
(8715, '铁西约一个高颜值前凸后翘的年轻妹妹', 26, 30, '500-1200', 210000, 210100, '1933056629', NULL, NULL, '鸳鸯浴,漫游,胸推,口活,爱爱', '年轻，通体雪白，胸很大（真胸），逼紧而且很浅，水很多，敏感体质。态度好，不机车。这是小狼混迹十余载打分比较高的女孩。很值得一试。', 1, 5, 12, 9, 2, '3', '2020-07-21 13:51:32', '2020-07-21 13:51:32', '[\"/upload/article/5e68acd92c537.jpg\"]', 0, ''),
