(8719, '三元里一个可以后门的少妇', 29, 30, '300-400+', 440000, 440100, NULL, '13650968903', NULL, '鸳鸯浴,漫游,胸推,口活,爱爱', '妹子是东北的，人也健谈，不会冷肠也不会催，我在玩的时候她电话一直响，她都没接，后面直接关机。SW KJ 69都有，我去的时候她穿着蕾丝，带我进去洗澡，不会先要价，是服务后才会要。', 2, 5, 1, 1, 2, '3', '2020-07-21 13:51:32', '2020-07-21 13:51:32', '[\"/upload/article/5e68b01e354da.jpeg\", \"/upload/article/5e68b024a4787.jpeg\"]', 0, ''),
