(8721, '房山 良乡大学城附近', 23, 30, '300起', 110000, 110100, '1083568891', '15933063616', '15933063616', '自询', '一开始在QQ附近搜到的，关注了半年多，基本每天都会发兼职信息，小姐会经常轮换。朋友圈都有视频，带图询价。可以到店，也可以上门，到店3起，上门6起。我都是让上门，好几次了，也换了不同的小姐，服务态度都很好。总的来说至少是安全可靠，小姐很多，可以挑自己喜欢的。还有一点就是，这个店时不时会有韩国妹，而且品质极佳。下图是我点过的，简直极品，诚意推荐！', 2, 1, 23, 4, 2, '3', '2020-07-21 13:51:29', '2020-07-21 13:51:29', '[\"/upload/article/394e5225ee0b0817b57549c198bd482b.jpeg\", \"/upload/article/95a3771161c886341dc846ef88e0d311.jpeg\"]', 0, ''),
(8722, '贵阳体验熟女，感觉还可以吧', 33, 30, '500', 520000, 520100, '1875094064', NULL, NULL, '鸳鸯浴,漫游,胸推,口活,爱爱', '来贵阳一直想想个实惠的小姐姐，长期约，奈何贵阳这边b价如此贵，基础物价太高造成的整体消费水平都高。最近找到这个老姐姐，其实价钱可以商量的，商量好之后直接前往，目的地也不是很远，不到半个小时我就到她楼下了', 1, 5, 8, 1, 2, '3', '2020-07-21 13:51:32', '2020-07-21 13:51:32', '[\"/upload/article/5e6996f93ecce.png\"]', 0, ''),
(8723, '亲身力荐一枚陕西mm', 25, 30, '600', 520000, 520100, '3116056497', NULL, NULL, '鸳鸯浴,漫游,胸推,口活,爱爱', '亲身体验确实很难忘的一次体验。妹纸高挑漂亮，长发及腰，服务体贴细致，颜值与服务兼具。', 1, 5, 19, 13, 2, '3', '2020-07-21 13:51:32', '2020-07-21 13:51:32', '[\"/upload/article/5e6998cc6d9e9.png\"]', 0, ''),
