(8757, '忍痛分享西青大寺兼职', 27, 30, '400起', 120000, 120100, '169063984', NULL, NULL, '鸳鸯浴,漫游,胸推,口活,爱爱', '妹子挺小心的，在西青大寺某别墅区里，那天上午加的她，中午才回消息，下午才约上，不过年纪确实小，也很玩得开。直接抱住往身上蹭，要求加个100整个全套，果断同意，绝对90后，真的是物有所值', 1, 5, 10, 1, 2, '3', '2020-07-21 13:51:29', '2020-07-21 13:51:29', '[\"/upload/article/5e6aff6fb3286.jpg\"]', 0, ''),
(8758, '塘沽漂亮小妹，不去后悔', 26, 30, '300起', 120000, 120100, NULL, '15002231928', NULL, '鸳鸯浴,漫游,胸推,口活,爱爱', ',妹子服务很细致,什么价位该做什么内容都会做,技术也挺不错的,然后就是啪啪啪，其他不表。反正物超所值', 0, 0, 19, 2, 1, NULL, '2020-07-21 13:51:32', '2020-07-21 13:51:32', '[\"/upload/article/5e6b008004622.jpg\"]', 0, ''),
(8759, '胸可以玩一年', 26, 30, '700', 120000, 120100, NULL, '2861152090', NULL, '鸳鸯浴,漫游,胸推,口活,爱爱', '必看津南的资源太少了，从朋友那里得到此姐姐的微信，果断加了，妹子刚下海，比较健谈，玩的开，津南的资源本来就少，该有的项目都有了，过程不详细说了，性价比极高', 1, 5, 11, 3, 2, '3', '2020-07-21 13:51:32', '2020-07-21 13:51:32', '[\"/upload/article/5e6b01a7b6f41.jpg\"]', 0, ''),
(8761, '可双飞的美娇娘', 26, 30, '400', 120000, 120100, NULL, 'wxidsup322', NULL, '鸳鸯浴,漫游,胸推,口活,爱爱', '见面有点欢喜，一身黑丝情趣本狼最爱，进屋之后就去洗澡，然后告知可以双飞，姐妹在楼上，看了下照片在想想钱袋，果断拒绝，姐姐也没说什么，然后就开始口活，真心不错，然后开搞，没有机车，很温柔', 1, 5, 23, 5, 2, '3', '2020-07-21 13:51:32', '2020-07-21 13:51:32', '[\"/upload/article/5e6b376226d11.jpg\"]', 0, ''),
