(9961, '大连泻火好选择', 25, 30, '300', 210000, 210200, NULL, 'wxs9488888', NULL, '鸳鸯浴,漫游,胸推,口活,爱爱', '出差到大连，晚上一个人寂寞难耐，在论坛溜达，看见网友推荐的，离酒店不是很远，便电话联系美美，一问刚好有时间，就驱车前往。遥控上楼，进门先洗澡，然后就不细说了', 1, 5, 13, 4, 2, '3', '2020-07-21 13:51:33', '2020-07-21 13:51:33', '[\"/upload/article/5eb4cc3a48adc.jpg\"]', 0, ''),
(9968, '成都武侯好耍的桑拿洗浴_美妙的感觉', 21, 30, '688', 510000, 510100, '2109247360', NULL, '15528193008', '保健,按摩,洗浴,桑拿,spa', '　　不是人心变的冰冷，而是你没有安全感，所以你不敢抛出自己的所有，然而一份真心才能换来另一份真心，就像在这家洗浴休闲会所也是用真心换真心。不管当初多么欢喜、在意，随着时间的流逝，一切都会慢慢变淡，成了你生命里一段缥缈的记忆。\r\n\r\n　　会所以暖白作为主色调使得空间氛围明亮、浪漫。深木色的按摩床、铜艺灯具使得整个空间更显尊贵感。包间内摒弃了墙纸，艺术涂料取而代之，柔软、丝滑，相得益彰。\r\n\r\n　　人生就是如此，你可以努力，却无法拒绝，因为爱--哪有胜利可言，挺住意味着一切！是时候关心下你身边的超级英雄，是时候去SPA养生保养一下了。\r\n\r\n　　具体服务时间：根据选择的项目调整时间，多数为120分钟\r\n\r\n　　超值优惠：免费领取现金优惠券，更有神秘大礼赠送\r\n\r\n　　中新网10月21日电潍坊学院10月20日通过官方微博通报称，学校依据目前已查出的教师杨洁学术不端情况，撤销杨洁副教授职称，相关学术称号按规程撤销，调离教师工作岗位，继续展开调查，发现问题跟进处理。\r\n\r\n　　有媒体报道，10月11日，太原师范学院文学院副教授郝建杰发布微博称，潍坊学院传媒学院杨洁出版的一本著作，抄袭其本人的博士学位论文。其微博曝光称，杨洁涉事著作11万字，抄袭字数达29210字，占比约26.55%。\r\n\r\n　　10月13日晚，潍坊学院通过官方微博就教师杨洁涉嫌抄袭博士论文发布情况通报称，目前杨洁已被停职，学校已委托第三方法律机构进行鉴证调查。\r\n\r\n　　10月20日，潍坊学院再次通过官方微博通报称，学校依据目前已查出的杨洁同志学术不端情况，根据《科研诚信案件调查处理规则》(国科发监〔2019〕323号)，按照相关规定研究决定：撤销杨洁副教授职称；相关学术称号按规程撤销；调离教师工作岗位；继续展开调查，发现问题跟进处理。', 3, 5, 8, 1, 1, '姐能干', '2020-07-21 13:51:33', '2020-08-07 04:08:56', '[\"/upload/article/13e41f704313d3bab2e733e90e4776d0.JPG\", \"/upload/article/57428c0b3aed07f5f44cea604c615c7f.JPG\", \"/upload/article/ea1d2718e7e5d3a95b583883bebee06d.JPG\"]', 0, ''),
