(9981, '会所    人妻', 30, 30, '自问', 110000, 110100, 'QQ2054775948', NULL, NULL, '做爱,kh', '这几日小头非常的难受，越是在寒冷的冬天，就越需要火热的性欲来暖身子。只想找个靠谱实在的女人泻火，一个个都是奔八百一千去的，我还是只选对的，不选贵的吧。本来年底花钱的地方也多，我倾向于走平民路线。之前就注意到了一个熟女艾艾，看过她的验证报告，自聊自做的人妻兼职，感觉差不了，应该很划算，于是就主动和艾艾联络了。\r\n据我的经验观察，艾艾还真的是自已做的，这样安全性也让人放心。昨天说好了去找她，路程略去，反正挺好找的地方。开门的是一个长相很温柔的熟女，30多岁，皮肤蛮好的，五官也算周正。身材曲线嘛，大胸大屁股，等下肯定有的爽了。来就是为了享受的，也不用费什么话，门一关上，艾艾就暂时属于我了，我去，这个女人好来劲呀，主动脱衣，强上了我。\r\n正中我的下怀，艾艾的舌头在我的身上就吸了起来，又麻又酥。我喜欢和艾艾这种性欲旺盛的女人搞，不流程化不机械化，实打实的男欢女爱。而且艾艾的技术超级好，口活一流，我的手也没有停着，艾艾大胸大屁股，身材可谓是实战利器，玩了69式，妹子的水太多了，够了，披挂上阵，战斗型人妻的高潮，搞了你就会明白有多胸猛，简直是叫人招架不住呀，一波流爽射之', 1, 2, 31, 6, 2, '3', '2020-07-21 13:51:33', '2020-07-21 13:51:33', '[\"/upload/article/8cf9a3a3b528d5e4b5c871b55f3675fe.jpg\"]', 0, NULL),
(9983, '北苑私密会所，意料之外', 24, 30, '500p 800pp', 440000, 441900, '2055645943和QQ2216449229', NULL, NULL, '按摩,推油,指划,69,kh,dh', '昨天闲来无事，跟朋友去了个私密会所，原以为是那种骗卡的店。去之后才发现很不错，一是环境，二是妹子。最主要的服务后付费，附图，妹子照片和随手拍的一张环境照，推荐ly去试试，信老弟的就对了', 1, 6, 29, 9, 2, '姐能干', '2020-07-21 13:51:29', '2020-08-07 05:51:35', '[\"/upload/article/22c960e1cce3170710c6ee9dac02ef9d.jpeg\"]', 0, ''),
