(10280, '验证大学生兼职乖乖女爽记', 22, 30, '1500', 350000, 350100, '1813364377', NULL, NULL, '口活,爱爱', '最近经人介绍认识了一个大学生妹妹，说是有点困难，不过这类借口早已见惯不惯了，看到照片让我就狂咽唾沫，身材完美，脸蛋精致，据说活算不上好吧但是还说的过去，属于有求必应，我就喜欢这种乖乖的听话的，让人欲罢不能。和妹妹联系上，妹妹是学生地方不太方便，目前就是酒店吧，咱们这些狼友买账了自然而然就有地方了，开好房间，把地址和房间号发给了妹妹，来到酒店先换上浴袍，躺在那里，想着妹妹，早已是望眼欲穿，不大一会敲门声想起，赶紧开门，看到妹妹第一眼就是哇塞，太惊艳了，深深的被吸引了，太绝了，大胸，水蛇腰，把妹妹引进门，和妹妹聊了几句，说话声音也特别好听，有点娃娃音的意思。\r\n\r\n   和妹妹聊了会，妹子会意的看了我一眼，妹子体贴的帮我脱了衣服，自己也脱了衣服，妹子体贴的调好水温，才叫我进来，妹子的身材真是没的说，一丝赘肉都没有，腿也够长，胸部也有料，抑制不住，立马把妹子抱在怀里，一顿乱啃，搞得妹子还有点不知所措，呵呵。妹妹身上好像还有股香味，很醉人。妹妹说哥哥不要急，先帮你洗洗，洗了洗，在我的要求下，妹妹在浴室就来起了口活，我擦这种感觉，水滴打在身上，下面还有个美女口着，这种感觉，不用我细说了吧。妹妹还在努力的口着，还不时的用那种勾魂的眼神望着我，受不了我，示意妹子叫停，拉起妹子，让妹妹手扶着墙壁，从后面缓缓进入，还真紧啊，缓缓了抽插了两下，加快速度，妹子的叫声十分好听，两手握着妹妹的奶子，我就喜欢这种姿势，太爽了。也没闲着从浴室干到床上，各种姿势搞起，主要妹妹太诱人了，今天战斗力直线上升，最后还是一泄如注。太爽了太爽了。抱着妹妹休息了会，擦干身体，和妹妹聊了会。放下毛爷爷走人。\r\n\r\n妹妹这等身材，看着我就受不了，贡献出来给大家分享分享。', 1, 2, 8, 2, 2, '3', '2020-07-21 13:51:29', '2020-07-21 13:51:29', '[\"/upload/article/f202d290ab73d68416ab41546178b27a.jpg\"]', 0, ''),
