(10420, '臀翘粉B的20岁小鲜肉，可爱良家小萌妹，好紧好舒服', 25, 30, '1298', 120000, 120100, '1273768292', NULL, NULL, '陪浴,胸推,舌漫,丝袜高跟,口活,69式,指滑,爱爱', '今天听色友说起的，说有新货刚到，属于待验证。掐指算算我也是许久没有开发新人了，这年头开发有风险，狼友们应该懂。不管怎么说先联系上，看看情况如何。结果小妹把照片发来，我还真的是有一点点心动，长的蛮漂亮的啊，本狼是颜控，那这就有点让人没办法拒绝了，而且还这么的年轻。既然真的是小鲜肉，那就要抓紧去爽了。别到时粉木耳变成黑木耳徒伤悲了。和小妹说好了，我今天下班后就过去。下午的时候在办公室里面都心神荡漾了，于是提前了半个点跟手下的几个小员工打了声招呼，我就先撤了，赶紧的去那边了。地方有点远，咱得抓紧。\r\n\r\n      终于是到了，按照妹妹的指示上楼，我保持警惕性，多走了一层再下来，没问题后再进入了婉婷的房间。姑娘已经在等我了，不错，是照片上的本人，真人更显年轻水嫩，乖乖女的样子，性格好好，聊天的气氛就各种愉快，越相处就越觉得妹妹很萌，一点风尘味都没有。差不多该开始正题了，咱过来可是为了办事的。妹妹自然也懂，主动脱光，两颗可爱的大白兔和粉嫩小葡萄出现，我咽了下口水。进了浴室，妹妹帮洗，我做的是全套，妹妹也没让我失望，做事儿不会敷衍，从洗澡上就看的出来，是个踏实侍候人的好姑娘。\r\n\r\n     待洗舒服了，做起来才放心。叫她穿上丝袜高跟鞋，到了炮房内战斗。小妹才20岁，对性爱方面的经验并不是太足的，但她肯学，态度好，说好的项目都会做。而且身材条件好，乳头和B那都是粉色的，舌漫的很舒服，重点部位重点照顾，妹妹这服务意识必须点个赞。口活可酥了，69式也让她感受了下我的舌功，她太敏感了，人仰马翻直求饶，我趁着水深火热之际，穿上工作服就深入战斗了，下面真紧啊，像是打开了新世界的大门，全身通体酸爽，这刚下水做的妞儿干起来真够痛快的，她真的很乖，什么都听你的，配合度百分百。', 1, 8, 7, 2, 2, '3', '2020-07-21 13:51:34', '2020-07-21 13:51:34', '[\"/upload/article/574f78af74de0fc3f0e52ca4df91f5ac.jpg\"]', 0, ''),
