(10488, '妹子的大眯又酥又软 摇摆蜜桃臀尽显风骚', 22, 30, '1500', 130000, 130100, 'QQ3593243342', NULL, NULL, '口活,爱爱,接吻,69丝袜', '最近想开开荤，听朋友说最近玩了个MM，胸大服务好，听得我直痒痒。向朋友要了联系方式约定了时间，到了才发觉身段超好，皮肤白白的，前凸后翘，超正点。MZ离我格外近，身上那股淡淡的体香闻起来有种欲醉之意。当我还沉醉在香味天下里的时辰，妹子已经脱掉了外衣，酮体若隐若现的在我眼前，看得我已经欲火焚身。我也速度全脱光了，给妹子一路YYY去了。洗澡时才发现小白兔真大 ，嘿嘿。刚进浴室就被妹妹强奸一次……“欧伟尔” 了\r\n\r\n       YYY竣事，抱起妹子香香的酮体，悄悄的放在床上，妹子随手一拉，原本就有种醉醉感受的我那能经得起这温柔的一拉哦，顺势就倒在妹子白白香香的酮体上，压着又酥又白的小兔上,嘴恰好贴在软软嘴唇上。这一压，完全有种丢魂失魄的感受。亲热了一会，妹子渐渐起头为我办事，用那有魔力的小白兔在我裸裸身材上游动，一系列办事，挑动我每根神经，满身酥麻的感受。我在也忍受不了任何撩拨了，而且当妹子给我办事的同时我也不甘逞强，把妹子搞得是一片汪洋了。于妹子给我小弟穿上战袍，早以坚硬小钢房炮被妹子火烧眉毛地塞进了水帘洞。停止了200回合大战，从床上到沙发，床头到床尾。终究缴械了。\r\n\r\n       躺了一会儿，起床冲洗终了，妹子替我擦干身材，挺仔细的。穿上衣服聊了一会，买单走人，这价格很值得，下周末继续帮衬，好东西不要错过。', 1, 4, 7, 3, 2, '3', '2020-07-21 13:51:34', '2020-07-21 13:51:34', '[\"/upload/article/f576b8c6c3b9664d479deb65d5e4c398.png\"]', 0, ''),
(10489, '大长腿 胸大的 圆圆 真爽 朝阳', 20, 30, '1000-3K', 110000, 110100, '617901936', NULL, NULL, '鸳鸯浴,KH,做爱,', 'MM比较大方，当着我的面脱衣服，女人脱衣服的时候是最漂亮的，我目不转睛的看着MM脱衣服，……当脱的只剩下内衣的时候，MM看我了一眼，故意的把胸部一挺……天啊！因为MM挺起了大胸，我发现MM的那两个球更加凸显，而且随着呼吸也在轻轻地颤抖着，幅度虽然不大，但是却让我的目光随之而上下微微地移动着，没有办法，实在是太诱人了。 雪白的肌肤的视觉冲击力。MM突然一笑，双手举起往后轻轻地一扣，内衣脱了下来，那被紧紧地束缚着的球就像是一对小白兔一般崩跳起来，最顶端的那两点嫣红更加是在轻轻地跳动着，我的小弟弟已经举枪致敬了！！\r\n上床后，我用舌头舔舐着MM的奶头，MM像一条抽了骨头的鱼一样，身体软了下来，在我的身下蠕动着……  一时之间，我和MM就像是两块着了火的碳一样，彼此纠缠着、燃烧着。 最后经过一番的折腾之后，我对MM说：亲亲我的小弟弟吧。MM翻过身来，趴在我的小弟弟上，嘴巴张开……噢……我顿时感觉到自己就像是进入了一个热火的“洞”里一般，我稍稍地抬了下头，看着MM那就在自己的双腿之间的头轻轻地动着，还发出出溜出溜淫荡的声音……MM抬起头问我，爽吗？我没说话，MM张开嘴，往我的小弟弟上吐了些唾液，用手上下的撸动着，然后再低下头含着小弟弟开始大幅度的动作！！我突然倒抽了一口冷气，双手不由得用力握紧，头也仰了起来，如果有人在现场看着的话，估计就会发现我现在身体绷直的像一杆标枪一样！！ 我看着MM也比较累，我说，开始吧……MM很顺从的躺在了床上，身体还在扭动着！我提枪进入，感觉里面有无数的肉齿一样，在来回的啮合摇动，先是轻轻的抽插着，MM的身体在跟着我抽插的幅度在来回的扭动，我抽插的速度在加快，MM的呻吟声也慢慢的变的急促起来…… “换个姿势吧”几分钟后我感觉到自己有丝丝射意，我就拔出小弟弟，和MM说道，跪着吧……MM很听话，翻过身子，把那雪白的屁股往我的小弟弟上拱着，我掰开MM的臀瓣把小弟弟放了进去，两个手放在MM的腰上，进行着原始的活塞运动……MM似乎也感到了快感，呻吟的声音有点高亢……啊！！！射了…', 2, 4, 2, 1, 2, '3', '2020-07-21 13:51:29', '2020-07-21 13:51:29', '[\"/upload/article/6944af64b6b819ce973be0897a6d44b4.jpg\", \"/upload/article/b990dfdb026c4b1f4e72af2e0d44d2fd.jpg\"]', 0, ''),
