(10674, '纯莞式的文雅', 27, 30, '500/次', 330000, 330100, '2372558821', 'wy18368831089', '无', '漫游,胸推,冰火,口活,爱爱', '约了几次小蜜蜂，都约满了，小蜜蜂给我推荐了她的小姐妹文雅，进门发现跟朋友圈的照片无差，略有小肚子，B-CUP。别的不多说，确实是纯莞式，服务非常卖力，A面的时候，我前面那根棒子被她冰火嗦了好几个来回，差点就交货了，我估摸着我不喊停的话会一直吃下去，一摸她下面，居然全是水，我又了个擦，老司机们懂得，极品啊', 2, 5, 30, 1, 2, '3', '2020-07-21 13:51:34', '2020-07-21 13:51:34', '[\"/upload/article/35afc227f79c2aea86c87c5f379fe2a2.jpg\", \"/upload/article/bbd7349ae3e7b58647108cf66e69cd37.jpg\"]', 0, ''),
