(10720, '成都私人水疗馆，刚下海的漂亮小妹', 22, 30, '688', 510000, 510100, '2809759331', '15528193008', '18628066080', '保健,按摩,洗浴,桑拿', '周末休息，跟朋友联系，无意中朋友说验证了一个好玩的地方，非常棒的一次谈，于是赶紧要过来，打算过去看看没要留联系方式，预约了时间，驱车前往，遥控一路不表，是一个小区，环境不错，停车也很方便，很快就找到了停车位，激动地心，颤动的手，她粗来接我，第一眼看到她，高挑的身材前凸后翘，长得漂亮，小鸟已经开始要飞的感觉了，进去以后，还有几个妹子都不赖，各有千秋，我选了出来接我的那个妹妹，进房间简单聊了几句给予步入正轨了，鸳鸯浴，手法不错，口活也不错，身材胸臀真的相当不错，我的鸡巴直接棒棒硬，真是绝了，这样的妹子现在干这个的少之又少，走出浴室，口活十分钟，我直接把她按在床上狂操，b有点紧，水特别多，边操边流淫水，不过她的叫声犹如我内心的一股骚动，边哭边叫的真是绝了，我越用力她叫的越性感，很刺激，很爽。推荐给大家，有兴趣可以去看看，我反正会常去的。', 0, 0, 1, 0, 2, NULL, '2020-07-21 13:51:34', '2020-07-21 13:51:34', '[\"/upload/article/1d74d5c3a14a89f7fecf167431a1f821.jpg\", \"/upload/article/6723119b42a59abe64083421d095dd3d.jpg\", \"/upload/article/aa3f5477863d4c467b4daed7e558e0ed.jpg\"]', 0, ''),
