(10871, '重庆杨家坪服务特别舒服的一位，提前预约', 25, 30, '400-600', 500000, 500100, '3352404519', '13629773169', '13629773169', '鸳鸯浴,波推,口活,啪啪', '妹子叫花蕊，也是在重庆出差的时候，一天闲来无事，问了下ly,就给我结果就给我推荐了这个。\r\n\r\n直接正题，到了地方遥控开门，没有颜值还行，身材娇小些。跟贴心，又拿鞋又递水得。确定套餐后直接带着我去洗澡。洗澡洗的很细，还有胸和嘴给弄了下，非常舒坦。洗澡床上躺着，口了一会直接提枪开干。没前戏第一遍很快就射。然后接下来就是服务了，各种推加漫游，还一边陪聊。妹子也特别会聊天，诱惑人也是非常到位。完事了，提枪开干，这次时间很长，床下后入推车，沙发坐莲来了一会，最后妹子上位搞了一会。各种姿势，一波结束后，舒坦喷了。拔枪休息，妹子也休息了以后，擦一擦，洗澡，聊了一会我就走了。', 2, 4, 16, 1, 2, '3', '2020-07-21 13:51:34', '2020-07-21 13:51:34', '[\"/upload/article/9abf71a530a0594fccd59a18a2b15060.png\", \"/upload/article/ea867a00295addf355bdd388127797b2.png\"]', 0, ''),
