(10935, '南昌性价比最高的兼职', 26, 30, '500qt', 360000, 360100, '2261179965', NULL, '13217002240', '全套莞式服务', '：加了这个妹子的QQ一个多月，一直都没有时间，正好11月初礼拜四的一个下午有机会翘班出来，就约了妹子，留了电话，妹子很爽快，只在下午约客人，晚上不约（后来做完了了解到妹子是怕晚上有人喝醉了乱来），中午12点半就去叠山路汉庭开好了房，把地址和房号发给了妹子，妹子大概15分钟就到了，见面了看见跟照片没区别，就给了500大洋，还给了30车费，然后就是鸳鸯浴，妹子今年26岁，胸软软酥酥的，摸上去感觉真不错，妹子很健谈，一边洗一边聊天，声音也好听，洗完了在床上做服务，妹子态度没的说，全套服务不打折扣，妹子的口活真的是一绝，尤其是360度吹，爽翻了，吹的时候有2次都想射，让妹子停了才缓过来，吹的差不多插进去，妹子的BB还算是挺紧的，抽插的时候妹子的叫声也是一绝，总体来说性价比超高。', 1, 1, 17, 3, 2, '3', '2020-07-21 13:51:34', '2020-07-21 13:51:34', '[\"/upload/article/a94ce32dd625bdfd21839a540d63106c.jpg\"]', 0, ''),
