(10951, '验证性感大奶张，欧美式口活，揉奶爆操出货', 23, 30, '1399', 350000, 350200, '3028819722', NULL, NULL, '69,漫游,口爆,口活,爱爱', '之前看见姐姐的巨乳照，就一直心猿意马，想去体验体验， 最近刚好办事路过，就驱车前往，到地方发现是简易楼，环境一般般，进去后姐姐开门就看只穿着透纱裙，于是上下其手，姐姐也一把抓住小弟弟，聊了一会儿洗澡，卫生间不大，也没让陪浴。洗完出来后开始kh，不得不说姐姐的口活是真好，欧美式的口活，基本上次次深喉，而且还没有齿感，这点真的很厉害。口的时候也不催，不叫停不停，小狼觉得差不多了，带雨衣提枪上马，换姿势姐姐也都配合，叫声也不假，最后揉着大奶出货。', 1, 5, 4, 1, 2, '3', '2020-07-21 13:51:34', '2020-07-21 13:51:34', '[\"/upload/article/7c830fb546f51327b2636686f4b74df7.jpg\"]', 0, ''),
