(11348, '长腿美女，骚的很', 25, 30, '600p  1100不限次2小时，1600包夜', 420000, 420100, '1284566189', '13469995820', NULL, '基本啥都配合', '这么冷的天，妹子外面大衣一拖，就看到妹子穿了一套jk服，裙子短的很。手一伸进去，发现没穿内衣，很温柔帮我脱了衣服，一起洗了澡，洗的很认真。很会口，无齿感，逼还不是很松，一顿输出，叫的也很淫荡，后面抱着妹子，感觉皮肤真的好，摸着她的mm睡着了，醒了以后，让妹子口了一波，硬了，打了一波奶炮，身材是真的好。', 2, 1, 31, 5, 2, '3', '2020-07-21 13:51:34', '2020-07-21 13:51:34', '[\"/upload/article/18e79bad33c16e5b9b01fc0cb93698e2.jpeg\", \"/upload/article/9cea3bdf9298dd0132066d18fe8472d9.jpeg\"]', 0, ''),
