(11499, '长腿美女可欣', 20, 30, '800', 310000, 310100, '703551718', NULL, NULL, '个人商量', '美女给人一种初恋的感觉，你能感觉到美女很害羞，但是慢慢就好了，过程一直在尖叫，叫的没成几分钟就下来了，等下次一点包夜干他', 2, 1, 17, 3, 1, '3', '2020-07-21 13:51:34', '2020-07-21 13:51:34', '[\"/upload/article/860124f0ce003839d1fefc069b6c6006.jpeg\", \"/upload/article/92dd6355cd4207755fdc3f3832317a5f.jpeg\"]', 0, ''),
(11504, '琪琪MM演绎潮喷美景，巨乳惊人', 25, 30, '1380', 350000, 350500, 'QQ2123344357', NULL, NULL, '口,指滑,漫游,高跟,胸推,情趣丝袜诱惑,爱爱', '废话不多MM提前说了一下，说自己微胖，但不丑，MM来了之后一看模样还OK，身材也仅仅是微微胖而已（其实大家都懂得，肉多的MM一般欲望都强，水都多），但是开始办之前，妹妹突然建议小狼在床上再铺个单子，小狼开始还以为是MM只是水多而已也没想到她能潮吹（因为一般要是能潮吹的MM都会提前说的毕竟潮吹也是一个特色啊，这里鄙视那些因为能潮吹而乱要价的人），。小狼不好一个新单子后与MM相拥上床，MM脱之间看着是个满文静的姑娘，没想到一脱开搞，立马换了个人那表情骚到爆啊，眼神迷离，紧咬嘴唇，开始女上位搞的时候就感觉水多都已经顺着大腿流，但是可以肯定这里还没潮吹还仅仅是水多而已，等换到男上位时，小狼感觉水越来越多，小狼突然感觉水这么多的MM有可能会潮吹，随和MM交流其是否能潮吹，MM给的答案是如果给她干到高潮，那是会潮吹的，小狼听大喜，真是每想到啊，废话不多说既然能潮吹那就必须搞到潮吹，因为mm本身也敏感型的小狼基本不费力MM潮吹了，水量相当大（完事后，一看不光小狼重叠新铺的单子湿透，连原来的床单也湿透，就连床单下面的褥子都是一片），多提一点，MM叫床声音也很大，高潮一来那声音估计定力小的直接给叫射了。呵呵', 1, 7, 10, 1, 2, '8', '2020-07-21 13:51:34', '2020-07-21 13:51:34', '[\"/upload/article/4859757186acdeb97ed9eaf34c01ee5d.jpg\"]', 0, ''),
