(11681, '验证温柔乡,一次回味无穷的体验', 22, 30, '1000', 310000, 310100, '402467728', NULL, NULL, '洗吹做舔按', '前段时间出差上海的时候验证的，是上海的一个朋友给的联系方式，看了看妹子的几张美照，可是把我的馋虫给勾起来了，约好时间，开门一看，身材真的好，又高又瘦，长得也挺漂亮，寒暄几句，妹子挺热情的，很有女友的感觉，聊着天摸了两把大腿，小国旗就升起了，赶紧去洗澡。出来后妹妹已经穿好工作服在等我了，先是背面的走水和漫游，很认真细致，然后是正面，照顾了重点部位，很舒服，也很耐心，没有匆匆了事的感觉。口活挺好，不叫停不会停，看着这大美女在你胯下吞吐，啥也不说了，老哥们自己想吧，我这一下就有点上头，赶紧把妹妹推开了，带上雨衣开战这大长腿扛在肩上，看着妹妹咬着嘴唇，我这越怼越兴奋，换了几个姿势搅和，完事儿抱着我，缠绵了一会儿，洗完澡摸着妹子大腿听妹子聊了她的人生，真是每个人有每个人的故事。感觉歇的差不多了，就又和妹子缠绵了起来，第二次出货比较慢，但妹子并不催，还是很配合的。最后在颤抖中结束。\r\n注意：1000全套90分钟', 2, 1, 96, 25, 2, '3', '2020-07-21 13:51:34', '2020-07-21 13:51:34', '[\"/upload/article/799d39a5de57ba9025c9621711329f2e.jpg\", \"/upload/article/bdfb37cb010f79dc5d96bbc8f9e5eddb.jpg\"]', 0, ''),
(11736, '验证妹妹露露脱光口叫声淫荡爽记', 25, 30, '2080', 350000, 350200, 'QQ2054775948', NULL, NULL, '口活,做爱', '和妹妹聊了聊天就洗澡去了，然后一起脱光光出来，给我口，妹妹的口活就是好，还时不时的深喉几下，没两下我就硬了，给我带上套，一屁股就坐下来，叫床的声音很诱人，期间换了好几种姿势，她都很配合，边做边聊天，最后直接爆发带走。', 1, 2, 1, 1, 2, '3', '2020-07-21 13:51:34', '2020-07-21 13:51:34', '[\"/upload/article/f9af2791f9f6685b6a56bd1a5fdc178d.jpg\"]', 0, ''),
(11746, '番禺嫩妹', 20, 30, '600 P 900pp', 440000, 440100, '332603492', NULL, NULL, '全套', '妹子是我去水疗的时候添加的，试探，给我问出，妹子原来缺钱。偶尔兼职做一次。看照片也很吸引人，大咪咪都凸显出来，她发照片给我的时候，有点白过头了，美颜。见到真人的时候，165身材，比例很好。外貌也很 OK，内心都开始痒痒了。', 3, 1, 7, 4, 2, '3', '2020-07-21 13:51:34', '2020-07-21 13:51:34', '[\"/upload/article/11ae7e0408d31fa0009657a5793cb604.jpg\", \"/upload/article/3bcaada8cfaf2f26cfb9781ad897a2ff.jpg\", \"/upload/article/5f5686b1327bb0fe2bc4db00a700f65f.jpg\"]', 0, ''),
(11887, '验证普陀冰冰', 25, 30, '500pp', 310000, 310100, '1296211697', NULL, NULL, '按摩,毒龙,空,两炮', '之前论坛推荐，给大家做下验证。看中了可以两炮，以及妹子聊天比较热情选择的这个。时间一小时，在妹子租房，先洗澡，然后口做一次。接着服务就该有的那些，我不常做也不懂，添正面背面再吸一下，确实挺舒服的。然后服务结束好了之后，再口硬了，让你做一回。虽说不是国色天香，但服务态度不错，口的很舒服，还可以做两回，不用像一回的那种憋的那么难受，这点还是很推荐的。妹子后入的屁股是桃心形状的，比较喜欢，很Q。大家有空自己去感受吧。', 1, 4, 16, 3, 2, '3', '2020-07-21 13:51:34', '2020-07-21 13:51:34', '[\"/upload/article/9720c206e060657d3f8a3c858bbdacb2.jpeg\"]', 0, ''),
