(12311, '杭州大胸妹贴心服务', 25, 30, '498kb tt   798ml', 330000, 330100, '602825106', NULL, '17174328221', '按摩,波推,舌滑,毒龙,口爆,爱爱', '联系客服，确定好妹子和时间过去，先洗澡保持卫生，然后享受妹子的按摩手法，开始用舌头游走全身，让你酥酥麻麻，波推的时候软软的很贴心，毒龙很给力，感觉要进去了，最后选择口爆，一泻千里，洗过澡撤离，适合狼友去放松，说是全年无休哦！', 1, 6, 16, 2, 2, '3', '2020-07-21 13:51:34', '2020-07-21 13:51:34', '[\"/upload/article/0744a8ad06aa47014b7085972c0d9b5f.jpg\"]', 0, ''),
