(12551, '小姐姐水多', 22, 30, '快7夜16', 330000, 330100, '747896480', NULL, '13022642414', '毒龙,口爆,鸳鸯浴,大活,胸推', '联系客服，确定好妹子和时间过去，先洗澡保持卫生，然后享受妹子的按摩手法，开始用舌头游走全身，让你酥酥麻麻，波推的时候软软的很贴心，毒龙很给力，感觉要进去了，最后大活，走向人生巅峰', 1, 5, 9, 3, 2, '3', '2020-07-21 13:51:34', '2020-07-21 13:51:34', '[\"/upload/article/60ced1e9cf07c612a6baabc0cbc86c8f.jpg\"]', 0, ''),
(12579, '黄埔青青', 24, 30, '750', 310000, 310100, '375073398', NULL, NULL, 'YYY,ZFYH,丝袜,口活,胸推,SH,69', '加了有一段时间了，一直没有去，恰逢那天发了工资跟奖金，联系mm，刚好有时间，遥控到房间，mm打开门，好像已经准备好了，黑色蕾丝连衣裙，下面穿着黑色丝袜，瞬间xl的欲望就被挑了起来。抱着mm上下一阵乱摸，先让口了一次，看着dd在mm口中一进一出，感觉超级棒，大概口了10 分钟，按住mm的头，一阵抖擞。然后去洗了洗，mm服务很好，后来又一起躺在床上来了一炮，先是69，mm下面不太紧，但是没什么味道，洗干净后舔了舔，后来mm有点受不了了，主动坐了上来，一上一下，xl双手自然没有闲着，摸着大奶，最后hr式结束，总之性价比很高，服务挺好。', 1, 7, 14, 4, 2, '3', '2020-07-21 13:51:34', '2020-07-21 13:51:34', '[\"/upload/article/e7db2b15ed06b239f20a4f60b685856d.jpg\"]', 0, ''),
