(12666, '闵行小雅', 24, 30, '5z50fz一次 9z两次80fz', 310000, 310100, '1939136960', NULL, NULL, '共浴水中萧69口活等等', '加qq和mz约好时间一起妹子会给你地址 到了联系mz会给你房间号 然后你懂的就不细说了', 1, 1, 32, 3, 2, '3', '2020-07-21 13:51:34', '2020-07-21 13:51:34', '[\"/upload/article/732b0ef1707eca6f8c5f0024968f8ada.jpeg\"]', 0, ''),
(12842, '20岁大胸清纯小妹', 20, 30, '500p', 310000, 310100, '1468903742', '本信息暂未验证，请小心被骗，如有押金，请勿上当。', NULL, '胸推,口活,独龙,做爱', 'QQ上找的妹子，最近刚下水，昨天下班时间早，就约了妹子直接过去了。妹子还是很主动的，胸绝对可以，有D。XL对胸大的妹子有一定喜爱，胸推真的是很爽。\r\n妹子很敏感，下面水很多哦，也很紧。AA的时候妹子也很主动，小屁屁也很大哦，hr的时候那感觉，你懂的。', 1, 4, 3, 1, 2, '3', '2020-07-21 13:51:34', '2020-07-21 13:51:34', '[\"/upload/article/b5acd49d619680aa91b9d1c2d500ec65.jpeg\"]', 0, ''),
(12866, '东北一米七高个子熟女蓝色玫瑰', 31, 30, '300 500', 110000, 110100, '蓝色玫瑰q：3209552241', '无', '无', '口活,独龙,做爱', '以前南苑西路有一个东北熟女叫妞妞，体验过几次，现在上岸了。有一天看见妞妞的说说上介绍有一个闺蜜，然后我就加上了，就是蓝色玫瑰。蓝色玫瑰自我介绍写净身高1米7，看照片身材确实高挑，鉴于是妞妞推荐的，决定去试试。到了后发现身材果然高挑，还穿的高跟鞋，本狼身高穿鞋后才1米74左右，看蓝色玫瑰需要仰视。。。过程就不细说了，不催人，咪咪大身材高，可以让她趴在床边，站着日，最后我站着缴枪投降。非常有征服感，。对了，300一次，作为熟女来说，还是值得。', 1, 3, 2, 1, 2, '3', '2020-07-21 13:51:34', '2020-07-21 13:51:34', '[\"/upload/article/00c6e2d4d6ad96a3ccdf1f191d1850e8.jpg\"]', 0, '');
