(12892, '验证气质新人,大白兔丝袜高跟,又美又骚气', 23, 30, '800', 110000, 110100, '525102018', NULL, NULL, '冰火,丝足,制服,波推,臀推,环游世界调情,爱爱', '这是新鲜出道的美女，素质说是很好的而且骚气十足，其实我就喜欢这种骚气十足型的，我就想试试。前面联系过程就不表了。如愿见到，妹子真的好有气质，穿着丝袜高跟，又美又骚气。忍不住从后面抱住了她，妹子回头来了一句”着什么急呀，禽兽，一会都是你的“，说的我禽兽大发，疯狂的摸了一阵了，不知不觉中一把妹子扒光了，中间妹子也是很配合，没有表现出不情愿了。既然光了，那就去先洗洗吧，洗完上床才发现MM的大白兔也够给力的，有C吧。感觉妹子也颇饥渴，十分主动，太他妈爽！会的活挺多，冰火，丝足，制服，波推，臀推，环游世界调情，就是这些前戏就让人舒服死了，还一边口一边挑逗我的乳头，再换我舔妹子乳头，她身体反应很诚实。接下来就是啪啪啪，妹子骑上来，又我骑上来，再后入，听着妹子娇羞又忍不住的娇喘还是很兴奋的，全程相当舒坦。\r\n最后总结一下：有点小贵，但感觉还是很值得，这种玩一次会很舒服，很享受，比那种三四百的快跑感觉要好的多。虽说是刚出道的，但感觉应该不是，感觉像是老手，也许是刚来北京出道吧。', 3, 7, 14, 4, 1, '3', '2020-07-21 13:51:34', '2020-07-21 13:51:34', '[\"/upload/article/68d1f0c4fee2b1f06f32b2b085d12b0b.png\", \"/upload/article/90a836fede6cc4b06a4f38ffb4b0857a.jpg\", \"/upload/article/ad654e089613d44b460ce17dd94a8427.jpg\"]', 0, NULL);
