(13005, '亦庄文化园地铁站晕眼F奶', 24, 30, '500/p 900/pp 1200/2h', 110000, 110100, '3106533640', NULL, NULL, '鸳鸯浴,漫游,胸推,69式,冰火,口活,爱爱', '忘了在里加的她了，突然想起有个F奶还没CJ过，就约好了时间过去看看奶。妹子住在亦庄文化园地铁站附近，楼下有个卖水果的，旁边就是小区的门禁。但是门禁是需要刷卡的，但人流还算密集，LY们可以跟着人流进去。妹子住的楼也有门禁，同样可以跟着人进去。\r\n上楼见到妹子本人后发现要比照片壮不少，脸有些大，但是模样儿还算很周正。进屋坐下妹子非常热情不腼腆，给拿了AD钙奶喝，哈哈哈！歇了有十分钟左右吧，准备脱衣服洗澡。妹子一点也不羞涩，三下五除二就扒光了自己，两个F奶瞬间就映入眼帘了！\r\n大！确实大！也还算挺！但并没有我想象中的那么震撼！\r\n妹子先去帮着放热水，本人也不急不慢的扒光自己，然后到浴室与妹子汇合。浴室整体空间不算大，有点像是酒店的风格，里面还有一个淋浴房，严重的限制了浴室的大小。妹子PY很不错，两个F奶打上沐浴露在身上蹭来~蹭去~蹭来~蹭去~还时不时的挑逗一下，感jio十分的美好。洗澡完毕后直接上床，妹子服务很多，因为我选择是2h的所以全部体验了，吞蛋十分的舒爽，把整个儿蛋全都含了进去。妹子舌头贼长，口活儿也十分牛逼，连舔带嘬，弄得我一会上一会下的，哈哈！\r\n口活儿完事，进入正题！鉴于妹子这块儿，也别女上了，自己动吧！妹子的下面不算粉嫩，但也不算黑，带上小雨伞，缓缓往里顶~啊~顶~啊！海星！还算比较紧的那种！甭说了，赶紧动吧~\r\npapapa过程与往常一样，20多分钟之后完事儿交货。打完收工后和妹子钻进被窝，揉着奶迷瞪了一会，然后洗澡走人。值得一说的是，完事洗澡的时候妹子还在挑逗，差点支着帐篷走...', 1, 7, 5, 2, 2, '3', '2020-07-21 13:51:34', '2020-07-21 13:51:34', '[\"/upload/article/affbe1adb4d91b78b557b0bb8b4efc9f.jpg\"]', 0, ''),
