(13233, '年轻漂亮的老兼职', 24, 30, '单次400时间是一个小时 两次是700时间是90分', 310000, 310100, '1304999481   3496519033', '13564054683', '13564054683', 'AA,洗澡,可口,丝袜,TQ,漫游,69,口爆,ZF,独龙,高跟鞋等', '这个是老兼职了，在上海地区做的时间很长，不过长得一般，身材还可以，主打SW，可以QT，家里有很多衣服高跟鞋可以随便选，主要做的就是FW，价格的话不贵，在上海地区来说算是普价了，自己在小区租房住可以外出，外出的话需要加路费，自己有工作，大家找的话提前加好友吧，电话微信和QQ都拿到了，联系起来很方便的的，我现在推荐一下。', 2, 11, 18, 5, 2, '3', '2020-07-21 13:51:34', '2020-07-21 13:51:34', '[\"/upload/article/89e65df55c637069d39eec477d2c2d35.png\", \"/upload/article/8ffc06295be23175fa8910ab8a0c9b9d.jpg\"]', 0, ''),
(13266, '大长腿“网红”妹子', 23, 30, '900', 110000, 110100, '455155166', NULL, NULL, '洗澡,按摩,亲吻,口活口爆,诱惑,69,爱爱', '这个妹子每次来北京十几天，但是不算兼职，应该是老师级别的人物，为什么这么说呢，实在是技术太炉火纯青了，py，波推，漫游，dl，kh，指划等等样样精通，而且服务态度也特别热情。\r\n这女的跟我说她被前男友开发过后门，但是自己不想做后门，因为太疼了，有这方面需要的朋友可以问下她加钱做不做。', 3, 7, 2, 1, 2, '3', '2020-07-21 13:51:34', '2020-07-21 13:51:34', '[\"/upload/article/009f2762a5c8500578d745740229a476.jpg\", \"/upload/article/0a86f9f549b79d847803ca0000c83b6c.jpg\", \"/upload/article/12c3104c870ee5273daac7371f70e96f.jpg\"]', 0, ''),
(13359, '新人妹子一个', 22, 30, '400p1500y', 340000, 340200, '489993103', NULL, NULL, '最低的就是口一次做一次,多两张来可以来两次,可以包', '联系好后到她的地方，要的4百的。陪浴的时候给k。完了直接上大活。妹子性格很温柔，不会有那种不耐烦催人的样子。', 1, 3, 17, 9, 2, '3', '2020-07-21 13:51:34', '2020-07-21 13:51:34', '[\"/upload/article/851e3f465c255217071a0bdf9620af5c.jpg\"]', 0, ''),
(13390, '闵行七宝居家ty妹子婷宝', 23, 30, '300', 310000, 310100, '2506268496', NULL, NULL, '鸳鸯浴,漫游,胸推,69式,冰火,口活,爱爱', '妹子颜值很高，身材很好，脚漂亮，300的价格很实惠', 2, 7, 6, 1, 2, '3', '2020-07-21 13:51:34', '2020-07-21 13:51:34', '[\"/upload/article/6adafc98cd135c93d7fdc18e03a46eba.jpg\", \"/upload/article/871cacee910390639f0ffb8d5bd1eae3.jpg\"]', 0, ''),
(13394, '临时约的梦嘉欣', 28, 30, '500/p 800/pp', 310000, 310100, '3260382489', NULL, NULL, '鸳鸯浴,漫游,胸推,69式,口活,爱爱,等等', '加班有些无聊，临时起意，挨个问P Q上出击列表中MZ是否有时间。问了一堆，就这位答复有时间。\n特意问了下，时间排的开吧。MZ答曰没问题。结果我就去了。给MZ买了点伴手礼。\n1. 见面：MZ小区是自己独住的，安全性不错；MZ颜值跟照片基本8成以上相似，身材略有肚腩；\n2. 服务：整体来说，该有的都有，包括SW，但是MZ应该是抽烟的，后来我自己倒是没想法SW了。MZ说楼下还有位开宝马的LY等着，不过他来早了，让他等着。瞬间心情不好了，一看时间很赶啊。虽然A面每个项目都做了，但基本上都是敷衍了事了。\n    姿势:女上一会儿，然后后入，然后站立，MZ虽然没催，但是很明显是着急下一位的。想了想算了，也别耽误人家生意了，快速进出后百来下，出水走人。\n    MZ皮肤还算可以，硬件嘛，熟了点，抽烟这个估计好多MZ都有。时间安排的不好，感觉好像我插队一样。总体体验不是特别好，但够不上投诉机车级别。MZ一直承诺下次会好好服务，我感觉除非急着卸货，短期不会再刷。\n以上有一说一，照片MZ空间有，最近拍了新照片。', 0, 0, 8, 1, 1, NULL, '2020-07-21 13:51:34', '2020-07-21 13:51:34', '[\"/upload/article/becfeded25d60787a1dc155e59c56d25.png\", \"/upload/article/f1183decd97573e9cadd1484e2a58fff.png\", \"/upload/article/ff729dfa3c000c2fa73277d8b93ded14.png\"]', 0, ''),
(13442, '有喜欢小短发这款的可以考虑', 25, 30, '3和4和6', 210000, 210100, '2475130186', NULL, NULL, '鸳鸯浴,漫游,胸推,69式,冰火,口活,爱爱', '最近查的非常严，所以有些朋友觉得买了信息也有时候联系不上，觉得被骗。这个nm有备用号，而且很多备用号，在空间里有可以好好看看。小短发干练那种，实际不是，感觉很好。照片是从另一个手机拍来的，不是偷的', 3, 7, 8, 2, 2, '3', '2020-07-21 13:51:34', '2020-07-21 13:51:34', '[\"/upload/article/0cf26f3f0d275cf2520185ceadf999e4.jpg\", \"/upload/article/6de18edcaf758a166527b8b437df7467.jpg\", \"/upload/article/b4f450a0d2a5baffd819d6e5dd507a1e.jpg\"]', 0, ''),
(13454, '广州越秀区的竹心', 25, 30, '500/次或900/PP', 440000, 440100, '1722397594', NULL, NULL, '鸳鸯浴,漫游,口活,爱爱', '9月份加上的。本来出差想找。结果他说出去旅游了。这次出差终于约上了。11月21号和11月23号去了两次。因为她爱好徒步。运动。所以身材很好并且是大长腿。面相有点风尘气了。声音很好听。比较爱干净。进屋不让坐床。先刷牙。陪浴，重点部位清洗很认真。洗干净才可以上床。没什么服务。就是口活。接吻。啪啪啪。就像她自己介绍的一样。服务控不用去了。像对待情人一样的可以找她。刷牙的原因就是可以舌吻。过程不会写。不管怎么干都能配合你。干完了帮你清理干净。聊会天留钱走人', 3, 4, 4, 2, 2, '3', '2020-07-21 13:51:34', '2020-07-21 13:51:34', '[\"/upload/article/101f993403cf227b263aeb17c1644cff.jpg\", \"/upload/article/122fb871a89a7365562431e33f9ec0e4.jpg\", \"/upload/article/e32a340c2d6730bb5c6ae4134fc98768.jpg\"]', 0, ''),
(13458, '越秀淘金温柔体贴妹子嫣然', 24, 30, '400/次.700两次.1000两小时不限次.夜1500不限次', 440000, 440100, '115018218', '18202065868', NULL, '鸳鸯浴,漫游,胸推,69式,冰火,口活,爱爱,SM,沙漠风暴,舌吻,毒龙,制服诱惑,道具,高跟丝袜,双飞', '再三声明，我不是枪手，我不是枪手，今天听朋友推荐刚出炉的淘金妹子嫣然很不错，所以一大早就开始约她，听说每天都比较忙，所以提前预约，11点约上，刚进房们嫣然很热情，我们两就进了房间，开始了我们的性福之时，我刚躺下，嫣然很激情的给我做各种服务，怪自己没有用，没有忍住，休息一会我聊了很久，就跟以前刚谈恋爱一样，啥都能聊上，休息一下我们接着又开始了，吹到真是很舒服，姿势随意配合，和AV电影一样的模式，多的保密，狼友们自己体验，觉不会遗憾，带着满满的性福感回味，', 2, 15, 11, 2, 1, '3', '2020-07-21 13:51:34', '2020-07-21 13:51:34', '[\"/upload/article/66eea1824622fe711d48219d77b70791.jpg\", \"/upload/article/ea6cf834ec5dba9fc192ac80f2983bb2.jpg\"]', 0, NULL),
(13469, '36D天然真胸美女云儿，会舞蹈', 21, 30, '550一次，950两次', 440000, 440100, '264745015', 'sn9188sn', NULL, '无套吹箫,鸳鸯浴,漫游,水中箫,69式,调情,口爆,按摩,波推,深候,激情爱爱', '筛选后挑了这个妹子云儿，提前联系好以后到达妹子家中，妹子很热情刚进门问我渴不渴，给我递上一瓶水，感觉很贴心温柔，22岁的妹子，目测162左右，不算很高，也是标准身高，不过胸蛮大的，有D。就带我到沙发上躺在我的怀里进行抚摸，骚话不断，紧接着马上脱掉自己的文胸让我抚摸他的奶子，这对硕大的奶子让我有些把持不住，很热情很主动而这些只是前戏，服务过程不详细描述了，有特点的有几个，一个是水中潇很很爽，另外一个加角色诱惑，妹子表演欲很强，换上制服以后立刻进入角色不断挑逗你，估计是学过舞蹈的表演能力那么强，而且服务很热情很主动，真人比较实在一些。', 0, 0, 6, 0, 1, NULL, '2020-07-21 13:51:34', '2020-07-21 13:51:34', '[\"/upload/article/06b0398959be41e55b55c606259c7749.jpg\", \"/upload/article/5a7453aa343941c2502ab54717593c25.jpg\", \"/upload/article/c7e010c94532382d859094dccd615ce7.jpg\"]', 0, ''),
(13476, '越秀体贴抒情女子-贝儿', 24, 30, '400一次45分钟 ，700两次90分钟，包2小时1000不限次数，夜1500不限次数', 440000, 440100, '1218925344', '18218764195', '13728069200', '鸳鸯浴,无套口吹,调情,按摩,情趣丝袜诱惑,高跟鞋制服诱惑,激情爱爱,乖巧听话,里面没写的就是没有,保证让您满意而归,', '情趣丝袜诱惑，高跟鞋制服诱惑，激情爱爱，乖巧听话', 3, 11, 7, 1, 2, '3', '2020-07-21 13:51:34', '2020-07-21 13:51:34', '[\"/upload/article/220def405328e4c4d114568f18aa821a.jpg\", \"/upload/article/fa2237c55ae8b58c78dc4197da8cf077.jpg\", \"/upload/article/fdb4b7b0ff3a768541cbdbdfca742b75.jpg\"]', 0, ''),
(13513, '20岁粉嫩的小土豆，乖巧可爱', 21, 30, '500/1次  750一小时不限', 440000, 440100, '3404369224', NULL, '19927441820', '鸳鸳浴,漫游胸推,无套吹,调情,制服丝袜诱惑,激情爱爱', '按照MM的指示到了楼下，家里环境还可以，本人跟照片差不多我就放心了，身高160左右吧，胸围有b，然后各位都懂的， 脱衣服洗澡，淋浴区比较小，妹子会帮洗澡，也有互动，一次性毛巾擦干净之后回房间开始做服务，波推，漫游什么的，之后一下MM在下面给我做口，小可爱舔到我满舒服，暖暖的，小小年纪口技还是可以也，摸着妹子，感到有点小湿润，年纪小果然敏感，带上帽子直接开始，前前，换个姿势后后，可以感觉到妹子在夹住我，一下子就给抓住了，交货。总体还是不错，妹子比较年轻，年纪小。下面粉嫩，服务也OK 都有。人也比较体贴温柔。', 0, 0, 12, 0, 1, NULL, '2020-07-21 13:51:34', '2020-07-21 13:51:34', '[\"/upload/article/52848b76eb98b2e42d937d81ddf9e613.jpg\"]', 0, ''),
