(13589, '朝阳寒漠 性格很好的妹子 多次亲身', 25, 30, '500', 110000, 110100, '2759479268', NULL, NULL, '鸳鸯浴,漫游,胸推,69式,口活,爱爱,等等', '整个我和这妞的聊天细节，可以看楼下，相信可以看出来这妞的性格真的没得说。我也学学坛子里的大神，字体改大点，重要的红色标出来！                                 \r\n                      去找她得有三四次了，原来是有代聊带着干，现在自己单做了，纯自聊自做，所以有时候加她了，短时间没通过回信息也别着急。她现在最注意的就是口碑，有人一定会通过的。那些打炮的细节什么的我也不想写！论坛里大把的人写的小黄文可比我强太多了。我就说说这个妞的性格，爆炸好！\r\n                     头一次找她，其实进屋以后有那么点小失望，外形方面没有达到我的心里预期，但我可以很肯定的说，不是什么大妈，也不是什么坦克，只不过就是太平庸了。\r\n                     但是一次过后，我就是去哪都觉得没意思，也可能是我没老婆，没女朋友，没有人陪。久经炮场的我对于纯打炮实在是提不起什么兴趣了。我也不瞒你们，很多次我都是去找凤姐，就是洗澡按摩，然后抱着再被窝里面聊聊天，有比较好的凤姐还会给弄点饭吃，对于不怕超点时间，愿意陪你吃吃喝喝聊天打屁的妞，我个人比较情有独钟，有感觉了打一炮，没感觉就是抱着聊天拉家常，或者包夜一起出去吃吃喝喝看看电影，回来再抱着睡觉。这个妞就是属于这一卦的，愿意花点时间陪你，而不是穿上裤子就要钱那种。\r\n                     其实熟络了以后，打炮更有感觉，妹子对我也非常的主动，甚至会有舌吻（我不知道对别人会不会），也没问过。包夜了经常性主动调戏我，有时候聊聊天，手也会伸下去或者直接猫被窝里给我口活。我真的是挺喜欢这种感觉的，而且也是说实话，这种良心妞也没几个了，都是太唯利是图了。她其实会的不少，那些所谓的东莞活她也都会，除了不口爆别的基本啥都行，而且极其的听话，可以摆各种姿势。后来聊了以后知道，以前有个家伙比较大的兄弟，抱着人家的头干，射嗓子眼，吐不出来咽不下去的，折腾的够呛，从此不做口爆。\r\n                     怎么说好呢？我其实就是属于那种空虚寂寞的，这个妞很多时候能给我一种情人的感觉，而不是单纯的交易，有时候聊天也会和我说，天冷了，多加件衣服，晚上吃点好吃的，多多心疼自己一点，其实有时候我也知道她可能会发给很多人，但是我就是觉得还挺暖心的。还有包夜她有时候会主动开玩笑的和我说，给你少收100块，你买点热茶喝，你也挺不容易的。其实有时候不是多点少点的问题，而是她有这个心思就足够了，当然了，大家去的时候别总和她说让她少收。\r\n                     从始至终，这妞一贯如一，从来也不会因为我们之间的熟络和关系，给我少做哪项服务，我是觉得这比那些号称什么都有，但是实际去了你不说她不做的那种要好太多了。这一阵子这妞生意清淡，有了回老家从良的念头，我就想着给她宣传一下，大家多多少少捧个场，让她赚一些，可能在北京能多待两年，我大杏吧还是威武的。\r\n                     不偷奸耍滑，技巧还可以，打炮的时候也挺投入的，看的出来，不是那种叫的假的一逼的那种。而且500块也带了不少服务，会照顾感受，就北京现在这个大环境来说，价格其实还可以的！\r\n\r\n500/一次带服务  900两次服务多 包夜1400', 3, 7, 74, 7, 2, '3', '2020-07-21 13:51:34', '2020-07-21 13:51:34', '[\"/upload/article/00db7d7d64510d37168c59cf7a12eb78.jpg\", \"/upload/article/b2c10d7a6f93f373f77f62f6148f66ff.jpg\", \"/upload/article/c92df46a022c162f5be03a35b3b40206.jpg\"]', 0, ''),
