(13641, '温柔甜美的多多 后入撞击弹感十足', 25, 30, '600一Q  1000二Q', 440000, 440100, NULL, 'swenrou888', NULL, '鸳鸯浴,漫游,胸推,69式,冰火,口活,爱爱', '之前看到论坛有哥们发帖说了多多，不巧添加都没后，多多休息了。昨天，刚好是双11，又是我的休息日。预约到中午就出发了。直接去到遥控上楼，门是打开的，直接上去按电梯。不过要花园的时候，可以跟人进去，进来都很方便。开到门，一进去房间，发现地方很小的，小单间。不过环境很少很干净的。床不算很大，勉强够2个激情。见到多多人，跟她朋友圈的照片差不多，9成吧。有化妆，比较精致。偏向有一些些小成熟类型。预计年龄是在23~24 可能长得有点成熟。类似小女人的感觉。就看到她穿着一个黑色长T恤，没漏出小性感的感觉。感觉有一些小保守哈哈。扫码付款6张，开始脱衣服去洗澡，不过多多脱衣服的时候，黑色小蕾丝的内衣有点诱惑，这点加分。然后大家进入浴室，浴室灰色地板和瓷砖，防水这种。很精致。很干净的浴室，就是有点小。多多也是认真帮你冲洗，干净后，用一次性浴巾这个很干净。然后躺着床上开始服务，流程都走了一次，躺着亲亲后面，亲你的小屁股，可以感觉到多多小唇很温柔，有弹性的感觉，可惜多多不给亲亲，这个好可惜。如果你很帅或者有机会。本人一般般不行。毒龙，亲咪咪，冰火，亲蛋蛋口都有。不过流程感觉有一点短不算很长。可能我是一次的，时间短吧。然后带上帽子，直接上位，一进去的感觉，有感觉，有水。真实不错。会摇摆，我都感觉到多多出汗了。可能是服务了那么多我都是躺着没出力。的确是一个比较认真的妹子。\n后面换成我来，换了4个姿势，最后是后入交货。唯一我最满意的是多多小屁股很有弹感，躺下来对着小屁股撞击的弹感很和谐这个最爽了。不知道去过的仁兄是不是有共鸣。很带感觉。[\n]总结：我现在都流连忘返，还想。可惜口袋有限。不能频频去。服务不错，耐心。认真。不过一些小缺点，我就不写了，我还是可以接受到的。其他方面都不错，颜值也OK。浪叫声不是很大，有点低调这种。过程还是不错的。', 0, 0, 0, 0, 1, NULL, '2020-07-21 13:51:34', '2020-07-21 13:51:34', '[\"/upload/article/2bf4ec0afdb696bb2baf16760e4d0f9c.jpg\", \"/upload/article/2d3bfccb91317f6cc6f26c5709cebb2a.jpg\"]', 0, ''),
