(13685, 'D胸可萌可风骚的小爱', 23, 30, '500M', 440000, 440100, '3508876852', 'aiai13642322949', NULL, '鸳鸯浴,五套吹,胸推,调情,爱爱,高跟丝袜', '人十分可爱性感，胸很不错是真的，腿更好', 2, 6, 1, 1, 2, '3', '2020-07-21 13:51:34', '2020-07-21 13:51:34', '[\"/upload/article/4b05d2a574268640423b3303993aefcb.jpg\", \"/upload/article/60acd0d7509ec11b0281de4c0d902150.jpg\"]', 0, ''),
(13686, '19岁乖巧粉嫩的小柚子 超级紧', 22, 30, '500M', 440000, 440100, 'QQ:2810047203QQ:562007678', NULL, NULL, '鸳鸯浴,漫游,胸推,69式,冰火,口活,爱爱', '可袖子相好看，身材苗条型，小波一手掌控，皮肤尚好，年龄估计在19上下。值得一说是，毛少，看起来非常可爱小性感，让人有占有欲，也是属于小可爱类型，乖乖女的感觉。服务有认真做，不催人，虽然胸不大，照样在身上擦来擦去的。亲下咪咪，接着漫游，这个过程有十来分钟，算不上特色，标准的套餐，换了3个位，不到15分钟，就交货了，有点意犹未尽啊。后入的时候比较紧，夹住的时候一下子就交货了。总体给个8分，有机会还会再找她的。仅供参考，喜欢的狼友，也可以找她。是一个很嫩的妹子。身材也较好，抱住的感觉也蛮OK，缺点就是年纪小不属于服务类型。', 2, 7, 10, 3, 2, '3', '2020-07-21 13:51:34', '2020-07-21 13:51:34', '[\"/upload/article/5ad6ffa0dd1dfd21b610fb476f50dfb6.jpg\", \"/upload/article/d5f1a08af732af99fb5c919c1d0335b7.jpg\"]', 0, ''),
(13687, '算是最近性价比最高的莞式全套了', 25, 30, '400/次', 440000, 440100, '3051741466', NULL, '13632369377', '鸳鸯浴,漫游,胸推,69式,冰火,口活,爱爱', '【寻欢细节】：\n                                                                                                     【前戏篇】\n话说刚到广州出差，周末抽空到天河北商圈走走。吃个饭，剪个头发，再一看表已经快晚上10点了。在天河体育场对面的某商场（不是本地人记不清名字了）门口石阶坐了会，听着体育场持续播放的躁动音乐，看着路上穿梭的各种美腿高跟，忍不住春心荡漾…...^^ 随即开始搜索工作。因最近工作压力较大，想找个莞式服务系的，自己躺着享受享受减减压。于是管朋友要了个莞式的资源。刚开始联系的说不在广州，问有认识其他的没，于是给推荐了这个，说莞式全会。加了QQ，看脸说实话一般，问了下会不会莞式，答曰服务全有。想想这么晚了（当时已22点多了）找没休息的也不好找，又就在附近。硬着头皮去吧。步行几分钟，到了体育西地铁站，根据引导到了附近的一个小区，小区门，单元门两层门禁，还算比较安全。乘电梯上去，一看，是本人。\n                                                                                                     【过程篇】      \n      MM叫lala, 穿了一身类似以前东莞选妃的那种晚礼服，应该是在会所做过。进去一问是贵州人，少数民族青衣族，怪不得长相确实不是大众脸，如果按少数民族的标准，更能接受。\n进房间，合租的房子，应该还有个同行（没见到）。房间里刚进去有点潮味，环境一般。问价位400，还得先付。说实话犹豫了一下想走，后又想想来都来了，就试试吧。抱着半信半疑的态度微信转了400。然后去洗澡，全程不用动，MM帮洗，全身照顾到位，我说我洁癖，结果还拿牙膏给我洗了三角区（不知道到底谁洁癖）。。。洗完后再浴室口了会，发现有两下子，深入浅出还带深喉。回房间后开始服务，因本人黑丝控，全程穿着备好的黑丝服务。先B面，指划（没指甲肉感略重差评），XT（挺有弹性，触感好评），臀推（屁股很有弹性，这点是惊喜），然后过水，吸皮，说实话，那小舌头点到刚刚好，很有感觉。之后撅着毒龙，也不知道是很久没做莞式了还是怎么，舔到会阴那部分感觉特别爽，竟然第一次差点没挺住。然后就是A面咬乳头，舔蛋，最后就是口。说实话，到口这段时就已经快扛不住了，赶紧顶住，提枪开干。选择最喜欢的后入式，MM的大屁股套着性感黑丝，上身又穿了粉色紧身裙（漏洞的那种），包住黑丝大屁股真的视角非常非常性感。而且在运动的过程中，感觉MM会吸，每次抽插都很输出，再加上有点声控，MM学的叫床声还很骚，所以没一会就缴枪了。结束后MM给重新洗了下，聊了会，快12点了，结束走人。\n                                                                                                      【感受篇】\n说实话，一没想到这么晚还能叫到莞式的（因为时间长，一般晚上10点多都休息了），二没想到先交的钱服务还真没对付，三没想到一个差点因颜值被pass掉的少数民族MM，竟然惊喜的是我一直喜欢的大屁股，毕竟最喜欢的后入式不用看脸，玩屁股就够了，而且还会吸，不管是服务过程（除了指划），还是大活的过程，都很爽。满足了我对这个价位所有的需求。个人觉得，有机会还可以去切磋切磋。', 0, 0, 6, 0, 1, NULL, '2020-07-21 13:51:34', '2020-07-21 13:51:34', '[\"/upload/article/1075f98bfa65784d47040f9cc3bf3bf0.jpg\", \"/upload/article/29cc4739f34d7015de08b97231878a97.jpg\"]', 0, ''),
