(13698, '天河颜值担当-苏小曼', 23, 30, '700-1', 440000, 440100, NULL, '15820265179', NULL, '鸳鸯浴,漫游,胸推,69式,冰火,口活,爱爱', '貌似论坛里之前有狼友发过，本人也是朋友介绍去体验的，的确是颜值担当，真人跟照片九成像，20多岁大长腿，妹子很文静，瞬间有种恋爱的感觉。唯一美中不足的是B-的上围，熊控建议绕行，颜值控们必须来见证一下。', 2, 7, 3, 1, 2, '3', '2020-07-21 13:51:34', '2020-07-21 13:51:34', '[\"/upload/article/8a74b63586ad9c7766da63d58d54bf85.jpg\", \"/upload/article/f5551c557680fad968d4e96eafd43c93.jpg\"]', 0, ''),
(13699, '越秀 超可爱甜甜', 23, 30, '400/1次或700/2次', 440000, 440100, '1807448675', NULL, NULL, '鸳鸯浴,漫游,胸推,69式,冰火,口活,爱爱', '颜值很不错，遥控上门，进来就亲一下很有女友feel，澡的时候有互动，拿对咪咪推你，两个小葡萄很有感觉，非常用心，洗完进房间开始服务，上床各种舔，漫游，舔胸，毒龙，一套下来搞得我欲火焚身提枪就上，妹子很配合各种动作，声音很甜，听着声音就很有征服感', 2, 7, 6, 1, 2, '3', '2020-07-21 13:51:34', '2020-07-21 13:51:34', '[\"/upload/article/4fc31b7472427eceb4a0073c14ce6aa4.jpg\", \"/upload/article/b3aa4697bb822b3c7712e19cb84fc090.jpg\"]', 0, ''),
(13700, '天河新人美美- 惊艳销魂口活', 23, 30, '400/1. 700/2', 440000, 440100, NULL, '17707308102', NULL, '鸳鸯浴,漫游,胸推,69式,冰火,口活,爱爱', '本狼只发亲身验证，对得起光大狼友，赚取金币也只用来购买和验证资源，造福更多狼友。美美是新人，10/30刚开课，所以水费很亲民。图片有过度美颜嫌疑，真人肤色没那么白，而且亲测车灯顶多C-，小狼都已经不抱奢望了。无奈妹子态度极好，索性一式，没想到口活无比惊艳，好到什么地步呢，小狼选的一水，大战百来回合后毅然决定深喉出水结束。口活绝对值得返食，无齿感，湿润包裹，舌头灵动，深喉极其有感觉。', 2, 7, 4, 2, 2, '3', '2020-07-21 13:51:34', '2020-07-21 13:51:34', '[\"/upload/article/071c6fc14037f220df31cbc725e40dc1.jpg\", \"/upload/article/5c192a72a3ffd171a161beb1f9ba4543.jpg\"]', 0, '');
