(13701, '19岁气质平面模特小乔，钟爱舌吻', 22, 30, 'p800/1次   1500/1次', 440000, 440100, NULL, 'AA1835758', NULL, '鸳鸯浴,漫游,胸推,69式,冰火,口活,爱爱', '妹子住在白云区，之前也是在论坛看到其他朋友发布，添加的，平面模特兼职，经常要去拍摄。妹子长的很标致，五官都不错，很有气质，身材标准，胸器稍微弱一些，不是很大，勉强抓起还不错。能亲能69，可以舌吻，可以舌吻的妹子已经很少了。只要你没口臭一般都可以舌吻。转进去你的嘴巴里甜甜的感觉。具体就不描述了，反正活是都做到了一样不少，态度也好有点情人的感觉。要说缺点那就是贵了，是800全套，不过偶尔体验一下还是不错的，有性感丝袜调情还是蛮到位的。一般是妹子开好房，在去她那个地方。妹子比较忙很难预约，基本要提前预约。偶尔兼职这个。19岁还是比较嫩，下面小紧。说话声音也是甜甜的。', 0, 0, 2, 1, 2, NULL, '2020-07-21 13:51:34', '2020-07-21 13:51:34', '[\"/upload/article/3dbd1855a1ddb82c3fdef6b8d18ef10c.jpg\", \"/upload/article/70ca424d1406139b5a5230628136e7a0.jpg\"]', 0, ''),
(13702, '广州体育西娇顺嫩妹-以沫', 25, 30, '500M', 440000, 440100, NULL, '13802418391', NULL, '鸳鸯浴,漫游,胸推,69式,冰火,口活,爱爱', '90后妹子，温柔可爱，服务中规中矩，重点是嫩，而且比较配合，不像有些人那样敷衍，虽然车灯不大（最多B-,凶控慎去）,但是身材好，而且乖巧可人。照片有美白和瘦脸效果，真人七成相似，本狼来来回回折腾了二十分钟才结束，没有任何催促和皱眉，事后只是说被晃得头疼…… PS：胸口有块胎记，不介意也无所谓，胜在乖巧可人，性价比高。另外，在一起还有好几位姐妹，有待开发之后再来汇报。\r\n本人只发真实体验，绝对负责，赚取金币也只是为了购买更多资源，为光大狼友扫雷。', 2, 7, 10, 2, 1, '3', '2020-07-21 13:51:34', '2020-07-21 13:51:34', '[\"/upload/article/2404bc0bb303e36a92d4dbacd51c9fed.jpg\", \"/upload/article/f9be523d8625b6482ca0ae3d97adaf3f.jpg\"]', 0, ''),
(13711, '出差西安，二刷韩姐处小姐', 35, 30, '200p', 610000, 610100, NULL, '18302967309', NULL, '口活,爱爱', '底本狼又被单位派到西安出差，这是今年第二次出差西安，3月份去的时候，去韩姐处玩了两回，一次熟女，一次嫩妹，都是150一次，虽说都是快餐，但毕竟便宜，对于在京经常花大钱操小姐的我来说，这个价位简直是白菜价。\r\n这次去提前联系好了，到了后当晚就去了，碰巧来了个新妹子，虽说是新妹子，只是在这家是新妹子，不是说是刚下海的。进门后发现是个熟女，说是34岁，但至少加10岁。照片是小清晰（去的时候只有左边这张照片，见到真人就变成了右边这张了），真人说不上是土、肥、圆，但绝对是老、油、腻。不过在京区，本狼也不止一次有人照不符的遭遇，习惯了。服务还是老一套，湿巾擦擦弟弟，然后口活，几分钟后戴套大活。射完稍微清理一下，结账走人。也可以洗澡，但是人生地不熟，担心，本狼没敢多呆，回来后洗的。', 1, 2, 11, 1, 2, '6', '2020-07-21 13:51:34', '2020-07-21 13:51:34', '[\"/upload/article/2cf0e4260bbe62d5b42f62354a08f7de.jpg\"]', 0, ''),
(13717, '龙岗爱联 真服务性价比高', 23, 30, '400/次或1000/夜', 440000, 440300, NULL, '13026609770', NULL, '鸳鸯浴,漫游,胸推,69式,冰火,口活,爱爱', '4米1\r\n6米2\r\n千夜', 9, 7, 45, 2, 1, '3', '2020-07-21 13:51:34', '2020-07-21 13:51:34', '[\"images/202010/c4608c2973ff8cd43519db2b59682086.jpg\", \"images/202010/e4969cc8a24c803cadb2fb16bbbe54d2.jpg\", \"images/202010/c1d025e08ac43b794887bf25d224c8f2.jpg\", \"images/202010/d3f207e93d00a6d6b85b3d3fb218f9af.jpg\", \"images/202010/81554e3009a725e1e62948b75631bce6.jpg\", \"images/202010/5debce2c7907921365d62e2803b3da4d.jpg\", \"images/202010/118671239472ef8936d19720d7738ac9.jpg\", \"images/202010/374f9a7b8947d6d5a8e87f049ba403fa.jpg\", \"images/202010/59c579c561778426e6a53296aadcb2d0.jpg\"]', 0, NULL),
(13726, '风骚性感的小雪，会撩人', 25, 30, 'p500/1P 1000/2P', 440000, 440300, NULL, 'xiating888123', NULL, '鸳鸯浴,漫游,胸推,69式,冰火,口活,爱爱', '位置在深圳民治地铁站附近的公寓，妹子偏瘦，不能说算瘦，比较苗条。但胸C杯应该还是有的，身材苗条，笔直美腿，这身材这颜值可以啊。大概162左右吧，算高挑环境是公寓干净的很常规洗完澡，漫游，无套环保吹，然后开始干正事。吸蛋蛋的时候蛮舒服的，调情也不错。下面一开始很紧，后来慢慢开始有爱液的润滑，接着女上位，女上位很卖力，全程还是不错的。穿着丝袜诱惑你的时候很骚气。眼神比较诱惑勾引人。服务会全部做完，很注意细节。下面会夹，水也比较多，粉嫩嫩的，叫声很真实。听说，她同屋还有个姐妹可以双飞！', 2, 7, 4, 2, 2, '3', '2020-07-21 13:51:34', '2020-07-21 13:51:34', '[\"/upload/article/7491d6d46cf3ddd2479354ee2d039ac6.jpg\", \"/upload/article/8624d9ad6c19da21e7909f813eedc512.jpg\"]', 0, ''),
(13727, '深圳靠谱妹子', 25, 30, '300/P，500/PP或800/夜', 440000, 440300, NULL, 'yuer73816', NULL, '鸳鸯浴,漫游,胸推,69式,冰火,口活,爱爱', '深圳市宝安区上星村\r\n出差深圳，无聊，想起之前包夜过的一个妹子，微信找到，约好。该妹子重庆人，健谈，适合包夜聊天，比较谨慎，课表都是发的语音，3张一次，5张2次，8张过夜，很多狼都不信深圳还有这么高性价比的妹子，其实自己做的妹子3到5张一次价格是差不多了，很多一开价就七八百的基本是鸡头代聊的，妹子直接得的也就这些。这个妹子样貌一般，但该有的服务都有，尤其是该妹子平时锻炼，练瑜伽，柔韧度好，一字马是相当不错的，其它很多高难动作狼友可以自己开发。本人是包夜，怕约不到，先给了100块定金，你也可以不给的。第二炮的时候，妹子还会主动伸出舌头和你舌吻哦，这个就很难得了。妹子很耐心，一点不机车，值得一去。本人发的都是自己体验过的，附聊天记录，照片是妹子本人。', 4, 7, 40, 5, 1, '3', '2020-07-21 13:51:34', '2020-07-21 13:51:34', '[\"/upload/article/29360eff82b544584c5ecc113f9da48c.jpg\", \"/upload/article/cb700b3641780810ffd39236a9480ca4.jpg\", \"images/202010/4595ec10af29337470c8120eea027b44.jpg\", \"images/202010/e5a01e06aa9fd1556997ca48c6d793ce.jpg\"]', 0, NULL);
