(13729, '年底总结之杨箕可可', 25, 30, '4/1或7/2等', 440000, 440100, NULL, '18217379351', NULL, '鸳鸯浴,漫游,胸推,69式,冰火,口活,爱爱', '可可算是这次广州行还比较合适的几个之一吧，主要是性价比还可以（个人理解）。过程不表，到楼下遥控上楼，见到真人和照片出入不大，80%吧，就是很普通的那种。没有华丽的衣服，拖鞋睡裙看着腿和皮肤没有过太多护理，估计也是真穷人。进屋给钱洗澡，广州楼凤标准流程。喜好因人而异吧，洗澡时发现真的皮肤一般，胸不大。但特别真实，从后面搂着挺是滋味。洗完上床没做其他服务，直接按倒下面口，有点儿齿感，纠正了有些改善。穿衣开干，交底有点儿发黄，真实劲儿有上来的，个人感觉良好，也比较听话。因为身高比较悬殊让她穿上高跟鞋后入，因为生理角度问题，弟弟在里面被别住了那种感觉，但这样显得很紧实，每下都会明显的接触输精管，所以时间会延长些。最后让她归床上，穿着鞋（恋脚癖上来了），鞋底有正常的磨损，太真实了，越是真实越来劲儿，最后交货。她马上起身摘套套，我把她推到有摸了摸B，也没表示方案，洗澡下一场。', 0, 0, 1, 0, 1, NULL, '2020-07-21 13:51:34', '2020-07-21 13:51:34', '[\"/upload/article/5986ce786f66ef41b8d3ce3b3b186c53.jpg\", \"/upload/article/c1f4edcda781585641ac5b94fd91405b.jpg\"]', 0, ''),
(13732, '一摸水都出来了 骚妇秀秀', 23, 30, 'p350一次45分钟，700两次90分钟，900两个钟，包夜1300(23:00到10:00）', 440000, 440100, '', '', '', '鸳鸯浴,漫游,胸推,69式,口活,爱爱,等等', '口活略有齿感，漫游快慢节奏有度，重点照顾了我的敏感部位。在浴室直接口我真刺激，这个爽。忍受不了，直接叫妹子拿套子进来，开搞。水花拍打到身上，爽快交货。回到房间休息了一会，接着去服务，给妹子的冰火刺激到又起来了，摸着黑丝袜的触摸感，里面来感觉。顺便摸了一下，BB，没想到水又流出来了，真是骚。爱爱节目烂漫刺激，配合很到位，多体位，多姿势轮换，最终传教士缴械出货。总之感慨万千，有销魂蚀骨之享受，床叫嗲声嗲气的，水多逼紧。这里点赞一下。350全套服务，700二次该有都有，的确良心价格。卸货发泄还带服务的超值划算。', 2, 7, 0, 0, 2, '姐能干', '2020-07-21 13:51:34', '2020-08-07 05:18:31', '[\"/upload/article/4cddd2e138327093617ec7a9a1f0ed36.jpg\", \"/upload/article/99a7d8a1c4f881b1856bc075701b3b76.jpg\"]', 0, ''),
(13734, '温柔彝族小妹', 22, 30, '400/次（环保），800/次（爱爱）；800/次（环保双飞），1600/次（爱爱双飞）', 440000, 440300, '', '', '', '鸳鸯浴,漫游,胸推,69式,冰火,口活,爱爱', '该小妹之前在会所做环保服务，现和一搭档在高端公寓，三房两厅；特别温柔，而且会所服务一个不拉，热情大方，胸B，没有照片那么大，人与照片8成像，姑娘是四川彝族人，既有会所的服务，也有女朋友的温柔，值得尝试。', 2, 7, 1, 0, 2, '姐能干', '2020-07-21 13:51:34', '2020-08-07 05:17:16', '[\"/upload/article/03b5aaa480df6908b0985e311878546e.jpg\", \"/upload/article/5584f3aceccf184b8e2215a2bd0e550a.jpg\"]', 0, ''),
(13737, '南山极品平面模特纯忆，性感骚', 22, 30, '1100一次', 440000, 440300, '1709156178', NULL, NULL, '鸳鸯浴,漫游,胸推,69式,冰火,口活,爱爱', '妹子照片跟本人没有差太多，身材劲爆，身高169，大长腿又细又白的，大长腿属实！！！不着急能玩1个小时！身材苗条修长！惊喜是乳头很嫩，很小，像小女生的~！惊喜~应该比较敏感，下面还算紧，我隔着内内给摸出水了！陪浴的时候也有互动，相互挑逗，完全是跟女朋友一样的感觉，回到房间，口的时候骚，真骚，很有点知性美女的感觉！啪的时候很配合，还主动问我要不要穿丝袜制服。我是足控，妹子的脚也不错，在啪的时候她的脚被我含在嘴里舔，很舒服，体验极佳。惊喜：大长腿，高挑苗条，基本高端上都是这个价格。妹子还锻炼过舞蹈，身材还是一流的', 2, 7, 14, 1, 1, '3', '2020-07-21 13:51:34', '2020-07-21 13:51:34', '[\"/upload/article/0e63b4ed65ed1dfcc0e860a9cbee730a.jpg\", \"/upload/article/1c6bcc89d4a0f3fa1e806d310d066b95.jpg\"]', 0, NULL),
