(13744, '床上性感风骚的飞儿，亲吻一流', 25, 30, '500M', 440000, 440300, NULL, 'MCN157', NULL, '鸳鸯浴,漫游,胸推,69式,冰火,口活,爱爱', '飞儿是在清湖地铁站附近的，在论坛看到其他朋友去过了，我也是预约很久才可以尝鲜，妹子长得大长腿类型模特。五官长的标致，有气质，身材标准，胸就稍微弱弱一些，不大，唯一我最记得是可以接吻，轻轻亲住我的嘴巴，有一种小甜美的感觉。很少妹子可以亲吻了，这个是唯一可以的。还可以69相互亲，下面没异，蛮干净，相互亲的时候都感觉到触电。爽。具体过程不描述了，该有的服务还是有的标准流程，体验过程感觉类似小女友的感觉。和飞儿做的时候，特别舒服，进去的包裹。还有叫床声声音很骚，哈哈这个我特别喜欢。在床上用性感小制服加丝袜勾引你，简直就是一个小狐狸。是600全套，看着那么有气质，没想到床上那么风骚到位。加分。真人比照片好看，照片有点小怪，但是真人颜值不错8分', 0, 0, 1, 0, 2, NULL, '2020-07-21 13:51:34', '2020-07-21 13:51:34', '[\"/upload/article/24d6d175de59de83a1cdbd3fc79b08fa.jpg\", \"/upload/article/715ab0588cbcc41d77ab2198c1e83c7c.jpg\"]', 0, ''),
