(13749, '深圳宝安上合喜利宝购物广场附近', 30, 30, '350/次或600/2次', 440000, 440300, '449846867、2660204557、', NULL, '13700970309', '鸳鸯浴,漫游,胸推,69式,冰火,口活,爱爱', 'p早上问了一下，中午就直接过去了，在洪浪北附近，打个摩的要10分钟左右。洗吹做标准服务，我玩的是2次，做了1次就闲聊，这阵子抓得严，妹子已经一个星期没开工了，很多号都被封了，所以加申请得时候要说得隐晦些防止被封号。这个妹子的特点是胸大，还有就是后进时有臀夹功夫了得。总体来说服务还不错，性价比高。之前有人已经发布过了，我重新发布上新的QQ号和手机号', 0, 0, 8, 1, 1, NULL, '2020-07-21 13:51:34', '2020-07-21 13:51:34', '[\"/upload/article/ad9de11caafa16a9f43ccd99223aff14.jpg\", \"/upload/article/f1ca3e5d95cbfb4854260ee4ed3e16dc.jpg\"]', 0, ''),
