(13802, '双井董董 性价比高', 23, 30, '10张pp', 110000, 110100, '320892112', NULL, NULL, '鸳鸯浴,调情,按摩,环游全身,口活69,做爱', '之前在一些群里还有坛子里都听很多人提过董董，一直加了但没约，最初感觉不太算是我的菜，因为我不太喜欢guan式那一套。近期封号严重，好多妹子都失联了，所以约了董董，因为朋友一直跟我推荐。\r\n总体来说，算一次优良的体验，感觉算是性价比蛮高的类型，颜值可以，和照片没什么差距，胸的手感很赞，腿很长，fw很多。\r\n董董算是比较风骚的类型，浑身上下透着一种魅惑，尤其是让她穿上一身教师制服，带上眼镜，看起来很像AV里的桥段。有PY，洗完后先坐下聊了一会，董董的打扮看起来非常有剧情的代入感\r\n聊完后躺在床上，董董给我来了一遍guan式那一套，舌吻很赞，胸的手感很软，也很挺，一双大长腿可谓吸睛，我对着这双腿舔了N久。下体粉嫩无异味可品，不事儿，蛮配合的，品久了也美什么怨言。KH不算亮点，但也很舒适没有任何齿感，会K很长时间。\r\n1K的套餐一个小时，颜值身材都在线，FW也多，但缺点就是不年轻，看着能有26岁，服务态度和品质上没得挑。喜欢这个类型的朋友可以试试，照片上的身材和颜值几乎一致，具体如何你们自己看吧。', 1, 6, 7, 1, 2, '3', '2020-07-21 13:51:34', '2020-07-21 13:51:34', '[\"/upload/article/8c043314804e4902dfe28e2d7cf93846.jpg\"]', 0, ''),
