(14009, '南站附近小溪可三通', 27, 30, '700/次（三通）', 510000, 510100, NULL, 'shuiduoduo333333', NULL, '漫游,胸推,冰火,口活,爱爱,三通', '细节就不多说了，说一下重点，可以三通，B和后门可以换插不用换套，有喜欢三通的可以试试，很不错。', 2, 6, 20, 1, 1, '3', '2020-07-21 13:51:34', '2020-07-21 13:51:34', '[\"/upload/article/38e3e20d47365ade8ad4eb358b853424.jpg\", \"/upload/article/7997e05c023b26ed85885d7b6a0cff50.jpg\"]', 0, ''),
(14014, '双飞切换可不换套 带SM道具和三通', 30, 30, '单飞1000/2小时（不限次），双飞2000/2小时（不限次）', 110000, 110100, NULL, '手机与微信：15045541077，暗语：涛哥介绍的', NULL, '鸳鸯浴,漫游,胸推,69式,冰火,口活,爱爱,SM,三通,深喉,颜射,口爆,毒龙,捆绑,滴蜡,角色扮演,虐待,舔脚,女同等', '这个凤楼算是我的老熟人，经常去光顾的，她们警察有2-4个MM在一起住着，都是同行都能做，看上谁都能服务。前阵子出差，接到她给我发微信，说来了两个姐妹，一对可双飞的女同，诱惑得我不行不行的了，LZ在外地呢，恨不得马上回北京。6号终于回来了，朋友约上出去吃饭，喝了点小酒，感觉实在忍不住了。告别朋友，打车前往，地址我早熟悉了。一路上策划着双飞怎么干的事。进屋后两个MZ已经穿好情趣战衣，给我放好热水，带我去洗澡。。。洗澡过程不表。\r\n往床上一躺，先帮我给烟点上，一边一个MZ搂着，在我耳边吻。。。问我要求她们怎么伺候爷。。。我说因为喝了点小酒，第一次我就不动了，你们全程自动操作吧，等我先释放一次醒醒酒。\r\n接着就是从脚指头。。。从下到上的舔。。。（两个MZ同时哦，舔完脚指头我让他们漱口一下），到口的时候，一个毒龙，一个深喉。我擦，这个感觉刺激得不行了，我怕我提前出货，立刻叫停，两个MZ都给我撅着屁股，四个洞洞在我面前。。。。哈哈，换洞不用换套哦。不过小玉的菊花不太好放得进去，丽丽说还是干她的吧，说小玉的痔疮犯了。。。我去，四个洞洞变成了三个，其实应该是五个，呵呵，干了不到20分钟，出货。\r\n开始第二次之前，我就躺着，让她们诱惑我。两人开始女同，玩各种道具，其实这个部分完全可以发挥自己的想象，小玉和丽丽两个人都能接受。平时也没少学习，各种大片中的情节瞬间在脑海中浮现。过程大家自行补脑吧.\r\n这次体验感觉非常爽，比我在北京找得其它双飞刺激多了，至少两人一点不做作，而且非常开放。两个女奴，且是女同。。。哈哈。', 2, 19, 31, 5, 2, '8', '2020-07-21 13:51:34', '2020-07-21 13:51:34', '[\"/upload/article/97b8909abb4a1789fba75b9128eca2fb.jpg\", \"/upload/article/ff5fa8523ea1a96c66abe2718c488ace.jpg\"]', 0, ''),
