(14394, '徐汇少御丹儿 性价比', 22, 30, '500/次 900/两次', 310000, 310100, NULL, 'liyan19940822 加的时候备注推荐', NULL, '鸳鸯浴,漫游,胸推,口活,爱爱,高跟,丝袜', '眼看着魔都的肉价飞涨，苦于囊中羞涩，一直潜水沉默，最近实在憋的难受，朋友推荐的婉儿妹子，加了微信一看 很合胃口，照片很漂亮，我喜欢的小情人类型，不错！决定前往一试！ 微信联系婉儿， 答日5点半有空，立刻约下，途中地铁很方便，下车走几十米就到了，中途车上美眉川流，想着一会就可以见到婉儿，小头不自觉的起立！到地方了，问妹妹可否上楼，得到肯定的答复后，立刻赶往，在妹妹的指挥下，来的妹妹家门口，轻叩门户，婉儿开门，见面感觉非常不错，艺术照70分，自拍基本一致， 妹妹态度很好，说话细声细语的，指引换上拖鞋，细声说到咱们洗澡吧!\r\n双双来到浴室，浴室不怎么大，妹妹脱了衣服，完美酮体展现眼前，车灯较挺，一手握得住，皮肤很白，很嫩，无小肚子，期间全程不用自己动手，妹妹洗的很认真，洗净，还帮我擦干！\r\n\r\n        来到房间，妹妹说趴下，我就老老实实的趴着了，这里要批评一下，妹妹没有一次性床单， 只是拿了几张纸巾帮我垫在小弟弟的地方！B面服开始，兄t,臀t都有，妹妹做的也很认真，皮肤很柔很滑，而且很细心的从上往下t着，这点好评，不像其他妹子走走过程。反过来A面，A面服务也是认真的做完，慢慢往下，照顾小弟弟，直接含住，我不喊停她便不停。 一个字，爽！对了期间提出想拍几张妹妹的照片，妹妹欣然接受，可惜最后还是没拍，主要是小狼爽到了，真忘记了这件事，下次去一定要先拍! 哈哈哈哈！口了一会，提示妹妹穿上雨衣，准备大战，问妹妹有没有高跟鞋，妹妹一笑, 说有啊，还问喜欢什么样的，挑了一双黑色的，让妹妹穿上，然后揉着妹妹的车灯，一边摸着小花园，感觉妹妹有水了，直接提枪进入！期间换了几个姿势，看着她穿着高跟在我胯下呻吟扭动，真真的极有征服感。最终扛着妹妹的美腿出货！躺下休息下，妹妹也不催，聊了一会看看时间，起身再次洗澡，交了水费，妹子热情的送小狼出门！ 出门前还抱了妹妹一下，顺便再卡下油！哈哈哈！\r\n\r\n         总的来说妹妹服务是真不错，温柔细腻，皮肤柔软有弹性,服务AB面该有的都有,唯一的不足就是没有一次性床单！希望妹妹后期能够改进！\r\n没有拍现场照，遗憾了，贴几张张妹妹发给我的照片，艺术照片相似度70%！自拍照90%。', 2, 7, 17, 4, 2, '3', '2020-07-21 13:51:34', '2020-07-21 13:51:34', '[\"/upload/article/1b7b62328028d91abdf3286d1cad7b7e.jpg\", \"/upload/article/90136ab45d71cf9ad10beb8943da3d13.jpg\"]', 0, ''),
