(14533, '亲测轻熟女 确实不错', 30, 30, '500/次或700/2次，1500包夜，可以谈', 350000, 350100, NULL, 'xiaolan6651 联络暗号：晋安河畔紫光', NULL, '鸳鸯浴,漫游,胸推,69式,口活,爱爱,丝袜', '那天出差回来无聊，意外加了个QQ群，哇，好多妹子，但是很多都是没服务，只能啪啪。小狼是比较喜欢服务多的，而且比较在意面相，有的人一看就是很机车那种，所以选了很久。这个少妇是福建人，面相感觉不会机车，就微信联系下去了。果然挺不错的，聊了下就去洗澡了，洗完就是过程，你们懂得。遗憾是没有吸皮。口的非常认真耐心，不说停一般不会停。我是选了两次，第二次她那个女伴一直敲门，很烦，就缴械走了。一直给我说抱歉，下次补一下。喜欢熟女的了解下，挺好的。目测33左右。但是胸一点也不垂，皮肤一般。', 2, 7, 42, 3, 1, '3', '2020-07-21 13:51:34', '2020-07-21 13:51:34', '[\"/upload/article/2cb28b8a5540cb7600d64196342e804a.jpg\", \"/upload/article/e713cc33ae0e8c398870b0a903dec75a.jpg\"]', 0, NULL);
