(14595, '南阳路靠谱的温柔熟女', 30, 30, '300', 410000, 410100, NULL, '18236932932', NULL, '该有都有', '之前有人好像也发过，此女子加了很久，经常换地方，最近在南阳路活动，由于天气太冷，去之前问家里有暖气没有，她说有，按照导航，驱车直奔地方，还算好找，进门以后，本人比照片看着更漂亮，穿着个黑丝套装，顿时欲望大增，身材不错，长发，长相也可以，洗洗上床，开始服务，一句话，很认真，也很会调情，咪咪，脖子，冰火，一样都不能少，来回游走，感觉这个价位能有这个服务已经太值了，你不说停，她继续调情，69，发现下面还很小，带上雨衣，开始进攻，前面，后面，侧面，上面的时候，她舔着咪咪，真叫一个爽，确实认真，缴枪以后还有个意外的惊喜，姐姐说，你趴着，我给你按摩放松一下，之前做过美容，肩颈按摩放松，也很专业，真实超值服务，比起那些所谓的莞式机车服务好的不是一点半点，就像情人之间的约会感觉，兄弟们为了论坛的健康发展，希望大家都真实的分享出来，兄弟们抓紧时间去体验，这样的服务现在少的可怜，这位姐姐也是兼职，从良了以后就没有机会了！', 1, 1, 140, 10, 1, '3', '2020-07-21 13:51:34', '2020-07-21 13:51:34', '[\"/upload/article/644ecdb6fa84a59ed4f594b8d0c56e2e.jpg\"]', 0, ''),
(14601, '喜盈门附近', 22, 30, '500/次或700/二次', 430000, 430100, NULL, 'a13412333372', NULL, '该有都有', '朋友推荐的，还没来得急去体验，最近老婆查的严，没时间去，去过的兄弟评价一下', 2, 1, 9, 2, 2, '3', '2020-07-21 13:51:34', '2020-07-21 13:51:34', '[\"/upload/article/39718564230bf14eae335728118dca2b.jpg\", \"/upload/article/b3a3c930f1cc2aa695d2cc08f4838042.jpg\"]', 0, ''),
