(14607, '南亚附近熟女波霸', 30, 30, '5米/次', 530000, 530100, NULL, '13912296977', NULL, '该有都有', '离的比较近，就直奔住处，上楼进屋，看到之后还是略有些失望，照片如果给100分，实际长相只能给70分，但是就是要找熟女，也没对长相抱有太大期望，姐姐比较矮，有点胖，但是奶子是真大，开门的时候穿着一件黑色半透明的长裙，很是诱惑。进屋姐姐还比较体贴，把电暖器拿来让我暖和一会，然后去冲凉，冲的时候姐姐主动进来说帮我洗，姐姐主要帮我把JJ和屁眼好好洗了一下，然后进屋开始：首先是趴着做背面，有按摩，胸推，臀推，漫游，舔肛，毒龙，海捞，姐姐的大奶子做胸推特别舒服，毒龙也很舒服，做海捞的时候口的来感觉了，正面的胸推臀推就没再做，360度口活也没让做，直接戴套正面插入，姐姐说自己是剖腹产的，所以下面还是比较紧，挺长时间没做了，再加上大奶子波涛汹涌的视觉刺激，不到10分钟就射了。整体感觉态度很好，服务也挺到位。当然追求颜值的就不要考虑了', 2, 1, 88, 3, 1, '3', '2020-07-21 13:51:34', '2020-07-21 13:51:34', '[\"/upload/article/a0b55e6da115d669e530a7fcfbce5375.jpg\", \"/upload/article/d9dc5c53232b281821a463093e9006dc.jpg\"]', 0, ''),
