(14650, '洛阳蛋蛋 小巧胸爆毛多性价比高', 20, 30, '3一次，上门需要滴滴车费，大概20~50不等。', 410000, 410300, NULL, 'asd227226', NULL, '鸳鸯浴,口活,胸推,做,69,其他的不知道,没有尝试,', '今年11月中旬左右去洛阳出差，在洛阳龙门附近汉庭酒店住的，傍晚到了哪里比较无聊，就在洛阳兼职总群qq里面找了几个离龙门站比较近的几个妹子，附近妹子还不少，随便聊聊几个，其中一个妹子价格不高，3一次，看介绍刚刚20岁，就聊了起来，说好了地方，她妹子离我也不是很远，先转了30块滴滴费用，大概9点就到酒店了，我怕有诈，就跟妹子说我到酒店外面去接她上去。顺理成章把妹子带到我开的酒店，妹子说我好帅，哈哈。后面就和妹子脱了衣服，冲洗一下，后面。。。。不说了。性价比比较高，唯一不足就是脸袋不行，酒店开着暗灯，不影响，最后推荐一下这个酒店，是水床。价格也不贵，220.', 1, 8, 6, 1, 2, '3', '2020-07-21 13:51:34', '2020-07-21 13:51:34', '[\"/upload/article/c8d097dc29185770c26df0601311c87e.jpg\"]', 0, ''),
