(14668, '渝中翘臀寻欢', 30, 30, '500/800', 500000, 500100, NULL, '15023259527', NULL, '该有都有', '今日重庆出差，夜晚寂寞难耐，寻觅楼凤无数，无一令人信服，忽见一张图片，翘臀映入眼前，兄弟起立致敬，立马拨打电话，得知预约已满，再三恳求之下，同意加班一回，快马加鞭赴会，上楼打开房门，豪乳迎面而来，外表御姐姿态，丁裤若隐若现，翘臀名副其实，稍作歇息一番，脱衣洗澡开干，出浴伏于床上，正戏拉开帷幕，舌如游龙漫步，指若柳叶刮身，吹拉弹唱精通，一阵狂舔乱吸，菊部已然失陷，翻身胸推上演，几近发射边缘，连忙提枪上阵，谁知遭遇暗算，缩阴夹吸绝技，一阵冲刺之下，只剩满屋喘息，稍作休整之后，开始二次进攻，此次改变策略，后方再次深入，势必拿下此女，大战几百回合，留下点点印记，欲知后事如何，请君自去探寻。', 1, 1, 11, 5, 2, '3', '2020-07-21 13:51:34', '2020-07-21 13:51:34', '[\"/upload/article/6e735e424eeacfe14c3f33b32e8ce8da.jpg\"]', 0, ''),
