(14698, '体验不错的蝴蝶名穴妹', 24, 30, '700', 420000, 420100, NULL, '忘记问了', NULL, '助浴,按摩,丝足制服,波推,臀推,环游调情,口活,做爱,', '我一直没去验证，这次终于亲自体验了一下。之前在空间看照片的时候觉得..身材不错，穿..的感觉尤其好，电话联系后约到了妹子。第一感觉确实比较年龄小，穿的很暴露，骚气十足，..嘛，放的开。简单冲冲，享受床上服务，很细致，不机车，彼此都很享.受.，小狼尤其自己观察了一下大名鼎鼎的蝴蝶B。确实如传说中一样，但说实话小狼对此比不是很感兴趣，还是偏好小小..的那种，这种蝴蝶B总觉得有些压抑，胸硬，似乎做过手术，小狼用手抠了会，也有点湿。哈哈，管它呢，既来之则安之，口了一会，在我的张罗下开工吧，姿势不多，我也没轻人那么多体力，追求的只是享受，站着插了会，后入了几分钟，最后还是选择老汉推车，输出完毕。 此女也很卖力气，蝴蝶比很标准很夸张，因小狼接触较少，体验..比较好', 3, 9, 3, 1, 2, '3', '2020-07-21 13:51:34', '2020-07-21 13:51:34', '[\"/upload/article/1ba70eba62c341575eba9a508e881b4e.jpg\", \"/upload/article/7d74c0eef1ac00e540b522c2798a8a14.jpg\", \"/upload/article/9531df55015d17f30deff9ed8bddb0ba.png\"]', 0, ''),
