(14815, '中项技师下海', 22, 30, '400/次', 130000, 130100, NULL, 'hui1503066', NULL, '漫游,胸推,冰火,口活,爱爱', '以前是店里的中项技师，去过几次，后来熟了，就试着约出来了，年龄绝对不到25，身高170+，皮肤光滑，嫩的不要不要的，服务态度相当好，也可能是因为熟了的关系，不催，瘦高身材，胸B吧，腿型相当好，身材总体9分以上，长相比身材差点，不是网红美女的样貌，很真实，娇喘的时候表情很诱人，算7分吧，服务很好，给我做的全套，太刺激，太舒服了，我做完一次，不过瘾就再加次数，一共做了三次，服务能给9分，总体觉得很值。说实话要不然人家说有点缺钱，真不舍得分享。如果联系的话注意留口德，别瞎说，别瞎问，具体内容看你们自己联系了。', 0, 0, 2, 0, 2, NULL, '2020-07-21 13:51:34', '2020-07-21 13:51:34', '[\"/upload/article/21a8f68a34022913613566207cc8b3fa.jpg\"]', 0, ''),
(14824, '北京西站附近的相貌上等的妹子', 27, 30, '400/次或600/次，项目不同价格不同，最低400快餐', 110000, 110100, NULL, 'xdz00011136', NULL, '该有都有', '这个是我定期光顾的，上一次是11月底，没在这个坛子发帖，发在了另外一个坛子。这次是上周末又去了一次。第一次去是开车抵达了指定小区，遥控上楼（妹子比较谨慎，在遥控过程中，发了楼层和门号接着就撤回了，我进门提到此事，她说第一次客人还是要谨慎一些，大家都安全，这一做法值得点赞）。妹子住的是租住的住宅小区，当时去的时候有3个妹子，只有一个常驻，其他的2个都是她以前的朋友，属于串场短暂停留。当时一看3个妹子质量都比较上等，年轻而且相貌不错（年轻就是资本，这是多少化妆品都掩盖不了的）。当时想来个双飞，结果我约的那个妹子入行不久，有点不好意思，也就没勉强，选了一个400快餐，按程序办事，大家都懂，不多描述。比较称赞的是妹子服务态度比较好，一点也不机车，非常温柔，皮肤非常光滑，我喜欢自带丝袜，有时候遇到皮肤不好的，还是让妹子穿上丝袜摸起来比较舒服，这个妹子直接省了一双丝袜，光滑的肌肤比丝袜爽多了。这一次去，又换了2个妹子。这次玩，呆的时间比较久了，开始玩了个双飞，一个172cm的长腿妹子，一个163cm的南方妹子。由于南方妹子皮肤比价好，之后又跟这个妹子来了个400快餐。至于验证图片，这两次过去都是偷拍，第一次是趁妹子回信息，小录了一段；第二次是趁妹子出去拿T，回来的时候偷拍的，光线不太好，只能看个大概。妹子艺术照就不发了，没什么借鉴价值，发两张偷拍的照片，大家鉴定下吧。', 2, 1, 16, 3, 2, '3', '2020-07-21 13:51:34', '2020-07-21 13:51:34', '[\"/upload/article/b6bd119670d48571510d4d8f19344594.png\", \"/upload/article/c122ec5231e41855447acf960fb86778.jpg\"]', 0, ''),
(14884, '老熟女', 42, 30, '400', 110000, 110100, '2067045939', '13011876656', '13011876656', '全套', '八角地铁站出，往南走一公里左右，老小区，有门禁。 QQ群联系的，比较谨慎注重安全，喜欢成熟的不约小孩，到了之后聊了一会，很健谈，有点自来熟，结婚3个月就离了，因为男方赌博。这个是兼职，一周约几个靠谱的，白天美容院工作的。之后 py，30多岁熟女很会服务，自己一套全洗好了。奶子很挺', 1, 1, 17, 3, 1, '3', '2020-07-21 13:51:34', '2020-07-21 13:51:34', '[\"/upload/article/9684471ee78ab6d6ddd2f21e00ca4c09.jpg\"]', 0, ''),
