(14910, '年轻耐干 青春风暴', 27, 30, '800一次', 110000, 110100, 'QQ：3520584283', NULL, NULL, '口活爱爱', '住在一个老楼，妹妹个子160吧，挺苗条的，可以助浴，能不能鸳鸯浴不知道，估计说说差不多，不能接吻，口活还可以，漫游也就是小漫游吧，亲脖子，胸，妹妹奶子不是很大，也就是个b吧，比较有特点的是奶头很大。', 0, 0, 2, 1, 1, NULL, '2020-07-21 13:51:34', '2020-07-21 13:51:34', '[\"/upload/article/18f5b0b1c4e004c8d3d5e948acc79f3a.jpg\", \"/upload/article/d77f99027717575f9350552e48120c1d.jpg\"]', 0, ''),
