(15170, '莞式宝宝 偶尔兼职', 27, 30, '400一次/700二次', 440000, 440100, NULL, '13630180581', NULL, '全套莞式', '宝宝不属于那种第一眼就很惊艳的美女，不过优点在于耐看可爱型，越看越有味道的这种。而且从谈话中也确认了，是偶尔兼职，平时有其他工作的，也要提前预约才可以。开课也比较少。过程聊天还是比较舒服的，健谈。果然还是年轻好啊，皮肤爽滑，有清纯气息，属于小感型的，所以不用说就是没有傲人的双峰，B到C之间，还是比较弹性，抓起舒服。沐浴过程就不必详谈了，自然是全程我负责吃豆腐，宝宝负责给我洗澡了哈哈。冲洗完毕，来到卧室，可能是因为那几天一直都是到处浪的节奏，来到战场上我有一种慵懒感，就把主动权交还给宝宝了，也顺便看看宝宝的功夫如何，哈哈。对服务还是很认真的，一个深下去的口，瞬间就有要崩的感觉，差点完蛋，还是忍住了，因为舒服啊。还不错。这个是花式的口。一冰一火，刺激的不得了。一套服务走完，拿出了小雨伞，节奏把握的很到位，舒服到位。总结性价比也高，服务也多，重要是妹子比较亲切多人。还是那句话服务没问题，而且身材比例OK，，小肉感型，没有很大的大胸，不过也不算小了，毕竟有B+。', 0, 0, 3, 0, 1, NULL, '2020-07-21 13:51:34', '2020-07-21 13:51:34', '[\"/upload/article/597e6a8fbd82513c91f10c8811615f2c.jpg\", \"/upload/article/e31f674a42514de7b85acc5ddbd23df9.jpg\"]', 0, ''),
(15190, '小胖妞人性，喜欢胖的去', 23, 30, '400p', 530000, 530100, '2034453424', 'asd08710000', NULL, '全套', '胸大38b，个子160，体重62kg，服务很用心，是妹子自己租的公寓，环境不错。当然现在的照片都p过，真人比照片略胖。到了之后妹子主动帮你脱衣，先洗澡，然后妹子穿着情趣装上床服务，妹子很亲切，陪你聊天。看着若隐若现的大奶，大奶甩起来让你心潮澎湃，叫声又大又尖，忍耐力不好很快就会一泻千里，整个过程妹子配合度极高。，介意胖的就算了。妹子性价比高，值得狼友一试。好像两个QQ都被封了，可以直接加微信，不过还是把QQ写上，', 3, 1, 16, 2, 2, '8', '2020-07-21 13:51:29', '2020-07-21 13:51:29', '[\"/upload/article/01fed0529cc62abed5da1979e383144b.png\", \"/upload/article/5cc84cb51095434a593672ebbb72edee.png\", \"/upload/article/be2f8b1395c53115eea07c2cd05fb443.png\"]', 0, ''),
