(15232, '海归淑女真服务的英语老师', 22, 30, '400一次/800二次/ 120分钟1000不限次 夜1300', 440000, 440100, NULL, 'gdp200326', NULL, '该有都有', '我就跟他约好1点左右到，时间约好后，也很快告知地址过来。上到楼层MM隐约的打开了门偷偷地望，一看就知道是她了，进门口后真人跟照片一样漂亮，还穿上一件很性感的案子内衣，也挺热情地问候一番后，开始帮我脱去衣服，然后进去冲凉房开始鸳鸯浴，一边洗一边你摸我、我摸她的过程，皮肤好滑，身材也好主要态度也很好，直接调情，加水潇，果然是真服务，口技服务不是假的，真东西。这个感觉第一次体会。洗完后就马上去房间。重点来了，床上服务，十指弹琴、波推漫游、海底捞月、毒龙、69还在这个360度旋转吹箫（这个厉害）写上的服务全部到有做并且好认真，不像其他的一些MM随便做一下就算，360度旋转吹箫第一次尝试，开始不知道她有做什么，后来一上口爽到不得了，了不去的绝活，吹了一会硬起来了马上上套干，让人性欲更加强大，感觉就像电影情节，换了几个动作，突然想去站着来，也不介意所以我们站这来，她贴着墙把胸口打开，我一边做她胸就一边荡，然后用手抓她胸部，下面一直插上面一直摸，一直在叫，爽到爆！爆！爆！最后一射而出满满的性福感，我们就在床上一起休息，我们一起躺在床上说说笑笑了一会才去洗澡，过程跟女朋友一样的贴心。这次的体验真的很棒，老师情切、温柔、性感、贴心，价钱又公道，如此美好服务态度那么好的的姑娘值得在去。刚刚开始我也不敢相信，4张会有那么多体验课程，简直是划算，的确是真莞式服务。不过老师稍微会有点小微胖，都属于正常。是成熟类型。', 3, 1, 12, 3, 2, '3', '2020-07-21 13:51:34', '2020-07-21 13:51:34', '[\"/upload/article/8ecbf140cfdeb308b4848d813c1497ef.jpg\", \"/upload/article/9a5b6620241f3fdd556af50f587ca680.jpg\", \"/upload/article/a6d3972fb589233aeaefa7659453b74a.jpg\"]', 0, ''),
(15235, '狂插晓港巨乳田心，波大奶头粉', 18, 30, '300/Q  500/2Q  800/Y', 440000, 440100, NULL, '18302094195', NULL, 'XCZ69制服,丝袜', '找过一次，感觉不错，波很大的，皮肤白，态度OK，印象最深的是她的骑术不错，360度旋转坐莲。之后一直想约她，但微信都没有回。今天刷朋友圈，发现更新了，鸡动啊，赶紧约。坐标晓港地铁站后边的民房，都是老广人家的，楼下还有很多小吃店，随便找了一家，吃个牛肉肠再上去开战。项目，课表上写的都做足，发现她的奶子变大了，她自己也说是的，摸上去很舒服，可以玩奶交了，但最令我记挂的还是那个坐莲服务，全程不用动，省力又省心。而且她很会掌控节奏，不会像有的人那样，骑上来就是一顿操作，让你快点出水走人，而是一开始很慢的，慢慢才加速，而且节奏有变化，她说女人的逼是很敏感的，知道男的什么时候想射，她就缓一缓，总之非常过瘾，尤其是背对着你坐莲的时候，视觉冲击力很大。我就偷拍了两张，给大家欣赏下，BB夹住鬼头，PP又动来动去，非常刺激，她还会突然一下子整个人坐下，整根JB都吃了进去，感觉有张嘴在吸一样，是一次非常难忘的经历。\r\nPS:地点在晓港地铁站附近的民房，很近，走路都不用五分钟，', 2, 2, 12, 2, 2, '3', '2020-07-21 13:51:34', '2020-07-21 13:51:34', '[\"/upload/article/5896ae9724e5e6d2d831324d84d821f3.jpg\", \"/upload/article/f9c083522be2b41977e2e3e4b5506f22.jpg\"]', 0, ''),
(15237, 'QM界AV梦梦', 27, 30, '一次800', 440000, 440100, NULL, 'rsrm2577', NULL, '该有都有', '上星期终于约到梦梦了，听说当年在QM界破具影响力的少妇！晚上到达距的住所时，一开门就穿着性感，将三围表露无遗，但是本人觉得梦梦的样子要比相片中老，不过还不是差距太大，可以接受。一进门，梦梦马上倒杯水，说让我休息一下，也没有着急要，我们聊左大概十分钟，我大概知道原来距有一个女，已经结婚了，老公却不知道她做什么，其实知道也好不知道也好，我不是太关心。聊完天，我就脱衣冲凉，梦梦却没有一起起来，反正无所谓，地方比较小，也不适合一起。当我洗好之后到达我们的战场，气氛十分迷人， 梦梦在我的要求下，一边播慢摇的音乐，一边脱下衣服，期间不断做诱惑我的表情和动作，小弟弟当然对梦梦的表现致以竖直的敬礼！挑逗完马上上床开战，梦梦很有耐心地在我身上慢慢地蠕动着舌头，一边吮我奶头，一边用手抚摩，差不多的时间，距一口含住，不停地上下上下，然后又用舌头横扫着我的小弟弟，箭在弦上，不得不发马上，带套，后入式，三四分钟后，交晒功课！做完一次之后，梦梦还等到一小时才让我离开。我觉得梦梦的态度不错，而且说明里有的都满足，特别是作完不崔人走，我知道其实还有一个在准备上距的！', 0, 0, 1, 0, 1, NULL, '2020-07-21 13:51:34', '2020-07-21 13:51:34', '[\"/upload/article/1056d6272888173c09e80bb8351fea94.jpg\", \"/upload/article/54a3b8f3ad44a71eb241314d7db5832c.jpg\"]', 0, ''),
(15242, '广州婷婷', 22, 30, '350/次', 440000, 440100, NULL, '18820425161', NULL, '该有都有', '这个婷婷之前去过，这次到广州其实有很多其他新选择，但应为本人最近看多了欧美片，想尝试点儿新鲜动作所以还是去找了婷婷。因为咱国人比不了欧美，所以婷婷的优势就出来了，特别瘦，没胸没屁股，适合我们尝试欧美各种从后面叠着的动作，哈哈哈。其他就是感觉她这里比较干净，屋里很整洁，姑娘也很将卫生，洗完澡赶紧就去收拾，比较邻家少妇型。没有那么风尘的感觉，但今年感觉有些显老了，可能是没少干的原因吧。', 0, 0, 10, 0, 1, NULL, '2020-07-21 13:51:34', '2020-07-21 13:51:34', '[\"/upload/article/18943ae97ce62a3c802dcaa682c6c48a.jpg\"]', 0, ''),
