(15244, '广州越秀杨箕', 22, 30, '350一次', 440000, 440100, NULL, '15172756502', NULL, '该有都有', '杨箕的AMY，喜欢的类型，直接出击了。看课表350一次还带那么多服务，真心实惠到达杨箕出口，很快就遥控到指定房间，和照片基本一致，8成左右基本差不多，有点小肉肉的感觉，是我比较喜欢的。有一种小女人的感觉，贤惠。有一点小肚子，胸蛮大的，少熟的类型总体是可以的，服务超值，AMY服务也温柔，态度也不错。少有这种服务态度，和划算的性价比。', 1, 1, 6, 1, 2, '3', '2020-07-21 13:51:34', '2020-07-21 13:51:34', '[\"/upload/article/6fb788d7c907baa32b613a7cd7777c14.jpg\"]', 0, ''),
(15247, '天河客运站附近', 22, 30, '四百一次，500一小时不限次数 ！！800两小时！！     包夜1200', 440000, 440100, '3413617774', '18218885530', '18218885530', '该有都有', '出了地铁站遥控指路，骑共享单车去到一个快捷酒店，先了钱就开始脱衣服，估计她做过大保健的，漫游，胸推，69式，冰火，口活什么都很不错，不过休息的时候她会语音谈生意，总的来说性价比很高', 1, 1, 10, 0, 1, '3', '2020-07-21 13:51:29', '2020-07-21 13:51:29', '[\"/upload/article/69b4418eca4d0fb3d7470bc58f31d89e.jpg\"]', 0, ''),
(15251, '体育西路地铁站约战QM', 22, 30, '500/次50min 或1000/两次 90min', 440000, 440100, NULL, '13534425548', NULL, '该有都有', '这个是朋友介绍的，本来约的是她的室友，不过她室友价格高一点（一次900，不过是真的漂亮，我同事试过，下次发她室友的），想着就先约她吧。体育西路地铁站G口出来后，按照指示，3分钟左右就到房间了 ，开门一看，和照片有点区别，不过500也差不多了，没有特别多的服务，XCZ，因为使用了一片延时湿巾，加上不是很满意，一个小时没出水，时间也到了，就让她问她室友有没有空，刚好她室友也有客来了，我就下课自己去会所了（总得弄出来不是，尴尬...），附近的狼友可以试试，比较容易约~', 0, 0, 2, 0, 1, NULL, '2020-07-21 13:51:34', '2020-07-21 13:51:34', '[\"/upload/article/3e732de96fc87861fb7eb16e46196108.jpg\", \"/upload/article/6de9c1478f4927d69b98e1238229a026.jpg\", \"/upload/article/a415f69eaa684d3781b9db25424e2f4c.jpg\"]', 0, ''),
(15252, '刚刚回国的小V 服务贴心', 27, 30, '400一次（60分钟）/700二次（90分钟）', 440000, 440100, NULL, '18218189614', NULL, '该有都有', '我也是预约了蛮久的，等了有点久，不过没关系值得，服务的确很OK，颜值也在线，烫了一个波浪发现，很显得有女人味，魅力十足。看着她的眼神都觉得，想恋爱的感觉，好像和这种大姐姐在一起，肯定很性福。妹子也是很实在的一个人，说比较直来直去，不喜欢转弯。这个性格比较霸气，哈哈，有点御姐范，服务的确很好，全程不偷钟，认真对待，唯一有一点就是要排队预约，不然都要等上一会会。口技的确了得，对人也好，全程照顾你，服务你，舔到你上天了。我是舔到给起鸡皮了。内心都给舔走了。做的时候也蛮有感觉，还会夹住你，特别是上位的那种视觉感，全自动走，反正是没像其他妹子用润滑油吧，妹子还是蛮多水的。胸肯定是C以上，挺抓起来都有感觉，摸了还想摸的感觉。各个姿势都配合。什么毒龙 什么69 什么口深都做到了。我毒龙转转很厉害，哈哈。去了的兄台就明白为什么服务会好了。自己体会。值得真值得。价格也很实惠，在广州应该很少找得到4张60分钟的服务课程了，其他妹子基本是7~9张才60分钟 大多数都是。', 3, 1, 14, 4, 1, '3', '2020-07-21 13:51:34', '2020-07-21 13:51:34', '[\"/upload/article/366ed86541f1aec8e84bc20c4b4a4ed0.jpg\", \"/upload/article/4d591d50f6f60829f4cd42eaa1fe151f.jpg\", \"/upload/article/e45a6aec01e07172e6f885cfc4b678f4.jpg\"]', 0, ''),
