(15274, '热情奔放的珊珊', 27, 30, '600一次/800二次', 440000, 440300, NULL, 'xinjiongain520', '13941164684', '该有都有', '看过她的照片，确实是形象很不错，是我的菜。再加上她的鲜嫩程度，我觉得这个价格还是很值得的。就这样联系好了，然后昨天双方都有时间，我便过去了。感觉还蛮顺利的，妹子人很踏实。见到珊珊本人，果然如我所料，她正是照片上的女孩，差别不大，这点让我很满意。妹子漂亮啊，前凸后翘的，大奶大屁股，还有一双美腿，芊细。个子有163。标准身材。留下来享受，就是看服务了。珊珊没有让我失望，开始展露她的功力，哈哈。浴室互动，直接给水潇，会突然一口把小弟弟含住，这个真是惊喜。都差点扶着墙。太突然了，用力舔，感觉痒痒，但舒服刺激，回到房间服务，珊珊妹妹年轻但懂事儿，舌头长长的，非常有攻击性，很卖力。特别是到了三角地带，真的是被她挑逗的欲仙欲死的，我的手也不闲着，她的奶子很坚挺很饱满，玉体光溜溜的，年轻的感觉真好。口活的时候，真是感觉销魂啊。尤其是看到一双水汪汪的大眼睛，汁水很多，受不了了，穿上防弹衣开战，期间各种姿势都尝试了，妹妹还挺会迎合的，小鲜肉就是小鲜肉，粉嫩的木耳紧紧的，一泻千里。总体喜欢服务控的可以找珊珊，的确真不错。全套真莞式服务，没偷钟，粉嫩，有服务好。', 2, 1, 8, 1, 2, '3', '2020-07-21 13:51:34', '2020-07-21 13:51:34', '[\"/upload/article/31aa74c1446e7320077df1cd59658e88.jpg\", \"/upload/article/6d1f97b6584ea489125b28a3dcbdd78f.jpg\"]', 0, ''),
(15275, '工兵排雷之福田沙尾220元江西大胸女', 22, 30, '500', 440000, 440300, NULL, 'hsl6699hsl6699', NULL, '该有都有', '今天刚好路过，想起价格的确厚道，就准备无私地过去帮狼友们趟下雷。\r\n妹子回消息很谨慎，大多都是发的微信收藏里的图片。\r\n估计是太便宜了，到了指定位置后，还等了二十多分钟。\r\n是在沙尾村里，第一次过去的确很难找，出来时直走竟然就出村到地铁口。\r\n遥控上楼，见到真人楼主有些诧异。打开门之前，楼主已经做好了各种准备。曾经在布吉遇到过 300 的 40+ 老女人。对于 220 本来没有抱任何想法，但真人挺年轻的。\r\n起码在 25 岁左右。姿色一定不算上流，价位在那里。但出来后温习朋友圈照片，发现的确每张都是本人。\r\n嘴型有点大，不过这个价格还要什么自行车。\r\n楼主再诧异的是城中村里的所谓工作室内部竟然还很干净，户型也挺不错。\r\n妹子问要哪种服务，我说先体验下 220 的，妹子推销了下，讲 400 的跳跳糖冰火可以给 300，时间也可以延长至 30 分钟。\r\n看着学生装的妹子，300 还要啥自行车。刷支付宝付款。\r\n300 套餐不含洗澡。妹子用湿纸巾操作。感觉妹子全流程非常熟练流畅，有上流水线的感觉。\r\n但妹子够卖力，该有的服务项一项没落。还一再抱歉这次的跳跳糖不够跳。\r\n之后女上位。\r\n之后老汉推车。\r\n赞一下妹子的屁股，肉感又不乏紧致。\r\n补充下妹子的咪咪的确够大够软。\r\n妹子叫床声肯定是装出来的，不过听起来也有几分感觉。\r\n然后交枪出货。\r\n整体感觉还可以，追求完美颜值的就不用过去了。这个价位还要啥自行车。', 3, 1, 14, 1, 1, '3', '2020-07-21 13:51:34', '2020-07-21 13:51:34', '[\"/upload/article/1160dbd6063c8af514cf47da727d2b9a.png\", \"/upload/article/51ec0678e0f2323b2498b49e398dc663.png\", \"/upload/article/71b0da97e3bbd5e05009c0603d64a1f5.png\"]', 0, ''),
