(15506, '分享一个自聊的妹子', 23, 30, '1000', 310000, 310100, '主QQ号280092714或者QQ 192604674', NULL, '无', '助浴,按摩,丝足制服,波推,臀推,环游调情,口活,做爱,', '逛论坛 觉得思思可靠点 聊了几次感觉妹子是自聊的！自聊的很少了   最主要的一点是 还是真人真照  所以分享给大家 \r\n          洗澡  全程不用自己动手  MM全身帮我洗了一遍  重要部位重点照顾了 摸着妹子的胸  妹子说36b 一只手握不住 目测不止36b c应该有的  洗完澡上床 妹子的大胸压着我 肉感十足\r\n\r\n          漫游   妹子伸舌头舔着我的RT 眼睛时不时的望着我 很骚 妹子笑起来迷人  舔得我身体颤抖着  JJ也随着一点点胀大\r\n\r\n          KJ   妹子蹲下一口含住  技术也是相当赞的 毫无任何齿感  大咪咪在我面前晃来晃去 要是不喊停的话 我肯定是缴械了\r\n\r\n          XT 前两次已经感受过了  妹子的大咪咪简直能把JJ和蛋蛋全部包住  定力差的人怕是撑不了多久就发射 这次DD想降落了 所以没做XT 直奔鸟巢\r\n\r\n          ML  让妹子换上黑丝袜 带上TT 先是妹子在上 五分钟后 妹子躺下我在上  大战数百回合后 妹子水是真不少丝袜都已经湿了  再改后进式，妹妹浪叫着  正好我也感觉差不多了  于是拔出来 来个老汉推车 开始最后的冲刺 约百回合后喷出万千子孙 去浴室清洗下后 扫了码   走人', 1, 9, 5, 1, 2, '3', '2020-07-21 13:51:29', '2020-07-21 13:51:29', '[\"/upload/article/47edd754d0fbe0ca3819aa828df60850.jpg\"]', 0, ''),
