(15515, '活泼大胸小爱', 22, 30, '500-1200', 440000, 440100, '3508876852', '13642322949', '13642322949', '鸳鸯浴,无套吹,胸推,调情,丝袜', '可爱，热情，性格活泼。刚一进门就感觉物有所值，胸是真的大，很热情，不会冷场。胸推是真的舒服，好软。', 1, 5, 3, 2, 2, '3', '2020-07-21 13:51:29', '2020-07-21 13:51:29', '[\"/upload/article/1c54c637fe96961eb3ce4baae4a19174.jpg\"]', 0, '');
