(15521, '龙华区熟女口活无敌', 37, 30, '300P 600双飞', 440000, 440300, NULL, '15920036136', NULL, '鸳鸯浴,口活,双飞', 'LY引荐介绍熟女一枚，口活真是好，300块钱口出来一次又做一次。听说她还有个表姐也一起做，果断喊过来双飞，讲实话颜值真的是一般，不过这个价位也知足了。不看脸喜欢熟女的可以尝试。', 1, 3, 5, 2, 2, '3', '2020-07-21 13:51:35', '2020-07-21 13:51:35', '[\"/upload/article/757b6c15157ac3e7d12e4c7aebe938d7.jpeg\"]', 0, ''),
