(15536, '昆山可可', 22, 30, '400/次或1500/夜', 320000, 320500, '3317075327', NULL, NULL, '该有都有', '本来是联系欣欣的，但她大姨妈来了，而给我推荐这个刚来投奔她的妹子。妹子刚来昆山3天，工作室还在布置中。妹子性格挺活泼的，前面的服务也算是比较到位（相对于某些走过场的妹子），口活非常赞。下面也很嫩，扣几下就出水了。ML的时候照例她先上，动作幅度很大，累了换成男上然后交工。', 0, 0, 1, 1, 2, NULL, '2020-07-21 13:51:35', '2020-07-21 13:51:35', '[\"/upload/article/42c9baa8979cb224aa2b77a0952009ad.jpg\", \"/upload/article/4d3457ee9617bbf669bc9b7376ac6799.jpg\", \"/upload/article/764967b05068b48a41f9505ba3fbbb6a.jpg\"]', 0, ''),
