(15546, '江北区猫猫', 22, 30, '4米鸳鸯戏水、水中萧、胸推、指划、漫游、刮痧、吹箫、冰火两重天、AA一次，7米一次半套一次全套、双飞9米两次。', 500000, 500100, '2330130467', NULL, NULL, '该有都有', '妹子住处位于江北区金源路半山华府小区附件，电话遥控上楼，和闺蜜租住一起，可双飞。', 3, 1, 20, 4, 2, '3', '2020-07-21 13:51:35', '2020-07-21 13:51:35', '[\"/upload/article/5bb97c8af3a91985886caaf69449b4bf.jpg\", \"/upload/article/5d27619fd5a898bec3f1efb3e30e5ba8.jpg\", \"/upload/article/f62cf9765e13d544201b8c79a0d4b67b.jpg\"]', 0, ''),
(15547, '沙坪坝娇娇', 26, 30, '300P45分钟、500PP90分钟', 500000, 500100, '3044713902', NULL, '17059956046', '该有都有', '此女需预约，约了一个星期才约到时间，到地方电话遥控上楼，进门给了一个拥抱，然后具体细节不擅长描述，反正谁用谁知道，确实安逸。', 3, 1, 7, 2, 2, '3', '2020-07-21 13:51:35', '2020-07-21 13:51:35', '[\"/upload/article/0c6f56c96d5e9b1e1b2d1775fb6ac4a2.jpg\", \"/upload/article/cc46ff72b311a35a348190ebff9fba70.jpg\", \"/upload/article/ef654ad81d85d30c1a71f296bbfb8f5e.jpg\"]', 0, ''),
