(15551, '21岁的野模嫩妹', 22, 30, '600/次', 420000, 420100, '3378107270', NULL, NULL, '口活爱爱', '看照片的时候就觉得很嫩，加了微信，约好时间马上过去开房  妹子和照片有八成吧，真的很小，很嫩，去洗澡，没有陪浴，自己洗干，也是自己搽干，妹子全程没有服务，躺在床上，妹子脱衣服，两侧锁骨，手臂，十个手指上都有文身，皮肤挺滑的，没照片里那么白。妹子先kou了一下，然后xiong推了一下就说开始做，我拒绝，让她继续kou了一会儿，然后带套开始，女上，她不怎么会动，不过态度很好，然后换我上，仔细看了下面，毛毛很少，很稀疏，下面也是粉粉的那种，水挺多的，最后后入结束。对了，妹子胸不大，捏在手里刚刚好那种。总得来说，没啥特殊的服务，追求服务的和胸控的可以跳过。喜欢嫩的这种可以去尝尝鲜。身材真的不错！', 1, 1, 8, 1, 2, '3', '2020-07-21 13:51:35', '2020-07-21 13:51:35', '[\"/upload/article/c9cc5cc11c199f34695b385d1eb2893f.jpg\"]', 0, ''),
(15556, '福州验证莞式服务超级棒的妹子', 26, 30, '600/次或800/2次或1800包夜', 350000, 350100, NULL, 'wwwjdxz77178    加微信的时候说，俊俊介绍', NULL, '该有都有', '这两天来福州出差，早就听福州朋友说这边服务好，今天没事，就把朋友早给的联系的方式加了，联系了妹子，到了地点遥控上楼，进门妹子给了一个亲切的拥抱，问我冷不冷，给我暖暖，给我到了杯水喝，然后给我洗澡，然后上床，爬我身上帮我全身暖热，和我聊了会天，就开始服务，妹子让我先爬着，先用酥软的胸给整个后背按摩，然后用舌头舔我后背，中间还用手指在我后背轻滑，那感觉让人酥麻无比，服务的很舒服，然后让我躺着胸推，接着妹子开始给我吹，没有齿感，从下到上，小弟弟都照顾到了，吹了一会妹子让我再爬着，让我屁股撅起来，开始给我做毒龙，那感觉整个人像被电了一样，妹子舌头很灵活，做毒龙一点没有应付差事，做毒龙的同时，还爬我屁股下面给我吹，舔蛋蛋，服务真的认真，服务完问我，我上，还是她上，我有点累，就让她在上面，她给我带上套套，就在我上面做，做了一会我感觉来了，把她直接按到床上开干，做了十几分钟，妹子问我要不要加紧，妹子这么一加紧，直接交枪了！然后妹子又给我吹了会！然后就躺床上休息聊天！妹子躺我身上聊天，有种小鸟依人的感觉，聊了会，妹子就跟我洗澡，洗澡又让她给我吹了会！洗完澡，穿好衣服，在她公寓沙发上休息了下聊了一会我就走了，临走时还依依不舍！妹子长的还可以，服务不催人很认真，想给她照几张照片，她不让我把她照片发网上！下次再来福州还会去找她！', 1, 1, 11, 4, 2, '3', '2020-07-21 13:51:35', '2020-07-21 13:51:35', '[\"/upload/article/2695a964a5839a31da4080647efdda0b.jpg\"]', 0, ''),
(15557, '验证可爱越南妹', 22, 30, '500/次1700夜', 350000, 350100, '', '', '', '该有都有', '一日精虫上脑，联系后得知有空，打车前往。进门后妹子一点也不拘束。脱光鸳鸯浴。妹子很细心全程帮洗不用自己动手，洗完后上床服务。口活儿很细心，不叫停绝对不停。技术娴熟。活儿也好，各种姿势都可以。换了几种姿势后出货。完事后休息一会离开凤巢。妹子很细心服务也很好，越南妹，下次还会去。', 1, 1, 0, 0, 2, '姐能干', '2020-07-21 13:51:35', '2020-08-07 03:26:59', '[\"/upload/article/7ac2d5d90a3e940d30f537222e4eb00b.jpg\"]', 0, ''),
(15560, '推荐一只上门的妹子', 22, 30, '500/次，1300/包夜', 350000, 350100, '3279333538', '13075978397', '13075978397', '该有都有', '出差到福州，经朋友推荐这个妹子，果断联系，发了房间号妹子来上门，见面真心不错，说话声音挺甜的，还有点羞涩，水中萧吹得相当不错！值得推荐。', 3, 1, 14, 3, 2, '3', '2020-07-21 13:51:35', '2020-07-21 13:51:35', '[\"/upload/article/1aeba6985b2871c5f4a40d4ecdb9ba7e.jpg\", \"/upload/article/30912b369b14765dc645c627d3bbb592.jpg\", \"/upload/article/a959d8cc2dd83b4f3f70af5d8e9d01e0.jpg\"]', 0, ''),
(15563, '2019成都十大优秀LF冠军候选人', 22, 30, '800P   12PP', 510000, 510100, '2295089017', 'Parichat19852788', NULL, '该有都有', '入选2019成都十大优秀|f，冠军苗子。qq回的慢,菜单又简单的批爆，都想算了，结果朋友qq约到喊我去了，一-进门就惊艳了，173大长腿，太古里街拍级别吧。猴急猴急的洗了，想到就算高价快餐也值了，结果妹妹口活很好很到位，反而我喊停了赶紧盾构，浅吻不能舌吻，不催人，感觉果果下面一夹一夹得一-起深吻交出大招。反正不要去想服务，感觉就像情人，沙发上窗台边和谐的啪啪,不是泄欲。', 3, 1, 9, 1, 2, '3', '2020-07-21 13:51:35', '2020-07-21 13:51:35', '[\"/upload/article/15ff4695a5f02529e6b6a5ec1e684b99.jpg\", \"/upload/article/62255b09cc6184878ad985272671c836.jpg\", \"/upload/article/ff6c11f4400ca3c5b85e1c39f7ca120c.jpg\"]', 0, ''),
(15564, '西门旗袍高跟大长腿', 26, 30, '600P  800pp  还可以双飞具体价格自己问', 510000, 510100, '2983434970', 'wxid_o7b594xu2e2822', NULL, '该有都有', '进门妹子就是旗袍  大口红  大大的拥抱邀请你坐在沙发上直接人就坐你身上  手就伸进你的裤裆  那是骚爆了  房子灯光也是那种幽暗的感觉  鸳鸯浴  水中萧  洗的时候各种磨磨蹭蹭  安静的空气呼吸的声音 从进门开始就没软过  服务的时候  妹子让你选情趣内衣 各种都有 做完背面后  翻过身来直接坐你身上  把她的咪咪放入你的口中 妹子咪咪的乳头特别的大 又圆又大 像殷桃一样  足足舔了半个小时  然后妹子直接测过身帮你舔你胸和上身   如同无数只蚂蚁在你身上游走  麻麻酥酥  游走游走就走到了小弟弟  魅惑的眼神看着你 你说这辈子还能有其他更好的享受吗  忽然她把屁股抬了上来放到了我的脖子 你懂的此处省略很多字 过后 开始大干一场  站着穿着黑丝高跟后入  一字马 从地板干到沙发  再到床上  姿势太多   可惜太冷没了我最爱的厨房环节  总体来说此老师职业素质优秀 从业经验丰富  值得前往', 2, 1, 5, 1, 2, '姐能干', '2020-07-21 13:51:35', '2020-08-07 03:26:45', '[\"/upload/article/cc28090645af8a2329f75093ba66d982.jpg\", \"/upload/article/f153d72415208bcc88857b0cd2fbafe6.jpg\"]', 0, ''),
(15565, '高升桥附近G胸妹子', 22, 30, '400/次，600/两次', 510000, 510100, '2389581621', NULL, NULL, '该有都有', '妹子的特点是胸大，自己说有G杯，我觉得E还是有的，屁股也大，但是人比较胖，比照片上要胖，不过本人比较喜欢丰满的，也在能接受范围之内，妹子感觉话比较少，可能人比较懒，明明房间环境不错但是感觉乱糟糟的，不过出来玩这都不是重点，其他的服务都差不多', 2, 1, 6, 2, 2, '3', '2020-07-21 13:51:35', '2020-07-21 13:51:35', '[\"/upload/article/9690d01ce3aebeca44f6296ae4ceee84.jpg\", \"/upload/article/daf7fb21019817389d43635bb0ea34b0.jpg\"]', 0, ''),
(15566, '双流精品少妇 胸大不下垂 屁股翘', 26, 30, '5P/7PP', 510000, 510100, '3203165446', NULL, NULL, '该有都有', '加了很久了，第一次分项，体验过很多次，已经熟人了，再次联系上直奔小区，进门就一个拥抱，穿的情趣套装衣服，一对大奶子呼之欲出，直接摸了起来！休息之后，一起洗澡，边洗边套弄鸡巴，在屁股后面摩擦起来，骚的不行！洗完上床，开始A/B面，胸推，各种舔，69舔等！最后带上套插入，中间直接喊老公，骚的不行！', 3, 1, 21, 2, 2, '3', '2020-07-21 13:51:35', '2020-07-21 13:51:35', '[\"/upload/article/3ae5f804acbd1da2bfdcf30a69b90224.jpg\", \"/upload/article/ed2d9853a92adad69045636fee5b7746.jpg\", \"/upload/article/ee1fad0df7ad1018d877436ba90febeb.jpg\"]', 0, ''),
(15568, '锦华万达东湖公园附近G胸嫩妹', 22, 30, '600/次，800/2次', 510000, 510100, NULL, '15708416124', NULL, '该有都有', '成都游玩找的这个妹子，G杯大胸，真的是没见过这么大的，而且人并不胖，长得也好看，技术也好，洗澡的时候一对大胸在身上蹭来蹭去真是爽的一匹，唯一美中不足的就是个子有点矮，感觉川渝的妹子大部分个子都不高吧，其他的流程都一样', 3, 1, 5, 1, 2, '3', '2020-07-21 13:51:35', '2020-07-21 13:51:35', '[\"/upload/article/7012bb471d72ef8208fa6285a887ea1a.jpg\", \"/upload/article/918777edf7bc86acbe5509b370b54adc.jpg\", \"/upload/article/ce23b58fc70f702bae158f8e195158b8.jpg\"]', 0, ''),
(15576, '立水桥大胸七姐', 34, 30, '400', 110000, 110100, '3075123797', '18210213823', NULL, '情趣,kh,漫游,69,做爱', '看日本动作片时，最喜欢看的就是朋友妈妈这个系列的，有情节，每次看完都感觉很爽。心里一直很想有这样一次经历（感觉现实中是不可能完成的任务）。不过今天的出击给了自己一把体验这样感觉的机会。\r\n\r\n立水桥七姐，是在论坛上看到的信息，看照片，大胸，肤白是自己的菜就卖了联系方式，联系后有空，就约好出发，地方很好找。遥控上楼，见到本人，第一感觉就是姐姐是丰乳肥臀型的骚货一枚。进门后七姐很热情的让我先做会，然后给倒热水，倒热水时撅着P股露出了大白腿和内内，这情节立马让我想起了日本片中的场景，JJ不由得站立起来。倒完热水七姐让我先喝点水，暖暖身子，七姐也坐在旁边，两个大白兔也映入我的眼帘，真是有白又大。七姐一直在热情的和我聊天，我却不停的偷瞄这七姐的上上下下。过了一会姐姐可能发现了我的偷瞄，问我要不要开始，第一次没敢提完剧情的要求，就正常的开始，显示陪浴，然后换上情趣内衣，开始服务，KH,MY,69,胸推等，做的很认真，尤其是KH,其实很厉害，差点缴枪。\r\n\r\n优点:胸大，真胸，态度好，服务认真\r\n\r\n缺点:有点肚子\r\n\r\n总之还是很值得体验一把的，而且七姐真的很好，完成后我把开始的事情和她说了，她说下次满足我的愿望，玩一次情节。对了，七姐以前的QQ号被封了，现在给大家的是新号。', 2, 5, 2, 1, 2, '小肥龙', '2020-07-21 13:51:35', '2020-08-15 01:55:04', '[\"/upload/article/515d7bfc82d403bc7a1d3f26cfcfed6f.jpg\", \"/upload/article/d795da4d264f12086c075118f4e5ddcd.jpg\"]', 0, ''),
(15580, '前两天刚验证过的昆明爽记', 22, 30, '500每次', 530000, 530100, '3092230157', NULL, NULL, '爱爱', '验证一个昆明伴游，这个昆明爽记是我前两天刚验证过，刚出来做一个月左右，断断续续的，还可以过夜，我现在推荐给大家！地址:昆明学府路附近\r\n项目:这个昆明爽记是我昨天刚采集到的，我先给大家介绍下，今年22 高是163 重是105围是C我说下价格服务 单次是500 时间是一个小时 两次是800 时间是90分钟 包夜是1500 晚上11点到早上9点，有地方，不外出不后门，AA需要带雨衣，过夜需要提前说一声，其它的我就不多了。今天继续给大家推荐昆明伴游资料！', 1, 1, 44, 9, 2, '3', '2020-07-21 13:51:35', '2020-07-21 13:51:35', '[\"/upload/article/cb875002d38527e76d8ba42ca513c6f5.jpg\"]', 0, ''),
