(15663, '李家沱十三姨 服务控推荐', 30, 30, '400/次或600/2次等', 510000, 510100, '1483742941', NULL, NULL, '该有都有', '额.我这个人挺懒的，玩的不少，报告没写两个，今天心血来潮，就想发一个前几天玩过的，李家沱十三姨，先说缺点：凶好像是假的，使劲点就感觉硬的，不爽，，然后年纪又点偏大35左右吧。长相一般再说说优点：服务控的墙裂推荐，吹功一级棒，完全没有齿感，还使劲给你吸，毒龙也是挺牛逼的！！过程也就不多说了。自己去体验吧，价格不贵，性价比高，当然这个看个人感觉得，反正我是服务控，我觉得不错，可能会回锅，没服务的和自己打飞机有区别？', 0, 0, 12, 1, 1, NULL, '2020-07-21 13:51:29', '2020-07-21 13:51:29', '[\"/upload/article/43847a48b077ce727fff80a85902f927.jpg\", \"/upload/article/8e61e2462c40fb5bc0555ab93fd68039.jpg\"]', 0, ''),
(15665, '贵阳会展城距鑫会展酒店36C妹', 22, 30, '500/次、800/两次', 520000, 520100, '1875236382', NULL, NULL, '口活爱爱', '好久没有啪了。找了以前的群，翻了几个在线妹纸，这个妹纸回复比较快，就聊上了，然后发照片、价格、项目、地址，就过去了。逼逼比较紧，妹纸说刚下水不久。比较会聊天，可以3P哦！！！不过价格有点贵', 2, 1, 33, 5, 2, '3', '2020-07-21 13:51:35', '2020-07-21 13:51:35', '[\"/upload/article/5423fae4c4c1cf5ea2e72a133a026b77.jpg\", \"/upload/article/badab43db27ed89ebdfdee3042638256.jpg\"]', 0, ''),
(15667, '小立夏妹子', 18, 30, '5米/次或8米//次过夜15', 530000, 530100, '1808165711', NULL, NULL, '该有都有', '这几天精虫上脑，群里加了个妹子，15元红包验证合适了，约了时间，在金马坊附近，mm自己租的房，小区要输密码进去，我是跟别人混进去的，然后坐电梯上楼mm在电梯口等你，在楼道付了钱然后进去，脱衣服MM帮你洗澡，MM皮肤很嫩，奶也挺，奶头太好看粉的，b也很粉嫩，主要是年纪小，是个兼职，没做多久呢，然后你们自己脑补。（好货狼友们尽快体验）图片p过，百分之80一样大家可以去验证。', 2, 1, 30, 5, 2, '3', '2020-07-21 13:51:35', '2020-07-21 13:51:35', '[\"/upload/article/b8762c570740b09554af90ca5059c8a6.jpg\", \"/upload/article/bc7c8a3f3a5a045ef63cfa7c0af78015.jpg\"]', 0, ''),
(15668, '官渡区蛮丰满的妹子', 22, 30, '500/次', 530000, 530100, '964189080', NULL, NULL, '该有都有', '这个真实的，不会写细节，就说说服务吧，主动热情，比较配合，道具制服都可以玩，身材丰满型的，', 2, 1, 24, 2, 2, '8', '2020-07-21 13:51:35', '2020-07-21 13:51:35', '[\"/upload/article/336a4398ee5fc0671e384dd44910819b.png\", \"/upload/article/bc3e9d6bc35cb50b3cdd0643b56ed507.jpg\"]', 0, ''),
(15669, '验证南亚附近熟女波霸', 26, 30, '5米/次', 530000, 530100, '1502855033', '13912296977', NULL, '口活爱爱', '看到好几个熟女的信息，联系了一会，只有这个回消息了，而且离的比较近，就直奔住处，上楼进屋，看到之后还是略有些失望，照片如果给100分，实际长相只能给70分，但是就是要找熟女，也没对长相抱有太大期望，姐姐比较矮，有点胖，但是奶子是真大，开门的时候穿着一件黑色半透明的长裙，很是诱惑。进屋姐姐还比较体贴，把电暖器拿来让我暖和一会，然后去冲凉，冲的时候姐姐主动进来说帮我洗，姐姐主要帮我把JJ和屁眼好好洗了一下，然后进屋开始：首先是趴着做背面，有按摩，胸推，臀推，漫游，舔肛，毒龙，海捞，姐姐的大奶子做胸推特别舒服，毒龙也很舒服，做海捞的时候口的来感觉了，正面的胸推臀推就没再做，360度口活也没让做，直接戴套正面插入，姐姐说自己是剖腹产的，所以下面还是比较紧，挺长时间没做了，再加上大奶子波涛汹涌的视觉刺激，不到10分钟就射了。整体感觉态度很好，服务也挺到位。当然追求颜值的就不要考虑了', 2, 1, 12, 1, 2, '8', '2020-07-21 13:51:35', '2020-07-21 13:51:35', '[\"/upload/article/ba6e349e9eadce6e35ad8ffa1237d1cf.jpg\", \"/upload/article/f898ec5af1b4b0754fab4056a6e5143b.jpg\"]', 0, '');
