(15671, '丰台果果', 22, 30, '500', 110000, 110100, '3061429748', NULL, NULL, '口活爱爱', '地方离地铁站很近，住的是家属区，妹妹人很热情，身材也不错，毕竟是帝都批价都比较高，这个只能算中规中矩，可能是那天后面有人有点催，整体还不错。', 0, 0, 0, 0, 2, NULL, '2020-07-21 13:51:35', '2020-07-21 13:51:35', '[\"/upload/article/ee6374086eed411203a2122d7043cdbb.jpg\", \"/upload/article/f1028641126feed0eb986cb11663eccb.jpg\"]', 0, ''),
(15673, '立水桥大胸七姐,朋友妈妈的感觉', 30, 30, '400p  300推油', 110000, 110100, '3075123797', '18210213823', '18210213823', '鸳鸯浴,漫游,胸推,69式,冰火,口活,爱爱', '看日本动作片时，最喜欢看的就是朋友妈妈这个系列的，有情节，每次看完都感觉很爽。心里一直很想有这样一次经历（感觉现实中是不可能完成的任务）。不过今天的出击给了自己一把体验这样感觉的机会。\r\n立水桥七姐，是在论坛上看到的信息，看照片，大胸，肤白是自己的菜就卖了联系方式，联系后有空，就约好出发，地方很好找。遥控上楼，见到本人，第一感觉就是姐姐是丰乳肥臀型的骚货一枚。进门后七姐很热情的让我先做会，然后给倒热水，倒热水时撅着P股露出了大白腿和内内，这情节立马让我想起了日本片中的场景，JJ不由得站立起来。倒完热水七姐让我先喝点水，暖暖身子，七姐也坐在旁边，两个大白兔也映入我的眼帘，真是有白又大。七姐一直在热情的和我聊天，我却不停的偷瞄这七姐的上上下下。过了一会姐姐可能发现了我的偷瞄，问我要不要开始，第一次没敢提完剧情的要求，就正常的开始，显示陪浴，然后换上情趣内衣，开始服务，KH,MY,69,胸推等，做的很认真，尤其是KH,其实很厉害，差点缴枪。\r\n优点:胸大，真胸，态度好，服务认真\r\n缺点:有点肚子总之还是很值得体验一把的，而且七姐真的很好，完成后我把开始的事情和她说了，她说下次满足我的愿望，玩一次情节。对了，七姐以前的QQ号被封了，现在给大家的是新号。', 1, 7, 15, 7, 2, '3', '2020-07-21 13:51:35', '2020-07-21 13:51:35', '[\"/upload/article/c4acc3b1d1de16859554a0d35ca22ae7.jpg\"]', 0, ''),
(15674, '安贞附近00后新下水的妹子漂亮态度好', 22, 30, '600/p 1200/pp', 110000, 110100, '2149707798', 'xiaxue56889', NULL, '口活爱爱', '，听说过年就回老家了，是来北京暂时实习的！朋友体验说非常爽，绝对的纯兼职，没有风尘气，而且长的还挺好看，我当时就按奈不住鸡动的心情，赶紧和朋友要来小M联系方式，这等货色岂能放过？于是和MM联系后立刻前往，MM开门后看到我，很不好意思的低下头，然后很低声的让我换鞋，换鞋后走进房间，寒暄了一会，问MM大概情况，果然如朋友所说，情况都属实。MM让我把衣服脱了，然后洗澡，洗完澡进屋后mm已经脱个精光，看见mm的胴体，一下子一柱擎天了，然后就躺在床上mm开始服务，mm很认真，脾气很好，经过一番忙活就进入主题，而且很紧，mm会用很满足的表情望着你，真的很漂亮，经过几回合的激战，我终于把持不住了，倒在了mm的石榴裙下', 2, 1, 28, 7, 2, '3', '2020-07-21 13:51:35', '2020-07-21 13:51:35', '[\"/upload/article/7a391793ffa5dbd0e06619feeb6915d8.jpg\", \"/upload/article/d27bd7199f39deda773d45b6f3a0480e.jpg\"]', 0, ''),
(15675, '宋家庄 大尺度小活', 26, 30, '4.5.6', 110000, 110100, '1547704616 /3447542435', NULL, NULL, '鸳鸯浴,漫游,胸推,69式,冰火,口活,爱爱,SM', '俩妹子分别试过了，很敬业。燕瘦环肥各有味道，芳芳 婉婷 都很专业，不过个人更喜欢芳芳，模样还是过得去的，婉婷骨感，样貌差些。宋家庄下地铁没多远，小区还不错，能停车还便宜。可以去试试，自聊自做的，应该会长期做下去，值得一试', 2, 8, 3, 3, 2, '3', '2020-07-21 13:51:35', '2020-07-21 13:51:35', '[\"/upload/article/7a1d2fe132cb8846df7afb9e2360e7a3.jpg\", \"/upload/article/b321d27b66689bd0ec00c446d55c9dff.jpg\"]', 0, ''),
(15679, '劲松武圣路波霸姐姐 口活炸裂', 30, 30, '4张/5张/6张', 110000, 110100, '610658062', 'lizi15010388582', NULL, '服务就那些,可以自己开发,姐姐挺好说话的', '小黄文不写了，说几个重点：1：颜值控就别去了，大姐长得一般，但是五官端正，不丑。2：看这个价格，对身材要求高的，玩嫩的也别去了，3：大姐的服务态度没的说，口活好到P爆炸，可以深喉，会嗦会裹，而且只要要求不过分都配合，4：大姐真大奶，两个奶子真的牛批，不是一般的大，感觉有E了，总结下：颜值身材一般，服务好，口活好，奶大随便玩。（大姐腿还行，穿上黑丝，鸡儿梆硬）', 0, 0, 0, 0, 2, NULL, '2020-07-21 13:51:29', '2020-07-21 13:51:29', '[\"/upload/article/43ba763e02098c9d92f1b28eb3444947.png\"]', 0, ''),
(15685, 'SPA', 23, 30, '300', 320000, 320400, NULL, NULL, NULL, '中项,除了不能做爱其他都可以', '环境还不错，技师的技术不错身材很好，颜值中等，整个过程大约1小时', 1, 2, 2, 1, 2, '3', '2020-07-21 13:51:35', '2020-07-21 13:51:35', '[\"/upload/article/aea6a2e939d20a5ac3349f328d7c2161.jpg\"]', 0, ''),
(15693, '绥中火车站前快餐', 24, 30, '150-250', 210000, 211400, NULL, NULL, NULL, '口,直', '绥中火车站前老马路心满意足，这地方去了好多次了，每次到绥中出差都去溜达溜达没什么联系方式，人家也不出来，直接进店选一个直接上楼，快餐，质量还行，安全系数不咋地，虽然没被抓过\r\n直口，带套，加钱不带套，反正不是什么高档地方，泻火还行，里面的妹子似乎不定时有变动', 1, 2, 1, 1, 2, '3', '2020-07-21 13:51:35', '2020-07-21 13:51:35', '[\"/upload/article/64c840f2dbf977512b9769365962e4cc.png\"]', 0, ''),
(15700, '徐汇彤彤', 24, 30, '6/p', 310000, 310100, '3057103335', NULL, NULL, '除了69以外大活基本都有', '本来想约另外一个mm，红休了，给推荐了这个mz，qq联系好，见面觉得蛮好，长的蛮标致，胸不很大b左右吧，主要是脸好，没什么赘肉，看着比较舒服。然后接受服务，交货付钱，走人，感觉没有那么热情，不过性价比还是可以吧', 2, 1, 24, 7, 2, '3', '2020-07-21 13:51:35', '2020-07-21 13:51:35', '[\"/upload/article/6fad976eb40dff3c41fac3f528b6d1f0.jpeg\", \"/upload/article/8101d724dc98b995aff5d106c41f015c.jpeg\"]', 0, ''),
(15712, '深圳龙华18岁妹子', 18, 30, '500-800', 440000, 440300, '3606377707', NULL, NULL, '洗吹做69都会', '妹子挺好看的，年轻，主要是紧，69下面也没异味，叫声也很好听，不错', 1, 1, 11, 3, 2, '3', '2020-07-21 13:51:35', '2020-07-21 13:51:35', '[\"/upload/article/60e0685a3e35c30a9f96c5fd25581ad9.png\"]', 0, ''),
(15714, '白云 羽菲', 26, 30, '600/1p，1100/2p', 440000, 440100, NULL, 'yfq102611', NULL, '鸳鸯浴,口暴,69,波推,做爱', '之前在广州qq群发现的，本着踩雷的风险去，没想到难得遇到一个货对版的，本人有照片9成相，皮肤比照片上稍微暗了点。服务还可以，口活很赞，也很健谈。就是不肯舌吻，怎么劝都不行。下面水很多。69的时候妹子直接高潮了。提枪上马，一顿忙活。也不催人，完事了，陪着躺一会儿，完美情人的感觉。', 0, 0, 7, 0, 1, NULL, '2020-07-21 13:51:35', '2020-07-21 13:51:35', '[\"/upload/article/05b09c86280939a4efe47b09a20bcf11.jpg\", \"/upload/article/be344c426d95631f6cc8bde98b7e67ca.jpg\"]', 0, ''),
(15718, '宝山区妹子', 22, 30, '500p', 310000, 310100, '3165621172', 'zai32aini', NULL, '洗吹推69高跟丝袜啪啪', '妹子服务热情不机车。性价比还算可以。', 1, 1, 3, 1, 2, '3', '2020-07-21 13:51:29', '2020-07-21 13:51:29', '[\"/upload/article/d116ccc14443c489ad3b4b646cd70b9a.jpg\"]', 0, ''),
(15720, '极品女神 微信真人照片', 24, 30, '900', 510000, 510100, NULL, 'jea15608173967', '15608173967', '标准全套,制服诱惑,骚劲难挡', '之前资源号里加的微信，冰冰经常会更新朋友圈，看到很多客户好评就种草了，照片里高挑的身材腿玩年，找了一天就去了，冰冰有点洁癖，洗澡时间长一些当然 项目也多一些，白白的胸在背上滑动，然后跪下来口，当时就想把她按在厕所搞一炮了，后面上了床更是，按摩了下就问我置换什么样的制服，我说成熟的，马上就去换了套秘书装，然后穿上了黑丝。后面就不细讲了，运气不错把冰冰去弄舒服了，下面一直流水，然后就抵挡不到我不停用嘴巴去挑逗，舌吻非常爽，冰冰嘴超软，可能皮肤好的原因，真的停不下来，当然这个看运气了。总之下次想爽的尽兴还是要去找冰冰，看到她高潮流汗的样子真的爽。', 3, 3, 54, 4, 2, '3', '2020-07-21 13:51:35', '2020-07-21 13:51:35', '[\"/upload/article/b3f39d7a776370cf166ce2e95b0676a8.jpeg\", \"/upload/article/da6c4c8543a2aad11233485b8a106ef6.jpeg\", \"/upload/article/fee2fa3708f3b82460fc744933cfdc3a.jpeg\"]', 0, ''),
(15722, '小雯小姐姐 丰满诱人 美腿丝袜', 26, 30, '5001p加服务900二次加服务。包夜1600。', 440000, 440100, NULL, '13640321116', NULL, '鸳鸯浴,水中吹箫,69.乳交,毒龙,爱爱等等,全套了,', '信息约的她。遥控上门。上楼见面直接给拥抱。没有陌生感。看到她穿着高跟鞋制服丝袜。后面的小黄文才疏学浅不会写。全套上了一次。值得一去', 3, 7, 4, 1, 2, '3', '2020-07-21 13:51:35', '2020-07-21 13:51:35', '[\"/upload/article/37712a3ac01e484d1dbd8ec93c873707.png\", \"/upload/article/c0b370ebeb7f52db630ae52d69130dc1.png\", \"/upload/article/f8f9c010709796e0b4f0706b67452c2d.png\"]', 0, ''),
(15739, '南京浦口桥北高颜值美女', 26, 30, '600一次 1200两次 包夜2200', 320000, 320100, '', '', '', '舔,口,深喉,啪啪啪', '在桥北浦东大厦，朋友介绍的。年龄看着二十五六岁，本人和照片九成相似，确实颜值非常高，比较瘦。唯一缺憾是胸小而且没啥弹性。服务还算可以，态度也还可以。但是不会助浴，也不是特别热情。颜值党可以一试，我今天状态不好，时间太短，太可惜。约之前直接加微信联系即可。注意头像不是本人，发照片给她看会告诉你门牌号', 1, 4, 0, 0, 2, '姐能干', '2020-07-21 13:51:35', '2020-08-07 03:24:53', '[\"/upload/article/1ac3c04b590e599422152c0edb2223ab.jpeg\"]', 0, ''),
(15749, '徐家汇燕子', 25, 30, '400', 310000, 310100, '1141736695', 'yzvx5206688', '18221394739', '推油', '徐家汇边上的小区，环境感觉很干净，相当不错的。本人要比照片好看，划重点！！！声音很好听！！！熊很软，很好摸，大小在C左右。以及是自聊的！！！推荐吧！', 1, 1, 9, 4, 2, '3', '2020-07-21 13:51:35', '2020-07-21 13:51:35', '[\"/upload/article/69827fd1b6466350dc253aafc4ec4780.jpeg\"]', 0, ''),
