(15799, '首经贸大学附近健谈女友妹妹星星', 26, 30, '600/次或1200/两次', 110000, 110100, '748157623', NULL, NULL, '该有都有', '早上起来无所事事，找个了这个首经贸大学附近的妹子星星，妹子很瘦，但胸很小，很健谈，小狼新手第3次找小姐姐，一点也不尴尬，进屋给配浴，不用自己动手，小狼没啥经验也不知道什么服务算好，我就口和做。妹子年龄看着不会超过23身高165体重80吧，感觉一用力就能给怼坏了，很有小鸟依人的感觉，妹子重庆人，有点口音，死了我就听成了屎了，很尴尬。本人比照片显瘦', 2, 1, 10, 1, 2, '3', '2020-07-21 13:51:35', '2020-07-21 13:51:35', '[\"/upload/article/35ec051516c58e8313c086f6a0b69b70.jpg\", \"/upload/article/51c0070a510c7b8d37bd791eac33535f.jpg\"]', 0, ''),
(15800, '东城小慧 还可以三通', 30, 30, '900/次  1200/两次    三通加600', 110000, 110100, '3476036176', NULL, NULL, '该有都有', '到北京出差之前就加上的，年纪跟我差不多，30来岁的样子，本人比较喜欢刺激一点的，这少妇说可以三通加600元，谈的挺合适，三天之后来到北京出差，第一个晚上直接联系妹子，遥控到妹子的地方，见到妹子还不错，虽然30了，还是风韵犹存，胸还是挺的起来，感觉不像是结过婚的那种，很礼貌，比较体贴，给我洗澡，边洗边聊，这少妇果然没结婚，还有这么好的姿色，想想都爽，两人来了个三天，一顿服务之后，不错，口技很好，口完之后叫妹子趴着，先来个肛交，不好插，还没开发完全，我这巨根不好进去，加了点润滑剂，别说有多爽了，肛交确实好有感觉，再多的细节就不说了，当时玩了两次加三通，不错的体验，', 2, 1, 5, 2, 2, '3', '2020-07-21 13:51:35', '2020-07-21 13:51:35', '[\"/upload/article/670b2c8a4b9fb4e1d3952542c399637f.jpg\", \"/upload/article/84e5264e804f2c3b38b37d67cf3b826e.jpg\"]', 0, ''),
(15801, '年轻萝莉型 口的很舒服', 22, 30, '500/次或1500/天等', 110000, 110100, NULL, NULL, NULL, '该有都有', 'ly推荐，圣诞节闲来无事，聊了一下，就去了，遥控上楼，开门一看，一个萝莉，个头真小，没穿裤子，说是19岁，还是年纪小啊，胸不错，很舒服，摸了几下，妹子喜欢打王者，我俩打了一把，我觉得没啥意思，就不玩了，她游戏有瘾，自己打了一把，然后我在旁边观战摸奶，打完之后开始进入正题，口的很舒服，xl比较喜欢kb，不过她这没有，可惜，口了一会，戴上雨衣就开始冲锋，妹子上位打桩，还不错，有些感觉，然后传统体位，后入出货，聊了几句，扔下大洋走人。', 2, 1, 1, 0, 2, '3', '2020-07-21 13:51:35', '2020-07-21 13:51:35', '[\"/upload/article/72051f098267f1eb4cf95f444cf9258d.jpg\", \"/upload/article/cda0752fe5de4727305db208f6c4133b.jpg\"]', 0, ''),
(15803, '热门梓兔', 26, 30, '600P\\900PP', 110000, 110100, '1516737969', NULL, NULL, '该有都有', '1.如果您是颜控、身材控的话，梓兔应该不太符合您的口味。毕竟之前的帖子里面也说的很清楚，梓兔主打特色是服务。不过话又说回来，长相也并不丑，身材也没那么差，一般水平吧，相信如果不是特别挑剔的应该都可以接受。\r\n2.坦白地讲，本人出来玩的次数不多，所以什么样的服务算是好的，什么算是差的并没有完全的发言权。但是有几点细节应该可以证明梓兔的服务肯定不差，一个是PY的时候真的是用Xiong和PP仔仔细细的把全身洗了个遍，仔细到脚趾；另外一个就是KH的时候，到最后B到嘴里也没有马上吐出来，而是等完全SHE完仔细舔干净，然后去洗手间吐出来漱完口之后，再含一口热水帮你再清理一遍。其他的也就不再细表，漫游什么的的的确确是认认真真的把全身舔了一个遍。\r\n3.梓兔性格很好，会主动和你聊天缓解刚到时尴尬的气氛，甚至如果渴了饿了还可以帮你点外卖等你来吃。完事之后也会耐心的陪你聊聊天，而且边聊边帮你做些简单的按摩，不像有些人，话里话外催你走。\r\n4.和梓兔聊天才知道，其实她没有大家以为的那么难约，qq加了迟迟无法验证完全是因为被封号，所以大家想去体验的，稍微有些耐心，理论上最长一周之内是可以验证通过的', 3, 1, 7, 0, 1, '3', '2020-07-21 13:51:35', '2020-07-21 13:51:35', '[\"/upload/article/3337f174fe5614d57587cd25d38b1fe7.jpg\", \"/upload/article/936ba777e4b70928adc4252f54a62594.jpg\", \"/upload/article/a8d810e4a71934a121239958f168c07b.jpg\"]', 0, ''),
(15804, '使出洪荒之力爆操实战利器荡货阳阳', 27, 30, '600一次', 110000, 110100, '3475641594', NULL, '13521377143', '该有都有', '在群里加了阳阳，加了以后随便聊聊，感觉挺靠谱。因为之前有听说过她，嘿嘿，狼友反馈都挺不错的。我决定去看看。\r\n阳阳本人是90后姑娘，轻熟丰满，还是很有女人味的，关键是看这身材绝对是实战利器类型。\r\n卫生间简单清洗重要部位后，躺倒床上，床很软，很舒服。摸着妹子的奶子，也是很大很舒服。\r\n阳阳非常主动，把我身体各种亲，特别的会吸，还给做了按摩非常的舒服，关键部位更是重点关照的水平，贼鸡儿爽！\r\n然后就是KH，一边K一边挑逗我的乳头，而且KH相当舒服。然后换我舔妹子乳头，嗯，奶子很小，但是乳头很诚实，稍微挑逗一番就硬硬的。接下来就是PPP，先是妹子骑上来P一会儿，我骑上去P一会儿，然后后入， P的时候听着妹子娇羞的娇喘还是不赖的。肉搏一波流，超爽释放。', 2, 1, 8, 2, 1, '3', '2020-07-21 13:51:29', '2020-07-21 13:51:29', '[\"/upload/article/d7ac8e89fa208848a55fcba5009479ae.jpg\", \"/upload/article/fd6b9edcca3138456e831941e63c1887.jpg\"]', 0, ''),
(15805, '丰台姐妹花 可以双飞 身材超级棒', 26, 30, '400', 110000, 110100, '290173771', NULL, NULL, '该有都有', '跟妹子联系好，坐地铁到10号线首经贸D口附近，妹子特别热情，在楼下等着接我，居家式的服务，姐妹两个人，本来想快餐泄泻火，两个妹妹实在诱惑难挡，实在没忍住，正好是晚上8点多了，直接决定包夜undefined，快餐单4p，包夜双飞要了1200，可以谈。陪浴，舔全身，口活......，有点虚脱了，下次要是再去，估计要休息个十天半月的', 3, 1, 34, 7, 2, '3', '2020-07-21 13:51:35', '2020-07-21 13:51:35', '[\"/upload/article/7e19c82c572e196851f350179ace0905.jpg\", \"/upload/article/9f2d406e31f7e428aaf2a743e422ac04.jpg\", \"/upload/article/af1f94057cf92d22aced9f09d7aff07b.jpg\"]', 0, ''),
(15806, '兼职老相识妹妹激情碰撞', 26, 30, '1000/一个半小时', 110000, 110100, NULL, '17161166723', NULL, '该有都有', '这几天寂寞难耐，联系好妹子后约好时间，遥控上楼， 女友一样的站在门口迎接， 到了后先聊聊家常，起身安排鸳鸯浴。洗澡的时候也不老实的蹲下口。洗好后上床，玩她的奶子，一手不可掌握，纯原装特别的大，妹妹的技术很厉害，A面和B面各种舔，每个部位都不放过，哪里有需要就舔哪里。RT，蛋蛋，JJ，都被她舔的透心麻，就像小马达一样。这种服务质量真是没的说，太精彩了。前戏做的足足的，JJ也是欲火难耐了，一个眼神示意，妹妹就给我戴上了套子，开始活塞，骚B榨汗机，水多的不得了，伴随着妹妹美妙又温柔的叫床，不断的放纵冲刺，交货', 0, 0, 8, 0, 1, NULL, '2020-07-21 13:51:35', '2020-07-21 13:51:35', '[\"/upload/article/5587470e191ebb3e6ee44dc5f3155350.jpg\", \"/upload/article/b1356554da23ca681c7f8d36b848891c.jpg\"]', 0, ''),
