(15810, '体验所谓体北瑜伽女', 30, 30, '400/次700/2次', 120000, 120100, NULL, '182 1036 1798', NULL, '口活爱爱', '因为第一次去这种地，在论坛上找了半天最后选择他了，但整个过程不是很满意。\n这个大姐微信看着还算年轻但世纪应该得有40左右吧。添加微信询问价格后定时间，大姐遥控上楼（有点墨迹）前后过程得有20分钟\n开门看见就有点想走的感觉。身高160左右吧，特别瘦，皮肤松弛。一点不主动，自己要求洗澡，然后妹子开始按流程亲一遍口了几下就开始进，胸基本没有。就俩大乳头还不让摸。在上面动了几下就开始躺下了，为什么给3星就是因为基本要求都能满足但服务一般。做了20分钟左右吧没做出来，大姐就要给我打出来说时间太长了。打的不是很舒服半天也没出来，最后还是自己打出来的。总体感觉一般，但绝对安全', 0, 0, 8, 0, 1, NULL, '2020-07-21 13:51:35', '2020-07-21 13:51:35', '[\"/upload/article/4f25185a8f99338431462b3fbd59ee4f.png\", \"/upload/article/82b2a6dc2a4667cadb1a33e6c83b02fd.png\", \"/upload/article/b421d4522ca3989c71abac2edc35f09a.png\"]', 0, ''),
