(15871, '19岁妹妹', 19, 30, '5/次或8//次过夜15', 530000, 530100, '1808165711', NULL, NULL, '鸳鸯浴,漫游,胸推,69式,KH,爱爱,', '在金马坊附近，mm自己租的房，小区要输密码进去，我是跟别人混进去的，然后坐电梯上楼mm在电梯口等你，在楼道付了钱然后进去，脱衣服MM帮你洗澡，MM皮肤很嫩，奶也挺，奶头太好看粉的，b也很粉嫩，主要是年纪小，是个兼职，没做多久呢，然后你们自己脑补。（好货狼友们尽快体验）图片p过，百分之80一样大家可以去验证。', 0, 0, 2, 0, 2, NULL, '2020-07-21 13:51:29', '2020-07-21 13:51:29', '[\"/upload/article/49d49a5ebcee274cb08294138ccb4201.jpg\", \"/upload/article/5f5441acc8ba12237b755af2e27457b7.jpg\", \"/upload/article/95bc0c9d9b2ed8aa7905f665cdf99a5b.jpg\"]', 0, ''),
