(15875, '公益西桥微熟', 28, 30, '400/P、800/PP', 110000, 110100, '2909576309', NULL, NULL, '陪浴,69式,KH,爱爱', '闲逛正好没事就联系周边的妹子、正好她有空那就过去坐坐呗。进去看看人跟照片就不是一个人，人挺热情的，聊个天挺逗，不像别的催着你。身材微胖但是没有赘肉也就110左右，看样子是生过孩子，但是胸很挺很大，捏着老爽了。KH还行，也不着急，舔蛋比较认真。她下面比较敏感，舔了几下骚的不行不行的，那小眼神迷离的都想干死她。带上雨伞两条大腿往肩上一抗一通输出，大长腿抱着输出就是有感觉哈哈哈，再捏捏蹭蹭大奶，痛快。前些日子回老家了，这两天回来，还新推出了情趣套装，有兴趣的狼友可以过去坐坐。', 2, 4, 5, 4, 2, '3', '2020-07-21 13:51:35', '2020-07-21 13:51:35', '[\"/upload/article/1948dac294047f95f146ff4d017b6d9f.jpg\", \"/upload/article/6afdeaf6bdf6a6494d39ba2e0f66a8d8.jpg\"]', 0, ''),
