(16097, '二刷徐汇小小', 27, 30, '自问', 310000, 310100, '1605789682', 'xiaoxiaoty19930312', NULL, '该有都有', '今年过完圣诞，基本也就跟9102年告别了，想着今年要有个完整的结尾，在QQ里左思右找，最后还是选了小小。\r\n原因很简单，因为服务真的用心。\r\n                      联系妹子后，得知她搬了家，往新地址，依然是个小区。寒冬之下，小小那边还是觉得十分温暖，因为已经提前开好空调，取暖器暖暖的。\r\n                      好了言归正传，下面记一波流水账，一顿遥控指挥来到楼下，地铁附近并不远，交通便利不用说，环境还是不错的，整体干净整洁，洗澡依旧有一次性毛巾，卫生方面经过确认很ok。\r\n                      照例洗完后，往床上一躺，小小脱去内衣之后一看，还是有点实力的，四处摸亲之后，放肆将头埋在胸前，感受着各种软糯。B面躺好，按摩10分，非常非常专业，能起到缓解疲劳的效果。耳边喘息，7分，时间很长，可惜少一些湿润，以接触为主，没有那种妹子把你生吞的感觉，漫游+过水吸皮，9分，路线左臂→左背→臀部→左腿→右腿→臀部→右背→右手臂，吸皮给力，吸皮的时候会侧吸到腰，痒的不行，妹子会重攻膝盖内侧，很痒 最喜欢妹子下钻口交，个人给10分，妹子会钻到身下下去口交。值得提的一点是妹子会感受你的姿势。有的时候会哥哥不用动妹妹全自动，抓住你的吊根就开始吞吐，有时候你有感觉主动抽插，就停下来，配合你的压胯下。最后转到A面，也是一阵花式吹箫，没过多久也是按耐不住直接爆在嘴里；最后妹子温柔的帮你清洁 按头采耳聊聊人生。这也算正式和今年说再见了。', 3, 1, 23, 2, 1, '姐能干', '2020-07-21 13:51:29', '2020-08-07 03:21:54', '[\"/upload/article/2dd367b55d403f59076967b8e25b9c91.jpg\", \"/upload/article/e725929cc68775a26e6eaa905693b542.jpg\", \"/upload/article/eaee3c2828a2aa7062a64ad47e0235c3.jpg\"]', 0, ''),
