(16099, '颜值在线的星星', 26, 30, '500/次 900两次 好像不夜', 310000, 310100, NULL, 'Yszza-1205', NULL, '该有都有', '下午约好，私事没处理好就拖到了晚上，路上妹子发信息以为我鸽子。而且出错了地铁口，还走了十来分钟的路，找她的楼也找了很久，加上阴冷的天气让人感到格外的不适，本打算路返回，但想到约了人家，鸽子也不好。遥控上楼，进门，屋子里很暖和，屋子大概是开了暖气的原因，我发牢骚说好冷，妹子拿着我的手搓了一会，这举动和态度让我感觉很好。我开始有了兴趣，房间灯光比较昏暗，她穿着一件黑色的连衣裙，但是仔细看一下，真人除了比照片微胖一点，别的差不多，长相看着很舒服，跟照片对比百分之80吧。\r\n\r\n    然后拿了拖鞋让我洗澡，然后一起进来陪浴，全程不需要动手。出来之后躺下就开始正题，然后开始舔我的乳头，左一圈右一圈的舔，然后我边揉着车灯，另手摸着她的小穴，毛不太浓密，摸着手感极度诱惑，没过一会感觉里面湿湿的了，小弟也变得僵硬了。她扶着我弟弟，跨坐上来，我以为要WT坐进去了，小弟弟又挺了挺，结果只是蹭了蹭用胸给我A面按摩，按摩完用舌头慢慢从胸口往下舔，到小弟弟那一口紧紧地含住，龟头随着她的吞吐，我忍不住按着她的头，下身不断耸动，发出咕叽咕叽的声音，嘴唇很柔软，温暖，无齿感，看着她给我口内心还是很爽的，毕竟颜值在线，最后她准备拿套给我提枪上阵，我问她能不能穿上丝袜，妹子表示男人都喜欢骚的吗？我说我喜欢这样征服感，然后她穿上黑丝，看妹子穿着黑丝真的是一种享受，还是连裤袜！\r\n      穿完黑丝她接着又帮我口了一会儿，说让我在上面。我翻身准备脱丝袜，她说直接撕就好了，我一下子就兴奋了起来，接着就是撕拉一声，残破的黑丝挂在大腿上，小穴若隐若现，我直接全根没入，弄得她一声低哼，我一边吮吸着她的乳头，一边继续巨龙冲撞，啪啪声不绝于耳，微胖的妹子真的是天生的炮架，偶尔用牙齿轻轻咬她的乳头，又惹得她一声惊呼，随着我的大力抽插，她的两个大胸画出一个又一个的富有节奏感的圆圈。草了一会儿，我把她的两条黑丝美腿往肩上一抗，弟弟瞬间被夹紧，视觉冲击也很强。最后我选了最喜欢的后入式，可惜床有点矮，不能站着全力输出，算是一点遗憾。后入的时候我一边扯着残破的丝袜，一边拍打她的屁股，听着她动人的呻吟，看着她的大屁股，和一波又一波的乳浪，10分钟交货，射的很满足，很舒服。做完我和她说想拍两张照片，她不让拍，说别弄出个什么艳照门就完了，我也没强求。接着就是洗澡，转账，床上一起聊了会天。妹子挺干净的，服务还行，下次希望解锁更多姿势和玩法。', 2, 1, 34, 7, 2, '3', '2020-07-21 13:51:35', '2020-07-21 13:51:35', '[\"/upload/article/432793e7a1e067fa7d97567686f6ab41.jpg\", \"/upload/article/7cce74113b4a468e8c239288abf09166.jpg\"]', 0, '');
