(16121, '京溪南方医院micky', 22, 30, '400/次或800/两次，1300/夜', 440000, 440100, NULL, '13537867553', NULL, '该有都有', '周五刚下班就约了小姐姐，这个小姐姐加了一两个礼拜，一直没去试，憋了两个礼拜，今天果断约上。一进门，果然没让我失望，和照片基本没差别，是我喜欢的肉感型，只是皮肤稍微没照片上好，开了一点美颜的缘故吧，胸比较挺，不过有一个是假的。妹子比较活泼，会和你聊天，洗完澡后，开始波推，口痧，毒龙，然后是口活，接着带雨衣干活，整个服务都比较认真，总得来说，指得一去，性价比高，颜值也可以。', 0, 0, 4, 0, 1, NULL, '2020-07-21 13:51:35', '2020-07-21 13:51:35', '[\"/upload/article/0e8e69c1a78dff8c139dd247de2c8427.jpg\", \"/upload/article/bb882f1779d8f7abb1b37d1035fe66c1.jpg\"]', 0, ''),
