(16123, '颜值 身材 服务都OK的安安', 22, 30, '4米一次40分钟，8米两课80分钟，两个小时10米不限次。夜颗13米', 440000, 440100, '1870313139', 'cls5325', NULL, '该有都有', '感觉心情有点压抑，这不释放一下怎么能行，发现朋友圈有新妹子，好友通过之后聊了一会儿感觉还可以，想着折日不如撞日，妹子刚刚开课就给我预定了。遇到一个有意思的事情，妹子居然那么大胆搂住我的腰，右手攥着我的裆部，这么硬了，果然是扫货。好久没遇到那么刺激的了。然后去洗澡，水潇有互动，妹子的咪咪蛮大的，给背后波推，带感觉。她的奶子蛮好看。这妞身上有种说不出来的香味很好闻，边亲，漫游，用舌头舔遍我全身，说实话很痒。。也蛮OK的，服务真多，跟课表一致。用她尖尖的舌头先是在J8的周围轻轻舔了一圈，然后嘴巴张大一口吞进JJ，那种感觉真是爽的不行啊。后面开始带帽子开始运动，越插越深，弄了大概有五分钟我射了。看她说话总是带着微笑给人一种特别舒服的感觉，性价比还是蛮高的4张那么多服务', 2, 1, 12, 2, 2, '3', '2020-07-21 13:51:29', '2020-07-21 13:51:29', '[\"/upload/article/7673bab6005541a8fd3483cc2c7854d5.jpg\", \"/upload/article/e36df5520dbafad1bd4a092146659b7b.jpg\"]', 0, ''),
(16124, '广州喵喵抓龙筋', 26, 30, '299-499/次', 440000, 440100, NULL, 'mm83016970', NULL, '推油按摩,鸳鸯浴,漫游,胸推,口活,抓龙筋,前列腺按摩', '这个妹子是之前约的小喵推荐给我的，她闺蜜喵喵服务内容是跟小喵一样的推荐给大家。服务只做环保，大家自己把握吧。（喵喵跟小喵不是一个人哦）进门直接脱光光，没有洗先做的推油，按完后就是胸推，抓龙筋，然后一边刺激前列腺一边飞机。服务没有写口不过你要求的话妹子也是会帮忙做的。她说胸推跟口活不好写在课表里，一般只做环保。想开大的话还是不建议大家去。', 2, 7, 10, 2, 2, '3', '2020-07-21 13:51:35', '2020-07-21 13:51:35', '[\"/upload/article/4b0568fef6f53e246b4bc6b9e87b04d3.jpg\", \"/upload/article/6356be82cc2490cb5ad7a6bb072f1da5.jpg\"]', 0, ''),
