(16191, '清纯可爱的娜娜', 22, 30, '400', 440000, 440100, NULL, '13556047130', NULL, '该有都有', '这几天我憋的难受，实在压不住火了，看到她在线就约她了，刚好她那时候也方便，说说对MM的第一印象了，个子高高的，屁股翘奶子大，身材还真是不错，长相比较清纯。后来她先陪我冲了一下，话说当她脱了衣服，两个白晃晃的奶子晃得我眼都花了，下面毛不算密，稀疏的点缀着，洗好后，奶子目测有C，吃了一会她的奶子，然后她开始主动服务了，各种挑逗后开始做口活，这技术自然是的没的说，会耍的那种。那感觉还真是说不出来的舒服。幸亏状态不错，否则指定提前交货。J8在她的“玩耍”下，过程蛮有情调的，还会在你耳边说骚话。不过妹子比较真实。看时机也差不多了，于是戴上TT，但没想到她的BB居然还蛮紧的，水多，慢慢进入，整根插到底，控制抽插的频率，没多久她就开始浪了起来，红着脸搂着我的脖子，呻吟着，看来是把她也插爽了，后来我也不知道干了多久，实在是很爽，缴枪后，浑身是汗，我抱着她休息了好一会儿，才一起去冲凉。一看时间，开心，就是下床后走路，腿都有点发软！！！总结：娜娜比较清纯可爱类型，笑起来有一些气质，下面还是比较粉嫩的，毛毛没多少。胸有弹性真实。性价比也高，4张。也是佛系开课，要预约才可以。刚刚出来兼职没多久，才一周。她还有一个闺蜜听说可以双飞，下次找她们一起试试。', 2, 1, 11, 4, 2, '8', '2020-07-21 13:51:35', '2020-07-21 13:51:35', '[\"/upload/article/2008dbea7e3ba8b98f46551f47586e1d.jpg\", \"/upload/article/d2a233257f8d5f23f22d442e8b7154b8.jpg\"]', 0, ''),
