(16574, '小可爱夏莎', 23, 30, '700p  1200pp  2000y', 330000, 330100, NULL, 'W898989u(这是她朋友的号，她先用着，约过之后可加她的号)', NULL, 'yyy,舌吻,无t口,制服等', '广东的小可爱，身高说是160，估计差个几厘米，我175抱着她就像玩具一样。但是娇小的身躯反而凸显了胸前的伟岸，一只手还抓不住。\n到地方进门之后，直接脱了衣服开始yyy，帮我涂沐浴露，洗干净后跪在地上口了一会儿。因为我比较喜欢接吻，所以洗完后亲了好几分钟，边亲边揉大奶子，妹子非常投入，也不会催着赶紧开始。第一次做完之后，精力恢复的挺快，就商量着来了第二次。开干之前让她穿上丝袜，她直接拿了条新的剪了洞，穿着让我操。射了之后又抱着亲了好久。之后洗了洗，也没催我走，就抱着她看电视，等到下一位快到了才让我下次再来。\n总的来说很温柔，会聊天，感觉很温馨。\n妹子一礼拜左右就回深圳过年了，平常两个地方来回跑。', 0, 0, 53, 2, 1, NULL, '2020-07-21 13:51:35', '2020-07-21 13:51:35', '[\"/upload/article/889ca709a35a572c6ce61f04232587f5.jpg\", \"/upload/article/e19f22dc9adbdf65d831a2189ceae3b2.jpg\"]', 0, ''),
