(16580, '普陀大熊妹莫妮卡可DL', 23, 30, '600', 310000, 310100, '1403855103', NULL, NULL, '全套有独龙可以69,需要的话可以加口爆', '上周体验的骚女，颜值很在线， 做过之后才知道她B好窄好舒服。给她的评价是 大nai白嫩正点极品，精彩刺激超爽 ，服务周到 本人很满意！就来这给大家分享了，喜欢这种大啵骚小姐姐的立马去！', 1, 2, 14, 2, 2, '3', '2020-07-21 13:51:29', '2020-07-21 13:51:29', '[\"/upload/article/f8a5b69c9125fc59cd002ab04f75573f.jpg\"]', 0, ''),
(16587, '宋家庄小奶猫', 22, 30, '600／P   1000／PP', 110000, 110100, '2695772776', NULL, NULL, '按摩,波推,口活爱爱', '说起这个小奶猫 圈内的兄弟大多数应该都听过。人照差距不大 不机车 算是性价比高的了。进屋以后女孩给我的感觉是偏甜一点，蛮漂亮！穿了个毛绒睡衣也看不太清身材，没关系，时间有的是，我还怕看不到么！\r\n         女孩到门口把门反锁，然后到我跟前蹲下帮我换了鞋，我之前再论坛里面看到过，突然真的有人这么做，我还有点受宠若惊的感觉，其实就这一个小细节，就让我觉得挺好，起码证明人家对我还算是上心的。\r\n          跟在我后面进了浴室，给我脱光光以后，她也开始脱衣服，我也没开水，就看着她，还给她看不好意思了！自己跑外面脱去了，哈哈！我头一回见这么腼腆的！然后包个浴巾又跑回来，我心里说，还包个屁啊！反正也得脱，但是就是这种小情绪往往可以刺激我的男性荷尔蒙！我也是有点开始觉得有意思，她进来开水，我瞬间一把就把浴巾给扯掉了，顺手就直接给抱过来了，妹子那个表情啊，精彩的很，想跑也不是，想不让抱也不对！就杵在那，瞪着大眼睛看着我，想挣开我又不敢使劲！我身上凉，女孩身上热热的，抱着感觉特舒服，有肉，还不显胖！随后，给我洗，拿着个喷淋头一会在后面，一会又在前面，我也是醉了，我说一嘴，我自己转不行么！洗的很仔细，尤其是洗我的鸡巴，左三圈右三圈的抹浴液，很仔细！洗完了还用浴巾帮我一点一点的擦干。\r\n         出了浴室，外面就有点冷了，妹子还紧着给我捂毛巾，还问我冷吧，其实这种小细节是没办法装出来的，一装就能看出来！能感觉到女孩是真的挺关心的！\r\n         上了床，我就四仰八叉的往那里一趟，鸡巴就在那竖着，她看了一眼抿嘴乐了，还一巴掌拍了一下，我这时候有点小激动，让她先帮我口一下！十分的乖巧听话，就跪在我下面，一口一口的小口润，我就抬起头想看看这时的景色，她好像也明白，突然大口含了进去，唉呀妈呀，温暖啊，湿润啊，没有什么形容词比这更贴切了！之后就在那十分缓慢的口，偶尔会快几下，我属于那种口活一般情况下不会射的，当时也不知道怎么了，就是感觉不像是一场交易，更像是情到浓时的一次激情，瞬间坐起来，让女孩拿套，套上也啥也没说，摸着奶子就是一顿狠干，有可能是一开始女孩还没动情，很干，插进去的时候我也看到她的脸有点疼的那意思，小小的龇牙咧嘴了一下，但是也没吱声，就在那忍着，手抱的我特别的用力，我当时的征服感简直是爆棚，干的那叫一个欢快！她皮肤很白，后入的时候，撅着屁股，更是让我有了充分的满足感，一开始她也没怎么有声音，但是越到后来声音越大，从小声的哼哼到特别大声啊，给我的感觉就很是动情。\r\n            完事以后，她一边帮我清理，一边和我说给我做个放松按摩，然后再做服务，在这我说一下，我做的是1000两次的！我也推荐一下妹子吧，性格很好，技术也算全面，外形样貌也都不错，胸也不小！我感觉基本能满足大多数人的要求，反正现在就给大家推一下！请看下面的照片吧。', 1, 3, 9, 1, 2, '3', '2020-07-21 13:51:35', '2020-07-21 13:51:35', '[\"/upload/article/e62742f8bd6bdf573fc93d80bfcc4ed0.jpg\"]', 0, ''),
