(16627, '南京天隆寺小极品', 25, 30, '800-1500', 320000, 320100, '', '', '', '波推,口交,做', 'vx指挥，发地址以后到楼下给房间号。真人比照片黑一点，但是车灯很不错。洗完澡之后直接无套口，然后用冷水含，口活特别好。车灯货真价实应该有C，皮肤也不错。口完戴套直接正题，比较紧，真实年龄应该24-25岁吧，价格小高。想去的要早点预约。', 3, 3, 0, 0, 2, '姐能干', '2020-07-21 13:51:35', '2020-08-07 03:16:19', '[\"/upload/article/052da281bc99d80fffdd99c0aa1ee0a9.jpeg\", \"/upload/article/71cd54c4bcae22a0e533bd7decae4da5.jpeg\", \"/upload/article/cd54622ccd917b57cede8d6f641de0c9.jpeg\"]', 0, ''),
(16638, '双井朵尔曼酒店 爽记 验证长腿安琪', 23, 30, '1500/PP', 110000, 110100, 'QQ320892112', NULL, NULL, '陪浴,波推臀推,漫游冰火,丝袜,69式无套口交,做爱', '晚上刚好有空。我在论坛看上了安琪~就加了她，看帖子的照片，安琪身材前凸后翘，在几番聊下~看安琪的样子就觉得挺骚的。我就约了，说了地址， 妹子就驱车前往我住的酒店，大概1个小时左右到我的酒店，\r\n安琪上楼，安琪敲门进入，安琪进入房间！我就抱着安琪就先摸几把，手感真好。安琪也很配合，还说小狼猴急，安琪身材很好，小狼也不多聊，就去洗个鸳鸯戏水。\r\n洗完澡就上床，安琪两个白嫩的咪咪和黑色的阴毛就暴露到小狼的目光里。身材真好，两个咪咪又大又挺。安琪很主动，从包包里拿出一双丝袜就穿上了，穿上以后更诱惑了，安琪躺在床上，双腿分开，黑与白的色差，暴露在外的木耳，视觉上很刺激也是妹妹一种无声的邀请，小狼抱着妹妹就开始亲。两个大咪咪更是不能放过，安琪也很配合的小声呻吟。\r\n过会安琪开始给小狼服务，手指在小狼的身上滑动，眼神魅惑的看着小狼。然后就开始漫游，漫游做的很仔细，不过小狼最喜欢的还是安琪的口活，小嘴含着小狼的DD边吃边看小狼。妹妹的口技很不错，没有齿感节奏分明。尤其是不喊停就会一直口，带上套套开始玩，扛起安琪的大长腿就开始直捣黄龙，\r\n几分钟后小狼都出汗了，妹妹也是面若桃花，让妹妹趴在床边小狼抱着大屁股就开始老汉推车，妹妹的骚言浪语很刺激人，各种姿势玩了个遍，精关大开一泻千里。', 3, 6, 10, 6, 2, '3', '2020-07-21 13:51:35', '2020-07-21 13:51:35', '[\"/upload/article/29adb1445b80c62e2d98054c25ed25c3.jpg\", \"/upload/article/55c87ef7618a73e631e33499f8d02a11.jpg\", \"/upload/article/da25b247d903a9b63f80dc695cb8d6ab.jpg\"]', 0, ''),
(16659, '重庆江北华新街 丰满少妇 芝芝', 28, 30, '300+', 500000, 500100, '1171906678', 'w18289091689', NULL, '鸳鸯浴,漫游,胸推,69式,口活,爱爱,主推精油按摩', '华新街芝芝，LY出差在群里看见的，主要是在意这性价比不错的快餐。LF的专业技术很不错，聊天的时候得知会所出来单干的，身材一般主要是，nanren在意的地方显著，我觉得是ok的，比较价格在那里。先是体验她的精油按摩，凶器的柔软度是十分的不错！皮肤很好特别是屁股摸起来简直不摆了，经典的蝴蝶B而且曲径深幽，喜欢69的狼友们不容错过哦，服务不是特别多但是态度很好基本上有求必应。下面是图片，妹子真实，是出差放松的好去处哈！', 3, 7, 12, 5, 2, '3', '2020-07-21 13:51:35', '2020-07-21 13:51:35', '[\"/upload/article/6b500b76f9b5c0ac095c91ccdc07a018.jpeg\", \"/upload/article/c9d4deef7476699a4cd6fb44c7435636.jpeg\", \"/upload/article/ddc628735aad1052ceb569c89fbe2ada.jpeg\"]', 0, ''),
(16661, '天府新区（二街）高挑妹子', 26, 30, '600+', 510000, 510100, '204329959', NULL, NULL, '该有都有,主要是A面B面毒龙波推吹箫口爆做爱', '总体较好，LF服务也很地道，去年6月份工作的时候，有空过去放松的。在朋友已经验证过的群里面看到讨论LF多多姑娘，哥们告诉XL已经验证过了，值得推荐一下，于是XL加上多多的QQ了解了下觉得还不错，离我的地方也还近，就和微微约好了时间过去。开门的是一个特别苗条的妹子，笑起来也很温柔，风尘味不重。后面一起去洗澡，整个过程15分钟左右，完全不用XL自己动手，而且还给XL口了一会哈哈，完事就脱光光上床，妹子的皮肤很光滑，手感是真不错，乳不大不小，颇有搞头。先霸王硬上弓的乱亲乱摸的激动了一阵，多多娇喘连连的回应，让我也觉得很爽。全程都没有催人，做的舒服。 LF多多相貌不错，而且服务技术比相貌还要出彩，挺让人惊喜的。确实不错，有兴趣的LY可以去试试！', 2, 2, 40, 1, 1, '3', '2020-07-21 13:51:35', '2020-07-21 13:51:35', '[\"/upload/article/870b0d989aae86a83920649a989831e9.jpg\", \"/upload/article/ce302e3d5dd946f5f7057e716c2c3530.jpg\"]', 0, ''),
(16671, '满足内心欲望的SM女奴 年后再战', 23, 30, '1500/P，sm：2000/p', 110000, 110100, '2307770707  必写：小姐姐俱乐部', NULL, NULL, '各种正常项目,sm,捆绑,强制,蒙眼,道具,项圈,', '得到这个QQ联系方式，妹子的网名是小金莲，我这不知道当年的潘金莲有没有她这么风骚，妹子自聊，通过很难，加了几次才加上好友。记得备注是 绅士介绍，\r\n能做sm项目的妹子，通常都是年龄大，相貌平凡，身材一般，要不就是完全的挂羊头卖狗肉，蜻蜓点水。\r\n但是这个妹子是颠覆了我对付费sm的认知，重庆妹子，年轻貌美皮肤好，年纪不到25，裸高超过170，皮肤细白，可以素颜见客。 最关键的是服务态度，就是一个勾引你内心暴虐的小魅魔，让你有一种为所欲为的冲动。2000p绝对是物有所值。\r\n黄文就不写了，写点干货吧，地点就在双井附近，妹子是完全自做自聊。态度非常好。虽说不是真正的sm，是以助兴为目的。这个妹子绝对有被虐倾向，看看哪个兄弟能完全开发一下。 \r\n一进门，小金莲就只穿了间黑丝衬衫，光着屁屁，跪在沙发前，期盼的目光看着我，我把玩着白白的屁股，先打个2分钟再说，然后把几粒草莓强行塞进她嘴里。 顺便沾沾下面的口水再让她吃掉。整体使用了各种道具，口塞，震动棒，遮眼，项圈，狗链，专业捆绑胶带。\r\n金莲妹子是超敏感体质，基本上是一碰就出水的状态。年轻精力好， 值得一试。\r\n现在回重庆过年了。我个人准备年后一再战。', 1, 8, 37, 1, 1, '1', '2020-07-21 13:51:29', '2020-07-21 13:51:29', '{\"1\": \"/upload/article/8fa7a0c23b4e017ddab3d7e6d3916c71.jpeg\"}', 0, ''),
(16673, '大龄熟女胸大逼紧还有水', 40, 30, '300/次', 230000, 230100, '2120766565', '15104653598', NULL, '该有都有', '约了好几次了，都是下午。到地方聊一聊，就脱了开干。先是口舔蛋蛋还给深喉，然后乳交，差不多了开干，主动坐上面，之后就是各种姿势。优势是胸大逼紧还有水，但是真的太老了，感觉四五十岁，但活真的非常好。', 2, 1, 17, 2, 2, '8', '2020-07-21 13:51:29', '2020-07-21 13:51:29', '[\"/upload/article/bc790d24bd0b53b3e375fe63562eaf2d.jpg\", \"/upload/article/f7212171a51564d731217ef5e22792c8.jpg\"]', 0, ''),
