(16676, '哈尔滨道里区亲身体验口活超级棒的妹妹', 26, 30, '500/1次 700/2次 1300晚', 230000, 230100, NULL, NULL, NULL, '胸推,69式,冰火,口活,爱爱', '之前看别人发过，去冰雪大世界玩回来决定联系下，开始比较慎重挺注意安全的问哪里知道的微信，直接说明来意哪里添加的。发红包看的照片直接开房发的车费。大概1个小时才到可能下雪路不太好走，我也没太着急。照片美颜过，不过还是可以接受的能看出来岁数不大。大概不说了口活超级好，人也不错不机车。有点羞涩。推荐大家体验下口活。', 2, 5, 0, 0, 2, '姐能干', '2020-07-21 13:51:35', '2020-08-07 03:16:00', '[\"/upload/article/8054b4e18f6e2348065d42e9267410a9.jpg\", \"/upload/article/ca691f8141725065bfc37e9977ff7d0f.jpg\"]', 0, ''),
(16678, '铁西约一个高颜值前凸后翘的年轻妹妹', 22, 30, '500/次或1500/夜等', 210000, 210100, '', '', '', '该有都有', '在跨年夜的晚上所有前场节目全部完事，合计自己一个人回去也睡不着于是翻了翻QQ，看看有个妹妹在线前些日子刚聊完还没约过就试着问了一下妹妹在线回复常规而热情，就此要展开一段美好的时光。到地方常规指挥上楼。进门眼前一亮护士情趣。高跟丝袜，雪白的肌肤，两只大白兔马上就要跳出来了。\r\n简短寒暄，妹妹帮忙调试水温，一起在卫生间冲洗了一下。然后进屋开始进入正题，具体内容不做描写。总结一下吧，年轻，通体雪白，胸很大（真胸），逼紧而且很浅，\r\n水很多，敏感体质。态度好，不机车。这是小狼混迹十余载打分比较高的女孩。很值得一试。', 2, 1, 1, 0, 2, '姐能干', '2020-07-21 13:51:35', '2020-08-09 23:48:34', '[\"/upload/article/304887b8866eaf085f038899ea974225.jpg\", \"/upload/article/3b4adb344787dc7babecf400405d0d3c.jpg\"]', 0, ''),
(16679, '和平鲁园附近二丫', 30, 30, '200/次', 210000, 210100, '2105230293', NULL, '13644076833', '口活爱爱', '前两天买的联系方式，看照片感觉还可以，所以元旦放假回来就抽了个时间，翘边去验证一下，由于是qq，联系她的人还挺多，只要是便宜，200的快餐，没有其他服务，我去的时候，还和其他的朋友装车了，我先上去的，那个哥们估计在外边等了一会，附近都是老小区，应该可以找到休息的地方。具体内容就不细说了，貌似只有快餐，客厅里摆着微信和支付宝的二维码，可以手机支付，她安全意识还挺高，手机是不让带到房间里的，重新完事用的是一次性的毛巾，总体感觉还行，200的快餐，服务也还可以，不催，不拖。', 1, 1, 15, 3, 2, '3', '2020-07-21 13:51:35', '2020-07-21 13:51:35', '[\"/upload/article/c6ed4220eaea63ea18da7733c9fd7fc5.jpg\"]', 0, ''),
(16681, '大连的一个学生妹子', 18, 30, '600/次  900/两次', 210000, 210200, '2924594115', NULL, NULL, '该有都有', '妹子是沈阳人，在大连这边来读书的出来挣外快，在群里认识的，妹子遥控我到指定的小区，然后到大门口接我，很活泼，自来熟，见面就挽着我的手进去了，喜欢笑，感觉很贴心，不墨迹，进房间先洗澡，妹子跟我一起洗，洗澡的时候摸着奶子真舒服，好久没干这么年轻的了，嫩逼妹子，有点婴儿费，但身材还是不错的，胸大，有分量，屁股也大，跟妹子在床上做服务，ab面都全了，接着给我口，说实在，口技一般，可能妹子还不习惯给客人用口，我直接翻过身按住妹子，来个69式，接着妹子给我戴套开始干，我就懂那些个招式，几下就射了，整体来说不错，妹子嫩逼没有味道，这个比较爽', 2, 1, 15, 5, 2, '3', '2020-07-21 13:51:35', '2020-07-21 13:51:35', '[\"/upload/article/4dc1a42eb366501081f985cb551e8476.jpg\", \"/upload/article/fc50165410befdb8134f7ce80a63b1c0.jpg\"]', 0, ''),
