(16684, '金州福佳新天地小妹', 30, 30, '200/次，300/小时', 210000, 210200, '344961479', NULL, NULL, '该有都有', '在微信群里无意间加的，一直没去，因为自己不在金州。qq里有时聊两句，即使一直没去，小妹妹也不叽歪。11月去金州办事，去过一次，小妹妹个子不高，小巧型，很听话，不叽歪。前几天又去办事，就顺利有光顾一下。小妹妹二十五六岁，自己在金州福佳新天地租的房子。不住哪里，只是用来接活的。第二次去，算是认识，约好时间，到了地方上楼。自己简单洗洗，没要陪浴。上床，抱抱，接吻，口活，摸摸下面，挺紧。用手插了一会（我就喜欢这个），带上TT，让小妹妹上来，各种姿势，一会交枪。又冲一下，穿衣服走人。临走前来个吻别。', 1, 1, 4, 2, 2, '3', '2020-07-21 13:51:35', '2020-07-21 13:51:35', '[\"/upload/article/93f7418ed5429e953d48593f4a75ccd1.jpg\"]', 0, ''),
