(16686, '长春十九岁妹子素质不错', 22, 30, '400/次700/2次', 220000, 220100, NULL, 'AD1010911', '13194369950', '该有都有', '妹子年龄小，照片百分百真人，水多态度好，口活还可以，别的不知道会啥，自己租的公寓条件还可以挺干净的。大长腿，值得玩玩，昨晚刚约完，干了半个多小时七个姿势，妥妥的。', 2, 1, 40, 11, 2, '3', '2020-07-21 13:51:35', '2020-07-21 13:51:35', '[\"/upload/article/96b9304f8c723e97d1b965561ab71012.jpg\", \"/upload/article/c6ea8d617e1c86b13f7658b5623cb71b.jpg\"]', 0, ''),
(16689, '鄞州区漂亮妹子', 26, 30, '500/次  800/两次  夜1500不限次', 330000, 330200, NULL, 'shange516', NULL, '该有都有', '妹子样子很漂亮，照片是本人。服务态度特别好。很温柔，体贴。不墨迹，口活一级棒，屁股很大，很软，阴道很紧水很多，身材也不错，有些丰满。过程就不多讲了，喜欢的可以去试试。', 2, 1, 63, 7, 2, '3', '2020-07-21 13:51:35', '2020-07-21 13:51:35', '[\"/upload/article/147de31e77c1f5086aa6c2804d7d7cb5.jpg\", \"/upload/article/dfa50ebb0476668f7880571a15458ca5.jpg\"]', 0, ''),
(16690, '鄞州大胸妹子 特别爽', 26, 30, '500/次', 330000, 330200, NULL, 'a520524928', NULL, '该有都有', '找了妹子好几次了，货真价实，妹子个子很高，胸奇大无比，一边操逼，一边吃奶刚刚合适，特别爽，可以高跟丝袜，妹子很温柔，人很好，欢迎狼友去捧场。', 2, 1, 6, 2, 2, '3', '2020-07-21 13:51:35', '2020-07-21 13:51:35', '[\"/upload/article/5c793afe690f622e1f8481c602140009.jpg\", \"/upload/article/768f500e0ec471d0883be59226766446.jpg\"]', 0, ''),
(16691, '宁波的一个舞蹈老师', 26, 30, '800/次', 330000, 330200, '741525923', NULL, NULL, '该有都有', '一个之前约过的妹子帮忙介绍的，800一次，到地方以后，她自己租的小户型，布置也还算温馨。简单聊了聊，妹子给拿来拖鞋，简单冲洗，搂着上床，调情和口活很不错，她会果冻胸推项目，本狼第一次体验，感觉非常不错，做起来麻酥酥的，各种服务走一遍就，插了一会儿，射完以后，妹子用舌头帮我舔干净，态度和服务没得说。', 3, 1, 8, 1, 2, '3', '2020-07-21 13:51:35', '2020-07-21 13:51:35', '[\"/upload/article/196c5a530f8605316bcdea3b55bbf631.jpg\", \"/upload/article/2e84a5faa7626046cd35adad82a35f64.jpg\", \"/upload/article/f9f9f82b3d40741b4ef27837fb47e189.jpg\"]', 0, ''),
(16692, '再次光顾服务系妹子', 26, 30, '600', 320000, 320500, NULL, 'mm15705698261', NULL, '鸳鸯浴,爱爱', '价格：600/1000/2000\r\n之前玩过一次.因为服务很好.一直有联系.今天说要来苏州了.就马上约了下时间去爽了一把.服务还是很好.只待到过年.弟兄们可以体验', 2, 2, 52, 6, 2, '3', '2020-07-21 13:51:35', '2020-07-21 13:51:35', '[\"/upload/article/a544f09d7e61230fcd3ab38042788c55.jpg\", \"/upload/article/a65f3dad6666bb24e4d9876ba4a72ffc.jpg\"]', 0, ''),
(16693, '高性价比居家水磨', 26, 30, '600/次', 320000, 320500, NULL, NULL, '13564979452', '该有都有', '进门后，发现是一室户的公寓。里面很温暖，房间也很干净整洁。妹子还养了2条小狗，一白一灰，很可爱。妹子很体贴得给我倒了杯水。话说进门后主动给我倒水的妹子没几个，这个小小的举动也让我倍感温馨。\r\n\r\n妹子人不高，1.6吧，属于娇小可爱型。胸大概有C。长相一般，她说自己30岁，应该没化妆的缘故，看上去没那么年轻。\r\n\r\n脱了衣服，进浴室后，妹子把一个气垫床和枕头放倒在地上，铺好垫纸后，让我躺上去。先做背面，然后前面。服务细节我就不表了，流程就那么多，涂上油后，妹子用身体给你按摩。然后漫游，吸皮，毒龙。正面类似，臀推，口活。等一柱擎天后，擦洗干净上床。这里说个细节，擦干身体用的是大浴巾，这个比较舒服。有的妹子那里洗完澡只给一条毛巾擦身，明显感觉就不如大浴巾爽。客户体验立见高下。\r\n\r\n上床后，妹子把灯一关。本以为会很暗，但是忽然发现墙上出现了各种五颜六色的灯光效果，煞是好看。光线既不太亮也不暗，正好合适。这是我遇到的最好的环境氛围了，很有感觉。上床后继续口活，我的手也没闲着，各种扣摸。几分钟后，带套后入。从后面干的时候，发现妹子的屁眼比较大，我忍不住用手指轻轻捅了捅，妹子没有大叫阻止，只是说轻点。（我觉得应该是可以三通的，虽然妹子说不行。）既然不能用鸡巴干，那就用手指干。看着妹子前后两个洞分别被自己的鸡巴和手指同时干着，这场面别提多刺激了，真是让人血脉喷张，没多久就缴械了。\r\n\r\n完事之后，妹子也不催人，电视机里正在放《鹤唳华亭》，她看我看得出神就让我休息休息慢慢看，反正接下来没人。\r\n\r\n整个过程1个小时左右，妹子挺健谈的，了解了她不少事。她是贵州人，之前在上海会所做水磨，1年半前来到苏州。家里还有个妹妹，在网上卖衣服。她做模特，每周摄影师都要给她拍摄，她妹妹再把照片挂网上卖。所以房间里挂满了各种衣服。', 2, 1, 3, 1, 2, '3', '2020-07-21 13:51:35', '2020-07-21 13:51:35', '[\"/upload/article/412b485a4e967531507f361f308d3112.jpg\", \"/upload/article/fdd9c3df570e799592e6829be1117a98.jpg\"]', 0, ''),
(16694, '风骚大屁股兰姐', 40, 30, '300', 110000, 110100, '3513451473', NULL, NULL, 'qt', '丰满型，看见就有欲望，水多不机车，叫声好听，可以试试', 1, 1, 7, 1, 2, '8', '2020-07-21 13:51:35', '2020-07-21 13:51:35', '[\"/upload/article/79c90cba77955e3466e3c953e8d31088.jpg\"]', 0, ''),
(16695, '苏州园区极品大胸妹', 22, 30, '700/次', 320000, 320500, NULL, 'guai7788121', NULL, '该有都有', '妹子胸很大，长相也跟照片9成像，服务还可以，不机车。喜欢大胸的狼友有福了。\r\n                      好了言归正传，下面记一波流水账，一顿遥控指挥来到楼下，地铁附近并不远，交通便利不用说，环境还是不错的，整体干净整洁，洗澡依旧有一次性毛巾，卫生方面经过确认很ok。\r\n                      妹子帮忙一起洗澡，妹子家里有很多情趣内衣，喜欢的狼友可以自行选择。上床之后，脱去内衣之后一看，还是有点实力的，胸非常大。四处摸亲之后，放肆将头埋在胸前，感受着各种软糯。B面躺好，按摩10分，非常非常专业，能起到缓解疲劳的效果。耳边喘息，7分，漫游，9分，路线左臂→左背→臀部→左腿→右腿→臀部→右背→右手臂，妹子会重攻膝盖内侧，很痒。\r\n                    妹子口交有深喉，体验感非常棒，而且不止一次深喉。舌头非常灵活。最后实在忍不住了，提枪开始大战一场，妹子姿势也很配合，各种换姿势，下面也是特别的湿润，弄起来特别有感觉。一顿操作，终于缴枪。\r\n                    妹子一个人住，太晚了就不做了。想去的狼友可以提前预约。总的来说，服务还可以，不是很机车，体验感还可以。喜欢大胸的一定要去试试。', 2, 1, 72, 8, 2, '3', '2020-07-21 13:51:35', '2020-07-21 13:51:35', '[\"/upload/article/eb4168c5da87570923ffeee6671252d9.jpg\", \"/upload/article/f7f99205f69a112b0962fdfc7134bc6f.jpg\"]', 0, NULL),
(16696, '吴中区泻火熟女', 30, 30, '500/次', 320000, 320500, '', '', '15862328689', '该有都有', '这个熟女在苏州久一点的狼友应该见过吧，反正我是14年就见过了，那时没去，前几天闲着没事，去玩了一次，泻火还不错，这个熟女应该在做鸡头，还有90后的妹子，长得还不错，可以加微信让她给联系', 2, 1, 3, 0, 2, '姐能干', '2020-07-21 13:51:35', '2020-08-07 03:14:12', '[\"/upload/article/6a3d902852810600dea521095a71a699.jpg\", \"/upload/article/bf86a360477120bb433f031c1925f448.jpg\"]', 0, ''),
