(16768, '青羊区颜值高挑妞体验', 26, 30, '500P , 700PP', 510000, 510100, '2182828527', NULL, NULL, '该有都有', '言归正传，说说为什么找这个‘思思’，是‘颜’！颜值即正义，我选QM一定要好看的，至少日常生活里见到的6分姑娘才可以，所以有些妞即使丰乳肥臀的，只要脸不OK，我还是没有艹的欲望，所以收藏‘思思’的原因因为如此，在看起来P得不严重的图片上，眼妆也不浓、鼻梁也还高，这两点差不多决定了底子不差了，剩下的皮肤是否白净那就可遇不可求了，其实只要刚洗个澡肯定都滑溜溜的，这点我也不担心；\r\n3、约好时间，停车场停好车上去联络，结果让我走地下停车场进入，汗，我刚才地下停车场走上来呢，也行，至少安全么，有次找QM被门禁问我去哪里，如果犹豫的话难免添堵。打开门以后一看，纤细高挑，皮肤就是普通的中间，不白也不黑，面相和图片大概8成吧，行吧，箭在弦上，一定要发射啦！\r\n4、脱衣带我去冲澡，自己也脱了过来陪我洗，因为我是中午去的，估计上课还不算多，耐心这个时候还比较多，这也是我几乎不会晚上去找楼凤的原因，一天工作下来人都疲倦了，哪还有精力细致服务呢，工作的人都懂那种感受；\r\n5、洗澡重点是小弟弟和屁屁，我这人吧，对于姑娘用手摸我的屁眼有点爽感，会起鸡皮疙瘩，这点就不得不夸了，我擦，她居然发现了，然后说再多给你摸摸，我欣然答应，嘿嘿！擦完身子躺床上，开始B面服务，对了，忘记说她的身材，胸也就是个大B吧，毕竟整个人瘦瘦高挑的，估计165cm得有了，感觉屁股不算大，不过屁股是好看的，较紧实，肚子也没有赘肉，目测没有胜过小孩子，年龄看起来二十六七吧；\r\n6、口砂一上就知道会所肯定待过，水准还是在的，尤其摩挲我腿的意思，小弟弟就起立了！刚转过来口活了2min忍不住了，赶紧带上TT开艹，她的哼哼唧唧有特色，那种想哼又要憋住的感觉，有点娇羞，我就喜欢这种调调，性质起来了，我那个冲刺不停啊，她可能有点受不了，感觉胯下在躲！躲得脱，马脑壳，我赶紧两手捏住她屁股两瓣，全力输出！\r\n7、马的，空调也有点热，我这一番动静，汗都出来了，不能停，让她夹我，她也懂得起，抱到床边老汉推车姿势准备出货！最后biu一泻千里，心里宁静了！然后她搂住我屁股不让我鸡巴抽出来，似乎全力榨干，哈哈哈，这点好评，我喜欢！\r\n8、大致就是如此咯，500P的价位，加上颜值和身材可以去，中规中矩，没有意料之外的惊喜，也不亏，可以体验下，哥们些儿～', 2, 1, 8, 5, 2, '3', '2020-07-21 13:51:35', '2020-07-21 13:51:35', '[\"/upload/article/34fd86001ce852f8e11e26d39e1913a2.jpg\", \"/upload/article/41e884f6995bb41ad18da13ae64f0df3.jpg\"]', 0, ''),
