(16773, '成都十大优秀LF冠军候选人4 运动型西雅图', 26, 30, '700P/900pp', 510000, 510100, NULL, 'win131425v', NULL, '该有都有', '身高168 胸有B+  屁股贼翘 活泼可爱  本狼去过很多次了  年龄在25岁   水真的多  经常弄一床单   背上有个纹身 酷炫   很爱聊天  话多 但是不是那种垃圾女孩  人家是爱健身的那种  服务态度真好不打折扣  比起大多数走诱惑路线的美女  这算是一种新的口味 挺不错的  吃腻了太有太腻的  换个其他口味 真心不错   特殊技能是能口一半让你插一半  口插交替 好耍', 2, 1, 11, 2, 2, '小肥龙', '2020-07-21 13:51:35', '2020-08-14 20:28:46', '[\"/upload/article/c1c939f882f5f842096c6d2275c8cf1f.jpg\", \"/upload/article/f19fe6f6d7643a1dc200de9a818de9fb.jpg\"]', 0, ''),
(16774, '文殊院的正妹', 26, 30, '400P / 600PP', 510000, 510100, '', '', '', '该有都有', '158cm的C胸丰臀妞！说到屁股，自从上了30岁以后，我最爱的就是那两瓣屁股咯（后有实拍图），一定要丰满、多汁、翘翘才可以！对屁股的喜爱远远多过了胸部！以及，姑娘最好待人比较有亲和力，我说的当然不是那种动辄’老公老公亲爱的‘称呼，那样有点恶心谄媚了，就是亲切且有一定距离，不远不近即OK；\r\n姑娘较为热情健谈，会主动和你找话题聊天，这点很重要！尤其你新去找一个妞，是否健谈轻松其实很大程度上决定了你的回锅率，我是如此认为的。她穿着透明的蕾丝内裤和紫色内衣站在门后，个子娇小的姑娘，但是屁股真的翘翘的、肉嘟嘟超可爱，当下就上去轻抚了一把，手感的大满足！\r\n在卫生间脱光了陪我一起洗澡，重点洗小弟弟，用身体给你抹沐浴露，来蹭你，所有你想到的温柔她都给到了，完美！洗完以后用一次性纸巾给我擦干，然后真的是牵着我硬邦邦的小弟弟去床边让我躺下的，哈哈哈，微微霸气的女皇掌控感，我有点喜欢！\r\nB面的服务我一直不算太喜欢，她呢就是尽责的口砂咯，每寸肌肤都不落下，不过还是觉得些许流程化，是用心的服务，不过对于我这样以前东莞都浪数次的人来说啊，不甚新意了，暂且不表，这里重点说她！的！屁！股！是真的翘，不用拗都被丰富的肉肉填满，wow！迷恋！一通口活以后，让她赶紧趴着，征得她同意拍了两张屁股的图片，然后带上雨衣就开始进入她的身体，赞！温暖的阴道！总说‘阴道的路对男人来说是全世界最美妙的道路’，一点不假，你的抽插之间蕴含的全部是作为雄性的征服和满足感，无比兴奋；\r\n她配合我的抽插给予的‘哼唧’，即使可能有演戏的部分，也觉得从声音上我可以得到满足，毕竟是生意，每天那么多客户，早就对性没有感觉了，能配合演戏的叫床这叫‘敬业’！待Biu发射以后，瘫在床边，她脸有一点红的靠过来贴着我，也不说话，就看着我，那一刻的连接从无到有又到无，大圆满！\r\n后记，推荐的缘故还是因为划算，400P的价位这个超值了，冲着那个屁股，你用鸡巴顶进阴道的快感就回本了，不喜欢那些干瘪的屁股，实话！', 3, 1, 0, 0, 2, '姐能干', '2020-07-21 13:51:35', '2020-08-09 23:44:46', '[\"/upload/article/19e13dccbf26891c68198718c000605b.jpg\", \"/upload/article/80c6ffb99d4efa24174f664df901a14e.jpg\", \"/upload/article/91976acbfe70022a70633ffb2add2e6f.jpg\"]', 0, '');
