(16783, '普陀小姐姐体验', 22, 30, '700/800/900 两次', 310000, 310100, '1291748724', NULL, NULL, '该有都有', '那是一个月黑风高的下午，QQ联系敲定后打车前往，遥控上楼，个人一般是货不对板直接走，这次开门竟然有惊艳的感觉，跟照片很符合。进门后简单招呼洗澡，进入卧室，XL选的是KB+ML，KB非常细致，做的极好，让人神清气爽，结束后简单AM（正经的哈），精神恢复后开始正常流程，妹子应该是专业训练过，项目质量是目前XL在上海LF中体验过的最好级别，流程结束后ML，先正常位然后后背位，由于第一次已经很尽兴了，10分钟出货，洗澡拥抱后给水费撤退，非常满意的一次寻欢。下次还去。', 0, 0, 7, 0, 1, NULL, '2020-07-21 13:51:29', '2020-07-21 13:51:29', '[\"/upload/article/20beda154ca4413f38ada23fb5ac7994.jpg\"]', 0, ''),
(16784, '徐汇蜜蜜', 22, 30, '500/P 800/PP', 310000, 310100, '3041455820', NULL, NULL, '口活爱爱', '遥控上门，地方还可以，进门洗澡，妹妹人很热情，该有的服务都有，身材也不错，腿长胸有C，前凸后翘曲线可以。干的时候有一种反差的刺激，看着淑女变浪女，你懂的。口活也非常出色无齿感，深陷在她的温柔乡里根本无法自拔。啪啪啪走起，这种半良家干起来是那种特别真实的感觉，总体还可以，照片与本人相似度80。', 2, 1, 3, 1, 2, '3', '2020-07-21 13:51:29', '2020-07-21 13:51:29', '[\"/upload/article/1899de4a8decd1529ca2d865d5e6d9ea.jpg\", \"/upload/article/7abd0d8bdbed28863b611245633d8737.jpg\"]', 0, ''),
(16786, '上海西站附近骚东北妹子蕊琪', 27, 30, '500/次', 310000, 310100, '2835674725', 'youyouikn', NULL, '该有都有', '居家好妹子，小只，说室友也接课但亲戚来了，过几天可试试双飞。 朋友推荐的妹子，快过年了还没回去的不多了。 提前一天约的妹子，很热情，服务态度好，东北人妹子，整体还不错，一番验证，妹子跟照片差距不大，身材目测有C摸着软软的，服务还行，值得5张，东北人，说话带点chazi味，妹子很听话，懂得配合，不一会就出水，后入很爽，妹子够骚，会叫。说是做这个有段时间了，前段时间打的严，不停搬家。 过年说可能也在  该有的服务都有， 可毒龙，果冻，69 。 总体90 ，可选全套／2次 仅仅5张。 住在老式小区内，安全。', 2, 1, 14, 3, 2, '3', '2020-07-21 13:51:29', '2020-07-21 13:51:29', '[\"/upload/article/0a48595db1da3776ce4896a81e5677f9.jpg\", \"/upload/article/a1e9dedacc9f9f78bbcc6394bf9b3677.jpg\"]', 0, ''),
