(16999, '童颜巨乳珠丽 168+ 偏肉感大妞 波大臀肥', 30, 30, '350一课', 440000, 440100, NULL, NULL, '13602730815', '该有都有', '是我操她同屋的一个熟女，叫开心的，之后在客厅看见的，她在隔壁房间。真人颜值可以，跟照片8成对版，肉感但不至于坦克，有点婴儿肥，显得年轻。身高168+，还TM喜欢穿高跟，直接把我秒了（我也不矮175的）。波大，38D应该没什么水分。流程还可以，洗吹做常规，漫游，波推，乳交，69，都有了，洗澡的时候特别认真洗你的手指，说男人都喜欢在69的时候捣进去，可以指入，水多，各方面比较配合。', 2, 1, 3, 1, 2, '3', '2020-07-21 13:51:35', '2020-07-21 13:51:35', '[\"/upload/article/02bd8fe9cd59cde1f23ee87a29e4f33b.jpg\", \"/upload/article/cc8344eb3809e12bc5e5f9a0bd5e587b.jpg\"]', 0, ''),
(17000, '东北爆乳少妇开心 170cm D奶', 30, 30, '350一次', 440000, 440100, '', '', '13922482468', 'XCZ,漫游,BT,69,丝袜高跟制服', '：废话不多说，都是老狼了，直接敲黑板划重点。坐标：万福路和越秀南交界的XX大厦，容易找，就在主干道路边，有门禁，但没保安，楼下是个衣帽交易中心，出入的人多，跟着进就行。\r\n颜值：8分，27-28岁左右的少妇，皮肤白滑，东北人，打扮很时髦，栗子色卷发，斯文之中带点骚气。\r\n身材：9分，净高168，穿上高跟接近175了，海拔低点的LY可能有压力，车灯大，D奶，波推的时候，夹住JJ都淹没了。\r\n服务：传统XCZ，还有BT，MY，KB，69，衣柜有几套制服，都是OL装的那种低胸，超短裙，可以叫她穿着做，态度很配合，技巧高，不用手就可以吹爆。\r\n价位：350一Q，600两Q\r\n联系方式：WX和电话，我是加了她WX约的，但一开始好久都不回，打电话过去问才知道，原来偶尔会封号，现在已经解开了，但最好还是直接打电话', 1, 5, 2, 0, 2, '姐能干', '2020-07-21 13:51:35', '2020-08-07 03:06:35', '[\"/upload/article/0f4a51d3d17be5445b9a8a6e40571f24.jpg\"]', 0, ''),
(17003, '福田石厦小妹', 26, 30, '400快餐 500全套服务一次 700二次', 440000, 440300, NULL, NULL, '13135283407', '鸳鸯浴,无套催,激情爱爱,制服诱惑,69,亲亲,可69,过水,毒龙,毛扫,按摩,水潇,胸推,臀推,环游,刮痧', '主要看缘分吧，看到喜欢的就加上，有时候又给忘记了。这两天倒是有点时间，刚完成了一个项目，想缓口气。结果看了照片，感觉条件蛮好的，是我喜欢的类型，就是人漂亮身材又好。但真人怎么样就难讲了，眼见为实吧。找到妹妹的住处没费啥劲。对方默契的打开门，窈窕淑女梦露温柔一笑，长的真好看，弯弯的眼睛，瓜子脸。个子高挑，看来是来对了。穿着低胸爆乳装，一眼就看到了她的事业线。三围还是蛮傲人的，性感又美丽的感觉，心就被她勾走了。看对眼，进屋关门，先是去洗澡，既然碰到自己喜欢的就选择做个全套，认真享受下。全套服务也不是说说而已，确实是相当有档次也相当的敬业。全程陪浴，在浴室里面各种挑逗不停，她的胸部抹上浴液后就在我的身体上来回摩擦。气氛暧昧，妹妹含住JJ开始KJ，我没有抵挡住诱惑啊，口了温柔的帮我洗净，叫我回床上躺好。贴心漫游，胸推是我很喜欢的环节，口活自然更不用讲，连蛋蛋都照顾的无微不至。毒龙一气呵成，这美女真是豁的出去啊，叫人怎么受的了，冲动的不行了，叫妹妹坐了上来，这小妖精直接把我干到出货了，想到外表这么温柔，实质上也是战斗力极其威猛啊。', 1, 16, 12, 4, 2, '3', '2020-07-21 13:51:35', '2020-07-21 13:51:35', '[\"/upload/article/8bf3d57c1ca6c03b8ac95aa8dfa554cb.jpg\"]', 0, '');
