(17088, '大望路琳琳  再次出击 依旧是舌吻69 性价比逆天', 25, 30, '500/次。没有包夜过。', 110000, 110100, '2374129740', NULL, NULL, '69式,口活,爱爱,', '琳琳在我心里，基本这个500元的价格在帝都应该是大望路第一了。有一段时间，她母亲生命，回老家很久，这次回来搬家了。就想着再来一次。毕竟衣不如新人不如故。（主要还是漂亮，69舒服）。老人约完了，直接开车过去，房间比大望路那边小了一些，不过是独立一居室，让心情放松了很多。其他过程就不说了，总之每次去都必须69，然后可以接吻啪啪啪。一切不能接吻的啪啪啪我都认为是*交。这是我最满意琳琳的地方。去之前，如果需要穿制服，提前告诉琳琳。', 3, 4, 5, 3, 2, '3', '2020-07-21 13:51:29', '2020-07-21 13:51:29', '[\"/upload/article/287bd7adba79abbacdda03d7592cb9dd.jpg\", \"/upload/article/63fd48e2be322f1630c44def8cec1811.jpg\", \"/upload/article/cf97ab2adf9ee66db6f89e7d52b9dcb0.jpg\"]', 0, ''),
