(17516, '天府广场角色扮演', 30, 30, '400p 500pp', 510000, 510100, NULL, 'Ym15884348756', '15775305579', '角色扮演,情趣制服,毒龙,该有都有', '提前选好叫色和制服，到了遥控上楼，进门开始挑逗，角色完全在线，慢慢脱掉衣服，然后开始含，各种挑逗，上床全套服务，最后进入正题，边叫边喊爸爸，太爽了', 1, 4, 15, 4, 2, '3', '2020-07-21 13:51:35', '2020-07-21 13:51:35', '[\"/upload/article/958ff3db7f458b90a424f0482c419f8e.jpg\"]', 0, ''),
