(17529, '杨浦熟女', 30, 30, '700/p', 310000, 310100, '485616724', NULL, NULL, '该有都有', '晚上在滨江这边吃饭，喝了一点小酒，小弟弟不听话，微信沟通了，确定OK，我就直接打的过去了，离我这边不远，10分钟就到，她住的地方是公寓，（8月份去过一次）我喜欢熟女，进门就给了我一个拥抱，口象征性的对吻了一下。简单介绍一下，身高163左右，身材不错，脸型80分，c乳左右，下面有点松，服务态度很好，不知道是不是我比较帅的缘故，（呵呵，开玩笑）臀部有点肥，后入比较好，这个我很喜欢，我请求她穿了黑色（不穿内裤）', 2, 1, 7, 5, 2, '3', '2020-07-21 13:51:35', '2020-07-21 13:51:35', '[\"/upload/article/47f15ba6f1b434b3d864d54b6f4fbed6.jpg\", \"/upload/article/cbddf3017c3d9d69a78074206b75060a.jpg\"]', 0, ''),
(17530, '黄埔不爽记', 22, 30, '1000/p', 310000, 310100, '786867734', NULL, NULL, '该有都有', '12月13号上午联系上的， 开始一切很好，直到要上楼了， 说要等5分钟，我觉得肯定是代聊了， 但是还是等了一会儿\r\n\r\n进门先要收钱，悲剧的开始。但是人是和照片差不多，就是有点黑\r\n\r\n然后就是洗澡， 有一次性的毛巾，MZ给洗，但是没有YYY，这时候发现MZ有一个巨大的纹身， 而且腰身很壮。\r\nPYQ的黑丝腿明显是P过的。\r\n\r\n洗完以后服务， 基本三点，不让摸RT，不让摸下面，磨熊只能是外围，碰到头就大叫（被前一个LY咬伤了？）\r\nDT开始干，正常体位----她的口臭差一点没让我软了，太臭了，我只好让她转过去， 勉强出货。\r\n\r\n完事洗澡， 让她给我一条新的一次性浴巾，被坚决拒绝，说一个客人只能用一条。\r\n\r\n总体来说：\r\n妹子和照片差不多， 但是根本不是小女友型的，全程不理你， 要不然就是说这个不行，那里不让碰\r\n身材是有168，但是很壮\r\n口臭太厉害了，我有鼻炎， 一般的味道我闻不到（所以从来不舔），但是这个是有让我恶心的感觉，前一个LY的JJ 生病了？\r\n\r\n看她朋友圈的图。有一张电视机变形了，还有自拍的手指都很粗，其实就是个轻坦，打了点瘦脸针，整了一下容', 2, 1, 3, 1, 2, '3', '2020-07-21 13:51:35', '2020-07-21 13:51:35', '[\"/upload/article/b083fd75095c99fc18aabd16c8e6cd49.png\", \"/upload/article/bb6cbac666dc2c7afb1ac13318ef871c.png\"]', 0, ''),
(17531, '性感高挑Aane', 18, 30, '500/p 800/pp', 310000, 310100, '983211907/1927821485', 'Anne6868558', NULL, '该有都有', '后决定去上次追寻未果的Aane，犹记得，之前QQ上看到的性感、风情的Aane，可惜上次妹子满约，未能成行。\r\n约好的时间到达现场，qq指挥开门，看到妹子时，确实没有各种美颜照片那么白，但身材确实实打实，裸高165左右，C+，无赘肉。\r\n和妹子寒暄了几句，就去洗澡了，天冷，妹子洗过了，也没必要强求一起洗。\r\n洗好上床，跟妹子缠绵了一会，妹子的身材是两点，尤其是一对白兔，熊控的狼友有福利了。\r\n妹子口活不错，张弛有度，无齿感，享受了很久。\r\n随后进入正题，妹子属于奔放型，呻吟声很足，但有些略假。但好在妹子各种姿势配合的很好，女上的时候，更是妹子主导。\r\n小黄文不表，各位狼友自行体验。\r\n总结：妹子属于长腿、丰满型，热情奔放，喜欢的狼友自行体验。', 1, 1, 26, 5, 2, '3', '2020-07-21 13:51:35', '2020-07-21 13:51:35', '[\"/upload/article/a629f3838330fd3f71d966acbbecb7d7.jpg\"]', 0, ''),
