(17534, '闵行小野猫', 26, 30, '700/p', 310000, 310100, '2150746052', NULL, NULL, '该有都有', '之前风大所以找居家的多，一般喜欢去找大奶，偶然找到这个还不错，奶大。 在某小区里，停车还算方便。妹子之前好像是和别人合租的，进门看真人感觉一般，160以下，熊是真的大不算黑。 衣服脱光有YYY，洗完躺着直接吹了，也没什么服务，就是个快餐级别。 真人有点微型坦克。原来要价500，现在居然要700，不知道哪来的勇气。 目测年纪也不小了。', 2, 1, 3, 1, 2, '3', '2020-07-21 13:51:35', '2020-07-21 13:51:35', '[\"/upload/article/7b055f780980fd27b329fbdf6196b9ae.jpg\", \"/upload/article/971b12169a8491faa20301717ed4cfb1.jpg\"]', 0, ''),
(17535, 'TY 茯苓', 22, 30, '400/ty 60分钟 700/90分钟 飞机无限', 310000, 310100, '2301339520', 'yy91662800', NULL, '胸推,漫游,过水吸皮,TY', '妹纸本来在普陀的吧好像，现在搬到长宁去了，靠近龙之梦，中山公园附近，小区门口我没看到保安也没大叔闲逛，这点我还是比较安心的，上去，一梯很多户，多少户数不清楚了，反正很多户。。。我的习惯都是到别的楼层再下去，这样我感觉会比较安全。开门进去妹纸很娇小，是我比较喜欢的类型吧，就那种loli身御姐，赛高。\r\n\r\n进门妹纸戴眼镜的，我么是loli眼镜控呀，完全适合我的胃口，然后简单YYY，没啥服务，这要记笔记，差点意思。然后妹纸帮我擦干，我反正躺床上，按摩按摩，捏捏肩，然后胸推，漫游，过水吸皮，一套ISO下来反正，我觉得捏捏肩蛮舒服的，可能平时上班太累了。我觉得还是比较熟练的动作，可惜没有DL，尺度小了点，但是也干净点，要求舌吻，妹纸给了个蜻蜓点水~~~算了，也好的，有总比没有好。缺点还是那一对A，不介意的就不介意了，介意的还是很介意的。然后就是我要求69了呀，我最喜欢的项目，妹纸是喷了液体在JJ上然后口的，她说她习惯这样，可能这样比较消毒？我坚持了一会！恩，然后就不行了。然后我就去洗澡了，听说时间没到妹纸可以无限飞机，我没要求，年纪大了，要保身体。从朋友圈里我拿了2张照片，对了，走之前我问了下有没有大活，妹纸说太贵，付不起，册那，有点老乱的嘛。', 2, 4, 3, 2, 2, '3', '2020-07-21 13:51:35', '2020-07-21 13:51:35', '[\"/upload/article/796bf421d64475d131093fc156601715.jpg\", \"/upload/article/f90ba7723e5f08278f1a7573fdb058b2.jpg\"]', 0, ''),
(17537, '奶牛纤纤', 26, 30, '400/p 700/pp', 310000, 310100, '2902176785', NULL, NULL, '该有都有', '约好楼下见的面，穿着衣服还不错，像个良家，脱了发现是个坦，但是车灯确实惊人，但是乳晕也很大。服务很齐全，YYY,SZX, 还拿屁股摩擦你的弟弟，很想就地阵法了，稍微塞点进去也没说什么。\r\n但是包夜只让做了两炮感觉有点机车， 但是这价位也没什么好挑剔的了，就劝妹子平时少吃点 不然救生圈以后会太夸张， 奶子的卖点都没了', 1, 1, 8, 2, 2, '3', '2020-07-21 13:51:35', '2020-07-21 13:51:35', '[\"/upload/article/e72a7c6d11cfe65207156875116494ee.jpg\"]', 0, ''),
(17539, '闵行心语', 26, 30, '600/p 1100/pp', 310000, 310100, '3175493478', NULL, NULL, '全套莞式', '心语妹子住的环境是酒店公寓相对没那么好，见面感觉有点岁月痕迹，但是皮肤很好很白，特别是器哪是真的大，服务也是iOS课表上有的都有！\r\n\r\n最后2妹子xl觉得小小比心语年轻，器心语比小小大，服务都没话可说都很不错，心语妹子比小小更主动，特别心语妹子索吻是不停的。最后收费区有大尺度现场照和妹子联系方式，联系方式在自荐贴里也有。', 2, 1, 12, 3, 2, '3', '2020-07-21 13:51:35', '2020-07-21 13:51:35', '[\"/upload/article/642807752fb6d1626db732d1b7a29e18.jpg\", \"/upload/article/cfe723878aaa0a541cc84c7c7b63bcb6.jpg\"]', 0, ''),
(17540, '普陀萱萱 性价比之选', 22, 30, '400/p 700/pp', 310000, 310100, '3194321407', NULL, NULL, '全套服务', '小区比较安静，人不多，南门有保安但是只管停车，北门貌似什么都没。个人认为是相当安全的小区吧。到了以后我是VX通知妹子开门的，没按门铃更没敲门。妹子是和思思合租的，萱萱的房间是没有卫生间的，个人认为影响不大吧，浴室离房间又不远。总体比较整洁。\r\n\r\n聊天评估：\r\n       大概率DL吧，虽然我一直以为DL都是秒回的，而妹子回消息的速度不算快，但也不用等太久。\r\n\r\n服务评估：\r\n       先说一下，妹子真的很娇小，瘦但是有熊B。其实吧我还是喜欢高挑的大姐姐的，CJ这么个小妹子纯属鬼使神差。不是我的菜，也就没怎么盘，个人觉得这次验证可能不太合格。\r\n       服务情况，我觉得别的验证已经写的比较好了。虽然个人很少CJ，但是对这些项目早就没啥新鲜感了。妹子问我爽不爽呢？爽，然后咧，没了。不知道我这算不算佛系。\r\n       还是写一下服务情况吧，首先是浴室：\r\n       YYY（yuan1 yang1 yu4）：其实就是背后涂沐浴露然后洗干净，我也没怎么揩油。妹子会帮擦干后背。有没有大佬指点一下YYY怎样才算合格？\r\n       SZX（shui3 zhong1 xiao1）：洗完然后KJ 就是SZX？天呐我一直以为是在水中KJ。\r\n       然后回房间，B面开场：\r\n       XT（xiong1 tui1）：个人觉得吧，妹子要是没个DEF，这个项目甚至可以跳过，反正我是不信小熊能做出什么惊天效果的。感觉一般。\r\n       XP（xi1 pi2）：这个XP我一直没看懂，今天回来总算想到是啥意思了，漫游吸皮过水对我来说就是个按摩，毫无快感可言，也不太可能在这个项目起反应。\r\n       DL（du2 long2）：纯舌的，不是很深，也不太用力，在周围转的时间稍长一点。借用LY的话“轻扫轻点，舌头有钻入却不深”。比上不足比下有余吧。\r\n       KJ（bu jieshi le）：这个妹子倒是挺好的，很认真，舌头挑逗感强，包裹感也很好，而且还有个打滚两圈的720度旋转KJ，期间萧不离口，算是特色项目了吧。我让妹子试试SH（shen1 hou2），虽然本人JJ短小，但是还是能感受到顶了，然后发现这个项目貌似也没啥强烈感受。\r\n       最后ML：我今天状态不是很好，有点低血糖的感觉，前面的SZX和KJ，早已使得JJ发红，然后有点供血不足头晕了。妹子一开始是女上的，JJ小也能感受到包裹感。妹子这么主动，给个好评吧。然后妹子搂着我示意我起身，抱着做，接着转传教士。整个ML下来没多久，感觉不超过3分钟，大概是前面太刺激了，我也没憋着直接就泄了。\r\n      整个服务大概35分钟吧。服务卡仅供参考，感觉常规项目都有吧。我嘴角破了没KISS更没SW，也不知道妹子有没有，很多LY还是很关心这个的，以后CJ就算我不一定SW也一定问一下有没有（这算是验证贴最大的败笔了吧）', 2, 1, 9, 3, 2, '3', '2020-07-21 13:51:35', '2020-07-21 13:51:35', '[\"/upload/article/2c249c20c7c58df69d8a49f86e3a4266.jpg\", \"/upload/article/6eb83b41468add722dbb2a428f218bc8.jpg\"]', 0, ''),
