(17547, '重口味 梦梦', 40, 30, '300/p 400/pp', 310000, 310100, '', '', '', '该有都有', '本人是一个喜欢熟女的小fo子，去的也不多温柔一个 ，混血安娜一个，还有一个是之前一个娄姐，这次看到一个猪头老哥发的帖子，选了离我满近的梦梦。环境是公寓， 没有门禁坐电梯直接上楼， 房间里我觉得算中等了 ，要去的话最好自带毛巾 。她那里都是那种自己洗的毛巾给你擦。 我用了餐巾纸，一进门阿姨在床上躺着在穿丝袜。然后我就真的被她的身材吓到了，而且我去的时候他还是素颜 我炸了。真的炸了 。我觉得我口味真的还挺重。但这次让我明白我可能年轻了点。阿姨的服务态度很好 很热情。配合度，技术的确都不错，他提供的项目表都有。泻火的确不错。结束之后我走回家在路上我觉得我可能再也不想去熟女了。 再次说一下阿姨没有一点不好。只是我自己发觉我可能还没到那个境界。', 1, 1, 1, 0, 2, '姐能干', '2020-07-21 13:51:35', '2020-08-09 23:39:11', '[\"/upload/article/8af35b233cfdb7c913d0c7fb3372b8da.jpg\"]', 0, ''),
(17549, '黄埔雪儿', 27, 30, '问妹子', 310000, 310100, '1700956037', '15021688104', NULL, '简单快餐', '妹子在鲁班路那边，老小区，停车不方便，妹子属于微胖圆润的那种，就是简单AM，FJ出。妹子很能聊天，不会冷场。服务的时候脱上不脱下。也不会再二刷了。', 2, 1, 2, 2, 2, '3', '2020-07-21 13:51:29', '2020-07-21 13:51:29', '[\"/upload/article/9a7666f8e5a383d58ecd265dddb1cf69.png\", \"/upload/article/ff3cb2151c7d282454390bfadadad7b3.png\"]', 0, ''),
(17552, '体验广东妹-诗诗', 22, 30, '600/p 1100/pp/2300Y', 310000, 310100, '1489979062', 'baobao6459(baobao200001)', NULL, '该有都有', '诗诗这个妹子QQ加了很久了，一直没去路程离的比较远，然而看过很多帖子说这个妹子很不错，于是乎约到了2号的头P，坐上4号线到金沙江站然后走了大概500米，到了公寓，联系妹子，遥控上楼，一面感觉还是不错的，和照片比大概有9分，唯一就是没有照片那么白，但是也算是正常肤色了，房间内部环境也还行，没有异味。进去后换拖鞋脱衣服，要求先给钱，给的现金，毕竟安全第一啊！进入浴室有YYY，但是没有SZX，小弟看着胸型挺圆润，屁股很翘就忍不住上手了，没想到居然躲了一下说手凉，心中一惊不会这么机车吧？再摸的时候就没躲了，洗完后有一次性纸巾擦身，这个时候妹子会帮你擦，上床让你选情趣内衣，选了一套粉红色的护士装，挺有趣的，然后开始舔你大腿内侧RT，照顾小兄弟，蛋蛋之类的，不过值得一提的是，期间妹子会要你摸她的奶，摸上去蛮软的，但是有一部分有一点点小硬，可是又不像是那种假奶那么的硬，这一点我也不说很懂就不下结论了，等各位兄弟自己去感受好了，然后小弟要求SW（这个课表上没有的）妹子不给，强烈要求下，给你吃个口香糖，她自己吃了一个，但是也没舌吻就是亲嘴了，牙关紧闭也不强求，就继续给KJ好了，也有69但是不让扣，这里提一下，这个妹子服务水平可能真的达不到一些服务系的水准，可以说很普通，所以很要ISO服务标准的兄弟建议跳过，如果只是如此的话，那么这次的出击也只能说是普通的不行，甚至是分数不及格，真正的好戏是穿雨衣开干之后，先是传统体位，插进去紧致度还是不错的，但妹子的表演就叫的有点假了，这个不管她，夯力打桩几分钟，妹子呼吸急促主动要求换后入，翘起屁股摆在你面前，如果满分是100分的话，这个屁股给75分绝对是很OK的，有肉紧致，一只手抓紧半边屁股一只手拍打，可是真的太爽了，然后妹子转过头来，小弟就凑上去SW，没想到没拒绝还很投入，后面就是真的发浪了，要你摸RT，输出了十来分钟，真的没体力，妹子说给飞机出货，然后睡在旁边给飞机，这个时候还给SW，小弟的手也往下面游去这次居然不躲也不挡了，还把两腿撒开，真的是发情了，那必须展示一下一阳指了这么搞了几分钟，妹子说不行好多的水， 又给小弟带套，这次全力输出了，没几分钟出货了，真的可以说基本什么都玩到了，期间询问妹子能不能拍照，被拒绝了不让。以上都是小弟的真实体验，不能保证每位都能玩到这些项目，但是把妹子玩发情了应该是没问题的。妹子写是写20岁，但是估计年纪应该加个5-6.最后有一点小担心，小弟的手指插了妹子的穴之后又摸了自己的吊这个有没有问题啊？', 2, 1, 9, 2, 2, '3', '2020-07-21 13:51:29', '2020-07-21 13:51:29', '[\"/upload/article/5cc85743015d5970b1eed06de3684f96.jpg\", \"/upload/article/b5f650ae047258a4ab55090a31ab2bb2.jpg\"]', 0, ''),
