(17555, '身材棒棒的杨雪儿', 22, 30, '600/p1000/pp', 310000, 310100, '2468984236', NULL, NULL, '该有都有', '最近总感觉欲火难耐，正巧看到了美女杨雪儿，看着相貌身材都不错，果断加上，单刀直入，毕竟妹子时间宝贵，直接问有没有时间，一问有时间，果断安排起来，约好时间，本狼直接出门驾驶千万座驾向妹子报到。  大概提早5分钟到站，在妹子指引下，准备出现在妹子门口，不得不说这小区门牌号设计挺奇怪的居然是从07开始，居然没有01设计师也太反人类了吧。开门后只穿着睡袍的妹子一脸笑容，很热情的把我迎了进去，还问我要不要喝点水，本狼当然是欣然答应。然后常规流程脱衣服洗澡，本狼拿脱的叫一个迅速，然后就帮妹子脱衣服，浴带一扯那叫拖的一个方便，脱光后发现妹子胸脯不大比较圆润，乳晕也不大，可惜乳头已经不粉嫩了，平坦的小腹没啥明显赘肉，屁股倒是又大又圆，让人很想抓一抓，没说的，好评，照片在收费区都有，独乐乐不如众乐乐嘛      乖乖跟着妹子去洗澡，妹子洗的非常认真，身前身后都给本狼抹上了香香的沐浴乳，可是说好一块进来呢，你咋就帮我洗呢，妹子说之前自己已经洗过了皮肤怕洗多了干燥，好吧，姑且相信了。结束后就进入房间，妹子给了我两条一次性毛巾，主动帮我擦背，还是挺贴心。接下来就趴下开始服务，首先是背部按摩，然后环游，胸推，刮痧，做的挺有水准的而且居然这些是用爽歪歪做的，怪不得全程有种甜甜蜜蜜的感觉。然后换到正面，照顾了本狼的三点后，开始KJ，着吹着吹着，妹子便把屁股撅过来了，不过本狼不好舔B外加可能也是对YYY妹子没洗有顾虑便就抓抓屁股，真的弹性十足，妹子KJ技术也真的不错，差点直接爆发，赶紧让妹子停下，穿上小雨衣开始正餐。    妹子主动坐了上来，一进入就感觉到紧紧的包裹，还抱着我一边厮磨一边亲吻在耳边颈部，简直了，赶快抱紧妹子不让她乱动，缓了一会，才让妹子开始上下套弄，水又多又紧，赶紧换后入，不然再那么整肯定扛不住，但还是失策了，具体大家看图，真是又大又圆，抓着就不想放手，一顿输出，射出了万千子孙。事后妹子还调戏本狼，是不是怕痒这么快就换姿势，哼，休息一会后看时间差不多了，就一起洗澡，这次倒是一块进来洗了，看来洗过没骗人，然后穿衣服出门，回公司继续看盘，赚钱再享受新妹子了，哈哈哈哈。', 2, 1, 3, 1, 2, '3', '2020-07-21 13:51:35', '2020-07-21 13:51:35', '[\"/upload/article/740743eb968548346b86a4f8d2e705ea.jpg\", \"/upload/article/e0f3e538ec80c1dfb970f374a4ac531e.jpg\"]', 0, ''),
