(17621, '东北高挑身材的轻熟女', 26, 30, '400/次', 610000, 610100, '3476123746', NULL, NULL, '鸳鸯浴,漫游,胸推,69式,冰火,口活,爱爱', '这个女的是东北人，来西安没多久，之前看过她的照片后，就被她的高挑身材所吸引，尤其穿上高跟鞋后，更加的诱人，见到她本人后，身高确实170以上，穿上高跟鞋后很高，我先洗澡，让后让她换上情趣制服，穿上高跟鞋，那画面感，确实很不错，服务从上到下，其中口活确实不错，之后和她玩过几个姿势后，让她趴着后入，看着她的大屁股和大长腿，更是诱人，整体来说喜欢高挑身材的狼友，可以去试试。', 1, 7, 5, 4, 2, '3', '2020-07-21 13:51:36', '2020-07-21 13:51:36', '[\"/upload/article/014d8349cdd907e958bd57e9f1da6201.png\"]', 0, ''),
(17622, '雨润妹子  外纯内媚', 22, 30, '600/次', 340000, 340100, NULL, 'LZ05511997 联络暗号：绿城玉兰', '15555430615', '鸳鸯浴,69式,口活,爱爱', '这个女的是我很久以前找的了，找过几次。巢湖人吧。妹子长相非常好。纯。没有风尘气息。过程不细致写了。总之内媚。【从业几年了，什么没见过】前一段据说家里有事没做了。。。说是过了年 过了正月在开始。。。非常难约  发出来给大家存着没错。。【犹豫妹子家就在合肥居巢区  所以露脸照片就不发了', 2, 4, 22, 5, 2, '3', '2020-07-21 13:51:36', '2020-07-21 13:51:36', '[\"/upload/article/112c9bc5cd65fa3c26e16b854f47ef24.jpg\", \"/upload/article/20eb5980acb5692fb33e4637745ddd7b.jpg\"]', 0, ''),
