(17624, '瑶海月一大波妹', 18, 30, '500一次', 340000, 340100, '1802484718', NULL, NULL, '该有都有', '给了房间，电话大概半小时到了由于电梯要刷卡我下去接的，妹子看得比较丰满，化了淡装，由于很长时间没有做过，一进门就给我用力摸了一把，简单洗了个澡，没等妹子下面湿润我就迫不及待提抢直干，由于久经战场，年纪大的缘故。几分钟就草草了事。很不尽兴，想再来一发。妹子由于还有事。就婉拒绝了。留了联系方式 ，期待下次来合肥出差再会会她。哈', 1, 1, 14, 1, 2, '3', '2020-07-21 13:51:36', '2020-07-21 13:51:36', '[\"/upload/article/4e0f6f4787bc39cf552b8c98397061d6.jpg\"]', 0, ''),
(17625, '2020久违的第一发', 26, 30, '500p  700pp 外出会加钱', 510000, 510100, '1272019621', NULL, '18144389531', '该有都有', '好久没有出来耍了，翻出手机到处约，结果好几个妹子都没能约上，于是我“退而求其次”选了小月（加上妹子有脸照，说实话，我觉得照片照的不咋好），联系，约上，然后就是上门干活。\r\n讲真的开门的一瞬间我愣了一下，妹子比照片好看不少，也年轻不少，穿上丝袜更是让我小伙伴起立致敬。二话不说咱们开干，细节就不说了，大家都懂，第一发kb，第二发全力输出，就一个字“爽”。\r\n总结一下吧：妹子的口活很棒，舔的也很诱人。\r\n妹子比较健谈，起码是不会冷场的\r\n身材不错而且颜值也还可以', 1, 1, 13, 2, 2, '3', '2020-07-21 13:51:36', '2020-07-21 13:51:36', '[\"/upload/article/49e0232df81c702e54be3520f51e4bfa.jpg\"]', 0, ''),
(17626, '南三环外围兼楼凤之东北D奶大蜜', 22, 30, '600元/次或800元/2次，包夜没问', 510000, 510100, '2182828527', NULL, NULL, '鸳鸯浴,漫游,胸推,69式,冰火,口活,爱爱', '春节前去的一个妞，本来想年后一定回锅的，这不传染病如此严峻，不知道何时她回来上工啊，等着吧！我先写出来给狼友们分享，一定要去体验啊，虽然每天很难约的，此妞外围接高档酒店上门单为主，QQ接单只选择姐妹客户里的那些熟客单，价格的话600P/800PP也是针对熟客，新客户好像是700P/1000PP而且几乎都说休假，不让你约到，还好前阵子找过思思，算是熟客了，言归正传，讲回此妞。\r\n\r\n盘正调顺的北方大蜜，资料写167cm，本人应该168cm左右，开门后那个肉感内衣穿着在我面前晃荡，瞬间小弟弟就起立致敬了，干！喜欢！颜值这些也很真实，不算是网红脸、整容脸，反而是我喜欢的鹅蛋脸感觉，那对奶子太舒服了，形状和大小都无可挑剔，洗澡时候我就开始温柔揉搓了，太赞！姑娘体重也不轻，怎么也是55kg左右了，高挑的姑娘，一般小个子的南方人还有点小车停大车库感觉，哈哈哈，不过兄弟们不要怕，艹上去啊！这姑娘配合度高，肉压在身下之舒服，温暖的包裹我的鸡巴的感觉，感受她阴道的温暖，干！喜欢！\r\n\r\n服务这些的标准化也行，据说会所也做了快一年，想要赚更多钱且时间自由才转外围的，包夜都在3000的价格，酒店上门也在1800左右，问起为什么做QQ单呢，告诉不是每天都有外围单的，闲着也是闲着，多一份收入，不过就是对于顾客选择很挑剔，一定要有素质的才接招，这才从姐妹中的熟客里可以约，会留介绍费给姐妹，这样看来，办法可行啊！幸运的我，哈哈哈哈～\r\n\r\nPP以后，我真的是腿软出门的，她说也要去人民中路二段的丽思卡尔顿酒店接上门单，给我看中介给她联络的信息的真实性，这就觉得我这800花的值啊！说实话，很多时候，买春这个事儿没有特别的定价标准，所以此妞这个身材条件，已经在我看来是Q妹的顶级了，那些住豪华酒店所谓订外围姑娘的人，还不是吃了信息不对称的亏咯，不对，买春也是买感受，不亏，哈哈哈哈～\r\n\r\n哥几个赶紧约，不知道年后啥时候返工，最近真是憋坏了，年后一定还要找她回锅！', 2, 7, 3, 2, 2, '3', '2020-07-21 13:51:36', '2020-07-21 13:51:36', '[\"/upload/article/66c70032ab6f07885b58daabeb9ca41f.jpg\", \"/upload/article/96d949651ad3469198db5407e39b73df.jpg\"]', 0, ''),
