(18183, '木渎兼职妹子 服务还行', 26, 30, '400/次', 320000, 320500, NULL, 'LiZi2597151570', NULL, '该有都有', '论坛前几个月应该有人发过，验证确实是兼职，本人平时在酒店上班，有空出来做，约了三次才有空。先说过程吧，因为兼职，自己没地方，开了酒店，约到真人跟想象还是有不少差距的，脸没什么差距，主要本人比较胖，皮肤也不太滑。当天饥渴难耐，就当泄火了。服务还行，先口，大部分深喉，然后69，边舔边用手指插进小穴，兼职嘛也没什么异味，玩了一会竟然被扣流水高潮了，估计一段时间没男人滋润了吧。哈哈！然后就躺下，冲刺，交货。总体下来可玩性不错，要做啥都配合，整体服务感觉还行，就是看重颜值的就别去了', 1, 1, 22, 2, 2, '3', '2020-07-21 13:51:36', '2020-07-21 13:51:36', '[\"/upload/article/459ae75fb7c6bac124c10a80973ab367.jpg\"]', 0, ''),
