(18187, '徐汇熟女美子', 27, 30, '400', 310000, 310100, '3500887548', NULL, NULL, '鸳鸯浴,漫游,胸推,69式,口活,爱爱', '本人看着比相片好看，属于轻熟系，东北MZ较热情。酒店式公寓，YYY全自动，一次性浴巾。MZ应该是HS出身，FW技术比较娴熟，如果要求都会有的，我当时没有要求。MZ肚子有些赘肉，但整体不胖所以还好，各种姿势都会配合，没有机车。小黄文不写了，4P里我觉得性价比很高。', 1, 6, 4, 1, 2, '3', '2020-07-21 13:51:29', '2020-07-21 13:51:29', '[\"/upload/article/5e0332d79f0fa3951f9077a85bfd346c.jpg\"]', 0, ''),
