(19138, '可爱佳人', 21, 30, '500', 310000, 310100, NULL, 'hu13482504407', '13482504470', '鸳漫游，胸推，冰火，口活，爱爱', '联系好后过去，到小区后电话遥控上楼，本人和照片七八分像吧，进去后自己洗一下，没有YYY，之后先口一次，然后在做服务，上面的服务基本都有，做好在做一次，冲一下走人。整个过程态度挺好的，不催人，不机车', 1, 1, 30, 3, 2, '6', '2020-08-28 12:04:11', '2020-08-28 12:04:11', '[\"images/202008/816c1ff379873ebe50524023145da0e6.jpg\"]', 0, ''),
(19139, '可爱女神', 22, 30, '1200', 110000, 110100, NULL, 'BBZ344', NULL, '鸳鸯浴,漫游,胸推,', '妹子自己有地方，加上了二话不说 ，直接过去，到楼下妹子遥控上楼，还是老一套，进屋付款，做做项目，戴套开干，妹子全程很配合，还主动让我舔胸，一边吃奶子，一边干，挺爽的，射了以后 妹子帮我清理一下，还温存了一下', 1, 4, 8, 2, 2, '6', '2020-08-28 12:07:24', '2020-08-28 12:07:24', '[\"images/202008/019ed41dda3668c2ac8247063bfa3e02.jpg\"]', 0, ''),
(19140, '成熟姐姐', 27, 30, '400', 110000, 110100, '2630942535', 'xiaogu912648', NULL, '深喉,胸推 ,69 ,口暴', '大胸熟女口活巨棒，我这人就喜欢大胸的妹子。要来Q加上，三两下就敲定下来，给了地址简单收拾一下出发，出了地铁没多久就到了，顺利找到香闺，看到小骨第一眼，果然没来错啊，大胸确实挺惹眼，进了门，妹妹相当会说话，环境很不错，抱着妹子上下其手，相当热情，妹子挺热情，挺会撩的，看的我都醉了', 1, 4, 40, 4, 2, '6', '2020-08-28 12:13:10', '2020-08-28 12:13:10', '[\"images/202008/fb7e5057762b8dc1fd76b25ca4cea29c.jpg\"]', 0, ''),
(19141, '气质姐姐', 27, 30, '500', 110000, 110100, '2736471726', 'makeai510', NULL, '漫游,胸推,69', '暗号：老九.进门观察环境简洁，大方..（感觉约过的几个房间格局都差不多）MM先是嘘寒问暖一番，也挺热情...晴儿穿着简装，本人比照片要好看，今天比较热，出了汗.小狼先去冲洗，让妹妹换上丝袜制服.小狼的最爱洗完出来MM已换好，用那妩媚的眼神看着小狼雄性激素蹭蹭的网上涨..晴儿转身往房间走去，小狼后面跟着 看着晴儿的背影脑海里想着各种姿势..进房先抱着晴儿抚摸一番（奶子也不小）', 1, 3, 34, 3, 2, '6', '2020-08-28 12:15:33', '2020-08-28 12:15:33', '[\"images/202008/3c22a1307a72f55d8f405582b817796b.jpg\"]', 0, ''),
(19142, '琳琳小美女回京了', 28, 30, '800', 110000, 110100, '2794482116', NULL, NULL, '鸳鸯浴,漫游,胸推,69', '面相更嫩一些，有技术，服务老道，态度好，去了可以好好享受的那种。身高不高160不到，体重看着80多斤，比较娇小，比较能满足有征服欲的狼友，照片是艺术照，我挑了几张没怎么P过的，觉得有8-9分像，有兴趣的自己去感受吧。', 1, 4, 7, 0, 1, '6', '2020-08-28 12:19:35', '2020-08-28 12:19:35', '[\"images/202008/63c84bdb38ac2b205eed8909fab79e7b.jpg\"]', 0, ''),
(19143, '百子湾清纯mm', 20, 30, '1000', 110000, 110100, '3215671917', NULL, NULL, '胸推,69式,冰火', '不磨蹭一约就上，摇控上楼，进房直接调情，直接干！', 1, 3, 9, 0, 2, '6', '2020-08-28 12:23:24', '2020-08-28 12:23:24', '[\"images/202008/edd20b039b8ced899a07458c3563416c.jpg\"]', 0, ''),
(19144, '会所   美女多', 20, 30, '1200', 110000, 110100, '2819138414', NULL, NULL, '胸推,69式,冰火', '漂亮，苗条身材，很有气质。太勾人了。最让我觉得难以抗拒的就是妹妹火 的身材，一弯腰感觉奶.子.都要从衣服里面掉出来了。我弟弟那还等什么，大全套搞起来。小妹在服务方面也是蛮讲究的，不会说随随便便，不机车，绝对的大全套', 1, 3, 17, 1, 1, '6', '2020-08-28 12:24:56', '2020-08-28 12:24:56', '[\"images/202008/57c181d052ab3dc1cb2b5f8623e1b260.jpg\"]', 0, ''),
(19145, '学生妹', 21, 30, '1500', 110000, 110100, '1274217783', NULL, NULL, '69,鸳鸯浴,爱爱', '室内环境很好，进屋后发现妹子穿着小短裤，特别诱人，一起洗澡，让小妹妹帮我都搓干净，就在浴室帮我口了十来分钟，然后去床上开干，发现小妹妹的胸也不是很小，很坚挺，那叫声真让人控制不住，下面看着粉嫩，没多少下就第一回交货，总之很值得的一次体验，妹子价格也不高，1500做两次。', 2, 3, 13, 4, 2, '6', '2020-08-28 12:26:48', '2020-08-28 12:26:48', '[\"images/202008/609e0432d42fbedc47133881275b8f89.jpg\", \"images/202009/3edb1a1b5ab56bef3abfa08806444157.jpg\"]', 0, ''),
(19146, '骚熟女泻火好去处', 27, 30, '400', 110000, 110100, '3185392992', NULL, NULL, '漫游 ,冰火 ,等等', '妹妹后门张弛有度，小弟弟终于受不了刺激，把几天来攒的精子一下子射了出去。妹妹还说，别急着拔出来，我再夹几下，说着真的一下一下的不停的夹。事后芊芊贴心的清洗一番', 2, 3, 13, 2, 2, '6', '2020-08-28 12:33:21', '2020-08-28 12:33:21', '[\"images/202008/e8ddf0b0fa959b596339c0327601c44c.jpg\", \"images/202009/500cef4889bfcaed9fa254e8cd7c3ac6.jpg\"]', 0, ''),
(19147, '销魂的手法完美的体验！', 23, 30, '200', 110000, 110100, '2822790887', NULL, NULL, '自问', '人很实在，轮服务人品，也算是京中一股清流。周末精虫上脑，下班之前约好时间，到点马不停蹄的直奔胖姐淫窝，轻车熟路，到了电话开门。白虎姐姐穿个情趣等我了，上下其手一番，简单清理一下开始69', 1, 1, 31, 12, 2, '6', '2020-08-28 12:51:32', '2020-08-28 12:51:32', '[\"images/202008/c5815d5416d1f6f361874a3ec7e50090.jpg\"]', 0, ''),
(19148, '二刷白虎熟女胖姐，依旧爱不释口', 30, 30, '200', 110000, 110100, NULL, NULL, NULL, '鸳鸯浴,胸推,口活', '真正的白虎手感口感都还是不错的。第一炮直接口爆，休息抽颗烟，聊聊姐姐从前的事情。一刻钟以后姐姐再次口含小弟，硬了直接上马，还是喜欢白虎，视觉冲击力很nice。上上下下，左左右右，大约十分钟左右射出万千子孙，清理干净', 1, 3, 8, 8, 2, '6', '2020-08-28 12:53:22', '2020-08-28 12:53:22', '[\"images/202008/99b591828925d0f9a252c6b52ff099d5.jpg\"]', 0, ''),
(19149, '白嫩温柔，配合度极高的妹子云儿', 20, 30, '1500', 110000, 110100, '2305732230', NULL, NULL, '鸳鸯浴,胸推,口活', '妹子是南方人，二十来岁，胸大概有C。联系好后，遥控到地址，看到妹子还是感觉不错的，寒暄了一下去洗澡，洗完后，妹子先出来脱光光在床上等着了，大胸真的是映入眼帘，直接将妹子扑到，边吃边揉，妹子胸白又挺，妹子服务比较细致，看着妹子吞吞吐吐的视觉效果满分，享受够了带套上马，摸着大胸加上妹子的小骚话不断相当有感觉，活塞运动后出货。出货后妹子给按了一会，又洗了一下，然后交了水费，和妹子拥抱一下。', 1, 3, 12, 1, 1, '6', '2020-08-28 13:32:57', '2020-08-28 13:32:57', '[\"images/202008/b83133974a68f9d542a8f06566330249.jpg\"]', 0, ''),
(19150, '刚下水的妹子很羞涩服务很好', 23, 30, '600', 110000, 110100, '2591838931', NULL, NULL, '鸳鸯浴,漫游,胸推', '颜值一般，xiong还可以，不过来是想放松的，遥控上楼，这个过程就不说了，进屋歇了会儿，妹子给倒了杯水，一边喝水一边观察了下屋里的环境，整体来说还可以，东西摆放的挺整齐，床上也干净。然后我就去冲洗了，出来我趴在床上，妹子准备来个全身按摩，然后就开始了，力度很轻柔，我都快睡着了，直到摸到我的dd，一股电流直冲大脑，翻过身来平躺着摸着妹子雪白的胸脯，把妹子按到床下开始发泄，最后感觉来了交货，妹子还说怎么s这么多，本狼说是压抑很久了哈哈，最后冲个澡付账', 1, 3, 5, 1, 2, '6', '2020-08-28 13:34:52', '2020-08-28 13:34:52', '[\"images/202008/0e9930f675bc7af4642ea2230b6897dd.jpg\"]', 0, ''),
(19151, '美模人妖雅琦，人妖＋道具双重刺激下的，扛着高跟美腿疯狂输出', 23, 30, '400', 110000, 110100, '3226215649', NULL, NULL, '鸳鸯浴,漫游,胸推', '找人妖其实更多的一种猎奇，而妖普遍服务都更细腻态度也更好，对比动不动就4、5的老熟女、这不能动那不能摸要换姿势就给脸子的，妖反而成了众多狼友新去耕耘的处女地。', 1, 3, 8, 1, 2, '6', '2020-08-28 13:36:29', '2020-08-28 13:36:29', '[\"images/202008/f000857bde74e437a18120516d948f78.jpg\"]', 0, ''),
(19152, '朝阳轻熟，服务用心，性价比还可以', 31, 30, '500', 110000, 110100, '1906561262', NULL, NULL, '鸳鸯浴,漫游,胸推', '上楼了以后看到人和空间的照片差距不算太大吧，估摸着也得30以上了，胸是真的大，皮肤挺顺滑的，人具体啥样可以加了以后看看空间里的视频。服务倒是比较用心，我选的是500的档，感觉性价比还行。', 1, 3, 22, 3, 2, '6', '2020-08-28 13:41:03', '2020-08-28 13:41:03', '[\"images/202008/be28065514d8b88e65a4f480cac52e15.jpg\"]', 0, ''),
(19153, '风情姐姐', 24, 30, '1600', 110000, 110100, '3493114796', NULL, NULL, '漫游,胸推,69式', '很好，，妹子很体贴，喜欢得狼友可以试试，过程就不说了，不怎么会写，我觉得可以，皮肤白，颜值佳，态度好，1600夜真好', 1, 3, 10, 2, 1, '6', '2020-08-28 13:42:15', '2020-08-28 13:42:15', '[\"images/202008/d91a50d96f4ddca576f31e66dd365a63.jpg\"]', 0, ''),
