(19155, '可爱妹妹', 60, 30, '500', 310000, 310100, '1556874821', NULL, NULL, '漫游,口,制服', '服务很好，价格也不鬼，自己体验吧', 1, 3, 21, 2, 2, '6', '2020-08-28 13:44:55', '2020-08-28 13:44:55', '[\"images/202008/7848397660632f851499abe54524c502.jpg\"]', 0, ''),
(19156, '天河新人 模特兼职梦烟', 23, 30, '1100', 440000, 440100, NULL, 'xhuxia100200', NULL, '鸳鸯浴,漫游,胸推', '妹子照片跟真人无差别，95%一致，妹子素质很不错，完美的身高足有170，身材爆棚，妹子态度温柔，热情主动，妹子很风趣，知识面广的很，聊的很开心，陪洗澡，主动互动，服务过程很足钟，算是挺认真的。口活不错，控力度到位。小舌灵活的很基本都给我来回走了一遍，69，有情趣蛮有情调的。性价比不错，服务都有做，具体狼友自己体验，物超所值。天河区', 1, 3, 46, 4, 1, '6', '2020-08-28 13:46:15', '2020-08-28 13:46:15', '[\"images/202008/de5336cf66c662b176ed114207c8f6bf.jpg\"]', 0, ''),
