(19159, ' 大熊妹妹裸聊+陪玩', 27, 30, '1500', 440000, 440100, NULL, 'rsqqllwyf', NULL, '鸳鸯浴,口活,爱爱', '她的一对一觉得很正点就越出来啪啪啪咯，细节就是把头埋进熊，真的会窒息，我去，别的不说了差不多是这样\r\n，1500夜可以', 2, 3, 15, 2, 2, '6', '2020-08-28 13:51:47', '2020-08-28 13:51:47', '[\"images/202008/1fbb0af5fbc20d7db86b12671ba67d75.jpg\", \"images/202009/48b3036166fed3fd71e54a260d672c97.jpg\"]', 0, ''),
(19160, ' 36C纯情小嫩妹（汉服诱惑）', 25, 30, '600', 440000, 440100, NULL, 'anni9136', NULL, '鸳鸯浴,调情,等等', '年龄就23左右。164高，胸有C，直入主题，帮我脱去了衣服，还比较亲切帮你清洗，出来后上床，穿了双性感肉丝，特别有感觉。她的胸手感非常的柔软，纯原装的就是棒。乳头不黑，让人觉得还蛮新鲜的，让我品尝了下奶香的味道，舌头也来挑逗我，从耳根处一路舔下来，从头到脚都感觉有电流穿过，这活儿做的太棒了。口活做的很有经验，而且态度非常的好，水是真的非常多。穿上防弹衣，果断后入，这大白屁股，弹性太爽了。活塞十来分钟。舒服了。活儿超好，真人真照，兼职型的，各位珍惜。', 1, 3, 20, 0, 1, '6', '2020-08-28 13:53:12', '2020-08-28 13:53:12', '[\"images/202008/abdab37ba0c6db1394e76679fa16c9d2.jpg\"]', 0, ''),
(19161, '清纯超可爱乖巧的妹子《顺子》', 23, 30, '800', 440000, 440100, NULL, 'tbmy2020', NULL, '鸳鸯浴,漫游', '就没见过这么好的妹子，妹子算是比较能聊天，没什么风尘味，总有种不会做很久的感觉。去的时候还说有个回头客在追她，经常发红包礼物，不过她没收，也是挺狗血。另外本来问过妹子要不要在论坛发帖子推荐，妹子比较谨慎保守没答应，最近看到还有ly在问，想想还是发了过来，希望大伙儿手下轻点对妹子好些，且约且珍惜', 1, 2, 5, 0, 2, '6', '2020-08-28 13:54:45', '2020-08-28 13:54:45', '[\"images/202008/82e8b2e7f5c0d7c0c77d3a7f8b9a34c0.jpg\"]', 0, ''),
