(19197, '娇小可爱', 21, 30, '600', 310000, 310100, NULL, 'luxue_888666', NULL, '鸳鸯浴,漫游,胸推', '进门后和妹子先来个鸳鸯浴，妹子很热情健谈，因为是淋浴，刚站好淋上水妹子就扑上来一口包裹住，个中滋味就不细说了，妹子带的有牙套，可能介意的会稍显不舒服，本狼到无所谓，主要看中的是她的奶子，大小B左右，我一手刚好覆盖，软硬适中，特别是奶头是凹进去的，我特别中意这个，盯着奶子吸吮，将粉粉奶头吸出来后，两指搓捏，特别带感，当然只是本狼比较喜欢这个妹子这个部位，还有妹子也特别敏感这个，一般的不熟还不让弄', 1, 3, 21, 3, 2, '6', '2020-08-30 11:46:50', '2020-08-30 11:46:50', '[\"images/202008/dd9e07af2939daefaf4b7e7844e47f9b.jpg\"]', 0, ''),
