(19660, '天津塘沽安安，大马', NULL, 30, '500', 120000, 120100, NULL, 'RR078324', NULL, '鸳鸯浴,漫游,胸推', '500/次或1500/天，夜要提前约\r\n塘沽工农村附近\r\n遥控上楼，说实话感觉这个居住环境还是稍微有点简陋的，简单寒暄了一下就去洗澡了，洗完澡简单擦了一下就开始干活，妹子说她嘴小，不太愿意给口， 之前还咨询了是否可以玩玩具，妹子没有， 也不让自己带玩具，口了几下就开始给带雨衣，憋了好久就提枪上马，但是这个马还真是个大马，有难度的动作不太容易实现，插了一会有射意，我就控制了一下，减慢了速度，但是妹子居然质疑我，不让我控制，这点有点不爽，我3分钟解决战斗你是赚了，老子不就亏了吗， 说是话这个妹子', 2, 3, 2, 1, 2, '6', '2020-09-15 13:00:09', '2020-09-15 13:00:09', '[\"images/202009/d149e9c7ecc0afdeffefb32995b85912.jpg\", \"images/202009/df3acb1a29524144ce5e98b7d691a1b3.jpg\"]', 0, ''),
