(19670, '成熟姐姐【已认证3】', 21, 30, '500', 310000, 310100, '2959747739', NULL, NULL, '鸳鸯浴,漫游,胸推', '上海闵行莘庄龙之梦附近\r\n让人感觉这女孩非常贴心。年轻温柔，外表也是蛮良家淑女的，163高，风尘味不重，身材前凸后翘的。当然最让我关注的还是她的身材，优点，胸大，36D弹性十足，真实性感。直入主题，陪浴，服务意识挺不错的，都不用我动手，洗的很认真，很负责，还要帮我擦脚，我都不好意思，漫游很有力度，波推都其鸡皮疙瘩了，都能感受到那个弹感。口活享受，前面力度非常的轻柔，到了后面，一波波的深。舒服。总体来说，还是不错的。清纯有可爱，过程相当刺激爽。', 2, 3, 46, 10, 2, '6', '2020-09-16 11:00:37', '2020-09-16 11:00:37', '[\"images/202009/0f597d5bdb77f38f713021e55cdb02ab.jpg\", \"images/202009/a05caca2294ba10ca5b85d310bd4d9a3.jpg\"]', 0, ''),
