(19728, '22岁的欣悦', 22, 30, '600', 110000, 110100, '3524421647', NULL, NULL, '鸳鸯浴,漫游,胸推', '北京市丰台区公益西桥附近\r\n600/次、1200/2次、1500/夜\r\n妹子年龄比较小，好像是20出头的样子，但是服务还是很用心的，我就喜欢年轻的实在的，哈哈！妹妹各种亲亲舔舔，眼神勾引，让我这个激动。而且不得不说，妹子功夫了得，无齿感，不叫停那是绝不停，态度实在太好了，可能我人帅，素质也不错的缘故吧，哈哈哈。欣悦妹子努力工作的时候，我也顺便摸了摸奶子，不是很大，但是年轻坚挺，手感不错', 2, 3, 16, 6, 2, '6', '2020-09-20 20:19:33', '2020-09-20 20:19:33', '[\"images/202009/ee5095ba78c42523997ae743bc34ee8b.jpg\", \"images/202009/25ffaaf2a36e06200d7c9d903adc3d7c.jpg\"]', 0, ''),
(19729, '湖北MM【已认证3】', 20, 30, '400', 110000, 110100, NULL, 'ffang002008', NULL, '鸳鸯浴,漫游,胸推', '400/p或600/pp\r\n北京朝阳区农光里市场西门\r\n白白的，大大的，软硬适中，奶头很小，奶头淡粉色，而且整个奶是上翘型的。如果你见过比这个更好看的奶，请在下方留言，我就不信了！奶的照片就不放了，留一点悬念，自己去试探', 2, 3, 12, 4, 2, '6', '2020-09-20 20:20:36', '2020-09-20 20:20:36', '[\"images/202009/d9c865c0370d5b2cc2cb4192df9d60fb.jpg\", \"images/202009/22579bcfd0c09029ab379f3d4c281a2b.jpg\"]', 0, ''),
(19730, '新下水的欲女，战斗力惊人，三张纯泻火', 23, 30, '300', 110000, 110100, '1823756322', NULL, NULL, '鸳鸯浴,漫游,胸推', '大红门\r\n三十来岁的小人妻感觉，有点风骚有点欲，性格热情大方。妹子很奔放的，门一关上，就是干，媚儿那副饥渴的神情，真叫人鸡动，我的手在她的全身上下摸索着，妹子真是很有料的', 2, 3, 21, 4, 2, '6', '2020-09-20 20:21:17', '2020-09-20 20:21:17', '[\"images/202009/165d8d43978b69e49df68dc99ed62cca.jpg\", \"images/202009/1dcd972e348fa1a31f7d823fba41c437.jpg\"]', 0, ''),
(19731, '第一次双飞体验', 21, 30, '400', 110000, 110100, '2195985369', NULL, NULL, '鸳鸯浴,漫游,胸推', '400/次；800/双飞；过夜双飞价格可以商量\r\n服务不是一般的好，各种诱惑，丝袜，制服什么的；时而一个姐姐在给你添屁眼，另一个躺在你身下吃几把；时而两个姐姐跪在身下一起抢几把吃，这种感觉真的太爽了，各种姿势玩弄之后，分别操弄，操着一个，扣另一个的逼，皇帝般的享受。最后口爆卸货，一个字，爽', 2, 3, 17, 5, 2, '6', '2020-09-20 20:22:03', '2020-09-20 20:22:03', '[\"images/202009/177a33bea852d0cf2b729651d7d5209a.jpg\", \"images/202009/84a1aebe50a2253ca2afa6edb1bb06b1.jpg\"]', 0, ''),
(19732, '聋哑妹妹双飞记', 33, 30, '500', 110000, 110100, '2524537566', NULL, NULL, '鸳鸯浴,漫游,胸推', '5，9，13双飞自己问\r\n丰台\r\n看上去挺年轻的，简单洗了洗我就开始双手不老实妹妹发出轻轻的啊啊声真的很刺激，过程123下面还挺紧的我靠。完事休息了一会换人继续战斗~~性价比挺高，这个价格可以玩到年轻小妹也别挑了', 2, 3, 8, 3, 2, '6', '2020-09-20 20:23:28', '2020-09-20 20:23:28', '[\"images/202009/0476a425928d9ab411e30cfb0e27c6df.jpg\", \"images/202009/25b0ecdbc30220c41757b812297b79b5.jpg\"]', 0, ''),
(19733, '发情姐妹花，轮番攻击，这谁顶得住！', 25, 30, '400', 110000, 110100, '249516340', NULL, NULL, '鸳鸯浴,漫游,胸推', '单个400次，双飞800两次\r\n马连道 \r\n开门的是一个高挑妹子，自我介绍叫洋洋，很邻家的感觉，长得相当可以。屋内是小花，人如其名，很是风情。不废话了，直接进入主题，先由小花陪我去冲洗下，回头出来后三人赤裸相对，3P游戏走起。然后两个美女就轮番上阵了，我享受着她们的蹂躏。她们一个前一个后，一个上一个下，这个前戏做的足够给力的，并不是随便敷衍，胸推一波未平一波又起，漫游无所不至。据我观察两个女孩都是技术流，口活后小弟欲火难耐，骑马射箭，先以小花为目标，洋洋妹子在后面助力，射出一次后，稍事休息，又搞了洋洋妹子，她也是水超多超饥渴，两个女人的发情，轮番攻击你，结束后感觉身体也被掏空了，太尽兴了', 2, 3, 62, 9, 1, '6', '2020-09-20 20:24:22', '2020-09-20 20:24:22', '[\"images/202009/f062b7fb81be21ae0243414e3b300d6a.jpg\", \"images/202009/0addfb219836b27dbe949727ff7a5811.jpg\"]', 0, ''),
(19734, '三里屯体验缇娜诱惑【', 21, 30, '1200', 110000, 110100, '2279018931', NULL, NULL, '鸳鸯浴,漫游,胸推', '1200/2小时不限次\r\n三里屯\r\n进门不用自己做什么，脱衣服，陪浴。Tina换好衣服开始正事AB面搞得很是舒服不着急2个小时慢慢搞，出来都是来放松的嘛。开始没经得住缇娜的诱惑早早就释放啦。不得不说Tina的小舌头真是搞得我麻酥酥的，期间休息还给做了个采耳个人非常喜欢哪种感觉', 2, 3, 5, 2, 2, '6', '2020-09-20 20:25:08', '2020-09-20 20:25:08', '[\"images/202009/4f32adc21790be14d4d00d0bd1a59a48.jpg\", \"images/202009/15839499ab6affb7b7438c778a4acd42.jpg\"]', 0, ''),
(19735, '淫荡小狐狸【已认证3】', 20, 30, '400', 110000, 110100, '2026232611', NULL, NULL, '鸳鸯浴,漫游,胸推', '东四十条\r\n标准的年轻女子，非常娇媚。聊了几句开干，衣服脱掉，胸部暴露，又白又大的节奏。小狐狸妹妹外表淑女，但内心还是蛮淫荡的，都是她主动攻击我。全身上下把舔了一遍，口活也是各种姿势的来，摸到她下面水好多，ML先让小狐狸女上，之后再回归传统式，她的表情一下子就变得太骚了，我总有一种要操死她的冲动，她也是高潮了好几次，根本停不下来的节奏，水乳交融，嗨的飞起。做的时候妹妹一点都不催人，特别投入', 3, 3, 34, 4, 2, '6', '2020-09-20 20:26:26', '2020-09-20 20:26:26', '[\"images/202009/d5804404b35fe73eec423462be4bae9b.jpg\", \"images/202009/aae08228ef7bca28debce3d83be94fa2.jpg\", \"images/202009/42c41a93cf84d75095aed98a17400261.jpg\"]', 0, ''),
(19736, '02年高中生琪琪通透归来', 18, 30, '1000', 110000, 110100, '1848117161', NULL, NULL, '鸳鸯浴,漫游,胸推', '1K夜4K\r\n昌平\r\n服务和态度都很好，进屋之后就帮忙拖鞋，聊了一会开始洗澡，全程不用自己动手，AB面，该有的都有。口了一会直接骑上来开干，结束后也不催着走，像女友一样躺在怀里聊一会', 2, 3, 12, 1, 2, '6', '2020-09-20 20:28:18', '2020-09-20 20:28:18', '[\"images/202009/a361f50f64311da8605b00827e481a57.jpg\", \"images/202009/98d4dcdab16aadb445c69ef7441e5447.jpg\"]', 0, ''),
