(19818, '大屁股姐姐', 22, 30, '400', 120000, 120100, NULL, '18722219749', NULL, '鸳鸯浴,漫游,胸推', '400/次700两次\r\n妹子身高173，体重125斤，属于微胖型。人比较谨慎，遥控指挥上到另一楼层来接你回屋。属于老旧小区，一居室。但是屋内比较温馨。服务好，不机车。服务过后带上雨衣，传统姿势抽插，然后把双腿扛上继续，完美的炮架子。最后后入（本人喜欢的姿势），有跃马扬鞭的感觉，一通冲杀，拍着肥硕的屁股射出亿万子孙。总结：优点，不机车，可69和接吻，随便摸', 2, 3, 28, 7, 2, '6', '2020-09-22 17:50:07', '2020-09-22 17:50:07', '[\"images/202009/076b9161413682c8b9ec4e0c4234ff9e.jpg\", \"images/202009/cb6f3e9f69dac9ada19accfdaac8658d.jpg\"]', 0, ''),
(19819, '会调情很热的妹子，过程很舒服', 20, 30, '500', 610000, 610100, '1794712909', NULL, NULL, '鸳鸯浴,漫游,胸推', '妹子本人比照片看起来好看的多啊，妹子性格很好，洗澡帮助陪浴，洗澡时就给口了起来，很舒服洗完澡，有一次性浴巾，很干净，到了床上，妹子已经提前开了空调，屋子很暖和，妹子的床超级舒服，由于屋子开了空调，直接躺在被子上，很软很舒服，妹子服务了一会后，让其穿上丝袜，妹子拿出一堆丝袜让选，穿好后继续服务，服务了一会后带上TT开始，妹子主动在上面服务，很用心的妹子，嘴里一边说着*奸你，一边用力，不像有的小姐，只愿意趟下面。整个过程很舒服，妹子很温柔，也很会调情，不会冷场', 1, 3, 51, 8, 2, '6', '2020-09-22 17:51:31', '2020-09-22 17:51:31', '[\"images/202009/e8fc39c3388c2882ba6c99e0f3f247ff.jpg\"]', 0, ''),
