(19821, '西安小寨辣妹白领', 20, 30, '600', 610000, 610100, '1485170644', NULL, NULL, '鸳鸯浴,漫游,胸推', '6/次或16\r\n看到小妹的第一眼感觉就是气质真好，五官很好看，绝对是个美人胚子，身材曲线也很亮眼，腿型很漂亮，一看就是有大波。闲话不表，清洁下上床开始服务，苹果妹子前戏做得挺认真的，是个实在人，舔脖子和耳朵的时候还会在我耳边呻吟，瞬间感觉很刺激。太性感太撩人了。翻过来做A面，服务的很认真，口活很舒服，没几分钟就有感觉了，翻身上马把妹子骑在胯下，摸着妹子的黑丝美腿和性感小脚丫，大力抽插不到3分钟分钟一泄如注。', 2, 3, 19, 2, 2, '6', '2020-09-22 17:54:16', '2020-09-22 17:54:16', '[\"images/202009/deb135fe97e8729453afb3363f3c94b0.jpg\", \"images/202009/597343481141725a2afc64f12b35330d.jpg\"]', 0, ''),
