(19907, '大胸熟女的技术，特别泻火（能三通）', 40, 30, '300', 110000, 110100, NULL, 'W15011577867', '13161575173', '鸳鸯浴,漫游,胸推', '300/次，800/夜。能三通，价格自己谈\r\n双井\r\n目测大姐年龄40左右，身材教胖，肉乎乎的干起来一颤一颤的，顶着一对大奶子（巨大），后入式是最棒的。那天我喝了点酒，晚上1点来钟了，好些旧相好都联系不上了，这个大姐不知道什么加的，翻出来微信果断联系。去到她家，她已经换好黑丝，我一把抓住一对大奶子揉搓了一会，然后去洗澡……洗好后，漫游、口、毒龙之类的，大姐能深喉和口爆。我是包夜的，因为喝酒了，详细过程记不太清了，总之第二天感觉特泻火，想休息几天，这几天不想约妹子了……最后腿软的离开了。', 2, 3, 24, 3, 2, '6', '2020-09-24 12:44:15', '2020-09-24 12:44:15', '[\"images/202009/45ee0b9829f713396ef83bc5c65a5bff.jpg\", \"images/202009/ea1912da64991888ebe8c8ceb85f8a24.jpg\"]', 0, ''),
(19908, '胸大臀翘纯小白，超级嫩超水灵，服务尺度全开放', NULL, 30, '500', 110000, 110100, '2856829748', NULL, NULL, '鸳鸯浴,漫游,胸推', '立水桥附近\r\n看照片挺真实，性价比也不错，心动了决定去验证。周末时间来到，正好双方都有时间。打车过去，妹妹这边地方挺好找，话说看到真人，感觉跟照片差距不大，来对了。小白自己住，人长的有点纯，人如其名的感觉。身材嘛，曲线超级给力，皮肤白皙，总之青春又性感的气质，直让人流口水。小白穿着一层薄纱般的睡衣，身材很好，腿纤细修长，腰也很细，pp很翘，还有大胸。小舌头很透软，埋头口了很久，希望把dd口的坚硬一些。还然后提枪上马，把小白双腿往肩膀一搭，感觉非常来劲。小白也很配合着表情和轻吟非常到位，也不会大吼大叫，但会忍不出让我插的深一些。三百回合交货', 2, 3, 22, 3, 1, '6', '2020-09-24 12:45:42', '2020-09-24 12:45:42', '[\"images/202009/448b76ab39e825a900d23d8e60402014.jpg\", \"images/202009/09a6d921d2430cbe5e072f8da4118f44.jpg\"]', 0, NULL),
