(19928, '福田难得的清纯巨乳美女', 20, 30, '500', 440000, 440300, '3315035309', NULL, NULL, '鸳鸯浴,漫游,胸推', '无套手推：500/次或带套口：650/次，共两个套餐\r\n福田\r\n妹子160不到，90左右估计，照片跟真人基本无出入。第二次去了，妹子比以前漂亮了些~遥控上门，自己洗澡，妹子帮忙擦干，上床，简单按摩，亲亲，然后开始服务；妹子配合，但是她本人也有许多规矩，不可亲乳头，不可摸下面，不可以开大其他干啥都行；但是偶尔亲一下还是可以的，手一直没离开过她的胸，真的很大。还会再返食，就冲着这对大F', 2, 3, 8, 1, 2, '6', '2020-09-26 14:51:42', '2020-09-26 14:51:42', '[\"images/202009/8416846766e2f8e24dd01f84d3d029ea.jpg\", \"images/202009/82c6e4abce58fbff9a91c7023c71341d.jpg\"]', 0, ''),
(19929, '熟女大姐', 35, 30, '300', 110000, 110100, '1700493990 ', NULL, NULL, '鸳鸯浴,漫游,胸推', '蒲安北里\r\n姐姐生意不好，过来宣传宣传，口活一流，听话，服务好，天气这么热，歇歇火，没问题', 2, 3, 3, 1, 2, '6', '2020-09-26 14:53:57', '2020-09-26 14:53:57', '[\"images/202009/4b8d6d6961f2cdab92d0eddf45acae7c.jpg\", \"images/202009/dbf7bf0702534a6b0a6d440355bc5695.jpg\"]', 0, ''),
(19930, '验证次元群推荐阿肆', 22, 30, '800', 110000, 110100, ' 3138086088', NULL, NULL, '鸳鸯浴,漫游,胸推', '800/p 1200/pp\r\n妹子以前是良家！应该是刚刚下海，妹子属于大大咧咧的邻家女孩类型，性格直爽，说话有趣，一如她的一头短发，干净利落不事儿。属于感觉系，服务也很用心。作为新人不错，A面B面都有，尤其是XT，异常舒服，也不知是姐妹教的还是拿前男友练手练的，属于小丰满型，体型匀称不胖也不是柴瘦型，胸也大小刚好，手感非常棒，不得不说的是妹子水很多，下面还很紧，女友系列值得体验，画面就不一一补充，姑娘是难得的一股清流，分享各狼友绝对值得体验！', 3, 3, 11, 3, 2, '6', '2020-09-26 14:54:59', '2020-09-26 14:54:59', '[\"images/202009/a1198e675d23a5f66b326affa211f97f.jpg\", \"images/202009/f83a86e94a4fae180b8ab2f018f2d2d8.jpg\", \"images/202009/5bcf339b3728a855d4616a57767a02ba.jpg\"]', 0, ''),
(19931, ' 新开发冷艳标致的妙龄美人', 21, 30, '500', 110000, 110100, '3375268623', NULL, NULL, '鸳鸯浴,漫游,胸推', '西大望路附近\r\n简单说下吧，刚开发的妹子，以前没听说过，说是新人。颜值挺正的，我觉得是冷艳气质，怎么说呢，就是偏御姐的感觉，搞这种类型的比较有征服感。人也年轻，算是妙龄吧，进门话不多，但笑起来的模样还真是可人，胸不大不小，腿很直，腰细，皮肤好，服务比较简单，就是A面漫游，然后口活，感觉挺舒服的，她那个表情吧，就是那种冷艳美女反差的感觉，骚起来很带感，之后啪啪啪不表。五张性价比还算到位，喜欢年轻标致的可去。', 2, 3, 9, 4, 2, '6', '2020-09-26 15:04:48', '2020-09-26 15:04:48', '[\"images/202009/7391d16e528ff0facf40c5cc666fc4fb.jpg\", \"images/202009/2c19615452dc69ae5b6cb10c30aeb8d7.jpg\"]', 0, ''),
(19932, '大灯小姐姐，战斗力很强', 20, 30, '600', 110000, 110100, '2148099307 ', NULL, NULL, '鸳鸯浴,漫游,胸推', '公益西桥附近\r\n见面感觉良好，确实是小姐姐一枚，脸蛋清纯，身材看着特别惹火。气氛不冷场，基本有问必答。然后衣服脱掉，看到她的大灯白白嫩嫩的，我就感觉有点扛不住了。之后做活，比我想象中要敬业，口技可以，差点直接缴枪。之后开干，妹妹给我感觉蛮梦中情人的，毕竟人长得好看，销魂风骚的表情也就特别带感，很刺激。还能做丝足，推荐了。', 2, 3, 17, 3, 1, '6', '2020-09-26 15:06:46', '2020-09-26 15:06:46', '[\"images/202009/e67067b85d37721b01159b9b2702f4b3.jpg\", \"images/202009/24a59b61d2b557d404ef608cf9e813a8.jpg\"]', 0, NULL),
