(19934, '骚货小雅，又犯骚了。。。。', 21, 30, '600', 110000, 110100, '2493130005', NULL, NULL, '鸳鸯浴,漫游,胸推', '朝阳北苑\r\n直无法形容。就这么缺大鸡吧嘛？就这么欠干吗？b就这么痒嘛？看的jb有硬了。于是又去了趟。进门以后二话不说，把头摁下来，拉开裤门就让她吃jb。看着她享受吃jb的样子。心想太骚了。就问她，一个够吗。她说还想吃。真是欠艹不得了，翻身让她撅起屁股，直接插进去（带t了）。一边艹一边让她给朋友打电话，说自己被别人艹呢。哈哈。但现在这个骚货对大jb要求越来越高，饥渴程度比一般熟女还要强。所以有觉得自己jb厉害的浪友，去干死她吧。干的时候让她给我打电话。太爽了。哈哈哈。骚货没办法。干就完了', 2, 3, 11, 3, 2, '6', '2020-09-26 15:11:29', '2020-09-26 15:11:29', '[\"images/202009/592295c24de751d40a97a1def2d3198a.jpg\", \"images/202009/1e24ac62915839a7886257363a3b914a.jpg\"]', 0, ''),
