(19942, '巨乳小太妹实战利器', 20, 30, '1000', 110000, 110100, '624302859', NULL, NULL, '鸳鸯浴,漫游,胸推', '和平西桥地铁站\r\n她是纯兼职的，非常难得的。不怎么好约。我跟她屡次勾搭好多次，终于有点回音。决定出鸡。本人还真的是个巨乳小太妹，好清纯，一点风尘味儿都没有。衣服一脱，两个球掉出来，可以随意吻的，口活真舒服，一点都不着急，做活儿真仔细，这个态度真是值得表扬，现在像她这么注重服务的小萝莉真的太少了。服务好才是王道啊。接下来带套ML，就不细表了，都是那两下子，不过妹妹这大奶子真是泻火神器了。就是不好约。兼职的。', 2, 3, 21, 1, 1, '6', '2020-09-26 15:28:09', '2020-09-26 15:28:09', '[\"images/202009/963bcc94dea22ec4a6be37a46f63feeb.jpg\", \"images/202009/74c5798d4190bf15c6b05452cf5aaefd.jpg\"]', 0, ''),
