(19951, '大望路长得像小燕子的妹子和她闺蜜被我双飞', 22, 30, '2000', 110000, 110100, '2014959135', NULL, NULL, '鸳鸯浴,漫游,胸推', '8P-20夜 或者20双飞\r\n大望路\r\n反正我是觉得像，虽然有点像明星但是吧我这呢不觉得妹子特别好看，每个人都有每个人的眼光，有人喜欢丰满，有人喜欢骨感，两个妹子对比我更喜欢可可，可可妹子长相可爱，这两个妹子身高都在线，估计168差不太多，颜值9成像吧，不敢瞎说，毕竟美颜有点吧，本人没有照片那么白，服务的时候两个妹子一起来服务一个人，一手一个人的胸，看这俩妹子给你一个人服务内个感觉是真的爽。做的时候感觉更爽一边后入雨果妹子，手嘴也不闲着亲着可可妹子摸着他的MM，看着一个明星脸的妹子在你面前做这个内种感觉不要太爽，本来想偷拍张照片来着，结果没找到机会，双飞总有一个人闲着。不过双飞倒是不后悔', 2, 3, 3, 2, 2, '6', '2020-09-26 15:38:58', '2020-09-26 15:38:58', '[\"images/202009/a43b2a5ebcdbffe3371929d14b607b77.jpg\", \"images/202009/4dc9cbb22df287eb2549afe6238db274.jpg\"]', 0, ''),
