(19959, '刚来京的小瑞妹妹', 21, 30, '800', 110000, 110100, '303182590', NULL, NULL, '鸳鸯浴,漫游,胸推', '800/次或3000/夜\r\n\r\n朝阳区百子湾\r\n联络暗号：漫步人生路介绍.课程主要就是陪浴、口、69、爱爱，虽然项目不多，但是做的非常仔细，态度决定一切。全过程姑娘给了我像女朋友似的感觉，让我拥有了一个美好的回忆。她朴素、实在、颜值高、性格好、年轻，应该一般人都会喜欢。过程就不叙述了，总之我有时间还会再去，极力推荐', 2, 3, 8, 2, 2, '6', '2020-09-26 15:48:11', '2020-09-26 15:48:11', '[\"images/202009/d4c4718b6b8059668c05ef8831f9c2f0.jpg\", \"images/202009/835e46cea1af3fc1e2d922de793d88a7.jpg\"]', 0, ''),
(19960, ' 90后粉嫩的姗姗，清纯可爱胸有C', 23, 30, '1500', 110000, 110100, '3201365586', NULL, NULL, '鸳鸯浴,漫游,胸推', '1500/2P，夜2000\r\n朝阳区百子湾\r\n妹子也挺对我胃口，一探究竟倒也没失望，就是属于白白嫩嫩那种，胸有C，手法还挺温柔，比较年轻吧，扣一扣，调调情，下面就满上了，过程你懂得，水刚刚好嘻嘻', 2, 3, 0, 0, 1, '6', '2020-09-26 15:49:42', '2020-09-26 15:49:42', '[\"images/202009/b428e492207799e17a9efcb2146e2178.jpg\", \"images/202009/36d0b6e1b2a1871a461547b69ca6b6ae.jpg\"]', 0, ''),
(19961, ' 梅开二度 ，旧梦重温，丰台爱讲卫生的妹子', 21, 30, '500', 110000, 110100, '3607507483', 'qc13804330856', NULL, '鸳鸯浴,漫游,胸推', '500次或1000次次\r\n海滨\r\n干净整洁，妹子主动给拿水果，倒水，挺贴心的，美中不足 ，没有归属感，就像宾馆的服务员一样，可能有些狼友喜欢这种感觉吧，我是觉得不舒服，因为这样我不如去会所，省的一顿联系。妹子会的服务到时不少 不过我需要那么多服务，我喜欢感觉。', 1, 3, 3, 0, 1, '6', '2020-09-26 15:52:04', '2020-09-26 15:52:04', '[\"images/202009/2f9d5efd1e3951c81c00282d9764bea1.jpg\"]', 0, ''),
