(19963, '新人身材紧致，白领兼职小妹妹,趁热', 30, 30, '600', 110000, 110100, '3141616636', NULL, NULL, '鸳鸯浴,漫游,胸推', '600一次， 过夜的价位忘记问了\r\n海淀\r\n联络暗号：初心初见.屁股倒是又大又圆。洗完后就进入房间，接下来就趴下开始服务，首先是背部按摩，然后环游，胸推，做的挺有水准的而且用草莓味的润滑油做的，小姐姐说要把我腌入味了吃，哈哈说话很有意思。然后换到正面，照顾了本狼的三点后，开始KJ，差不多后，穿上小雨衣开始正餐，我自带的001的小雨衣。小姐姐主动坐了上来，一进入就感觉到紧紧的包裹，小姐姐开始上下套弄，水又多又紧。然后又换了两个姿势，奈何我割了皮以后小兄弟不敏感，干了20分钟小姐姐也没催，看着她有点痛苦的表情我就停了，最后打了出来。然后我们对是否要去割包皮进行了仔细的讨论，哈哈太有意思了。', 2, 3, 12, 6, 2, '6', '2020-09-26 15:54:32', '2020-09-26 15:54:32', '[\"images/202009/8cbbaae0d34ebc07480ef2d269f02252.jpg\", \"images/202009/d6e0ec3ce96fdd8d0cceb1430abe68df.jpg\"]', 0, ''),
(19964, '房山时代广场温柔大姐姐寻欢爽记', 31, 30, '300', 110000, 110100, '241226624', NULL, NULL, '鸳鸯浴,漫游,胸推', '300/次或800/\r\n房山时代广场\r\n看照片知道其实就是熟女类型的，话不多说，决定CJ，开门第一眼就看到丝袜高跟，瞬间按捺不住，长相就是一般人吧，还是有些岁月的痕迹的，简单洗洗，随姐姐来到小二层，她住的是单身公寓，里面还有个楼梯，装修简约而不简单，在楼梯上看着屁股一扭一扭，很有感觉啊。。摸着丝袜大腿就上床了，床上内容不细表了，就是正常流程，各种体位都可，皮肤还是可以的，挺白挺滑。。。', 1, 3, 39, 1, 1, '6', '2020-09-26 15:55:15', '2020-09-26 15:55:15', '[\"images/202009/ce0d4df5bea4352eac3d7214cbae40ef.jpg\"]', 0, ''),
