(19966, '颜控福音！左拥右抱两个极品大美人，相当美滋滋', 21, 30, '400', 110000, 110100, '2015237985', NULL, NULL, '鸳鸯浴,漫游,胸推', '单个400次，双飞800两次\r\n马连道\r\n这个小静梦梦组合，最吸引我的就是颜值超高，是颜控福音。梦梦是御姐妩媚型，小静是玉女清纯型，太赏心悦目了。真人和照片差距不大，身材还都不赖，都是细腰肢大长腿，胸器逼人。洗好上床，左拥右抱三个极品大美人，两个妹妹轮番攻击，都不是省油的灯。玩得就是刺激，那种成就感。值得一提的是两个美人儿全程不催，态度特别好，连着释放两次，也是过足了瘾', 2, 3, 29, 6, 2, '6', '2020-09-26 16:00:06', '2020-09-26 16:00:06', '[\"images/202009/8e335fa0b957c9e6d85c9c438a2514ec.jpg\", \"images/202009/9f7d6fbdd23b83e7abcd5dc72e9eff55.jpg\"]', 0, ''),
