(19968, '长腿青春妹【暂休息中】', 26, 30, '800', 110000, 110100, '321374905', NULL, NULL, '鸳鸯浴,漫游,胸推', '北三贵州大厦附近\r\n先看脸，是个胶原蛋白很足的水灵妞，高挑苗条，青春无敌，这个不假。这个线条实在诱人，胸大屁股大，有一点欧美范，皮肤也非常的好。妹妹谈吐也是非常有素质的，不会那么俗气。接下来就是放开玩吧，衣服脱了，舌吻来着，这尺度你懂得的。和妹妹调戏完后，梦琪跨坐了上来，捧着JJ就开始KH，技术值得表扬，也是蛮有经验的，应该是经过不少狼兄调教了吧，而且她做的很耐心，一点都不着急的，态度特好', 2, 3, 32, 4, 1, '6', '2020-09-26 16:02:14', '2020-09-26 16:02:14', '[\"images/202009/a10a7f3225cedb26141c1658e2db48ea.jpg\", \"images/202009/ca0374b15ce24b1b786eb23552d05b2f.jpg\"]', 0, NULL),
