(19970, '天津小妞', 22, 30, '400', 110000, 110100, '1978726378', NULL, NULL, '鸳鸯浴,漫游,胸推', '北京\r\n400次600/1100/1500\r\n东城区二号线东四十条桥站b口附近\r\n接嗨起来。果然滚上床，妹妹主动发起攻击。口活做的挺实在，新人不会那么油，不偷懒。之后上马，妹妹的表情呻吟就是很真实的样子，非常投入，汗都干出来了，她的水挺多的，也挺会享受的样子，泻火图的就是减压，快乐发泄就完事了。不外出', 2, 3, 22, 4, 1, '6', '2020-09-26 16:33:58', '2020-09-26 16:33:58', '[\"images/202009/1e205c00b2905147304a049cebbfc7be.png\", \"images/202009/514c427eeb42ed917bb8665977d789ea.png\"]', 0, NULL),
