(20121, '性感00后，口活不赖服务周到', 19, 30, '1000', 110000, 110100, NULL, '18743348363', NULL, '鸳鸯浴,漫游,胸推', '百子湾\r\n最主要是00后，我这人就喜欢玩嫩的。朋友引荐，那肯定联络起来相当顺利，然后加了VX，过程聊的很愉快，我们约在晚上见面。   直奔百子湾，路程不表，讲真的，第一眼感觉就是这妞绝对是个极品，举手投足间充满女人味。长相可以给90分了，人很年轻，很清纯有有点风情，我也没猴急着立即开始，跟她先聊着家常话，这感觉还挺舒心的，然后慢慢的试探性在她身上摸，发现她身材蛮不错的，有曲线，尤其是这一双长腿，一定好好开发', 2, 3, 8, 5, 2, '6', '2020-10-03 13:03:20', '2020-10-03 13:03:20', '[\"images/202010/499eeecb3125985c97dddc0494b6ccb4.jpg\", \"images/202010/879428e0cf537687f6bea3ec62be8653.jpg\"]', 0, ''),
