(20131, '身材很棒胸部很美丽', 21, 30, '1000', 110000, 110100, '3200582625', NULL, NULL, '鸳鸯浴,漫游,胸推', '海淀\r\nMM看出来了还挺会来事，先让小狼去冲澡缓解下情绪。洗完出来MM已经换好衣服....黑丝＋情趣衣 真尼玛性感，感觉像马上要操到AV里面的女优似的...迫不及待，MM指引上床，开始服务...口活无齿敢，不亏是带口爆的爽，服务做完带上套套开始冲刺，小狼喜欢后入，MM很是配合..看着大大的屁股裹着丝袜，抓着大奶子..在加上MM销魂的叫声，抽插百来回射出亿万子孙..结束。抱着MM摸了会大奶子 ，去冲澡，洗完穿好衣服，丢下毛爷爷..闪人。', 2, 3, 6, 3, 2, '6', '2020-10-03 13:14:36', '2020-10-03 13:14:36', '[\"images/202010/6a064eebfe4bf2ec9a510401c73eaac9.jpg\", \"images/202010/a94f101c4fa2d56e30ca0ad89d0ddc67.jpg\"]', 0, ''),
