(20136, '冉冉', 31, 30, '500', 110000, 110100, '2576844255', NULL, NULL, '鸳鸯浴,漫游,胸推', '人照基本两分像唯一优点就是态度好 进门她自己都说说我看你有点犹豫要是不行是可以不做的 胖 胖的不是那种照片的胖是肉都泄了那种 而且老鱼尾纹什么的不化妆没法看 说没来得及化妆还用画吗 还用问吗 而且最主要的就是 脚臭！ 真的是酸臭（有好这个的那真的是有福了 我真接受不了）不过有一点好 就是态度好 我说穿丝袜马上就去 进门就给拿水 躺着说先做活 就是摸摸口口 让上来开干不说换姿势绝对不自己说要下来', 1, 3, 4, 1, 2, '6', '2020-10-03 13:17:57', '2020-10-03 13:17:57', '[\"images/202010/29ff91f9e604283ed79917b8fb6f1c13.jpg\"]', 0, ''),
