(20138, '20岁 成寿寺圆圆菇凉', 20, 30, '600', 110000, 110100, '2998408993', NULL, NULL, '鸳鸯浴,漫游,胸推', '成寿寺\r\n一看妹纸长得亭亭玉立，楚楚动人，重庆人，个子不高也不矮，长发飘飘，脸蛋紧致大眼睛很好看，皮肤很白。我做的时间有点长，姑娘全程配合，换姿势，出了很多汗，把妹子床单弄湿了，她都没有怨言，这个价位还有这么好的姑娘，当时真的很感激。注意到了她的化妆品和衣服根本没有什么牌子，应该是个很朴素的姑娘，要不是困难谁愿出来做这个，我很珍惜她，希望大家也能怜香惜玉', 2, 3, 25, 8, 2, '6', '2020-10-03 13:19:18', '2020-10-03 13:19:18', '[\"images/202010/c7740a3a9e0aced4fdaf0b00f5fa8fc7.jpg\", \"images/202010/c5b3b1dfdb5f9418ca8a22554f929f2b.jpg\"]', 0, ''),
(20139, '出击年轻妹妹', 21, 30, '1399', 110000, 110100, '1142504780', NULL, NULL, '鸳鸯浴,漫游,胸推', '丰台\r\n算是妥妥的嫩女了。真人是那种可爱萌萌哒的感觉，但是身材发育的真的不错，该大的都大，水灵灵的。笑起来很甜的糖糖，人如其名。抱住调情，可以舌吻的，这个尺度真是杠杠的。我们就像是多日未见的情侣一样，非常的激动。和这种小萝莉做，我喜欢掌握主动，她反应也蛮真实的，总之任我搞就是了。她在技巧上也不错，但是磨人的小妖精玩得就是感觉，把我整的意乱情迷的，口后上马，这小嫩逼确实是紧啊', 2, 3, 28, 5, 2, '6', '2020-10-03 13:19:54', '2020-10-03 13:19:54', '[\"images/202010/fde0e157b37c56bbdc1c5a0857fab4e4.jpg\", \"images/202010/f5c4e6fc7a71cce8e21f39294e6b6373.jpg\"]', 0, NULL),
