(20167, '南京小妹', 24, 30, '600', 320000, 320100, NULL, 'LL3105151', NULL, '鸳鸯浴,漫游,胸推', '600/次或1000两次\r\n\"服务非常到位 可以说是小狼遇到过最好的了。到地方指挥上楼，进门聊聊开始洗澡，用的是一次性的浴巾，很干净。\r\n                      1，先做B面，吹水很仔细，从上到下吹到脚指头。然后拉皮，胸推。胸很大，真的，很软，一手抓不住。\r\n                      2，叫你跪着，顶肛，是真的顶，不含套子，顶的很深的那种，顶了起码5分钟以上，爽的不行。\r\n                      3，吹箫，无齿感，最牛逼的是深喉，反正我是爽的飞起，然后用一个震动圈套几把上，用跳跳糖帮你吹，那酸爽，我差点就缴枪了。\r\n                      4，做爱，姿势随便你，想怎么玩都行，可以舌吻，但是我没敢。\"', 2, 3, 72, 4, 1, '6', '2020-10-05 14:21:17', '2020-10-05 14:21:17', '[\"images/202010/91d5668b2d47d4a781b2a50e8012b0bd.jpg\", \"images/202010/240ac51fd545a2efb429f382c1e6f358.jpg\"]', 0, NULL),
