(20265, '性格好的东北妹子', 22, 30, '400', 340000, 340100, NULL, 'jiaqi990125', NULL, '鸳鸯浴,胸推,口活', '合肥 西环中心广场\r\n绝对真实！近期遇到的质量很高的一个妹子了，人照几乎吻合了，9分！首先，妹子很嫩，也就20出头，胸部手感很好，有弹性；进门后聊了两句，开始脱衣服，一起洗澡。给你冲遍每个部位，然后再帮你擦，你就可以这个时候释放双手了，干嘛你们懂得；妹子的房子有投影，灯一关，那感觉，放个剧还是美滋滋的；躺下开始口，不得不说，口的用力', 2, 3, 35, 8, 2, '6', '2020-10-07 13:28:29', '2020-10-07 13:28:29', '[\"images/202010/2e7c3b2e7610ce891eb9465b90bc7f83.jpg\", \"images/202010/66a40b9366cb1b67c025fa3821d01846.jpg\"]', 0, ''),
