(20267, '刺激双飞', 26, 30, '自问', 340000, 340100, NULL, 'ainiyiwannianlinge', NULL, '鸳鸯浴,漫游,胸推', '不同项目不同价格\r\n长得不能算极品，但也还行；声音也不是那种难接受的，关键热情奔放；进到房间里面，墙上挂了很多情趣内衣，还有狐狸尾巴，皮鞭等等用品；问之才说，很多人找她玩，而且她可攻可受，小狼接受不了“受”这个角色；还说有真女可以一起双飞；想想就她妈刺激，但是由于第一次有点紧张，就没有叫双飞，下次一定体验。TS和妹子最大的区别就是一个心态，很放松，而且知道你想要什么，全程放松；也是本狼觉得印象特别深刻的一次体验了，细节就不写了，也不是写黄书的，各位狼友又兴趣的自行体验感受吧！！！ps：加一句，这个妹子长居合肥', 2, 3, 40, 3, 1, '6', '2020-10-07 13:32:54', '2020-10-07 13:32:54', '[\"images/202010/3a34ad2a381385fc04882611b79ffff2.jpg\", \"images/202010/ac381491ada74fb00eaad2c265ec447c.jpg\"]', 0, ''),
