(20319, '中昆医大湖南妹子', 23, 30, '500', 530000, 530100, '672163520', NULL, NULL, '鸳鸯浴,漫游,胸推', '昆明西山区\r\n500  1P  800  2P    1500  Y\r\n皮肤白皙光滑，美中不足就是腹部有赘肉，所以只能归类在泄火良品！进门老流程，配合洗澡擦干上床趴下开始服务，过水舌吻样样到位，没有瑕疵，正面挑逗口活感觉良好，随之带套开干！水挺多的，叫声不错，抱着肉肉的屁股一插到底，每次都是大力抽插，这样才是泄火的感觉，一次力道十足一股热精狂泄而出，舒坦！推荐体位：男上女下，有点抽插大力！', 2, 3, 36, 9, 2, '6', '2020-10-08 15:21:48', '2020-10-08 15:21:48', '[\"images/202010/bf6431b2b2d5d5a65065cbaaecb2ae49.jpg\", \"images/202010/8e06c690fe2dec052db0a414e809e7d1.jpg\"]', 0, NULL),
