(20323, '沐汐', 28, 50, '1200', 310000, 310100, NULL, 'pan575710', NULL, '自问', '1200/120分钟两次\r\n新浦东区\r\n一眼就觉得妹子挺不错的，挺热情，相当骚气直接，跟着楚楚进了卧房，卧房是一个大房间，环境挺不错的，我三两下自己就脱光了。她也是主动脱了衣服，白花花的一片！奶子大皮肤白。身材不错。洗澡的时候自然手不会闲着啦，左捏一把右捏一把的。洗好之后，进屋开搞，先是趴着B面开始，胸推漫游，毒龙，舔了一会，翻过来，口的很认真，深喉舒服，期间还有舔蛋蛋，大腿根，69时狠狠地照顾了下妹子，一会妹子就有点招架不住了，舔的我舌头都有点疼了。妹子的口活也很实在，非常卖力，只要不说停，就一直在做。大概折腾了10多分钟', 2, 1, 10, 2, 2, '6', '2020-10-08 15:26:52', '2020-10-08 15:26:52', '[\"images/202010/c4044fd41c59be2f91143abe96f8a799.jpg\", \"images/202010/50f09a967f62dc34cb601a7cccde8779.jpg\"]', 0, NULL),
(20324, '昆明官渡区大都D奶00后', 19, 30, '400', 530000, 530100, NULL, '18087375618', NULL, '鸳鸯浴,漫游,胸推', '4/1P、7/2P、12/夜\r\n昆明官渡区大都\r\n妹妹也很听话的，口了一会妹妹说嘴巴酸了，直接带上套子插进去，屄又肥又水，就是妹纸叫的有点假，换了4/5个姿势就忍不住射了。坐下来喝了点妹纸那给的饮料，聊了半小时的天。在沙发上让妹纸口交，让去洗了洗又回床上继续口，妹纸舔硬了又想带上戴套干她，我让她那跳蛋上来，告诉她就不干她要玩到她高潮，很不情愿的去翻出跳蛋来。打开塞到屄里面，一边吸她的奶子一边用手去口她的屄，过了10分钟妹纸高潮把我手的夹疼了。高潮后她让赶紧插进去，真的才爽，插了一会又拔出来让妹子用口，最后在妹纸不情愿的情况下全部射到她嘴里，洗个澡打道回家。', 2, 3, 75, 6, 2, '6', '2020-10-08 15:28:10', '2020-10-08 15:28:10', '[\"images/202010/eca7c46d40abb1118b97db9880f98ade.jpg\", \"images/202010/9d7c42064509ff8f76d7002d7d66085f.jpg\"]', 0, NULL),
(20325, ' 轻熟女大奶妹', 22, 30, '666', 140000, 140100, NULL, '18534601538', NULL, '鸳鸯浴,漫游,胸推', '，一见面感觉很温柔体贴的女孩，一脱衣服我兴致来了，一看就是没结婚生过孩子的，咪咪挺拔，小b紧紧的，做完爱我又加钱让她陪我出去喝酒，小妹还挺能喝，差点我让她喝多了，哈哈，不错的一次体验', 2, 3, 7, 3, 2, '6', '2020-10-08 15:29:11', '2020-10-08 15:29:11', '[\"images/202010/039dd40bcefa13656d03346f4d41d14e.jpg\", \"images/202010/bb7837cce32134c6a4ac67a4306f6767.jpg\"]', 0, ''),
