(20331, '胜在年轻活力无限', 19, 30, '500', 330000, 330400, '3498218975', NULL, NULL, '鸳鸯浴,漫游,胸推', '500/次 800/2次\r\n嘉兴市南湖区\r\n19岁，这个水是哗哗的，都不用像那种老楼凤一样每次都要用油润滑一下，虽然长相一般，但胜在不催人，服务好，兄弟们这个是重点啊，出来玩的都知道，现在的楼凤没做的时候跟你客气，一做时间稍微长一点就不停的催你，咱们给钱是享受的不是来买气的，妹子有个特点，一个月就开几天课，稍微赚点生活费就跑出去旅游了，没钱了又回来开课', 2, 3, 58, 3, 1, '6', '2020-10-08 15:38:44', '2020-10-08 15:38:44', '[\"images/202010/413032e550799830e23017c1b88a38d8.jpg\", \"images/202010/3bd90e09c1c1cf0fc3b49f5a7e66f49e.jpg\"]', 0, ''),
