(20482, '中介   嫩妹媛媛', 23, 30, '800', 520000, 520100, '2370962409', NULL, NULL, '鸳鸯浴,漫游,胸推', '800p1500pp\r\n真人是那种可爱萌萌哒的感觉，但是身材发育的真的不错，该大的都大，水灵灵的。笑起来很甜。抱住调情，可以舌吻的，这个尺度真是杠杠的。我们就像是多日未见的情侣一样，非常的激动。和这种小萝莉做，我喜欢掌握主动，她反应也蛮真实的，总之任我搞就是了。她在技巧上也不错，但是磨人的小妖精玩得就是感觉，把我整的意乱情迷的，口后上马，这小嫩逼确实是紧啊，各种姿势操了一番，抱起来搞和后入最有感觉，让人很有满足感。喜欢嫩货萌妹子的可以去', 2, 3, 16, 5, 2, '6', '2020-10-12 17:24:33', '2020-10-12 17:24:33', '[\"images/202010/40f5ade59a7301fbe85a3db9a2bb0306.jpg\", \"images/202010/92d971a5d113fc6c1ea90eef9578de50.jpg\"]', 0, ''),
