(20486, '赤峰苗条少妇', 33, 30, '200', 150000, 150400, NULL, 'w18204955535', NULL, '鸳鸯浴,漫游,胸推', '这个年龄大概35左右。身材很好，特别喜欢穿着皮裤搞她。很喜欢干净，每次会仔细帮你清理JJ。身上没有赘肉，而且肚子到胸部有纹身，女上位搞起来非常有冲击感。地址在火花路附近。联系她请打电话或者发语音。', 1, 3, 42, 5, 1, '6', '2020-10-12 17:27:53', '2020-10-12 17:27:53', '[\"images/202010/38c838ed74a63c6589722753b1cff12c.jpg\"]', 0, NULL),
(20487, '贵阳观山湖区会展城清纯小妹妹', 23, 30, '600', 520000, 520100, NULL, '17385522285', NULL, '鸳鸯浴,漫游,胸推', '贵州贵阳观山湖区会展城\r\n年纪不是很大，让人有种怜惜，不过服务还是很到位的，也很听话叫她做什么都做的（不过分的话）享受她服务尤其是做爱的时候，感觉会吧她弄痛的感觉，就有点像刚刚第一次和女生上床的那种感觉，胸不大不小刚好我一只手正合适，还有就是很粉，粉嫩粉嫩的那种，叫声也很好听还很敏感，总的来说就要点像那种邻家小妹妹被搞上床的那种感觉，和平时玩的那种绝对不一样', 2, 3, 47, 2, 1, '6', '2020-10-12 17:30:52', '2020-10-12 17:30:52', '[\"images/202010/1a20cf3c5b4f3a7836d2e52ce2cb29fa.jpg\", \"images/202010/4f06efff3aabd785d56dc5adb8ff0b87.jpg\"]', 0, ''),
