(20648, '梦雨', 25, 50, '500', 110000, 110100, '3274507499', NULL, NULL, '鸳鸯浴,漫游,胸推', '地址：东城区\r\n评价：首先看到妹子穿了一件黑色蕾丝上衣，一对大白兔若隐若现，温柔的话语南方姑娘的气质一览无余，简短聊了一会我便迫不及待的洗了个澡，上了妹子柔软的大床，看到妹子洁白的玉体和一双大白兔，我血液急剧上涌，双手一手捉住一只大白兔，感觉太好了，妹子把我翻压在她身下，为我做了一套完美的服务，弟弟的抗议使我无法控制，我便翻身把妹子压在身下行云布雨，和妹子大战几百回合，完美结束，事后回味无穷，感概这要是我的女人多好', 2, 3, 11, 0, 1, '6', '2020-10-18 13:48:01', '2020-10-18 13:48:01', '[\"images/202010/cba2723f44ec9398818f19af6b1baad7.jpg\", \"images/202010/cc037c68266e5b1e79160f3f175c5453.jpg\"]', 0, NULL),
