(20650, '少妇莎莎', 27, 30, '300', 110000, 110100, '1589317208', NULL, NULL, '鸳鸯浴,漫游,胸推,口活', '地址：丰台方庄附近\r\n评价：一看照片，就一下激起我的性趣。只要三张，还要啥自行车，杀了过去看看。莎莎本人就是那种风骚感觉的小少妇，脸不大，个子相对我来说比较小巧，很苗条，胸不错，比例挺赞的。最让我觉得舒服的就是莎莎的服务态度，陪浴后直接上床，口活相当到位无齿感，那眼神各种勾你，我觉得她这技术真的有两把刷子，而且不偷懒，有服务标兵那味儿，接下来就是一顿操作了，如狼似虎也不为过，倒是我最近身体乏力，差不多了就一泻千里了。不过舒服了也就是值了。', 2, 4, 54, 13, 2, '6', '2020-10-18 13:49:20', '2020-10-18 13:49:20', '[\"images/202010/21b478f3766e5530a47dac9e2598476a.jpg\", \"images/202010/a12649ab93afdef48f8a522b7fa5ef00.jpg\"]', 0, NULL),
(20651, '熟女挺好', 41, 30, '200', 110000, 110100, '2901417753', NULL, '13671330594', '鸳鸯浴,漫游,胸推,爱爱', '地址：北京大兴火箭万源地铁\r\n评价：虽然岁数大了，但是我感觉比3，4十的好多了，长得我感觉不丑，熟女这样也就可以了，69的时候我都感觉不可思议，逼小并且不黑，感觉姐姐这个年龄已经约男无数了，就是不黑你说气不气人，进去的时候也很紧，逼小干的过瘾，趴着干的姐姐高潮了，我也射了，没想射但是不得不射，忍不住。第二次也是这样，好多姿势还没有试呢，只能等下次了，虽然姐姐年龄大，我感觉我是挺舒服的，比年轻的舒服，个人感觉', 2, 4, 50, 1, 1, '6', '2020-10-18 13:50:11', '2020-10-18 13:50:11', '[\"images/202010/223affa63b7deb817cee30382176683a.jpg\", \"images/202010/3c03e89782eecab3f414f7d56ffef552.jpg\"]', 0, NULL),
(20652, '朝阳轻熟女', 22, 30, '400', 110000, 110100, NULL, '17813108786', '17813108786', '鸳鸯浴,漫游,胸推,69', '地址：朝阳\r\n评价：周末老婆不在家，有点寂寞难耐，随即打开手机找找之前的联系方式，问了一圈只有这个小姐姐有空便驱车前往。进门一个深情的拥抱，简单陪浴之后上床，妹子换上黑丝便爬上来各种调情，小舌头那叫一个带劲，慢慢向下滑后到dd口活还是一如既往的好，不叫停就一直口。受不了了带上小雨伞开干，最后坐莲喷射。整个过程舒服无比，第一次发出来，给ly福利。', 1, 4, 10, 0, 1, '6', '2020-10-18 13:51:11', '2020-10-18 13:51:11', '[\"images/202010/44da61166e44f89b3efd8f455028879a.jpg\"]', 0, NULL),
