(20678, '瑜伽老师夏美', 25, 30, '450', 350000, 350200, '3491096297', NULL, NULL, '鸳鸯浴,漫游,胸推', '价格：450/1泡，800/2泡\r\n地址：厦门瑞景双座\r\n评价：妹子跟照片相差不多，上传的那张自拍照就百分百真实了。据当事人描述是新疆那块混血的略带异域风情，身材小巧型有点料，跟上课表描述的差不多。妹子能撩擅谈脾气好业务周到，只要是提出的合理要求都能满足，一根手指插入小穴滑滑紧紧的都是水有点意思，后续的服务丝滑紧致并着快乐。整体下来服务特别好，值得向往', 2, 3, 16, 7, 2, '6', '2020-10-18 14:14:55', '2020-10-18 14:14:55', '[\"images/202010/ce71ad16775955ac74ee55fb9c061f1e.jpg\", \"images/202010/5257bf1e12412ed680f103c9487577b0.jpg\"]', 0, NULL),
(20679, '九江浔阳区极骚mm', 28, 30, '800', 360000, 360100, NULL, 'w15870828249', NULL, '鸳鸯浴,漫游,胸推', '地址：江西九江浔阳区\r\n评价：妹妹人非常爽快，见到面出乎意料。本人跟照片无差别。于是就带到酒店房间。没有着急，聊了会天。很投缘。就开始去洗澡。床上妹妹很主动会带动节奏。非常有女朋友的那种感觉。最值得推荐的是口活。差点直接射她嘴里。后面直接按倒她爆操。过程酣畅淋漓。是一次非常不错的猎艳经历', 2, 3, 10, 2, 1, '6', '2020-10-18 14:15:56', '2020-10-18 14:15:56', '[\"images/202010/6299b8be47b339cfb3c1a47fca34a24a.jpg\", \"images/202010/dfa4fe3e33aeb233b68feeeacd39f3aa.jpg\"]', 0, NULL),
