(20954, '拱墅邻家小妹落樱靓女无限制', NULL, 30, '1000', 330000, 330100, NULL, 'YingerBY68', NULL, '鸳鸯浴,漫游,胸推', '拱墅区万达\r\n上楼开门，一入眼就感觉是邻家小妹，妹妹穿的淡蓝T恤，下半身热裤遮起来了，露着腿，我先观察了下，照片修的没那么厉害，确定本人，主动上前抱住像情人一般，还是比较健谈，笑起来有种邻家小妹妹的感觉，很符合我的口味，过程我不太会写，划重点的是妹妹高潮脸颊会发红发烫很可爱，我用手指扫她阴蒂还喷了水，喷了一床，应该是把她操舒服了，她居然眼睛迷离的舔我全身，重点是舔了脚！！！！重点！！(我是她帮我洗了澡的)，真的让我意想不到，下面做了半年，但还是比较紧，可能平时保养比较好，而且年龄也小，看起不超过21岁，胸差不多C吧，反正够用，喜欢后入式，我边用力打她屁股，边后入，她叫的很温柔，不骚但是就像是每次顶她到高潮那种，过程很舒服，是个母狗潜力股，大体就这么多，做完了还会给你按摩肩膀，在后面用胸蹭你，像女朋友那样，打个99分吧，满分还是怕她骄傲。', 2, 3, 22, 4, 1, '6', '2020-10-21 19:02:25', '2020-10-21 19:02:25', '[\"images/202010/8d65392aad0a66cda61bb23cebd462f4.jpg\", \"images/202010/66b2d6aaae5509b4538ac7294696fb00.jpg\"]', 0, NULL),
