DROP TABLE IF EXISTS `video_loufengs`;
CREATE TABLE `video_loufengs` (
  `id` bigint NOT NULL AUTO_INCREMENT,
  `name` varchar(255) DEFAULT NULL COMMENT '模特名',
  `age` int DEFAULT NULL COMMENT '年龄',
  `sale_price` int DEFAULT NULL COMMENT '平台销售价格',
  `price` varchar(255) DEFAULT NULL COMMENT '价格',
  `province_id` int DEFAULT NULL COMMENT '地区',
  `city_id` int DEFAULT NULL COMMENT '城市',
  `qq` varchar(255) DEFAULT NULL,
  `wechat` varchar(255) DEFAULT NULL,
  `phone` varchar(255) DEFAULT NULL,
  `tag` text COMMENT '标签',
  `profile` text COMMENT '简介\n',
  `images_count` int DEFAULT '0',
  `tag_count` int DEFAULT '0',
  `sold_count` int DEFAULT '0',
  `complaint_count` int DEFAULT '0',
  `state` tinyint DEFAULT '1' COMMENT '1上架  2下架',
  `operator` varchar(45) DEFAULT NULL COMMENT '最后操作人',
  `created_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `updated_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `pictures` json DEFAULT NULL,
  `approve` tinyint DEFAULT '0' COMMENT '0不认证 1认证',
  `tt` varchar(255) DEFAULT '' COMMENT 'tt联系',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE KEY `id_UNIQUE` (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=21679 DEFAULT CHARSET=utf8mb3 ROW_FORMAT=DYNAMIC;


